var book = {
	"name": "ၦဆၧ",
	"numChapters": 28,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> စၥံၫအီဖလၧၭဧ့, ယကွ့ၭဝဲၩယူၭလံၬအခၪ့ထံၭလ ဘံၪ့လၧကယဲယ့ၫၡုၬမၩၥၫ့ဆၧ, ဒဲၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧ,",
			"2": "<sup>2</sup> ထီၩ့လၩ့မုလနံၩလၧအဘၪဆၧမၩန့ထၪ့ထဲၩ့ဝ့ၫထီး အမၪလူၬ, လၧၥၭမုဆံၫ့ဎံၪအလးခဲၫ့, ၦဆၧအၪ့မၧၫ့",
			"3": "<sup>3</sup> ဖိၪၥံၪလၧအရွံန့ဝ့ၫလဖၪနီၪလီၫ.- တၭလၧအထိးဆၧ ၡၪ့ဆၧနၭအလးခဲၫ့နီၪ ဒုၭနဲၪဖျီၪထၪ့အၥၭမၧၫ့လၧအ ဝ့ၫၥံၪအမ့ၬယၫ လၧဆၧထိးအၥၭအၪမံၩ့, လၧၦဂဲး လိၬတ့ၭလိၬလၥ့ၪဘၪ,ဒဲမၩဖျီၪထၪ့အၥၭလၧအဝ့ၫ ၥံၪအမ့ၬယၫ အၥၫ့လံဆံၫအထးဖၧၩ့တၭ, လီၩလၩ့ လၬလၩ့ဆၧဘၪဆဲၫ့လၧယွၩအဘၩ့အမုးလီၫ.",
			"4": "<sup>4</sup> အဝ့ၫဒၪအီၪကိၩ့အီၪကီၪ့ယူၭ လၧအဝ့ၫၥံၪအၥိၭ တၭ,မၪလူၬဝ့ၫဘဲၫၥိၭအထီးစဲၪ့ထၪ့ခွံၬ လၧယရုစ လံၫ့လဂ့ၩတၭ, အ့ၪမွဲဘဲၫၥိၭအမိအီၪခိၭ ဖါအဆၧလီၩ",
			"5": "<sup>5</sup> ဝဲၩလၧနၥံၪနါဂၧၫ့ယူၭလၧယၧၩယူၭလီၫ.- အဂဲးဘဲၫ ယီၩစယီဟၫ့ဘၭတံၫဇၫ့ဆၧလၧထံၫကျၩလီၫ. အ့ၪ မွဲနၥံၪဝ့ၫယီၩ, ထီးယီၩလၧယၫလခီၫ လအၪနံၩအၪ ၥၫ့ဘၪ,နၥံၪမိဒိၭ ဘၭတံၫဇၫ့ နၥံၪအၥၭ လၧၥၭမု ဆံၫ့ဎံၪလီၫ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪအီၪကိၩ့အီၪကီၪ့ဂီၩ့ အၪ့စၪ့အဝ့ၫတၭ, စံၭဝ့ၫ,ကဆါဧ့, မွဲနမိဖ့ၪလၫ့ထဲၩ့ ဘၩ့မုးလၧၦအံၫစရ့လၭအစူၪဖၧၩ့ ဘိၩ့နဲၪ့ယီၩဆ့",
			"7": "<sup>7</sup> ဧၪ.- တၭအဝ့ၫဒၪလီၩဘၪအဝ့ၫၥံၪ, အမုအလၩအ ဆၧၫ့အထီလၧဖါအီၪက့ၪလၩ့ လၧအစီၩ့အမၩ့ဒၪဝ့ၫ",
			"8": "<sup>8</sup> အဖၧၩ့နီၪ, ဆၧဒုၭၥ့ၪယၫနၥံၪအ့ၬ.- မွဲလါနၫ့ဘိၩ, ထီးၥၭမုဆံၫ့ဎံၪအ့ၪဂဲၫလၩ့ခိၬ လၧနၥံၪအလီၩ့တၭ, နၥံၪမိဒိၭန့ဆၧ အစီၩ့အမၩ့နီၪ, နၥံၪမိကဲၪထၪ့ၦထိး အၥၭလဖၪလၧယဂးလၧယရုစလံၫ့အဖၧၩ့ ဒဲလၧ ခးယုဒၫထၧၫ့ခးယၫအဖၧၩ့, ဒဲလၧစမ့ရအၫ ဒဲထီၩ့ လၧဂၪ့ခိၪအထုၬလီၫ.",
			"9": "<sup>9</sup> အဝ့ၫဒၪစံၭဆၧနီၪလဖၪဂီၩ့တၭ, အဝ့ၫၥံၪယိဝ့ၫအ ဘိၩ့ဘၭနီၪ, ဆၧမၩန့ထၪ့ထဲၩ့အဝ့ၫတၭ, ဆၧအုၪ့ဒိၭန့",
			"10": "<sup>10</sup> ဝ့ၫလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.- တၭအဝ့ၫၥံၪယိထံၫ ယိဆၭဆၧလၧမူၭခိၪ ထီးအထဲၩ့ထၪ့ အဘိၩ့ဘၭနီၪ, ယိခွါ,ၦနံၫဂၩကီၩ့ၥိၭဆၧဘွၩ အီၪထၪ့လၧအနဲၩ့",
			"11": "<sup>11</sup> ထံၭ,- စံၭဝ့ၫဒၪ, ၦဂၫလလံၫဖိၪၥံၪဧ့,နၥံၪဆၧၫ့ထုၪ့ တၭ,ယိထၪ့ဆၧလၧမူၭခိၪနီၪမွဲဘၪလဲၪ. ယ့ၫၡုၬအနၫ့ ဆါဒၪဝ့ၫလၧဆၧအၪ့မၩန့ခွံၬဝ့ၫလၧ နၥံၪအအီၪ, ထီၩ့ လၧမူၭခိၪအဖၧၩ့နီၪမိဂဲၫလၩ့ထဲၩ့ဘဲၫနၥံၪဒၪဘၪ",
			"12": "<sup>12</sup> အထဲၩ့ထၪ့လၧမူၭခိၪ အၥိၭနီၪလီၫ.- ထီးနီၪလဖၧၫ့ ၦလဖၪနီၪထဲၩ့ခွံၬ လၧခိၪလီၩ့ကိၭဝ့ၫအလဲအိၫ့ထီၩ့ လၧယရုစလံၫ့တၭ, အလဲအိၫ့နီၪအီၪဘူၭလၧယရုစ လံၫ့မးၥံၫအနံၩလနံၩဖၧၩ့ၥၭလီၫ.",
			"13": "<sup>13</sup> ထီးအဝ့ၫၥံၪထဲၩ့နုၬထဲၩ့ဝ့ၫတၭ, လ့ၩထၪ့ဝ့ၫလၧဒူၭ ဖၧၩ့လၧအထၪ့ထီၫလဆၫ့တၭ, ၦအီၪဝ့ၫထီးနီၪစပံ တၧၫ,ဒဲစယ့မံၭ,ဒဲစယီဟၫ့, ဒဲစအၪ့ဒူၫ, ဒဲစဖံလံၭ, ဒဲစထီမၭ,ဒဲစဘၫၥီလမုၫ, ဒဲစမၭၥုၫ,ဒဲစအၫလဖံအၧၭ အဖိၪခွၫစယ့မံၭ,ဒဲစစဲမၧၫ့စလိတံၭ, ဒဲစယုဒၭလၧအ",
			"14": "<sup>14</sup> ထၧၫ့ဖုဝဲလၧစယ့မံၭလီၫ.- အဝ့ၫၥံၪထီးအလူၬဒဲၦမုၪ ၥံၪဒဲယ့ၫၡုၬအမိနးမၫရံၫဒဲအထၧၫ့ဖုဝဲခွၫၥံၪနီၪအၪ့ ကံၩ့ဘၩဆိၪဖၪဆၧလၧအၥၭလဖျိၪ့ဎးလီၫ.",
			"15": "<sup>15</sup> ဆၧလၧမုနံၩလဖၪနီၪ စပံတၧၫဂဲထုၪ့ထဲၩ့လၧအ ထၧၫ့ဖုဝဲအကျၩ,(ထီးနီၪအမံၩ့အီၪဝ့ၫ ဖိၭဘိၭလယၩ",
			"16": "<sup>16</sup> နံၫဆံၫ)တၭ, စံၭဝ့ၫ,- ၦထၧၫ့ဖုဝဲၥံၪဧ့, ဆၧကွ့ၭအ ၥၭဘၪလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧ ၥၭမုဆံၪ့ဎံၪလီၩဘၪဝဲၩဝ့ၫ လၧစဒၫဝံၭအနိၭလၧစယုဒၭ အဂဲးအကၠီၪ့ လၧအ",
			"17": "<sup>17</sup> လ့ၩၥိၫ့ၦဖီၪ့ထၬယ့ၫၡုၬနီၪလီၫ.- အဂဲးဘဲၫယီၩၦ လဂၩနီၪဘၪဆၧဝံနုၬဝ့ၫလၧပကျၩယီၩန့ဘၪဆၧအ",
			"18": "<sup>18</sup> ခ့ၫအၡၩအဆၧမၩယီၩအလးလီၫ.- အဝ့ၫနီၪဎွ့ၩန့ဂၪ့ ခိၪအဝၩ့လၧဆၧအၧၩ့ဆၧၥၫ့အလံၩ့အလဲၫတၭ, လၩ့ထ့ၬဝ့ၫနီၪအဂူၭဖိၫ့ဖီးဖၭဝ့ၫတၭ, အဎွံၭလၩ့လၬ",
			"19": "<sup>19</sup> ဝ့ၫထီးအလူၬလီၫ.- ၦအီၪဝ့ၫလၧယရုစလံၫ့ ကိၭဂၩ ဒ့ၭလဖၪၥ့ၪယၫဝ့ၫ ဆၧအဂဲးအကၠီၪ့နီၪလီၫ. အခိးမွဲ ဆၧကိၭဂၪ့ခိၪအဝၩ့နီၪ အမံၩ့လၧအလၨဒၪဝ့ၫ, အစ့ လဒမၫ, ဘဲၫၦစံၭဆၧအၥိၭ,ဆၧၥွံၪအဂၪ့ခိၪလဝၩ့လီၫ.",
			"20": "<sup>20</sup> အဂဲးဘဲၫယီၩ ဆၧကွ့ၭအၥၭ လၧလံၬစံၭထၪ့အၪ့ အူၭဆၧအဖၧၩ့, မွဲအအီၪဝ့ၫလၧအလးအီၪယူဆံၭ, မွဲၦထီးအီၪလၧၩ့လၧအဖၧၩ့နးဂၩလဂ့ၩ. ဒဲ, မွဲၦဂူၫဂၩထၪ့လၧအယိဆၧအလးဆံၭ.",
			"21": "<sup>21</sup> မၩအၥၭဘဲၫနီၪတၭ, လၧကဆါယ့ၫၡုၬဂဲၫနုၬအီၪ",
			"22": "<sup>22</sup> ဝ့ၫလၧပကျၩ,- လၧစယီဟၫ့ဘၭတံၫဇၫ့ဆၧနီၪ,ထီၩ့ လၩ့အနံၩအၥၫ့လၧအဘၪဆၧမၩန့ထၪ့ထဲၩ့ဝ့ၫနီၪ,ၦ အီၪလၧပကျၩကိၭအဆၧၫ့အထီဒ့ၭလဖၪဘၪကဲၪထၪ့ ၦထိးအၥၭနးဂၩလၧပၥိၭယီၩ, လၧယ့ၫၡုၬဂဲထုၪ့ ထဲၩ့အဂဲးအကၠီၪ့လီၫ.",
			"23": "<sup>23</sup> အဝ့ၫၥံၪအီၪက့ၪလၩ့ဝ့ၫလၧ စယိၥၭကိၭဝ့ၫလၧ စဘၫစဘၭ ဒဲကိၭထဲၩ့ဝ့ၫအမံၩ့အၥၫ့လၧ စယၧၭစ",
			"24": "<sup>24</sup> တၧၭ,ဒဲစမၭၥဲအၭနံၫဂၩ,- တၭအဝ့ၫၥံၪဘၩဆိၪဖၪ ဆၧ,စံၭဝ့ၫ, ကဆါလၧအၥ့ၪယၫ ၦၡၩအၥုၪ့ခံၥၭလဲၫ",
			"25": "<sup>25</sup> ထီးအလူၬဧ့,ၦနံၫဂၩယီၩ,- ဘဲၫၥိၭအမိန့ဘၪဆၧ အခ့ၫအၡၩအဆၧမၩအလး, ဒဲဆၧအၪ့မၧၫ့ဖိၪအ လးယီၩလၧစယုဒၭလၩ့ထ့ၬခွံၬဝ့ၫလၧအဖၧၩ့, ဘဲၫ ၥိၭအမိထဲၩ့ထဲၩ့ဝ့ၫလၧအလးဒၪဝ့ၫနီၪ, ဒုၭနဲၪလါၦလ ဂၩလၧနရွံန့နဝ့ၫနီၪဆံၭ.",
			"26": "<sup>26</sup> အဝ့ၫၥံၪဖၭဝ့ၫနီၪ, ဘၪစမၭၥဲအၭတၭးဆၧဝံနုၬအ ဝ့ၫဒၪလၧ ၦဆၧအၪ့မၧၫ့ဖိၪဆံၫလဂၩအကျၩနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> တၭထီးယဲဆံၫအမုနံၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ယူၭတၭ, အဝ့ၫၥံၪကိၭဂၩဒ့ၭအီၪဝ့ၫ လၧအၥၭလဖျိၪ့ဎးလၧအ",
			"2": "<sup>2</sup> လးစီၪ့ဎးလီၫ.- ဆၧၥီၫလၩ့ၡုၭဝ့ၫလၧမူၭခိၪဘဲၫလံၩ မုလဖုၬဂဲၫဝ့ၫအၥိၭနီၪဎွ့ၩဂံၪ့လၧအဝ့ၫၥံၪဆၧၫ့နၩ့အီၪ",
			"3": "<sup>3</sup> ဝ့ၫလၧအဖၧၩ့ထၧၫ့ဖျိၪ့ယၫလီၫ.- ဆၧအဖျ့ၩလဖၪဘဲၫ မ့ၪလၪအၥိၭအီၪဖျီၪထၪ့တၭ, အၪ့နၩ့ဖၭလၩ့အၥၭနီၪ,",
			"4": "<sup>4</sup> ဆီးလၩ့ဝ့ၫလၧအဝ့ၫၥံၪအလီၩ့ ဆုၬဆုၬလီၫ.- ၦကိၭ ဂၩဒ့ၭနီၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫ လၧၥၭမုဆံၫ့ဎံၪတၭ, ချဲၩ့ထၪ့ဝ့ၫလၧၦဆၨၩဂူၫဂၩအလၨ ဘဲၫၥၭမုနီၪဒုၭချဲၩ့ ဝ့ၫအၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> ၦယုဒၫဖိၪၥံၪလၧအယူၭယၪ့ယွၩ လၧၦကိၭဆၨၩ ဒ့ၭအကျၩလၧအအီၪလၧမူၭခိၪအဖၫ့လၬ, အီၪဝ့ၫလၧ",
			"6": "<sup>6</sup> ယရုစလံၫ့အဖၧၩ့လီၫ.- ထီးဆၧအလူၥီၫထၪ့ဝ့ၫနီၪၦ ခမျၧးအီၪကိၩ့အီၪကီၪ့တၭ, အၥၭဘံၪဘူၪဝ့ၫလီၫ.အ ဂဲးဘဲၫယီၩမွဲအနါဂၧၫ့ဝ့ၫလဂၩလၧအလၨဒၪဝ့ၫ, လဂၩ",
			"7": "<sup>7</sup> လၧအလၨဒၪဝ့ၫနီၪလီၫ.- ၦကိၭဂၩဒ့ၭထီၫမံၫထီၫမၪ ဝ့ၫ,ဆၧလၩ့လၭ လၧအၥၭဖၧၩ့တၭ, စံၭလိၬအၥၭ, ၦလၧအချဲၩ့ဆၧလဖၪယီၩ, မွဲၦဂၫလလံၫဖိၪထီးအ",
			"8": "<sup>8</sup> လူၬမွဲအ့ၬဧၪ.- တၭပနါဂၧၫ့ဆၧလၧပအီၪဖျဲၪအလၨ, လဂၩလၧအလၨဒၪဝ့ၫ, လဂၩလၧအလၨဒၪဝ့ၫဘဲၫၥ့ၪ",
			"9": "<sup>9</sup> လဲၪ.- ၦပၫၥအၫ့ဖိၪ,ဒဲၦမံဒၠၫ့ဖိၪ,ဒဲၦအံလၫ့ဖိၪ,ဒဲၦအီၪ ဝ့ၫလၧမ့စိၫပတ့မၠၫအဖၧၩ့, ဒဲလၧခးယုဒၫ, ဒဲကၭပဒိ",
			"10": "<sup>10</sup> ၡၫ,ဒဲပီၪ့တၧၭ,ဒဲအ့ၡၫ,- ဖြံဇအၫ,ဒဲပၫ့ဖံလအၫ, အံ ဇံၭ,ဒဲလုဘၠၫအခးအီၪဘူၭလၧစဲၫရံနံၫၥံၪ, ဒဲၦမွံၩလၧ ရိမၫၦယုဒၫဖိၪ,ဒဲၦနုၬလၧၦယုဒၫဖိၪအထူၫအရူၫၥံၪ,",
			"11": "<sup>11</sup> ၦကြံတံၫဖိၪ, ဒဲၦအရ့ဘၠၫဖိၪ,ပဝ့ၫဒၪယီၩပနါဂၧၫ့လၧ အလီၩလၩ့လၬလၩ့ယွၩအဆၧလၩ့လၬလၧပလၨဒၪ",
			"12": "<sup>12</sup> ပဝ့ၫဘဲၫၥ့ၪလဲၪ.- ၦကိၭဂၩဒ့ၭထီၫမံၫထီၫမၪ, ဒဲအၥၭ ဂံၩ့ဂၩ့တၭ,စံၭလိၬအၥၭ,ဆၧမၩအၥၭယီၩ, မွဲအစံၭဝ့ၫ",
			"13": "<sup>13</sup> ဘဲၫၥ့ၪလဲၪ.- အ့ၪမွဲအဂူၫဂၩလနၩ့နၩ့ဒုၪဒွ့ၪဆၧတၭ, စံၭဝ့ၫ,အဝ့ၫၥံၪဎွ့ၩဝ့ၫလၧစဘံၭထံၫအဆၧၫ့လီၫ.",
			"14": "<sup>14</sup> စပံတၧၫဆၧၫ့ထုၪ့ဎုၬ လၧၦဆံၫလဂၩနီၪထုၭထၪ့ အလူတၭ,စံၭအဝ့ၫၥံၪ, ၦယုဒၫဖိၪ,ဒဲၦအီၪဝ့ၫလၧယရု စလံၫ့ထီးအလူၬၥံၪဧ့, ၥ့ၪယၫဆၧယီၩဒဲဒိၭနၥံၪအနါ",
			"15": "<sup>15</sup> လၧယလူဆံၭ.- အဂဲးဘဲၫယီၩၦလဖၪယီၩအီၩမၧၩ့ အၥၭဘဲၫနၥံၪဆီၫ့မီၪ့အၥိၭနီၪမွဲအ့ၬ, အဂဲးဘဲၫယီၩ",
			"16": "<sup>16</sup> ဘိၩ့နဲၪ့ယီၩမွဲမုမ့ၬထၪ့ၥၧၫ့နၩရံၩလီၫ.- အ့ၪမွဲဆၧလ မံၩ့ယီၩမွဲဆၧ လၧမီၪစယိၫအ့လၭလီၩဘၪဝဲၩဝ့ၫ လီၫ.",
			"17": "<sup>17</sup> ဒဲလၧအမုနံၩအခဲၫ့ထုၬလဖၪနီၪ, ယွၩစံၭဝ့ၫဒၪ,ဆၧ မိမၩအၥၭလၧယမိလူၫလၩ့ယၥၭမုလၧကယဲ ဆၧယၪထီးအလူၬအလီၩ့လီၫ. ဒဲနၥံၪအဖိၪမုၪၥံၪ,ဒဲနၥံၪအဖိၪခွၫၥံၪမိချဲၩ့ဆၧလၧ မီၪအချိၬ, ဒဲနၥံၪအဖိၪခွၫၥံၪမိဒၪဆၧလၧယၫလခီၫ, ဒဲနၥံၪအၡၩၥၭၡါၥံၪမိမံၫမးဆၧမံၫမးလီၫ.",
			"18": "<sup>18</sup> လၧမုနံၩလဖၪနီၪ ယမိလူၫလၩ့ယၥၭမုလၧယဎီး ယၡၩမုၪၥံၪ, ဒဲယဎီးယၡၩခွၫၥံၪအလီၩ့, တၭအဝ့ၫၥံၪမိချဲၩ့ဆၧလၧမီၪအချိၬလီၫ.",
			"19": "<sup>19</sup> တၭယမိဒုၭနဲၪဆၧလၩ့လိလၩ့လၭၥံၪလၧမူၭခိၪ, ဒဲဆၧမၩနဲၪ့လၩ့လၭၥံၪလၧဂၪ့ခိၪချိၫ့, ဆၧၥွံၪ, ဒဲမ့ၪ, ဒဲဆၧခူၪအအွံၩလီၫ.",
			"20": "<sup>20</sup> ဘိၩ့ကဆါအမုနံၩဖၭဒိၪ လၩ့မဲၩလနံၩနီၪ လချႃၭ ထီၩ့ဒံၭဘၪနီၪ, မုမ့ၬမိကဲၪထၪ့ဆၧခံၭ, ဒဲလၩမိကဲၪထၪ့ဆၧၥွံၪလီၫ.",
			"21": "<sup>21</sup> တၭဆၧမိမၩအၥၭ, ထီးဒၪၦလၧအကိၭထၪ့ကဆါ အမံၩ့လဂၩလါလါနီၪ,မိထီၩ့လၧဆၧထိးထဲၩ့ တၩ့ထဲၩ့ဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> ၦအံၫစရ့လၭဖိၪၥံၪဧ့, ဆၧအလူယီၩခိၭနၪနၥံၪဝ့ၫ ဆံၭ.ဘဲၫနၥံၪၥ့ၪယၫအၥိၭနီၪ, ယွၩဒုၭနဲၪၦနၭဇရ့ၭ ဖိၪယ့ၫၡုၬလၧဆၧစီၩ့ဆၧမၩ့, ဒဲဆၧလၩ့လိလၩ့လၭ, ဒဲဆၧမၩနဲၪ့လၩ့လၭၥံၪ, လၧယွၩမၩဝ့ၫလၧအစူၪ",
			"23": "<sup>23</sup> ဖၧၩ့လၧနၥံၪအကျၩလီၫ.- အဝ့ၫဒၪလဂၩဘၪဆၧ ဖ့ၪလၫ့ခွံၬဘဲၫယွၩအကိၪ့ထၪ့ ဆၧဂုးဖၭလၩ့ဆၧခၧၫ့ အဆၧစ့ၩရၫ့ ဒဲအဆၧၥ့ၪယၫဝဲၩဝ့ၫနီၪ အီၪဝ့ၫအၥိၭ တၭ,နၥံၪဝ့ၫဒၪယီၩ နၥံၪမၩန့အဝ့ၫလဂၩနီၪ နၥံၪဖျၩ ထၪ့ဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့, ဒဲမၩၥံၫဝ့ၫလၧၦ",
			"24": "<sup>24</sup> အၧၩ့အစူၪလဖၪလီၫ.- အဝ့ၫဒၪနီၪယွၩကွဲၪဖျါခွံၬဝ့ၫ လၧဆၧၥံၫအဆၧၡၪ့ဒဲဒုၭဂဲထုၪ့ထဲၩ့ဝ့ၫတၭ, မွဲဆၧ နီၪဖီၪ့ထၬဝ့ၫလၥ့ၪဘၪအဂဲးလီၫ.",
			"25": "<sup>25</sup> အဂဲးဘဲၫယီၩစဒၫဝံၭလီၩဘၪဝ့ၫလၧအဂဲး အကၠီၪ့, ယဒၪဘၪယွၩလၧယမ့ၬယၫလထံၪဎးလီၫ. အဂဲးဘဲၫယီၩ အီၪဝ့ၫလၧယစူၪထွ့ၪဘဲၫယထီးဝၭ လဂ့ၩအၥိၭလီၫ.",
			"26": "<sup>26</sup> အခိးမွဲဘဲၫနီၪတၭ,ယၥုၪ့ထိၬၥၭထိၬဒဲယဖျ့ၩၥုၪ့ ထိၬၥၭထိၬလီၫ. လၧနီၪအမ့ၬယၫ ယဖံၭယယၪ မိအီၪလၧဆၧယိ လါအဖၧၩ့လီၫ.",
			"27": "<sup>27</sup> အဂဲးဘဲၫယီၩနလအီၪက့ၪလၩ့ထးဘၪ ယၥၭၡီၩ့ လၧဖျႃဖၧၩ့နီၪး နမိဒုၭဒၪဘၪနၡၩဆံၫ့ဎံၪလဂၩလၧ ဆၧအအုၪနီၪမွဲအ့ၬ.",
			"28": "<sup>28</sup> နဒုၭၥ့ၪယၫယူၭယၧၩလၧဆၧမၧၫ့အဖၧၩ့ၥၭယူၭး နမိမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ယၧၩလၧဆၧၥၭထိၬ လၧ နမ့ၬယၫနီၪလီၫ.",
			"29": "<sup>29</sup> ၦထၧၫ့ဖုဝဲၥံၪဧ့, ဒုၭချဲၩ့ယၧၩလၩ့ထံးလၩ့ဆ့ၭလၧ ၦလဆၨၩယီၩအဖါစဒၫဝံၭအဂဲးအကၠီၪ့ဆံၭ. မွဲဆၧ အၥံၫဝ့ၫဒဲဘၪဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫနီၪ, အၥွၪခိၪအီၪ",
			"30": "<sup>30</sup> လၧပကျၩထီးမုလနံၩယီၩလီၫ.- ၦၡၩနီၪမွဲမီၪလဂၩ တၭ,ၥ့ၪယၫဝ့ၫလၧယွၩဆိၪလၩ့အၥၭလဖၧၫ့လၧ အမိဒုၭဆၧၫ့နၩ့အယးဒံၩ့အဆၧၥၪလၧ အလးဆီၩ့ဆီ",
			"31": "<sup>31</sup> အဖၫ့ခိၪတၭ,- အဝ့ၫနီၪဒၪဘၪဝဲၩဝ့ၫ, ချဲၩ့ဆၧလၧဎရံၬ ဂဲထုၪ့ထဲၩ့အဂဲးလၧဆၧလအီၪက့ၪလၩ့ထးဘၪအ ၥၭၡီၩ့လၧဖျႃဖၧၩ့တၭ, ဒဲအဆၧယၪနီၪဒၪဘၪဆၧအုၪ",
			"32": "<sup>32</sup> ၥ့ၪကျၪၥ့ၪဆ့အ့ၬ.- ယ့ၫၡုၬလဂၩနီၪ,ပဝ့ၫဒၪယီၩ ထီးအလူၬပကဲၪၦထိးအၥၭလၧယွၩဒုၭဂဲထုၪ့ထဲၩ့",
			"33": "<sup>33</sup> ဝ့ၫအဂဲးအကၠီၪ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ဆၧအီၪက့ၪ ထၪ့ထီၫယူၭအဝ့ၫဒၪလဂၩလၧယွၩအစူၪထွ့ၪနီၪ, မွဲအဒိၭန့ဆၧစံၭဝဲၩဘၪဆဲၫ့ လၧၥၭမုဆံၫ့ဎံၪ လၧဖါ ဎယွၩၭအအီၪတၭ, မွဲအလူၫလၩ့ဆၧလၧနၥံၪဒၪ",
			"34": "<sup>34</sup> ဘၪဒဲနၥံၪနါဂၧၫ့နၥံၪဝ့ၫဘိၩ့နဲၪ့ယီၩလီၫ.- အဂဲး ဘဲၫယီၩစဒၫဝံၭထၪ့ဘၭလၧမူၭခိၪအ့ၬ. အနၫ့ဆါဒၪ ဝ့ၫစံၭ, ယွၩစံၭယကဆါ,",
			"35": "<sup>35</sup> ဆၧၫ့နၩ့လၧယစူၪထွ့ၪ, ထီးယအီၪက့ၪလၩ့ နဒုၪနဒၩၥံၪလၧနခၪ့ယဲးလၩ့ အလးဆံၭ.",
			"36": "<sup>36</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬလၧနၥံၪ ဖျၩထၪ့ဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့လဂၩနီၪ, ယွၩအီၪက့ၪအဝ့ၫ ဒၪလၧကဆါဒဲဎရံၬတၭ, မွဲၦအံၫစရ့လၭ အၡၩအဂံၪ့ ဖိၪထီးအလူၬၥ့ၪယၫလၩ့ထံးလၩ့ဆ့ၭဆံၭ.",
			"37": "<sup>37</sup> အဝ့ၫၥံၪနါဂၧၫ့ဆၧနီၪ အၥၭဘၪဆ့ၭဝ့ၫဒၪတၭ, စံၭစပံတၧၫ, ဒဲၦဆၧအၪ့မၧၫ့ဖိၪအဂူၫဂၩလဖၪနီၪ, ၦထၧၫ့ဖုဝဲၥံၪဧ့, မွဲပမိမၩဆၧနီၪလဲၪ.",
			"38": "<sup>38</sup> စပံတၧၫစံၭဆၧၫ့အဝ့ၫၥံၪ, နၪ့ထၪ့နီၫ့ယါလၩ့ထဲၩ့န ၥံၪအၥၭ, ဒဲဘၭတံၫဇၫ့နၥံၪအၥၭလဂၩ ဒဲလဂၩလၧ ယ့ၫၡုၬဎရံၬအမံၩ့အဖၧၩ့ လၧဆၧဖီၩ့ဖျ့ၭ ဆၧဒဲၩဘၭ အဂဲးဆံၭတၭနၥံၪမိဒိၭန့ဘၪဆၧဖ့ၪလၫ့ၥၭမုဆံၫ့",
			"39": "<sup>39</sup> ဎံၪလီၫ.- အဂဲးဘဲၫယီၩဆၧစံၭဝဲၩ ဘၪဆဲၫ့လၧနၥံၪး ဒဲနၥံၪအဖိၪအလံၩ,ဒဲၦလၧအယဲၩ့ထီးအလူၬ, ထီး ဒၪကယဲၦလၧယွၩပကဆါမိကိၭထဲၩ့ဝ့ၫလဖၪနီၪလီၫ.",
			"40": "<sup>40</sup> အဝ့ၫဒၪထိးအၥၭဒဲ ပဂၨၪထၪ့ဆၧလၧအဆၧချဲၩ့အ ဂူၫဂၩအၪထံၪတၭ,စံၭဝ့ၫ,ထိးထဲၩ့တၩ့ထဲၩ့နၥံၪအၥၭ လၧၦၡၩအနါကဲၪ့လဆၨၩယီၩဆံၭ.",
			"41": "<sup>41</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအဒိၭန့အလူလၧဆၧၥုၪ့ ထိၬၥၭထိၬလဖၪနီၪဒိၭဘၭတံၫဇၫ့အၥၭတၭ, ဆၧလၧ မုနံၩလနံၩနီၪ ဆၧအီၪက့ၪအၪထၪ့ ၦလၧအဝ့ၫၥံၪအ ကျၩဖိၭဘိၭၥၧၫ့ထီၫ့လီၫ.",
			"42": "<sup>42</sup> အဝ့ၫၥံၪအီၪဂုးခၧၫ့ဝ့ၫလၧ ၦဆၧအၪ့မၧၫ့ဖိၪအဆၧ ၥီၪ့ဆၧၥၫ့အဖၧၩ့လထံၪဎး,ဒဲလၧဆၧဖံၭၥိၭလိၬအ ၥၭ,ဒဲလၧဆၧကံၪ့ဘျ့ၭကိၪ, ဒဲလၧဆၧဘၩဆိၪဖၪအ ဖၧၩ့လဖၪနီၪလီၫ.",
			"43": "<sup>43</sup> ဆၧလၩ့လိလၩ့လၭဒဲဆၧမၩနဲၪ့ အဆၧလၩ့လၭ မၩအၥၭအၪမံၩ့ လၧဆၧအၪ့မၧၫ့ဖိၪလဖၪနီၪ အစူၪ ဖၧၩ့တၭ, ၦၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫ ကိၭဂၩဒ့ၭလီၫ.",
			"44": "<sup>44</sup> တၭၦလၧအနဲၩထဲၩ့ဝ့ၫ ထီးအလူၬလဖၪနီၪ အီၪဝ့ၫ စီၪ့ဎးလိၬအၥၭ, အီၪက့ၪကီၪ့အဆၧထီးအလူၬ,",
			"45": "<sup>45</sup> တၭအၪ့ဆၫခွံၬအဆၧဖိၪဆၧလံၩ, ဒဲအစူၪလးခၪ့ခိၪ နီၪအၪ့နၩ့ဖၭဝ့ၫ လၧၦထီးအလူၬထီးဒၪအမိန့ဘၪဆၧ",
			"46": "<sup>46</sup> အလးအီၪဝ့ၫနီၪလီၫ.- အီၪဒၪအဆၧ လၧအၥၭလ ဖျိၪ့ဎးလၧဆၧလုအဂံၪ့ဖၧၩ့ ၥံၫ့ၥံၫ့နံၩတၭကံၪ့ဘျ့ၭကိၪ လၧလဂံၪ့ဘၪလဂံၪ့, လဂံၪ့ဘၪလဂံၪ့အဖၧၩ့တၭ,ဒိၭ န့ဆၧအၪ့ဆၧအီၩလၧအၥုၪ့ထိၬၥၭထိၬ, ဒဲလၧအၥုၪ့ တီၩၥၭလီၩ့လီၫ.",
			"47": "<sup>47</sup> ၥံၫကျံၩထၪ့ယွၩတၭ, ဘၪၦခမျၧးအ ၥၭထီးအလူၬလီၫ. တၭၥံၫ့ၥံၫ့နံၩနီၪကဆါအီၪက့ၪ အၪထၪ့ၦလၧအဘၪဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ လၧဆၧ အီၪကီၪ့အဖၧၩ့လီၫ."
		},
		"3": {
			"1": "<sup>1</sup> စပံတၧၫဒဲစယီဟၫ့လ့ၩထၪ့ဎုၬဝ့ၫ လၧဆၧလုအဂံၪ့ ဖၧၩ့ထီးဆၧဘၩဆိၪဖၪအခၫလၧခွံၫနၩရံၩအဖၧၩ့နီၪ",
			"2": "<sup>2</sup> လီၫ.- ၦလၧအခၪ့ဂၭဂီၩ့ဝ့ၫလၧအမိအဒၧၩ့လးဖၧၩ့လံၩ လံၩလဂၩနီၪ, ဘဲၫၥိၭအမိအၪ့ကံၩ့ဆၧဖ့ၪလၫ့ယၫ့ၥၭ လၧၦလၧအလ့ၩနုၬ လၧဆၧလုအဂံၪ့ဖၧၩ့လဖၪတၭ, ၦဂဲၫဆိၬအီၪက့ၪလၩ့ဝ့ၫ လၧဆၧလုအဂံၪ့အတရၫ့ ကိၭဝ့ၫအဎံၫအလၩအခၪ့ထံၭ ကိၭနံၩဒ့ၭလီၫ.",
			"3": "<sup>3</sup> အဝ့ၫနီၪဒၪစပံတၧၫဒဲ စယီဟၫ့မိလ့ၩနုၬထၪ့လၧ ဆၧလုအဂံၪ့ဖၧၩ့တၭ, အၪ့ကံၩ့ဆၧဖ့ၪလၫ့ယၫ့ၥၭလီၫ.",
			"4": "<sup>4</sup> စပံတၧၫဒဲစယီဟၫ့ ယိအဝ့ၫဒၪထံၫထံၫဆၭဆၭတၭ",
			"5": "<sup>5</sup> စံၭဝ့ၫ,ယိထၪ့ပၧၩဆံၭ.- မွဲအဆီၫ့မီၪ့လၧအမိန့ဘၪဆၧ",
			"6": "<sup>6</sup> လမံၩ့မံၩ့လၧအဝ့ၫၥံၪနီၪဒိၭအနါလီၫ.- စပံတၧၫစံၭဝ့ၫ, ကျိၪၥံၪစ့ၩၥံၪထီၫ့ၥံၪလွ့ၫၥံၪနီၪ အီၪလၧယၧၩအ့ၬ. အ့ၪ မွဲဆၧလၧအအီၪလၧယၧၩနီၪ ယဖ့ၪလၫ့နၧၩလီၫ. လၧ ၦနၭဇရ့ၭဖိၪယ့ၫၡုၬဎရံၬအမံၩ့အကၠီၩ့နီၪဂဲထုၪ့စဲၪ့",
			"7": "<sup>7</sup> ထၪ့ဘီၪ.- ဖီၪ့ထၪ့အစူၪထွ့ၪတၭဘိၭဂဲထုၪ့ဝ့ၫလီၫ. အ ခၪ့ယၫၥၭဒဲအခၪ့ဒိၪမ့ၬနီၪ အဂဲးအဘၭဆီၪ့ထၪ့ထဲၩ့",
			"8": "<sup>8</sup> ဝ့ၫချဲၫ့မၬလီၫ.- အဝ့ၫနီၪဖုၫထၪ့ဝ့ၫဆၧၫ့ထုၪ့တၭလ့ၩ ဆၧနီၪဖုၫထၪ့ဝ့ၫ, အၪ့အူၭထၪ့ယွၩတၭ, လ့ၩနုၬဎုၬ",
			"9": "<sup>9</sup> လၧအဝ့ၫၥံၪအၥိၭလၧဆၧလုအဂံၪ့ဖၧၩ့လီၫ.- ၦခမျၧး ထီးအလူၬဒၪဘၪဝ့ၫလၧ အလ့ၩဆၧဒဲအၪ့အူၭထၪ့ယွၩ",
			"10": "<sup>10</sup> နီၪလီၫ.- အဝ့ၫၥံၪၥ့ၪယၫလၧအမွဲၦလၧအဆၧၫ့နၩ့အၪ့ ကံၩ့ဆၧဖ့ၪလၫ့ယၫ့ၥၭ လၧဆၧလုဂံၪ့အတရၫ့ အဎံၫ အလၩအခၪ့ထံၭနီၪလီၫ. ဆၧမၩအၥၭဘၪဆဲၫ့လၧၦ လဂၩနီၪလၩ့လၭလၧ အဝ့ၫၥံၪအမ့ၬယၫဒိၪမၬနီၪထီၫ မံၫထီၫမၪဝ့ၫလီၫ.",
			"11": "<sup>11</sup> ၦအခၪ့ဂၭဂီၩ့ဘျၪထဲၩ့ဝ့ၫလဂၩနီၪ ဖီၪ့ထၬစပံတၧၫ ဒဲစယီဟၫ့အဘိၩ့ဘၭနီၪ, ၦခမျၧးထီးအလူၬ လ့ၩစဲၪ့ တလဲးအီၪကီၪ့လၧအဝ့ၫၥံၪအအီၪ လၧထိၬချိၫ့ဆၧ ကိၭဝ့ၫလၧစစီလမၧၫ့အဖၧၩ့တၭ, အဝ့ၫၥံၪထီၫမံၫထီၫ",
			"12": "<sup>12</sup> မၪဝ့ၫဒၪလီၫ.- စပံတၧၫဒၪဘၪတၭ, ချဲၩ့ထၪ့ဆၧလၧ ၦခမျၧးနီၪ,ၦအံၫစရ့လၭအၡၩၥံၪဧ့,မွဲဘၪနီၫနၥံၪထီၫ မံၫထီၫမၪ လၧဆၧယီၩ အဂဲးအကၠီၪ့နီၪလဲၪး နၥံၪယိ ထံၫယိဆၭပၧၩဘဲၫပဒုၭစဲၪ့ထၪ့ထဲၩ့ အဝ့ၫဒၪလၧပစီၩ့ ပမၩ့ဒဲပဆၧယူၭယၪ့ယွၩဒၪပဝ့ၫအၥိၭ, မွဲဘၪလဲၪ.",
			"13": "<sup>13</sup> စအၫဘြဟၫ့ဒဲစအံစၭ, ဒဲစယၫကူၭအယွၩ,ပဖါၥံၪ အယွၩနီၪဒုၭဖျီၪထၪ့အခ့ၫအၡၩ ယ့ၫၡုၬအလၩအ ဖၩ့လီၫ.ထီးစပဲလၭစ့ၩရၫ့လၧအမိဖျါခွံၬအဝ့ၫဒၪနီၪ နၥံၪဖ့ၪလၫ့ခွံၬ ဒဲမီၪ့ဘံၭခွံၬအဝ့ၫလဂၩလၧစပဲလၭ",
			"14": "<sup>14</sup> အမ့ၬယၫနီၪလီၫ.- နၥံၪမီၪ့ဘံၭၦအဆံၫ့အဎံၪဒဲ အတီၩအလီၩ့လဂၩနီၪတၭ, နၥံၪအၪ့ကံၩ့လၧဆၧမိ ဖ့ၪလၫ့နၥံၪလၧၦလၧအမၩၥံၫၦၡၩလဂၩနီၪလီၫ.",
			"15": "<sup>15</sup> နၥံၪမၩၥံၫခွံၬဆၧမၧၫ့အခိၪ လၧယွၩဒုၭဂဲထုၪ့ထဲၩ့ ဝ့ၫနီၪ,ပကဲၪထၪ့ပဝ့ၫလၧၦထိးအၥၭလၧဆၧနီၪအ",
			"16": "<sup>16</sup> ဂဲးလီၫ.- ဆၧနဲၩထဲၩ့အဝ့ၫနီၪအမံၩ့တၭ, အဝ့ၫအမံၩ့ ဒၪလ့ၬမၩဆီၪ့ထၪ့န့ ၦလၧနၥံၪဒၪဘၪ ဒဲနၥံၪၥ့ၪယၫဝ့ၫ လဂၩယီၩ အဂဲးအဘၭလီၫ. မွဲမၬ, ဆၧနဲၩဘၪဆဲၫ့ လၧအဝ့ၫနီၪ ဒုၭအီၪဆီၪ့အီၪချဲၫ့ဆၧယီၩလၩ့ထံးလၩ့ ဆ့ၭလၧနၥံၪထီးအလူၬအမ့ၬယၫလီၫ.",
			"17": "<sup>17</sup> ဘိၩ့နဲၪ့ယီၩထၧၫ့ဖုဝဲၥံၪဧ့, ယၥ့ၪယၫလၧနၥံၪလ ၥ့ၪယၫဘၪနီၪနၥံၪမၩနၥံၪဝ့ၫ ဒဲနၥံၪအၦဒိၪၦၡါၥံၪ,မွဲ",
			"18": "<sup>18</sup> ဘဲၫနီၪအၥိၭဆ့လီၫ.- ဆၧလၧယွၩလီၩဘၪဝဲၩဝ့ၫလၧ အမီၪၥံၪ ထီးအလူၬအနိၭလၧဎရံၬဘၪထိးဆၧနီၪ",
			"19": "<sup>19</sup> မွဲအမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫ ဘဲၫနီၪအၥိၭလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭနၥံၪအဆၧဒဲၩဘၭ မိဘၪ ဆၧထူၭခွံၬဝ့ၫ, ဘဲၫၥိၭဆၧၡုၪဆၧမုၬလၧကဆါအမ့ၬ",
			"20": "<sup>20</sup> ယၫအထီမိဘၪနီၪ,- ဒဲဘဲၫၥိၭအဝ့ၫဒၪမိအၪ့မၧၫ့လၩ့ ယ့ၫၡုၬဎရံၬလၧအဘၪ ဆၧလီၩလၩ့လၬလၩ့ဝဲၩဝ့ၫ လၧနၥံၪနီၪ, နီၫ့ယါလၩ့ထဲၩ့နၥံၪအၥၭတၭ, ကၠၪ",
			"21": "<sup>21</sup> လီၩ့ထဲၩ့နၥံၪအၥၭဆံၭ.- အဝ့ၫနီၪလၧဆၧထီးအလူၬ လချႃၭမၩထဲၩ့အၥၭဒံၭဘၪနီၪ မူၭခိၪဘၪထိးဆၧၫ့ဝ့ၫ ဘဲၫယွၩစံၭဝဲၩဝ့ၫလၧမီၪဆံၫ့ဎံၪထီးအလူၬၥံၪအနိၭ",
			"22": "<sup>22</sup> လၧဖျိၩ့လံၩလံၩအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩစမိစ့ၭ စံၭဎပဖါၥံၪတီၩတီၩၭ ယွၩ,န ၥံၪ အ က ဆါ, မိ ဒုၭ အီၪ ထၪ့ န့ န ၥံၪ လၧ မီၪ နး ဂၩ လၧ န ၥံၪ အ ထၧၫ့ ဖု ဝဲ အ ကျၩ ဘဲၫ ယၧၩ ယီၩ အ ၥိၭ လီၫ. အ ဝ့ၫ ဒၪ နီၪ ထီး ဒၪ အ လီၩ ဘၪ န ၥံၪ ထီး အ လူၬ လ မံၩ့ လါ လါ နီၪ န ၥံၪ ဘၪ ခိၭ",
			"23": "<sup>23</sup> နၪ လီၫ.- ဆၧ မိ မၩ အ ၥၭ လၧ က ယဲ ၦ လၧ အ လ ခိၭ နၪ ဘၪ မီၪ နီၪ အ လူ လ ဂၩ လါ လါ နီၪ မိ ဘၪ ဆၧ မၩ ဂၭ ဂီၩ့ ခွံၬ ဝ့ၫ လၧ ၦ ခ မျၧး",
			"24": "<sup>24</sup> အ ကျၩ လီၫ.- ကယဲမီၪၥံၪလၧစစၫမုၫအ့လၭအ နၫ့ဆါလံၩလံၩ, ဒဲၦလၧခဲၫ့လဖၪလၧအချဲၩ့ဆၧထီး အလူၬနီၪ, မွဲအလီၩဘၪဝဲၩ ဆၧလၧမုနံၩလဖၪယီၩ အဂဲးဆ့လီၫ.",
			"25": "<sup>25</sup> နၥံၪဝ့ၫဒၪယီၩ နၥံၪမွဲမီၪၥံၪအဖိၪခွၫလဖၪဒဲဘၪ ဆဲၫ့လၧဆၧအုၩ့လၩ့ လၧယွၩအုၩ့လၩ့ဝ့ၫ လၧပဖါၥံၪ လီၩဘၪစအၫဘြဟၫ့, က ယဲ ၦ ၡၩ အ ဆၨၩ လၧ ဂၪ့ ခိၪ ချိၫ့ ယီၩ ထီး အ လူၬလ ဖၪ နီၪ မိ ဘၪ ဆၧ ဆိၪ ဂ့ၩ ဝ့ၫ လၧ န ချံၫ န ၥၪ အ ဖၧၩ့ လီၫ.",
			"26": "<sup>26</sup> ယွၩလၧအဒုၭဂဲထုၪ့ထဲၩ့အဖိၪခွၫယ့ၫၡုၬတၭ, အၪ့ မၧၫ့အလ့ၩဆိၫလၧနၥံၪအအီၪနီၪ, ဘဲၫၥိၭအမိဆိၪ ဂ့ၩနၥံၪလၧအဘိၭကၠၪခွံၬနၥံၪအၥၭ လၧနၥံၪအဆၧ ဒဲၩဘၭအအီၪကိၭအဂၩဒ့ၭဆုၬဆုၬလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> အဝ့ၫၥံၪချဲၩ့ဆၧလၧၦခမျၧးအဘိၩ့ဘၭနီၪ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ၦခမျၧးဒဲလီၩလၩ့လၬလၩ့ဆၧ ဂဲထုၪ့ထဲၩ့လၧ ယ့ၫၡုၬအဖၧၩ့အဂဲးအကၠီၪ့တၭ,ၦလုဆၧလဖၪဒဲဆၧ လုဂံၪ့အခိၪလဂၩဒဲ ၦစၭဒုၫစံၫၥံၪနီၪအၥၭခိထၪ့တၭ,",
			"3": "<sup>3</sup> လ့ၩစိၩဝ့ၫလၧအအီၪလီၫ.- အဝ့ၫၥံၪအီၪက့ၪအစူၪလၧ ၦလဖၪနီၪအလီၩ့တၭ, ဒုၭနုၬဝ့ၫလၧထီၫ့ဖၧၩ့ ထီးဆၧ ဖၩ့ထၪ့ကဲဂီၩလနံၩလီၫ. အဂဲးဘဲၫယီၩမွဲ မုဂၪလၩ့ဝ့ၫ ဒၪလီၫ.",
			"4": "<sup>4</sup> မွဲလါနၫ့ဘိၩ ၦလၧအနါဂၧၫ့ဆၧအလူနီၪနဲၩထဲၩ့ဝ့ၫ ဒၪအၪဂၩတၭ, ဆၧဝံထၪ့နၬထၪ့ဝ့ၫနီၪ, ၦခွၫၥံၪအီၪဝ့ၫ ဖိၭဘိၭယဲထီၫ့လီၫ.",
			"5": "<sup>5</sup> တၭထီးကဲဂီၩလနံၩဆၧမၩအၥၭ လၧၦဒိၪၦၡါၥံၪ",
			"6": "<sup>6</sup> ဒဲအၥုၪ့က့ၭၥၭၡါၥံၪ ဒဲၦကွ့ၭလံၬၥံၪ,- ဒဲၦလုဆၧအခိၪ စအၪ့နၭ,ဒဲစက့အဖၭ,ဒဲစယီဟၫ့,ဒဲစအၫလ့ၭစၪ့ဒၧၫ, ကယဲၦလုဆၧအခိၪအဘူၭအထံးၥံၪ အီၪကိၩ့အီၪကီၪ့",
			"7": "<sup>7</sup> လၧယရုစလံၫ့နီၪလီၫ.- အဝ့ၫၥံၪအီၪက့ၪလၩ့ၦလဖၪ နီၪလၧဆၧၥၭကျၩတၭ, အၪ့စၪ့ဝ့ၫမွဲနၥံၪမၩဆၧယီၩ လၧဆၧနီၫလၫအစီၩ့အမၩ့ဒဲလၧပလၫလဂၩအမံၩ့အ ၥၪလဲၪ.",
			"8": "<sup>8</sup> ထီးနီၪလဖၧၫ့ စပံတၧၫလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလၧ ၥၭမုဆံၫ့ဎံၪတၭ, စံၭအဝ့ၫၥံၪ, ၦခမျၧးအၦဒိၪၦၡါဒဲၦ",
			"9": "<sup>9</sup> အံၫစရ့လၭဖိၪအၥုၪ့က့ၭၥၭၡါၥံၪဧ့,- ဆၧမၩအဂ့ၩ လမံၩ့လၧအဘၪၦအက့ၩအကွဲၪ့လဂၩတၭ, မွဲအဘျၪ ထဲၩ့ဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ပအ့ၪဒိၭဆၧအၪ့စၪ့",
			"10": "<sup>10</sup> ပၧၩလၧမုလနံၩယီၩတၭ,- နၥံၪဝ့ၫဒၪထီးအလူၬ,ဒဲက ယဲၦအံၫစရ့လၭဖိၪၥံၪ, လၧၦနၭဇရ့ၭဖိၪယ့ၫၡုၬဎရံၬ လၧနၥံၪဖျၩထၪ့ဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့နီၪ, ယွၩဒုၭ ဂဲထုၪ့ထဲၩ့ဝ့ၫလၧဆၧၥံၫအဖၧၩ့လဂၩနီၪ အမံၩ့အကၠီၩ့ တၭ,အဝ့ၫလဂၩယီၩ အီၪဆီၪ့အီၪချဲၫ့ဒဲဆၧၫ့ထုၪ့လၧ",
			"11": "<sup>11</sup> နၥံၪအမ့ၬယၫယီၩ, ၥ့ၪယၫနၥံၪဝ့ၫဆံၭ.- အယီၩမွဲလိး လဖျိၪ့လၧၦၥုၪ့ဂံၪ့,နၥံၪဝ့ၫဒၪယီၩနၥံၪအီၪက့ၪခွံၬဘဲၫ လမွဲဘၪဆၧနးမံၩ့အၥိၭတၭ, ကဲၪထၪ့ဝ့ၫလၧဂံၪ့နိၪ့အ",
			"12": "<sup>12</sup> ခိၪစီၪ့လီၫ.- ဆၧထိးထဲၩ့တၩ့ထဲၩ့လၧၦဂူၫဂၩအဖၧၩ့ နီၪလအီၪဘၪဝ့ၫနးဂၩနီၪ, အဂဲးဘဲၫယီၩဆၧဖ့ၪလၫ့ အမံၩ့ဂူၫဂၩလၧၦၡၩအကျၩ လၧမူၭခိၪအဖၫ့လၬလၧ ၦဘၪထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့လၧအဖၧၩ့နးဂၩ အ့ၬ.",
			"13": "<sup>13</sup> ထီးအဝ့ၫၥံၪဒၪဘၪ စပံတၧၫဒဲစယီဟၫ့အၥၭဒူၩနီၪ ၥ့ၪယၫဝ့ၫလၧအမွဲၦလၥ့ၪဘၪလံၬ,ဒဲၦလၧအလမၩ လိၪဘၪဆၧတၭ, ထီၫမံၫထီၫမၪဝ့ၫဒၪလီၫ. ၥ့ၪယၫဝ့ၫ လၩ့ထံးလၩ့ဆ့ၭ လၧအဝ့ၫၥံၪမွဲၦလၧအအီၪယူၭ လၧ",
			"14": "<sup>14</sup> ယ့ၫၡုၬအၥိၭလီၫ.- အဝ့ၫၥံၪဒၪဘၪ ၦလၧအဘျၪထဲၩ့ ယူၭဝ့ၫလဂၩ ဆၧၫ့ထုၪ့လၧအၥိၭတၭ, ချဲၩ့ပဒၩ့ထၬ ဆၧနီၪလမံၩ့အလးအီၪအ့ၬ.",
			"15": "<sup>15</sup> မွဲလါနၫ့ဘိၩအဝ့ၫၥံၪအၪ့မၧၫ့ၦၡၩၥံၪနီၪ စဲၪ့ထၪ့ခွံၬ လၧဆၧကိၪ့လိၬအၥၭအလးနီၪလၧခီၫ့ဂီၩ့တၭ, အဝ့ၫ",
			"16": "<sup>16</sup> ၥံၪကၩ့ကၩလိၬအၥၭနီၪ,စံၭဝ့ၫဒၪ,- ၦလဖၪယီၩမွဲပ မိမၩဝ့ၫဘဲၫၥ့ၪလဲၪး အဂဲးဘဲၫယီၩဆၧလၩ့လၭလၩ့ ထံးလၩ့ဆ့ၭလမံၩ့မၩအၥၭ လၧအဝ့ၫၥံၪနီၪအီၪဖျီၪထၪ့ လၧၦအီၪဝ့ၫ လၧယရုစလံၫ့အဖၧၩ့ ထီးအလူၬအမ့ၬ ယၫတၭ, ပဝ့ၫဒၪယီၩပမီၪ့ဘံၭဆၧနီၪလမံၩ့ၥ့ၪအ့ၬ.",
			"17": "<sup>17</sup> မွဲလါနၫ့ဘိၩ ဘဲၫၥိၭအထီးဂၧၫ့ထၪ့ၥၩလၩ့ဒံၭ လၧၦ ခမျၧးအကျၩဒံၭလဂ့ၩတၭ, မွဲပမၪလူၬၡီၩ့အဝ့ၫၥံၪလၧ ဆၧချဲၩ့ၥၭမဲၪနီၪ ဘဲၫၥိၭအထီးလီၩလၩ့လၬလၩ့ဆၧ",
			"18": "<sup>18</sup> လၧၦလဂၩနီၪအမံၩ့လၧၦနးဂၩလဂ့ၩဘီၪ.- တၭအ ဝ့ၫၥံၪကိၭထဲၩ့ၦလဖၪနီၪတၭ, ဘဲၫၥိၭအထီးလီၩလၩ့ လၬလၩ့ဆၧ, ဒဲထီးၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧလၧယ့ၫၡုၬအ မံၩ့လၩလါလဂ့ၩတၭ, မၪလူၬဝ့ၫဒၪလီၫ.",
			"19": "<sup>19</sup> အ့ၪမွဲစပံတၧၫဒဲစယီဟၫ့ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ ၥံၪ, ပခိၭနၪနၥံၪအလူအၪနဲၪ့ ပခိၭနၪယွၩအလူတၭ, လၧယွၩအမ့ၬယၫမွဲအတီၩလတီၩဘၪလဲၪနီၪ, စ့ၩရၫ့",
			"20": "<sup>20</sup> ဒၪနၥံၪဝ့ၫဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧလၧပဒၪဘၪဒဲ ဆၧလၧပနါဂၧၫ့ဘၪနီၪ, ပအ့ၪလလီၩလၩ့လၬလၩ့ဘၪ တၭ,ပအီၪၥ့ၪအ့ၬ.",
			"21": "<sup>21</sup> အဝ့ၫၥံၪစ့ၩရၫ့စၪၦလဖၪနီၪလဒၪဘၪဝ့ၫအလး တၭ,ချဲၩ့ၥၭမဲၪဒံၭဝ့ၫတၭ,ကွဲၪဖျါခွံၬဝ့ၫဒၪလီၫ. အဂဲး ဘဲၫယီၩလၧဆၧမၩအၥၭအကၠီၩ့နီၪ, ၦခမျၧးထီးအ",
			"22": "<sup>22</sup> လူၬစံၭထၪ့အၪ့အူၭယွၩလီၫ.- အဂဲးဘဲၫယီၩၦလၧအ ဘၪဆၧမၩဘျၪထဲၩ့အလၩ့လၭလဂၩနီၪ အၥၭၡါယူၭ အနံၪ့လံဆံၫဘျဲၪလီၫ.",
			"23": "<sup>23</sup> အဝ့ၫၥံၪဘၪဆၧဖျါခွံၬဝ့ၫနီၪ ထဲၩ့ထဲၩ့လၧအထံၩအ ၥိၭလဒီၪ့အအီၪတၭ, ကယဲဆၧလၧၦလုဆၧအဒိၪ ၥံၪ,ဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪ စံၭအဝ့ၫၥံၪနီၪ, လီၩထဲၩ့ဆၧ",
			"24": "<sup>24</sup> ထီးအလူၬလီၫ.- ၦနါဂၧၫ့ဝ့ၫလဖၪနီၪဘၩဆိၪဖၪယွၩ လၧအၥၭလဖျိၪ့ဎးတၭ, စံၭဝ့ၫဒၪ,ကဆါဧ့,နဝ့ၫဒၪယီၩ နမွဲယွၩလၧအမၩကဲၪထၪ့မူၭခိၪ, ဒဲဂၪ့ခိၪ,ဒဲမၫဆ",
			"25": "<sup>25</sup> မံၭဒဲဆၧအီၪလၧအဖၧၩ့ထီးအလူၬလီၫ.- နစံၭဆၧလၧ နခ့ၫနၡၩစဒၫဝံၭအနိၭ, မွဲဘၪနီၫလၧၦဆၨၩၥံၪတုၩ့ထၪ့တုၩ့လၩ့, ဒဲၦခမျၧးၥံၪကိၪ့ထၪ့ဖၭလၩ့ဆၧပျီၩပျီၩနီၪလဲၪ.",
			"26": "<sup>26</sup> ဂၪ့ခိၪအစဎွၩၥံၪအီၪက့ၪဆၧၫ့ထုၪ့အၥၭ, ဒဲၦဒိၪၦၡါၥံၪအီၪကိၩ့အီၪကီၪ့လစီၪ့ဎး, ထၫ့ဒုၪဒၩယွၩ, ဒဲအဎရံၬနီၪလီၫ.",
			"27": "<sup>27</sup> အဂဲးဘဲၫယီၩစဟ့ရၧၭ, ဒဲစပီၪ့တအၧၭပဲလၭ, ဒဲၦဆၨၩလဖၪ, ဒဲၦအံၫစရ့လၭဖိၪၥံၪနီၪအီၪကိၩ့အီၪ ကီၪ့တၭ, မွဲမၬ,အထၫ့ဒုၪဒၩၦလၧနဂုၪဝ့ၫနခ့ၫနၡၩဆံၫ့",
			"28": "<sup>28</sup> ဎံၪယ့ၫၡုၬ,- ဘဲၫၥိၭအမိမၩထီးဒၪနစူၪဒဲနဆၧကိၪ့",
			"29": "<sup>29</sup> စ့ၩရၫ့ဝဲၩလၧအမိမၩဝ့ၫလဖၪနီၪလီၫ.- ဘိၩ့နဲၪ့ယီၩ,",
			"30": "<sup>30</sup> ကဆါဧ့, အဝ့ၫၥံၪအဆၧချဲၩ့ၥၭမဲၪနီၪ,ယိခွါဆံၭ.- မွဲ နယူၬစိၩနစူၪ ဘဲၫၥိၭနမိမၩဘျၪထဲၩ့ဆၧစူၭဆၧဆၫ,ဒဲ ဒုၭမၩအၥၭလၧဆၧမၩနဲၪ့လၩ့လၭ, ဒဲဆၧလၩ့လိလၩ့ လၭလဖၪလၧနခ့ၫနၡၩ ဆံၫ့ဎံၪယ့ၫၡုၬအမံၩ့တၭ, ဖ့ၪ လၫ့နခ့ၫနၡၩၥံၪလၧအၥၭဒူၩဂုးဂုးခၧၫ့ခၧၫ့ ဘဲၫၥိၭ အမိလီၩလၩ့လၬလၩ့နလူနထၫဆံၭ.",
			"31": "<sup>31</sup> အဝ့ၫၥံၪဘၩဆိၪဖၪဆၧအဘိၩ့ဘၭနီၪ ဆၧအီၪကိၩ့ အီၪကီၪ့အလးနီၪဝၭဝ့ၫတၭ, ၦထီးအလူၬလၧၫ့ထၪ့ ဎွ့ၩထၪ့လၧၥၭမုဆံၫ့ဎံၪနီၪ လီၩလၩ့လၬလၩ့ယွၩအလူ အထၫလၧအၥၭဒူၩလီၫ.",
			"32": "<sup>32</sup> ၦခမျၧးလၧအနဲၩထဲၩ့ဝ့ၫလဖၪနီၪ အီၪဝ့ၫလၧအၥၭ လဖျိၪ့ဎးဒဲၥၭၡီၩ့လဖျိၪ့ဎးတၭ, ကယဲအစူၪလးအ ခၪ့ခိၪလဖၪနီၪမွဲအဆၧဒၪဝ့ၫစံၭဝ့ၫနးဂၩအ့ၬ. အဆၧ",
			"33": "<sup>33</sup> ထီးအလူၬနီၪမၩန့ဝ့ၫထီးဒၪအၥၭဆုၬဆုၬလီၫ.- ၦ ဆၧအၪ့မၧၫ့ဖိၪထိးအၥၭလၧ ကဆါယ့ၫၡုၬဂဲထုၪ့ထဲၩ့ အဂဲးလၧအစီၩ့ဒိၪအမၩ့ဒိၪလီၫ. တၭအဆၧခိးဒိၪ",
			"34": "<sup>34</sup> တၩဒိၪအီၪဝ့ၫလၧ အလီၩ့ထီးအလူၬလီၫ.- အဂဲး ဘဲၫယီၩၦလၧအဘၪၡၪ့ဘၪယၬအီၪလၧ အဝ့ၫၥံၪအ ကျၩနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩထီးဒၪၦလၧအအီၪလၧ ဂၪ့ခိၪအဝၩ့, ဂံၪ့ၥံၪဎၫ့ၥံၪနီၪအၪ့ဆၫခွံၬဝ့ၫတၭ, ဂဲၫဆိၬ",
			"35": "<sup>35</sup> ဆၧလၧအအၪ့ဆၫခွံၬဝ့ၫန့အဎွ့ၩနီၪ,- အီၪက့ၪလၩ့ဝ့ၫ လၧၦဆၧအၪ့မၧၫ့ဖိၪလဖၪနီၪ အခၪ့ထံၭလီၫ. ဘဲၫ ၦလဂၩဂၩကြၨၭန့ဘၪဆၧအလးအီၪဝ့ၫအၥိၭနီၪ အၪ့နၩ့ဖၭဖ့ၪလၫ့ဝ့ၫဆုၬဆုၬလီၫ.",
			"36": "<sup>36</sup> စယိၥၭလၧၦဆၧအၪ့မၧၫ့ဖိၪလဖၪနီၪ ကိၭထဲၩ့အမံၩ့ အၥၫ့စဘၫနဘၭ(ဘဲၫၦစံၭဆၧအၥိၭ, မၩမုၬဆၧအဖိၪ",
			"37": "<sup>37</sup> ခွၫ,) ၦလံဝဲၫဖိၪအီၪဖျဲၪလၧစဲပၧၭနီၪ,- အီၪလၧဆံၬၥံၪ နၩၥံၪ တၭ, အၪ့ဆၫခွံၬဝ့ၫနီၪ, ဂဲၫဆိၬအဎွ့ၩအီၪက့ၪလၩ့ဝ့ၫလၧ ၦဆၧအၪ့မၧၫ့ဖိၪလဖၪ အခၪ့ထံၭနီၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> အ့ၪမွဲၦလဂၩအမံၩ့ စအၫ့နနဲအၭဒဲအမၫနးစဖဲရၫ",
			"2": "<sup>2</sup> အၪ့ဆၫခွံၬအစူၪလးအခၪ့ခိၪ,- အဎွ့ၩနီၪမၩန့လၧအ ဂးဒၪဝ့ၫလနၩ့, ဒဲဂဲၫဆိၬလနၩ့နီၪ အီၪက့ၪလၩ့ဝ့ၫလၧ ၦဆၧအၪ့မၧၫ့ဖိၪလဖၪ အခၪ့ထံၭတၭ,အမၫၥ့ၪယၫ",
			"3": "<sup>3</sup> ဝ့ၫဒၪလီၫ.- စပံတၧၫစံၭဝ့ၫ,စအၫ့နနဲအၭဧ့, ဘဲၫၥိၭနမိ ချဲၩ့ဘျံၭချဲၩ့ဘျၪၥၭမုဆံၫ့ဎံၪနီၪ နအၪ့မၩန့ဂၪ့ခိၪလဝၩ့ အဎွ့ၩလၧနဂးဒၪနဝ့ၫလနၩ့တၭ, မွဲဘၪနီၫမုၪခီၩလဲး",
			"4": "<sup>4</sup> မၩဎွ့ၩထၪ့နၥၭနီၪလဲၪ.- လၧအအီၪလၧနစူၪဖၧၩ့နီၪ မွဲနဆၧဒၪနဝ့ၫ, မွဲအ့ၬဧၪ. လၧနအၪ့ဆၫခွံၬဝ့ၫနီၪမွဲအ အီၪဒံၭလၧနစီၩ့နမၩ့အဖၧၩ့, မွဲအ့ၬဧၪ.မွဲဘၪနီၫနကိၪ့ ထၪ့ဖၭလၩ့ ဆၧလဖၪယီၩ လၧနၥၭခံဖၧၩ့နီၪလဲၪ. မွဲ",
			"5": "<sup>5</sup> နလချဲၩ့ဘျံၭချဲၩ့ဘျၪဘၪၦၡၩနီၪ,မွဲယွၩလီၫ.- တၭ စအၫ့နနဲအၭနါဂၧၫ့ဆၧချဲၩ့နီၪလၩ့ထံၩဖါဝ့ၫတၭ,အ ၥၭစဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ. ၦလၧအနါဂၧၫ့ ဆၧလဖၪယီၩ,",
			"6": "<sup>6</sup> ဘၪဆၧၥၭမဲၪၥၭဖျဲၩ့ဒိၪမၬလီၫ.- ၦဖိၪၥၪခွၫလဖၪ ဂဲထုၪ့ဘီၪ့ထၪ့ဝ့ၫတၭ, လ့ၩဆိၬခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫဒၪ လီၫ.",
			"7": "<sup>7</sup> ဆၧမၩအၥၭဖိၭဘိၭၥၧၫ့နၩရံၩဖီၩ့ခွံၬနီၪ, အမၫလ ဂၩလၥ့ၪယၫဘၪဆၧမၩအၥၭတၭ, ဂဲၫနုၬဝ့ၫဒၪလီၫ.",
			"8": "<sup>8</sup> စပံတၧၫချဲၩ့ထၪ့စံၭအဝ့ၫ, နၥံၪအၪ့ဆၫခွံၬဂၪ့ခိၪအဝၩ့ အဎွ့ၩန့ၫအံၩန့ၫအိၩနီၪ, မွဲအ့ၬဧၪ, လီၩဘၪယၧၩဆံၭး",
			"9": "<sup>9</sup> အဝ့ၫဒၪစံၭဝ့ၫ, မွဲယူၭန့ၫနီၪလီၫ.- စပံတၧၫစံၭဝ့ၫ,မွဲဘၪ နီၫလၧနၥံၪအီၪက့ၪနၥံၪအၥၭလဖျိၪ့ဎးဘဲၫၥိၭနၥံၪ မိကျဲၩ့ဖစီၩ့ကဆါအၥၭမုနီၪလဲၪ, ယိခွါ, ၦၡၩၥံၪ အခၪ့လၧအလ့ၩခုၪ့လၩ့ဘၧၩ့ခွံၬနဝၩနီၪ အီၪလၧတရၫ့",
			"10": "<sup>10</sup> ထံၭတၭ,မိလ့ၩဆိၬခွံၬနၧၩဆ့လီၫ.- တၭအဝ့ၫဒၪလၩ့ ထံၩဖါဝ့ၫလၧအခၪ့ထံၭချဲၫ့မၬနီၪအၥၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လီၫ.ၦဖိၪၥၪခွၫလဖၪနီၪဂဲၫနုၬဝ့ၫတၭ, ဒၪဘၪလၧအ ၥံၫယူၭတၭ, လ့ၩဆိၬခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧအဝၩအ",
			"11": "<sup>11</sup> နဲၩ့ထံၭနီၪလီၫ.- ဆၧအီၪကီၪ့ထီးအလူၬ,ဒဲကယဲၦလၧ အနါဂၧၫ့ဆၧမၩအၥၭလဖၪနီၪ, ဘၪဆၧၥၭမဲၪဒိၪမၬ လီၫ.",
			"12": "<sup>12</sup> ဆၧမၩနဲၪ့လၩ့လၭဒဲ ဆၧလၩ့လိလၩ့လၭလဖၪအၪ မၬမၩအၥၭလၧၦဆၧအၪ့မၧၫ့ဖိၪၥံၪအစူၪဖၧၩ့လၧ ၦခမျၧးအကျၩလီၫ. အဝ့ၫၥံၪကိၭဂၩဒ့ၭအီၪလၧအၥၭ",
			"13": "<sup>13</sup> လဖျိၪ့ဎးလၧစစီလမၧၫ့အထိၬချိၫ့အဖၧၩ့လီၫ.- အ့ၪမွဲ ၦဂူၫဂၩလဖၪနီၪ နုၬလၧအဝ့ၫၥံၪအဖၧၩ့ဘုၪ့နးဂၩ အ့ၬ.မွဲလါနၫ့ဘိၩ, ၦခမျၧးအီၪက့ၪဒိၪအဝ့ၫၥံၪလီၫ.",
			"14": "<sup>14</sup> (ၦခမျၧးနဲၩထဲၩ့ဆၧဒဲမုၪဒဲခွၫနီၪ, ဆၧအီၪက့ၪအၪထၪ့",
			"15": "<sup>15</sup> ဝ့ၫလၧကဆါအဖၧၩ့အၪဂၩဆ့လီၫ.)- မၩအၥၭဘဲၫ နီၪတၭ,ၦဂဲၫဆိၬၦဘၪစူၭဘၪဆၫလဖၪ လၧဖၧၩ့ၥၭ တၭအီၪက့ၪလၩ့ဝ့ၫလၧအလးမံၫၥံၪဒဲ ချီၪၥံၪအဖၫ့ခိၪ, ဘဲၫၥိၭစပံတၧၫအ့ၪလ့ၩဆၧနီၪ အလၩၡုၪမိဘၪအဝ့ၫ",
			"16": "<sup>16</sup> ၥံၪလဂၩဂၩလီၫ.- ၦခမျၧးအီၪဝ့ၫ လၧဒိၩ့အီၪဝၬဖီၩ့ ဆၧနီၪဂဲၫန့ၦဘၪစူၭဘၪဆၫ, ဒဲၦလၧဆၧနၪအီၪလၧ အလီၩ့လဖၪတၭ,ထီၩ့လၧယရုစလံၫ့နီၪလီၫ. အဝ့ၫၥံၪ ဘၪဆၧမၩဘျၪထဲၩ့ဝ့ၫကိၭဂၩဒ့ၭလီၫ.",
			"17": "<sup>17</sup> ၦလုဆၧအခိၪ ဒဲၦအီၪဝ့ၫလၧအၥိၭထီးအလူၬလၧ အမွဲၦအစူၪ လလၩ့ဎုၬဘၪၦစၭဒုၫစံၫလဖၪဂဲထုၪ့",
			"18": "<sup>18</sup> တၭ,အၥၭထၪ့ဎွ့ၩဝ့ၫဒၪနီၪလီၫ.- အီၪက့ၪအစူၪလၧ ၦဆၧအၪ့မၧၫ့ဖိၪၥံၪအလီၩ့တၭ, ဒုၭလၩ့ဝ့ၫလၧၦခမျၧး အထီၫ့ဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> အ့ၪမွဲယွၩအၥီၫ့လဂၩ ဝဲထၪ့ထီၫ့အတရၫ့ၥံၪလၧမု",
			"20": "<sup>20</sup> နၩလခီၫတၭ, ၥိၫ့ထၪ့ခွံၬအဝ့ၫၥံၪတၭ, စံၭဝ့ၫဒၪ,- လ့ၩ ဘီၪ, ဆၧၫ့ထုၪ့လၧဆၧလုအဂံၪ့ဖၧၩ့နီၪ လီၩလၩ့လၬ လၩ့ၦခမျၧးၥံၪလၧဆၧမၧၫ့ယီၩအလူအထၫထီးအ",
			"21": "<sup>21</sup> လူၬဆံၭ.- အဝ့ၫၥံၪနါဂၧၫ့ဝ့ၫတၭ, လ့ၩနုၬလၧဆၧ လုအဂံၪ့ဖၧၩ့လၧဂီၩလခီၫ ဂီၩဂီၩလ့ၬတၭ, ၥီၪ့ထဲၩ့ၥၫ့ ထဲၩ့ဆၧလီၫ. အ့ၪမွဲၦလုဆၧအခိၪဒဲၦအီၪလၧအ ၥိၭလဖၪဂဲၫထီၩ့နီၪကိၭကီၪ့ၦကိၪ့လိၬဆၧ, ဒဲၦအံၫစရ့ လၭဖိၪအၥုၪ့က့ၭၥၭၡါထီးအလူၬတၭ, အၪ့မၧၫ့ၦၡၩ လ့ၩလၧထီၫ့ဖၧၩ့နီၪ ဂဲၫထဲၩ့န့ အဝ့ၫၥံၪ လၧအအီၪ",
			"22": "<sup>22</sup> လီၫ.- အခ့ၫအၡၩလ့ၩဆၧနီၪ, လဒၪလၧၩ့ဘၪအဝ့ၫ",
			"23": "<sup>23</sup> ၥံၪလၧထီၫ့ဖၧၩ့တၭ, ဂဲၫထဲၩ့လီၩဘၪဆၧ,- စံၭဝ့ၫဒၪ, မွဲမၬ,ပဒၪဘၪထီၫ့အတရၫ့ၥံၪ ကၭဘံၭထၬအၥၭခၧၫ့ ခၧၫ့လ့ၬ,ဒဲၦခိၭဆၧလဖၪ ဆၧၫ့ထုၪ့ဝ့ၫလၧတရၫ့အဂၩ့ ထံၭလၧခီၫ့လီၫ. မွဲလါနၫ့ပဝဲထၪ့နီၪ ပဒၪဘၪၦလၧထီၫ့ ဖၧၩ့နးဂၩအ့ၬ.",
			"24": "<sup>24</sup> ၦလုဆၧနီၪဒဲဆၧလုဂံၪ့အခိၪဒဲၦလုဆၧအဒိၪၥံၪ, ထီးအနါဂၧၫ့ဆၧချဲၩ့နီၪ, ဆၧနီၪလဖၪမိကဲၪထၪ့ဝ့ၫ လၧဆၧနီၫလဲၪနီၫလဲၪနီၪ, ထီၫမံၫထီၫမၪအၥၭလီၫ.",
			"25": "<sup>25</sup> ၦလဂၩဂဲၫလီၩဘၪအဝ့ၫၥံၪ, ယိခွါ, ၦလၧနၥံၪအီၪက့ၪ လၧထီၫ့ဖၧၩ့လဖၪနီၪ, ဆၧၫ့ထုၪ့ဝ့ၫလၧဆၧလုအဂံၪ့",
			"26": "<sup>26</sup> ဖၧၩ့တၭ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ၦခမျၧးလီၫ.-ထီးနီၪလဖၧၫ့ ၦအခိၪဒဲအခ့ၫအၡၩလဖၪနီၪ လ့ၩမၩန့ဂဲၫထဲၩ့ၥိၫ့အ ဝ့ၫၥံၪတၭ, မွဲအၥၭမဲၪၦခမျၧးမိခွံၬဘၪခိၬ လၧလိး",
			"27": "<sup>27</sup> တၭ,မၩဆီၪ့ဝ့ၫဒၪအ့ၬ.- ဂဲၫထဲၩ့ၥိၫ့အဝ့ၫၥံၪအီၪက့ၪ လၩ့ဝ့ၫလၧၦၥၭၡါအီၪကီၪ့အကျၩလီၫ. ၦလုဆၧအ",
			"28": "<sup>28</sup> ခိၪအၪ့စၪ့အဝ့ၫၥံၪ,- စံၭဝ့ၫ, ဘဲၫၥိၭနၥံၪထီးၥီၪ့ထဲၩ့ၥၫ့ ထဲၩ့ဆၧလၧအဝ့ၫဒၪအမံၩ့နီၪလဂ့ၩ, ပမၪလူၬနၥံၪလၩ့ ထံးလၩ့ဆ့ၭမွဲအ့ၬဧၪ. တၭ,ယိခွါ, မွဲနၥံၪမၩဎွ့ၩ ထၪ့ယရုစလံၫ့ လၧနၥံၪအဆၧၥီၪ့ဆၧၥၫ့နီၪ မိဒုၭလၩ့ ဘၪနၥံၪအၥၭလၧ ၦလဂၩနီၪအၥွံၪလၧပလီၩ့လီၫ.",
			"29": "<sup>29</sup> စပံတၧၫ,ဒဲဆၧအၪ့မၧၫ့ဖိၪလဖၪနီၪ ချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭဝ့ၫ, ပဘၪခိၭနၪယွၩနီၪအၪနဲၪ့ပခိၭနၪၦၡၩ",
			"30": "<sup>30</sup> ဒံၭလီၫ.- ပဖါၥံၪအယွၩဒုၭဂဲထုၪ့ထၪ့ထဲၩ့ယ့ၫၡုၬလၧ နၥံၪဖျၩထၪ့ မၩၥံၫဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့နီၪ",
			"31": "<sup>31</sup> လီၫ.- အဝ့ၫနီၪယွၩအီၪက့ၪထၪ့ထီၫဝ့ၫလၧအစူၪ ထွ့ၪဘဲၫၥိၭအမိကဲၪထၪ့ၦအခိၪ, ဒဲၦလၧအထိးထဲၩ့ တၩ့ထဲၩ့ဆၧ,ဘဲၫၥိၭအမိဖ့ၪ ဆၧနီၫ့ယါလၩ့ထဲၩ့ၥၭ, ဒဲဆၧလၧအကွဲၪဖျါၦဆၧဒဲၩဘၭလၧၦအံၫစရ့လၭဖိၪ",
			"32": "<sup>32</sup> လီၫ.- ပဝ့ၫဒၪယီၩပမွဲၦထိးအၥၭလၧဆၧနီၪလဖၪ အဂဲး,ဒဲၥၭမုဆံၫ့ဎံၪ လၧယွၩဖ့ၪလၫ့ၦလၧအခိၭနၪဝ့ၫ လဖၪနီၪ, မွဲဆၧထိးအၥၭဆ့လီၫ.",
			"33": "<sup>33</sup> အဝ့ၫၥံၪနါဂၧၫ့ဝ့ၫနီၪ အၥၭထၪ့နၭနၭလ့ၬတၭ,",
			"34": "<sup>34</sup> ကိၪ့လိၬအၥၭလၧအမိမၩၥံၫအဝ့ၫၥံၪလီၫ.- ၦၥီၪ့လိၪ ဆၧမၪလူၬနီၪအဂဲး, ၦဖၫရစံၫလၧၦခမျၧးထီးအလူၬ ယူၭယၪ့ဝ့ၫကိၭဝ့ၫအမံၩ့, စဂမၫလအ့လၭလဂၩဂဲ ထုၪ့ထၪ့လၧၦၥၭၡါအီၪကီၪ့အကျၩတၭ, မၪလူၬဝ့ၫ ဘဲၫၥိၭၦမိၥိၫ့ထၪ့ဆၧအၪ့မၧၫ့ဖိၪၥံၪ လၧခီၫ့နးဆိလီၫ.",
			"35": "<sup>35</sup> တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ၦအံၫစရ့လၭဖိၪၥံၪဧ့, နၥံၪ မၩၦၡၩနီၪဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ, ထီးလၩ့နၥံၪအၥၭ",
			"36": "<sup>36</sup> ဘီၪ.- အဂဲးဘဲၫယီၩလၧဆၧလချႃၭဘၪဒံၭဘၪ အနံၩ အၥၫ့ယီၩ စၥုဒၭလဂၩဂဲထုၪ့တၭ, စံၭလၩ့အၥၭလၧ အမွဲၦလဂၩတၭ ၦၡၩလဖၪဖိၭဘိၭလံယၩနုၬလၧအ ဖၧၩ့လီၫ. အဝ့ၫဒၪဘၪၥံၫဝ့ၫတၭ, ၦကိၭဂၩဒ့ၭထီးဒၪ ၦလၧအခိၭနၪဝ့ၫထီးအလူၬလဖၪနီၪ လၩ့မုလၩ့ဖၭ",
			"37": "<sup>37</sup> တၭ,ကဲၪထၪ့ဆၧနးမံၩ့အ့ၬ.- ဆၧယီၩအလးခဲၫ့လၧ ပဆ့ၭလၩ့ပမံၩ့အမုနံၩလဖၪနီၪ, ၦဂၫလလံၫဖိၪစယု ဒၭလဂၩဂဲထုၪ့ဝ့ၫဒၪတၭ, အၪ့လွ့ၫန့ၦခမျၧးဖၭဒိၪဖိၬ ထၪ့အခဲၫ့လီၫ. အဝ့ၫနီၪလဂၩဘၪဆၧဂၭဂီၩ့ဆ့,ဒဲ ၦကိၭဂၩဒ့ၭ, ထီးဒၪၦလၧအခိၭနၪဝ့ၫလဖၪနီၪ လၩ့မု လၩ့ဖၭဝ့ၫဒၪ ထီးအလူၬဆ့လီၫ.",
			"38": "<sup>38</sup> ဘိၩ့နဲၪ့ယီၩ ယလီၩဘၪနၥံၪ, မၩၦလဖၪယီၩလၧ ဆၧနးမံၩ့လဂ့ၩတၭ,အီၪဒၪဝ့ၫဘီၪ. အဂဲးဘဲၫယီၩ ဆၧကိၪ့ထၪ့ဖၭလၩ့ယီၩ ဒဲဆၧမၩယီၩအ့ၪကဲၪထၪ့လၧ",
			"39": "<sup>39</sup> ၦၡၩတၭ, မိဂၭဂီၩ့ဒၪအဆၧလီၫ.- အ့ၪဘၪဆဲၫ့လၧ ယွၩနီၪ, နၥံၪမၩဂၭဂီၩ့လၥ့ၪဘၪနီၪလကၭလၧၩ့း မွဲဘဲၫၥိၭနၥံၪထီးကဲၪထၪ့ၦဒုၭၥုၭထၫ့ဒုၪဒၩယွၩလဂ့ၩ တၭ,ထီးလၩ့နၥံၪအၥၭဘီၪ.",
			"40": "<sup>40</sup> အဝ့ၫၥံၪခိၭနၪအလူတၭ, ကိၭထဲၩ့ဆၧအၪ့မၧၫ့ဖိၪ လဖၪတၭ, ဒိၪဝ့ၫထးဝ့ၫဂီၩ့တၭ, မၪလူၬဝ့ၫဘဲၫၥိၭ အထီးလီၩလၩ့ ဆၧလၧယ့ၫၡုၬအမံၩ့လဂ့ၩတၭ, ကွဲၪဖျါခွံၬဝ့ၫဒၪလီၫ.",
			"41": "<sup>41</sup> အခိးမွဲအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧၦကိၪ့လိၬဆၧအမ့ၬ ယၫလၧဆၧၥုၪ့ထိၬၥၭထိၬနီၪ, အဂဲးဘဲၫယီၩမွဲဆၧ အီၪက့ၪလၩ့ဝ့ၫဘဲၫ ၦကြၨၭဘၪဆၧမ့ၬမဲလၧအဝ့ၫလ",
			"42": "<sup>42</sup> ဂၩအမံၩ့အကၠီၩ့နီၪလီၫ.- လအီၪထီဘၪတၭ,ၥီၪ့ထဲၩ့ ၥၫ့ထဲၩ့ဆၧ, ဒဲလီၩလၩ့လၬလၩ့ယ့ၫၡုၬဎရံၬ အဆၧၥၭ ထိၬအပရၧၫ့ လၧဆၧလုအဂံၪ့ဖၧၩ့ ဒဲလၧၦၡၩအဂံၪ့ ဖၧၩ့လဂံၪ့ဘၪလဂံၪ့,လဂံၪ့ဘၪလဂံၪ့ကိၭနံၩဒ့ၭလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> လၧမုနံၩလဖၪနီၪ အထံၩအဖျဲအၪထၪ့ဝ့ၫတၭ,ၦလၧ အချဲၩ့ဂြံစၭၥံၪအမုၪမဲၫလဖၪ ဘၪဆၧယိဖၬဝ့ၫလၧၥံၫ့ ၥံၫ့နံၩအဆၧလုအၪ့လုအီၩအဖၧၩ့တၭ, မွဲအၥူၭဝံၪၥူၭ",
			"2": "<sup>2</sup> လၩၦဟံဘြႃၫဖိၪၥံၪလီၫ.- ၦလဆံၫနံၫဂၩနီၪကိၭကီၪ့ အထံၩအဖျဲခမျၧးၥံၪတၭ, စံၭဝ့ၫဒၪ,ပစဲၪ့ဒၪယွၩအလူ",
			"3": "<sup>3</sup> အထၫနီၪ,မၩစပွဲၥံၪအဆၧမၩကြၨၭအ့ၬ.- မၩအၥၭ ဘဲၫနီၪတၭ, ဖုၥံၪဝဲၥံၪဧ့,ၦလၧအလၩအဖၩ့အီၪဝ့ၫဎွ့ၩ ထၪ့လၧၥၭမုဆံၫ့ဎံၪ ဒဲဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ လၧနၥံၪအ ကျၩနီၪ,ရွံန့ၦနွ့ၫဂၩဘဲၫၥိၭပမိအီၪက့ၪလၩ့ အဝ့ၫၥံၪ",
			"4": "<sup>4</sup> လၧဆၧမၩယီၩအဖၫ့ခိၪဆံၭ.- အ့ၪမွဲပဝ့ၫဒၪယီၩ ပမိ အၪ့ဂူၬကျ့ၭစၨၭ လၧဆၧဘၩဆိၪဖၪအဖၧၩ့, ဒဲဆၧအ လူအထၫအဆၧမၩထံၪဎးလီၫ.",
			"5": "<sup>5</sup> ဆၧချဲၩ့နီၪဘၪၦခမျၧးအၥၭတၭ, အဝ့ၫၥံၪရွံန့ၦလၧ အဎွ့ၩထၪ့လၧဆၧနဲၩ ဒဲၥၭမုဆံၫ့ဎံၪနီၪ,စတံဝံၫ့ဒဲ စဖံလံၭ,ဒဲစပြီၭခရၧၭ,ဒဲစနက့နၧၫ,ဒဲစတဲမၧၫ့, ဒဲစပၫမ နၭ,ဒဲၦလၧအနုၬဝ့ၫလၧၦယုဒၫဖိၪအထူၫအရူၫ ၦအၪ့",
			"6": "<sup>6</sup> တအီၭဖိၪ,စနံကလၭၥံၪ,- မွဲအအီၪက့ၪလၩ့ၦၡၩနီၪ လၧၦဆၧအၪ့မၧၫ့ဖိၪလဖၪ အမ့ၬယၫတၭ, အဝ့ၫၥံၪ ဘၩဆိၪဖၪဆၧတၭ, အီၪက့ၪအစူၪလၧအဝ့ၫၥံၪအ လီၩ့လီၫ.",
			"7": "<sup>7</sup> ယွၩအလူအထၫ ဂၧၫ့ထၪ့ၥၩလၩ့,ဒဲအထံၩအဖျဲ ၥံၪအၪထၪ့အၪအၪလ့ၬ လၧယရုစလံၫ့အဖၧၩ့တၭ, ၦ လုဆၧခမျၧးနဲၩထဲၩ့ဝ့ၫဆ့လီၫ.",
			"8": "<sup>8</sup> စတံဝံၫ့လၧၫ့ထၪ့ဎွ့ၩထၪ့လၧ ဆၧအခိးအတၩဒဲဆၧ စီၩ့ဆၧမၩ့တၭ, မၩဆၧလၩ့လိလၩ့လၭ ဒဲဆၧမၩနဲၪ့",
			"9": "<sup>9</sup> အလၩ့လၭဖၭဒိၪလၧၦခမျၧးအကျၩလီၫ.- ၦဘၪဆဲၫ့ လၧၥရိၬကိၭဝ့ၫ လၧလံဘတံၫ့ၥံၪ, ဒဲၦစဲၫရံနံၫဖိၪၥံၪ, ဒဲၦအလ့ၭစၪ့ဒၫဖိၪၥံၪ,ဒဲၦစလံၡၫဖိၪၥံၪ, ဒဲၦအ့ၡၫဖိၪ ၥံၪနီၪ,ဂဲထုၪ့တၭ, ဂဲးလိၬတ့ၭလိၬအၥၭ လၧစတံဝံၫ့",
			"10": "<sup>10</sup> လီၫ.- အဝ့ၫၥံၪပဒၩ့ထၬအဆၧကိၪ့ၥ့ၪ, ဒဲၥၭလၧအဒုၭ ချဲၩ့ဝ့ၫနီၪၥ့ၪအ့ၬ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪကိၭန့ၦထိးအၥၭအဘျံၭ အဘျၪလဖၪနီၪ, အဝ့ၫၥံၪစံၭ, အဝ့ၫဒၪလဂၩပနါဂၧၫ့",
			"12": "<sup>12</sup> အဒုၪဒွ့ၪ စမိစ့ၭ ဒဲယွၩလီၫ.- အဝ့ၫၥံၪထိၪဂဲၩထၪ့ၦ ခမျၧးဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪတၭ, ဂဲၫစိၩ လၧအအီၪနီၪဖီၪ့ထၬဝ့ၫတၭ, မီၩ့ဝ့ၫလၧၦၥၭၡါအဆၧ",
			"13": "<sup>13</sup> အီၪကီၪ့တၭ,- အီၪက့ၪလၩ့ၦထိးအၥၭ အဘျံၭအဘျၪ လၧအစံၭဝ့ၫၦလဂၩယီၩလအီၪထီဘၪ လၧအဒုၪဒွ့ၪ",
			"14": "<sup>14</sup> ဆၧအလးဆံၫ့ဎံၪယီၩဒဲဆၧမၪလူၬဆ့လီၫ.- အဂဲးဘဲၫ ယီၩပနါဂၧၫ့အစံၭလၧၦနၭဇရ့ၭဖိၪယ့ၫၡုၬနီၪ မိမၩ ဂၭဂီၩ့ခွံၬဆၧအလးယီၩ, ဒဲမိအၪ့လဲၩခွံၬပထူၫပရူၫ လၧစမိစ့ၭဖ့ၪလၫ့ပၧၩလီၫ.",
			"15": "<sup>15</sup> ကယဲၦဆၧၫ့နၩ့ လၧၦၥုၪ့က့ၭၥၭၡါၥံၪအဆၧအီၪ ကီၪ့အကျၩလဖၪနီၪ ယိဝ့ၫထံၫထံၫဆၭဆၭတၭ, ဒၪ ဘၪလၧအမ့ၬလၩ့ဂၬယွၩအၥီၫ့လဂၩအမ့ၬနီၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> ၦလုဆၧအခိၪစံၭဝ့ၫ, ဆၧနီၪလဖၪ မွဲဘဲၫနီၪၥိၭဆ့",
			"2": "<sup>2</sup> ဧၪ.- တၭအဝ့ၫနီၪစံၭဝ့ၫ, ၦထၧၫ့ဖုဝဲၥံၪ,ဒဲဖါၥံၪဧ့,ခိၭ နၪဆံၭ.လၧပဖါစအၫဘြဟၫ့ လချႃၭအီၪဝ့ၫလၧဟၫ ရၫ့နီၪ,ဆၧလၩဆၧဖၩ့ အယွၩအီၪထၪ့လၧအမ့ၬယၫ",
			"3": "<sup>3</sup> လၧမ့စိၫပတ့မၠၫအဖၧၩ့,- တၭစံၭအဝ့ၫဒၪ,စဲၪ့ထၪ့ခွံၬ လၧနထံၫနခး, ဒဲလၧနဘူၭနထံးအအီၪတၭ, လ့ၩထီၩ့",
			"4": "<sup>4</sup> လၧထံၫၥံၪခးၥံၪ လၧယမိဒုၭနဲၪအလးနီၪဘီၪ.- ထီးနီၪ လဖၧၫ့အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬဝ့ၫလၧ ခးခၫလဒံအၫတၭ, လ့ၩအီၪဝ့ၫလၧဟၫရၫ့တၭ, အဖါၥံၫဝ့ၫအလးခဲၫ့နီၪဆၧ ဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪ, ထီၩ့လၧခးလၧနၥံၪအီၪလၧအ",
			"5": "<sup>5</sup> ဖၧၩ့ဘိၩ့နဲၪ့ယီၩလီၫ.- ဆၧဖ့ၪလၫ့အန့ၥၫဆၧလၧအ ဖၧၩ့နးမံၩ့အ့ၬ. ကယဲခးယဲးအလးလစီၪ့နီၪ,လဖ့ၪလၫ့ ဘၪဝ့ၫလါနၫ့ဘိၩ,လၧစအၫဘြဟၫ့ လချႃၭထၪ့ဖိၪဒံၭ ဘၪနီၪ,ဆၧလီၩဘၪဝဲၩဝ့ၫလၧအမိဖ့ၪလၫ့ဝ့ၫလၧဆၧ န့ၥၫအလးဒဲအချံၫအၥၪ လၧအလးခဲၫ့အဂးနီၪဆ့လီၫ.",
			"6": "<sup>6</sup> ယွၩစံၭဝ့ၫဘိၩ့ယီၩ န ချံၫ န ၥၪ မိ ကဲၪ ၦ မွံၩ လၧ ၦ လ ခီၫဘၩ့ မုး အ ဖၧၩ့ တၭ, ၦ ၡၩ နီၪ မိ အၪ့ မၧၫ့ ဎီး ဝ့ၫ ဒဲ မၩ အၧၩ့ မၩ နၭ ဝ့ၫ အ နံၪ့",
			"7": "<sup>7</sup> လံ ယၩလီၫ.- ယွၩ စံၭ ဝ့ၫ ဒၪ, ၦ လၧ အ အၪ့ မၧၫ့ ဎီး အဝ့ၫ ၥံၪ လ ဆၨၩ နီၪ, ယ မိ စ့ၩ ရၫ့ ဝ့ၫ လီၫ. ဆၧ နီၪ အ လး ခဲၫ့ တၭ, အ ဝ့ၫ ၥံၪ မိ ဂဲၫ ထၪ့ တၭ, မိ မၩ ယ ဆၧ ထီး ယီၩလီၫ.",
			"8": "<sup>8</sup> တၭဆၧဖ့ၪလၫ့အဝ့ၫ လၧဆၧကူၭတရံၭအဆၧအုၩ့ လၩ့းဘဲၫၥိၭစအၫဘြဟၫ့ထၪ့ဖိၪစအံစၭတၭ, လၧ ဎိၭနံၩလနံၩအဖၧၩ့နီၪ, ကူၭတရံၭဝ့ၫလီၫ. စအံစၭနီၪ ထၪ့ဖိၪစယၫကူၭတၭ, စယၫကူၭနီၪထၪ့ဖိၪၦလဆံၫ နံၫဂၩလၧအကဲၪထၪ့ ၦလဆံၫနံၫဒီၪ့ အဖါၥံၪလီၫ.",
			"9": "<sup>9</sup> ၦလဆံၫနံၫဒီၪ့အဖါလဖၪနီၪၥၭခ့ၬဆၧတၭ,အၪ့ ဆၫလၩ့ခွံၬစယိၥၭ လၧခးအံဇံၭအဖၧၩ့ လါနၫ့ဘိၩ",
			"10": "<sup>10</sup> ယွၩအီၪလၧအၥိၭ,- မၩဖီၩ့မၩဖျ့ၭဝ့ၫလၧအဆၧၡၪ့ ဆၧနၭထီးအလူၬတၭ, ဖ့ၪလၫ့အခိးအတၩ ဒဲအဆၧ ကိၪ့ၥ့ၪလၧခးအံဇံၭ အစဎွၩဖၫရိၫအမ့ၬယၫတၭ, အ ဝ့ၫဒၪအီၪက့ၪထၪ့ဝ့ၫ လၧခးအံဇံၭအခိၪ, ဒဲအဂံၪ့ ထၧၫ့ဖျိၪ့ယၫအခိၪလီၫ.",
			"11": "<sup>11</sup> ဆၧၥၭဝံလၩ့ဒိၩ အီၪထၪ့လၧခးအံဇံၭအဖၧၩ့, ဒဲခးကၫနအၫ့အဖၧၩ့ ထၧၫ့ခးယၫတၭ, ဘၪၡၪ့ဘၪနၭ",
			"12": "<sup>12</sup> ဒိၪမၬနီၪ, ပဖါၥံၪဒၪန့ဆၧအၪ့ဆၧအီၩ အ့ၬ.- အ့ၪမွဲ စယၫကူၭနါဂၧၫ့ဝ့ၫလၧဘုၪၥံၪဂူၫၥံၪအီၪလၧခးအံဇံၭ အဖၧၩ့နီၪ, အၪ့မၧၫ့ပဖါၥံၪလ့ၩဆိၫဝ့ၫလီၫ.",
			"13": "<sup>13</sup> တၭနံၫဘျၩ့လဘျၩ့နီၪ, စယိၥၭဒုၭနဲၪအၥၭလၧ အထၧၫ့ဖုဝဲၥံၪ အမ့ၬယၫတၭ, စယိၥၭအဘူၭအထံး",
			"14": "<sup>14</sup> အီၪဖျီၪလၧဖၫရိၫအမ့ၬယၫလီၫ.- ထီးနီၪလဖၧၫ့ စယိ ၥၭအၪ့မၧၫ့ၦလ့ၩကိၭန့အဖါစယၫကူၭ, ဒဲအထၧၫ့ဘူၭ",
			"15": "<sup>15</sup> ထၧၫ့ထံးထီးအလူၬၥံၪနွ့ၫဆံၫယဲဂၩလီၫ.- စယၫ ကူၭလ့ၩထီၩ့လၧခးအံဇံၭအဖၧၩ့တၭ, အနၫ့ဆါဒၪဝ့ၫ,",
			"16": "<sup>16</sup> ဒဲပဖါၥံၪ ၥံၫထီးနီၪဆ့လီၫ.- ဘၪဆၧလ့ၩဆိၬ ခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫလၧဆၧၥွၪခိၪ လၧၡံခံၫ့အဖၧၩ့နီၪ, လၧ စအၫဘြဟၫ့ဎွ့ၩန့ဝ့ၫလၧစ့ၩလၧစၡံခံၫ့အဖါ စဟၫမီၫ အဖိၪခွၫလဖၪအစူၪဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> ထီးဆၧစံၭဝဲၩအထီ လၧယွၩဆိၪလၩ့အၥၭလၧ စအၫဘြဟၫ့နီၪအီၪဘူၭထၪ့ယူၭတၭ, ၦလဖၪနီၪအၪ",
			"18": "<sup>18</sup> ထၪ့ဂီထၪ့ဒဲအၪထၪ့လၧခးအံဇံၭအဖၧၩ့,- ထီးစဎွၩ အဂူၫဂၩလဂၩလၧအလၥ့ၪယၫဘၪ စယိၥၭဂဲထုၪ့ဝ့ၫ",
			"19": "<sup>19</sup> လီၫ.- အဝ့ၫလဂၩနီၪအၪ့လီၫန့ပဘူၭပထံးတၭ,မၩၡၪ့ မၩနၭပဖါၥံၪထီးအဘၪခွံၬၡိၭၥံၫခွံၬအဖိၪ အဆံၭၥံၪ ဘဲၫၥိၭအထီးမၧၫ့လၧၩ့လဂ့ၩလီၫ.",
			"20": "<sup>20</sup> လၧအထီထီးနီၪၦအခံးအဂၩ့ဂ့ၩဂ့ၩလ့ၬ, စမိစ့ၭလ ဂၩအီၪဖျဲၪဝ့ၫတၭ,ဘၪဆၧအၪ့လုဝ့ၫလၧအဖါအဂံၪ့",
			"21": "<sup>21</sup> ဖၧၩ့လၩၥၧၫ့ဘံၪ့လီၫ.- ထီးအဘၪဆၧခွံၬၡိၭခွံၬဝ့ၫ နီၪစဎွၩဖၫရိၫအဖိၪမုၪ အၪ့မၩန့ဝ့ၫတၭ, ယိထဲၩ့ခွါ ထဲၩ့ဝ့ၫလၧအဖိၪခွၫဒၪဝ့ၫအဂးလီၫ.",
			"22": "<sup>22</sup> စမိစ့ၭမၩလိၪၦအံဇံၭဖိၪအဆၧကိၪ့ဘၪကိၪ့ၥ့ၪထီး အလူၬတၭ, အီၪလၧအစီၩ့အမၩ့လၧဆၧချဲၩ့,ဒဲလၧ",
			"23": "<sup>23</sup> အဆၧမၩလဖၪလီၫ.- ထီးအၥၭမၧၫ့ဎွ့ၩထၪ့အနံၪ့လံ ဆံၫနီၪ,အၥၭအီၪထၪ့ဝ့ၫ လၧအမိလ့ၩအီၪၡီၩ့အ",
			"24": "<sup>24</sup> ထၧၫ့ဖုဝဲၦအံၫစရ့လၭဖိၪၥံၪလီၫ.- ဒၪဘၪၦလဂၩဘၪ ဆၧလတီၩလလီၩ့ဘၪနီၪ မၩဘိၭမၩဆၧၩ့ဝ့ၫတၭ, ၦလၧအဘၪဆၧမၩအၧၩ့ဝ့ၫလဂၩနီၪ, စ့ၩရၫ့တီၩန့ဝ့ၫ",
			"25": "<sup>25</sup> တၭ,ဖ့ၬၥံၫခွံၬၦအံဇံၭဖိၪလဂၩနီၪလီၫ.-မွဲအဆီၫ့မီၪ့ ဝ့ၫလၧအထၧၫ့ဖုဝဲၥံၪ မိနၪၥ့ၪလၧယွၩမိမၩဖီၩ့မၩဖျ့ၭ အဝ့ၫၥံၪလၧအစူၪဖၧၩ့လီၫ. မွဲလါနၫ့ဘိၩအဝ့ၫၥံၪနၪဝ့ၫ ၥ့ၪအ့ၬ.",
			"26": "<sup>26</sup> ကဲဂီၩလနံၩဒီၭနီၪၦထၫ့ဒုၪဒၩလိၬအၥၭအဘိၩ့ဘၭ နီၪအဝ့ၫဒၪဒုၭနဲၪအၥၭလၧအဝ့ၫၥံၪ, ပဂၨၪထၪ့အခဲၫ့ ဘဲၫၥိၭအမိအီၪဘၪလိၬအိၭလိၬဝ့ၫနီၪ, စံၭ ဝ့ၫ, ၦ ၡၩ ၥံၪ ဧ့, န ၥံၪ မွဲ ထၧၫ့ ဖု ဝဲ လီၫ. မွဲ ဘၪ နီၫ လၧ န ၥံၪ မၩ လိၬ န ၥံၪ အ ၥၭ လၧ ဆၧ လ တီၩ လ",
			"27": "<sup>27</sup> လီၩ့ ဘၪ နီၪ လဲၪ ၦ လၧ အ မၩ အ တ ခွၫ လ တီၩ လ လီၩ့ ဘၪ လ ဂၩ နီၪ, ဆၪ့ ခွံၬ ဝ့ၫ တၭ, စံၭဝ့ၫဒၪ, မွဲ ပလၫ အီၪ က့ၪနၧၩလၧၦဒိၪၦၡါ, ဒဲ ၦ စ့ၩ ရၫ့ ခွး လၧ ပဖၫ့ခိၪလဂၩလဲၪ.- ဘဲၫ န မၩ ၥံၫ ၦ အံ ဇံၭ ဖိၪလၧမုဂၪ",
			"28": "<sup>28</sup> အ ၥိၭ နီၪ, မွဲ န မိ မၩ ၥံၫ ယၧၩ ဆ့ ဧၪ.- စမိစ့ၭစဲၪ့ထၪ့ခွံၬဝ့ၫ",
			"29": "<sup>29</sup> လၧဆၧချဲၩ့နီၪအကၠီၩ့တၭ, လ့ၩကဲၪၦမွံၩ လၧခးမံဒၠၫ့တၭ, ထၪ့ဖိၪအဖိၪခွၫထီးနီၪနံၫဂၩလီၫ.",
			"30": "<sup>30</sup> ထီးအနံၪ့လံဆံၫဎွ့ၩထၪ့နီၪ,ယွၩအၥီၫ့လဂၩအီၪ ထၪ့လၧအမ့ၬယၫလၧဆၧၡိၬကျၩ လၧမ့ၪလၪအဖၧၩ့",
			"31": "<sup>31</sup> လၧခိၪလီၩ့စဲနၫအမံၩ့လၬကျၩလီၫ.- ထီးစမိစ့ၭဒၪဘၪ ဝ့ၫနီၪ, ထီၫမံၫထီၫမၪဝ့ၫ လၧဆၧဖျီၪထၪ့အကၠီၩ့တၭ, လၧအၥုၭဘူၭအၥၭဘဲၫၥိၭ အမိယိထံၫယိဆၭဆၧအ ဘိၩ့ဘၭနီၪ, ကဆါအလူလၩ့ဘၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ,",
			"32": "<sup>32</sup> ယ ဝ့ၫ ဒၪ ယီၩ ယ မွဲ န ဖါ ၥံၪ အ ယွၩ,စ အၫ ဘြ ဟၫ့ အ ယွၩ, ဒဲ စ အံ စၭ အ ယွၩ, ဒဲ စ ယၫ ကူၭ အ ယွၩ လီၫ. စ မိ စ့ၭ ဝၭ ထိၬ ဝၭ တ့ၭ, ယိဝ့ၫအမ့ၬလဘုၪ့ဘၪလီၫ.",
			"33": "<sup>33</sup> က ဆါ လီၩ ဘၪ ဝ့ၫ ဘဲၪ့ လၩ့ ခွံၬ န ခၪ့ ဖံၭ လၧန ခၪ့ လီၩ့ နီၪ ဘီၪ , အဂဲး ဘဲၫ ယီၩ ဆၧ လၧ အ လး လၧ န ဆၧၫ့ ထုၪ့ နီၪ မွဲ ဂၪ့ ခိၪ ဆံၫ့",
			"34": "<sup>34</sup> ဎံၪ လီၫ.- ယ ခ့ၫ ယ ၡၩ ဘၪ ဆၧ မၩ အၧၩ့ မၩ နၭ ဝ့ၫ လၧ ခး အံ ဇံၭ အ ဖၧၩ့ နီၪ, ယ ဒၪ ဘၪ တ ၡါ ယူၭ ဒဲ အ ဂၪ့ အုၩ ဂၪ့ ထိၬ ဆၧ နီၪ ယ နါ ဂၧၫ့ ယူၭ, ယ ဂဲၫ လၩ့ ဘဲၫ ၥိၭ ယ မိ မၩ ဖီၩ့ မၩ ဖျ့ၭ အ ဝ့ၫ ၥံၪ လီၫ. ဘိၩ့ နဲၪ့ ယီၩ ဂဲၫ ဘီၪ, ယ မိ အၪ့ မၧၫ့ န လ့ၩ လၧ ခး အံ ဇံၭ အ ဖၧၩ့ လီၫ.",
			"35": "<sup>35</sup> စမိစ့ၭလဂၩယီၩၦခွံၬၡိၭဝ့ၫတၭ, စံၭဝ့ၫ,မွဲပလၫအီၪ က့ၪနၧၩလၧၦဒိၪၦၡါ, ဒဲၦစ့ၩရၫ့ခွးလဂၩလဲၪနီၪး မွဲ ယွၩအီၪက့ၪအဝ့ၫဒၪလၧၦဒိၪၦၡါ, ဒဲၦထိးထဲၩ့တၩ့ ထဲၩ့ဆၧလၧအၥီၫ့လၧအအီၪက့ၪထၪ့လၧအမ့ၬယၫ,လၧ",
			"36": "<sup>36</sup> ဆၧၡိၬကျၩလဂၩအစူၪဖၧၩ့လီၫ.- အဝ့ၫဒၪၥိၫ့ထၪ့ခွံၬ အဝ့ၫၥံၪတၭ, မၩဆၧလၩ့လိလၩ့လၭ, ဒဲဆၧလၩ့ လၭအဆၧမၩနဲၪ့လၧခးအံဇံၭအဖၧၩ့, ဒဲလၧမၫဆမံၭ ဝီၩအဖၧၩ့, ဒဲလၧၡါမုနၧၫ့ဖၫအဖၧၩ့ အနံၪ့လံဆံၫ လီၫ.",
			"37": "<sup>37</sup> စမိစ့ၭလဂၩနီၪမွဲၦလၧအစံၭၦအံၫစရ့လၭဖိၪ, ယွၩ မိ ဒုၭ ဂဲ ထုၪ့ န့ န ၥံၪ လၧ မီၪ လ ဂၩ လၧ န ၥံၪ အ ထၧၫ့ ဖု ဝဲ အ ကျၩ ဘဲၫ ယၧၩ ယီၩ အ ၥိၭ လီၫ. အ ဝ့ၫ နီၪ န ၥံၪ ဘၪ ခိၭ နၪ အ လူ လီၫ.",
			"38": "<sup>38</sup> အဝ့ၫလဂၩနီၪမွဲၦလၧအအီၪ လၧဆၧအီၪကီၪ့လၧ ၡါမုနၧၫ့ဖၫလၧအၥီၫ့အၥိၭလၧအချဲၩ့ဒုၪ့ဝ့ၫလၧခိၪ လီၩ့စဲနၫတၭ, အီၪလၧပဖါၥံၪအၥိၭး ဒဲအဒိၭန့ဆၧ",
			"39": "<sup>39</sup> လူမၧၫ့ဘဲၫၥိၭ အမိဖ့ၪလၫ့ပၧၩယီၩလီၫ.- အဝ့ၫ နီၪပဖါၥံၪခိၭနၪဝ့ၫအ့ၬ. အဝ့ၫၥံၪဆၪ့ခွံၬဝ့ၫတၭ, လၧ အၥၭခံဖၧၩ့ ထဲၩ့ထဲၩ့ဒီၭ လၧခးအံဇံၭ အဖၧၩ့နီၪ,",
			"40": "<sup>40</sup> စံၭ စအၫရၧၫ့,မၩ ကဲၪ ထၪ့ န့ ပ က ဆါ လ ဖၪ လၧ အ မိ လ့ၩ လၧ ပ မ့ၬ ယၫ ဘီၪ, အ ဂဲး ဘဲၫ ယီၩ စ မိ စ့ၭ လၧ အ ၥိၫ့ ထၪ့ ခွံၬ ပၧၩ လၧ ခး အံ ဇံၭ လ ဂၩ နီၪ, မွဲ အ ဘၪ ဆၧ နီၫ လ မံၩ့ လဲၪ နီၪ, ပ ၥ့ၪ ယၫ အ့ၬ.",
			"41": "<sup>41</sup> လၧမုနံၩလဖၪနီၪ, အဝ့ၫၥံၪမၩကဲၪထၪ့ ချီဖိၪလ ဒုၩတၭ,လုထၪ့ဆၧဂၩ့နီၪ မုၬလၩဝ့ၫလၧဆၧလၧအ",
			"42": "<sup>42</sup> မၩဝ့ၫလၧအစူၪလီၫ.- ယွၩကၠၪဒိၭချိၫ့ခွံၬအၥၭ ဒဲခွံၬ ၡိၭခွံၬအဝ့ၫၥံၪထီးအဘၩထၪ့မူၭခိၪအၥုၭမုဘဲၫ ဆၧကွ့ၭအၥၭလၧ မီၪလဖၪအလံၬဖၧၩ့အၥိၭနီၪလီၫ. အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, လၧၡါမုနၧၫ့ဖၫနီၪအနံၪ့လံဆံၫယၫ, မွဲနၥံၪဂဲၫဆိၬန့ယၧၩလၧဆၧမၩၥံၫခွံၬ, ဒဲဆၧလုၥံၪဆ့ဧၪ.",
			"43": "<sup>43</sup> ဒဲနၥံၪဆိၬထၪ့မိလ့ၬအတဲၩ, ဒဲနၥံၪအကဆါရံၫ့ဖၫ့အၡၪလီၫ. အဝ့ၫၥံၪမွဲဆၧဂၩ့လၧနၥံၪမၩဘဲၫၥိၭ, နၥံၪမိဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫလီၫ. တၭယမိလ့ၩဆိၬခွံၬနၥံၪလၧ ဘၭဘလၧၫ့ဝါလခီၫ လီၫ.",
			"44": "<sup>44</sup> ပဖါၥံၪအီၪလၧဆၧထိးအၥၭအတဲၩ လၧၡါမုနၧၫ့ဖၫ ဘဲၫၦလၧအချဲၩ့ဆၧ လၧစမိစ့ၭလဂၩမၪလူၬဝ့ၫအ ၥိၭနီၪ,ဘဲၫၥိၭအမိမၩဘဲၫအဒီၩ့ လၧအဒၪဘၪဝ့ၫအ",
			"45": "<sup>45</sup> ၥိၭနီၪလီၫ.- ပဖါၥံၪဒိၭန့ဝ့ၫ,ဒဲဂဲၫၥိၫ့န့ဝ့ၫလၧစယီ ၡုၫအ့ၫအၥိၭလၧၦဆၨၩလဖၪ အဆၧန့ၥၫအဖၧၩ့း ၦၡၩၥံၪနီၪယွၩနၫ့ထၪ့ခွံၬဝ့ၫ လၧပဖါၥံၪအမ့ၬယၫ",
			"46": "<sup>46</sup> ထီၩ့လၧစဒၫဝံၭ အမုနံၩလဖၪနီၪလီၫ.- အဝ့ၫဒၪဘၪ ယွၩအခိးအတၩတၭ, အၪ့ကံၩ့လၧအဂးဒၪဝ့ၫ ဘဲၫ",
			"47": "<sup>47</sup> ၥိၭအမိဒၪန့စယၫကူၭအယွၩအတဲၩလီၫ.- မွဲလါနၫ့",
			"48": "<sup>48</sup> ဘိၩစစီလမၧၫ့ၥုၪ့အဂံၪ့လီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ဆၧထီၫထုၬလဂၩ အီၪဝ့ၫလၧဂံၪ့လၧၦၡၩမၩလၧအ စူၪနီၪမွဲအ့ၬ. ဘဲၫမီၪၥံၪစံၭဝ့ၫအၥိၭ,",
			"49": "<sup>49</sup> မူၭခိၪမွဲယလးဆီၩ့ဆီ, ဒဲဂၪ့ခိၪမွဲယခၪ့ယဲးလၩ့အလးလီၫ. နၥံၪမိမၩဂံၪ့လၧယဂးဘဲၫၥ့ၪလဲၪ, ကဆါစံၭဝ့ၫဒၪ. ယအီၪပွံၭအလးမွဲဆၧနီၪလမံၩ့လဲၪ.",
			"50": "<sup>50</sup> ဆၧထီးအလူၬယီၩ, မွဲယမၩလၧယစူၪအ့ၬဧၪ.",
			"51": "<sup>51</sup> ၦအခိၬဆီၪ့ဒဲအၥၭဒဲအနါလဘၪဘၪ ဆၧကူၭတ ရံၭၥံၪဧ့,နၥံၪထၫ့ဒုၪဒၩၥၭမုဆံၫ့ဎံၪထံၪဎး, ဘဲၫနၥံၪ",
			"52": "<sup>52</sup> အဖါၥံၪမၩဝ့ၫအၥိၭနီၪမွဲနၥံၪမၩဆ့လီၫ.- မီၪလၧနၥံၪ အဖါၥံၪလမၩအၧၩ့မၩၥၫ့ဘၪနီၪမွဲဂၩဂၩလဲၪ.အ ဝ့ၫၥံၪမၩၥံၫၦလၧအလီၩဘၪဝဲၩဝ့ၫလၧ ၦအတီၩအ လီၩ့မိဂဲၫဝ့ၫ အဂဲးအကၠီၪ့နီၪ, ၦလဂၩလၧနၥံၪဝ့ၫဒၪ ယီၩဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ, နၥံၪဖ့ၪလၫ့ခွံၬ, ဒဲမၩၥံၫခွံၬ",
			"53": "<sup>53</sup> ဝ့ၫဒၪဆ့လီၫ.- နၥံၪဝ့ၫဒၪယီၩနၥံၪဒိၭန့ဆၧအလူအထၫ လၧယွၩအၥီၫ့ၥံၪအီၪက့ၪဝ့ၫလါနၫ့နီၪ နၥံၪထီးန့",
			"54": "<sup>54</sup> အ့ၬ.- ထီးအဝ့ၫၥံၪနါဂၧၫ့ဆၧလဖၪနီၪ, အၥုၪ့ထၪ့အၥၭ ထၪ့နၭနၭလ့ၬအဲၪ့ဎံၬအမဲၪလၧအလီၩ့လီၫ.",
			"55": "<sup>55</sup> အ့ၪမွဲအဝ့ၫနီၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧၥၭမုဆံၫ့ဎံၪ တၭ,ယိထၪ့ဆၧလၧမူၭခိၪ ထံၫထံၫဆၭဆၭတၭ, ဒၪ ဘၪယွၩအလၩအဖၩ့, ဒဲယ့ၫၡုၬအီၪဆၧၫ့ထုၪ့လၧယွၩ",
			"56": "<sup>56</sup> အစူၪထွ့ၪ,- စံၭဝ့ၫ,ယိခွါ,ယဒၪဘၪမူၭခိၪဝဲထၪ့အ ၥၭတၭ,ၦၡၩအဖိၪခွၫဆၧၫ့ထုၪ့လၧယွၩအစူၪထွ့ၪ",
			"57": "<sup>57</sup> လီၫ.- အ့ၪမွဲအဝ့ၫၥံၪကိၭၡၭထၪ့ဝ့ၫလၧ အလူဖၭဒိၪ, ဒဲမၩဘံၭထၬအနါတၭ, လ့ၩစဲၪ့တလဲးဝ့ၫလၧအအီၪ,",
			"58": "<sup>58</sup> နၫ့ထၪ့ခွံၬဝ့ၫလၧဒိၩ့အချိၫ့တၭ, ခွံၬဝ့ၫလၧလိးလီၫ. ၦၡၩထိးအၥၭလဖၪနီၪအီၪက့ၪလၩ့အကီၩ့အၥိၭ လၧၦဖိၪၥၪခွၫလဂၩကိၭဝ့ၫအမံၩ့လၧစစီလူၫအခၪ့",
			"59": "<sup>59</sup> ထံၭလီၫ.- အဝ့ၫၥံၪခွံၬဝ့ၫလၧလိးအဘိၩ့ဘၭနီၪ စတံဝံၫ့ ဘၩဆိၪဖၪဆၧတၭ,စံၭဝ့ၫ,ကဆါယ့ၫၡုၬဧ့, ထိးဆၧၫ့",
			"60": "<sup>60</sup> ယၥၭဆံၭ.- ချံၭလၩ့အခၪ့တၭ, ကိၭၡၭထၪ့လၧ အလူၥီၫဖၭဒိၪ, ကဆါဧ့, ဆၧမၪယီၩထီးအီၪက့ၪလၧ အဝ့ၫၥံၪအလီၩ့လဂ့ၩ, စံၭဝ့ၫဘဲၫနီၪတၭ, မံၫဝ့ၫဒၪလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> အဝ့ၫဒၪၥံၫဝ့ၫနီၪဘၪစစီလူၫအၥၭလီၫ. လၧမုလ နံၩနီၪဆၧမၩအၧၩ့မၩနၭဆၧအီၪကီၪ့ၥံၪ လၧယရုစလံၫ့ အဖၧၩ့နၭမၬတၭး ၦထီးအလူၬနီၪလၩ့မုလၩ့ဖၭဎံၩ့ ခးယုဒၫဒဲ ခးစမ့ရအၫလီၫ. အီၪလၩ့ထးဒံၭ န့ၫၦဆၧ",
			"2": "<sup>2</sup> အၪ့မၧၫ့ဖိၪလဖၪလီၫ.- ၦလၧအယူၭယၪ့ယွၩလဖၪ လ့ၩဆိၬခွံၬစတံဝံၫ့ဘဲၫၥိၭ အမိခုၪ့လၩ့ဘၧၩ့ဝ့ၫတၭ, ဂၪ့",
			"3": "<sup>3</sup> ဆၧယၧၩ့ဆၧလၧအကၠီၩ့ဒိၪမၬလီၫ.- အ့ၪမွဲစစီလူၫလ ဂၩနီၪမၩဂၭဂီၩ့ဆၧအီၪကီၪ့တၭ, လ့ၩနုၬဝ့ၫလၧဂံၪ့ဖၧၩ့ လဂံၪ့ဘၪလဂံၪ့လဂံၪ့ဘၪလဂံၪ့တၭ, မီၩ့ၦမုၪၥံၪဒဲၦခွၫ ၥံၪဒူၭလၩ့အဝ့ၫၥံၪလၧထီၫ့ဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအလၩ့မုလၩ့ဖၭလဖၪ လ့ၩလီၩ့လၩ့လၬလၩ့ဆၧအလူအထၫဎံၩ့ဎံၩ့လ့ၬလီၫ.",
			"5": "<sup>5</sup> စဖံလံၭ လ့ၩလၩ့လၧဒိၩ့အီၪဝ့ၫ လၧစမ့ရအၫအဖၧၩ့ နီၪ,လီၩလၩ့လၬလၩ့အဝ့ၫၥံၪ လၧဎရံၬအဂဲးလီၫ.",
			"6": "<sup>6</sup> ၦခမျၧးနါဂၧၫ့ဆၧတၭ, ဒၪဘၪဆၧလၩ့လၭလၧစဖံလံၭ",
			"7": "<sup>7</sup> မၩဝ့ၫနီၪခိၭနၪအလူလၧအၥၭလဖျိၪ့ဎးလီၫ.- အဂဲး ဘဲၫယီၩဆၧနၪအီၪဝ့ၫလၧၦအၪဂၩအလီၩ့ကိၭၡၭထၪ့ ဝ့ၫလၧအလူဖၭဒိၪတၭ,စဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ. ၦၥံၫလခီၫ ဖၩ,ဒဲၦအခၪ့ဂၭဂီၩ့ၥံၪ, ဘျၪထဲၩ့ဝ့ၫဒၪအၪဂၩလီၫ.",
			"8": "<sup>8</sup> ဆၧၥၭထိၬဖၭဒိၪအီၪထၪ့ဝ့ၫလၧ ဒိၩ့လစီၪ့နီၪအဖၧၩ့ လီၫ.",
			"9": "<sup>9</sup> ၦလဂၩလၧအမံၩ့ မွဲစစဲမၧၫ့အီၪဝဲၩဝ့ၫ လၧဒိၩ့နီၪအ ဖၧၩ့မၩကဒၩၦမ့ၬတၭ,စံၭလၩ့အၥၭလၧအမွဲၦဒိၪဖၭ ဒိၪလဂၩတၭ, မၩထီၫမံၫထီၫမၪၦစမ့ရအၫဖိၪအၥၭ",
			"10": "<sup>10</sup> လီၫ.- ၦထီးအလူၬအဒိၪအဆံၭၥံၪခိၭနၪအလူတၭ, စံၭဝ့ၫ,အဝ့ၫလဂၩယီၩ အီၪလၧယွၩအစီၩ့အမၩ့ဒိၪဝ့ၫ",
			"11": "<sup>11</sup> ထီၫဝ့ၫလီၫ.- လၧအဆၧအူၪဆၧပီၩၥံၪ, ဒဲလၧအမၩက ဒၩၦမ့ၬယံၬယံၬယူၭ အကၠီၩ့နီၪ, အဝ့ၫၥံၪခိၭနၪအ",
			"12": "<sup>12</sup> လူလီၫ.- အ့ၪမွဲထီးၦနဲၩထဲၩ့ စဖံလံၭလီၩလၩ့လၬလၩ့ ယွၩအဘၩ့အမုးအဆၧၥၭထိၬအပရၧၫ့, ဒဲယ့ၫၡုၬ ဎရံၬအမံၩ့အဂဲးတၭ, ဒိၭဘၭတံၫဇၫ့အၥၭဒဲ မုၪဒဲခွၫ",
			"13": "<sup>13</sup> လီၫ.- စစဲမၧၫ့အနၫ့ဆါဒၪဝ့ၫ နဲၩထဲၩ့ဝ့ၫတၭ, ဒိၭဘၭ တံၫဇၫ့အၥၭဂီၩ့နီၪ အီၪဝ့ၫလၧစဖံလံၭအၥိၭ, ယိဆၧ မၩနဲၪ့လၩ့လၭဒဲဆၧလၩ့လိလၩ့လၭ လၧအဒိၪအထီၫ ဝ့ၫလၧအမၩအၥၭနီၪ ထီၫမံၫထီၫမၪဝ့ၫလီၫ.",
			"14": "<sup>14</sup> ထီးၦဆၧအၪ့မၧၫ့ဖိၪ လၧယရုစလံၫ့အဖၧၩ့လဖၪနီၪ နါဂၧၫ့လၧၦစမ့ရအၫဖိၪ ထိးဆၧၫ့ယွၩ အလူအထၫ တၭ,အၪ့မၧၫ့စပံတၧၫ, ဒဲစယီဟၫ့လ့ၩလၧအအီၪလီၫ.",
			"15": "<sup>15</sup> ထီးအဝ့ၫၥံၪဂဲၫလၩ့နီၪ ဘၩဆိၪဖၪန့ဝ့ၫ အဂးဘဲၫၥိၭ",
			"16": "<sup>16</sup> အမိဒိၭန့ၥၭမုဆံၫ့ဎံၪနီၪလီၫ.- အဂဲးဘဲၫယီၩၥၭမုဆံၫ့ ဎံၪနီၪဂဲၫလၩ့ဒံၭ လၧအလီၩ့နးဂၩဒံၭအ့ၬ. အဝ့ၫၥံၪ ဒိၭန့ကယဲဆၧဒိၭဘၭတံၫဇၫ့အၥၭလၧ ကဆါယ့ၫၡုၬ",
			"17": "<sup>17</sup> အမံၩ့အဖၧၩ့နီၪလီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪအီၪ က့ၪထၪ့အစူၪလၧၦလဖၪနီၪအလီၩ့တၭ,မွဲအဒိၭန့ ၥၭမုဆံၫ့ဎံၪလီၫ.",
			"18": "<sup>18</sup> ထီးစစဲမၧၫ့ဒၪဘၪဝ့ၫလၧ ၦဆၧအၪ့မၧၫ့ဖိၪလဖၪအီၪ က့ၪအစူၪလၧၦလဖၪနီၪအလီၩ့တၭ, ဆၧဖ့ၪလၫ့ၥၭမု ဆံၫ့ဎံၪနီၪ,အဝ့ၫဒၪဂဲၫဆိၬကျိၪၥံၪစ့ၩၥံၪလၧအအီၪ,",
			"19": "<sup>19</sup> တၭစံၭဝ့ၫ, ဘဲၫၥိၭထီးဒၪၦလဂၩလါလါ လၧယ အီၪက့ၪယစူၪလၧအလီၩ့နီၪ မိဒိၭန့ၥၭမုဆံၫ့ဎံၪတၭ,",
			"20": "<sup>20</sup> ဖ့ၪလၫ့ယၧၩဆ့လၧဆၧစီၩ့ဆၧမၩ့ယီၩဆံၭ.- စပံတၧၫ စံၭအဝ့ၫ, မွဲနဆီၫ့မီၪ့လၧယွၩအဆၧဖ့ၪလၫ့နီၪ နမိဎွ့ၩ န့လၧစ့ၩအကၠီၩ့တၭ, မွဲနစ့ၩဘၪဆၧဂၭဂီၩ့ဎုၬလၧ",
			"21": "<sup>21</sup> နၥိၭဆံၭ.- နဝ့ၫဒၪယီၩနဘၪဆဲၫ့လၧဆၧယီၩလမံၩ့ နးဆံၬအ့ၬ.- အဂဲးဘဲၫယီၩနၥုၪ့နၥၭလတီၩလလီၩ့ဘၪ",
			"22": "<sup>22</sup> လၧယွၩအမ့ၬယၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နီၫ့ ယါလၩ့ထဲၩ့နၥၭလၧ နဆၧအၧၩ့ဆၧၥၫ့ယီၩတၭ, အၪ့ ကံၩ့အၪ့ယၫယွၩဆံၭ. ဘၪလဘၪဆၧမိမၩဖီၩ့မၩ",
			"23": "<sup>23</sup> ဖျ့ၭနၥၭအဆၧဆီၫ့မီၪ့လီၫ.- အဂဲးဘဲၫယီၩလၧယဒၪ ဘၪလၧနအီၪလၧဒံၩအခၪ,ဒဲဆၧလတီၩဘၪအဖျံၩ",
			"24": "<sup>24</sup> စၧၩ့ထၬအဖၧၩ့လီၫ.- စစဲမၧၫ့ချဲၩ့ဆၧၫ့ဆၧ စံၭအ ဝ့ၫ,နၥံၪဝ့ၫဒၪယီၩအၪ့ကံၩ့ဘၩဆိၪဖၪန့ယဂးလၧ ယွၩဆံၭ.မွဲဘဲၫၥိၭ နၥံၪစံၭဆၧနီၪ ထီးထီၩ့လၩ့ဘၪ လၧယလီၩ့နးမံၩ့လဂ့ၩလီၫ.",
			"25": "<sup>25</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးအဝ့ၫၥံၪထိးယူၭအၥၭ, ဒဲလီၩလၩ့လၬလၩ့ယူၭယွၩအလူအထၫတၭ, ထဲၩ့ထၪ့ ထဲၩ့ဝ့ၫလၧယရုစလံၫ့နီၪ လီၩလၩ့လၬလၩ့ဆၧၥၭထိၬ အပရၧၫ့လၧ ၦစမ့ရအၫဖိၪၥံၪအတဝၫ့အၪစီၪ့လီၫ.",
			"26": "<sup>26</sup> အ့ၪမွဲယွၩအၥီၫ့လဂၩချဲၩ့ဆၧလၧ စဖံလံၭတၭ,စံၭ ဝ့ၫ,ဂဲထုၪ့တၭလ့ၩဆၧလၧမုခံၫ့လခီၫလၧဖၧၩ့ၥၭလ့ၩ လၩ့ခွံၬလၧယရုစလံၫ့ဖိးလၧဂၫဇၫနီၪဘီၪ, ဆၧထီး နီၪမွဲၡါမုနၧၫ့ဖၫလီၫ.",
			"27": "<sup>27</sup> တၭအဝ့ၫဂဲထုၪ့လ့ၩဝ့ၫဒၪလီၫ. ယိခွါ, ၦအံၥအိပၠၫ ဖိၪၦဖၫဆွံၪ, မွဲၦဒိၪဖၭဒိၪလၧခးအံၥအိပၠၫအနးဎွၩ မုၪနးကၪဒစံၫအၡၩယိအဆၧလူဒိၪဎွ့ၩဒိၪထီးအလူၬ လဂၩ, လ့ၩထၪ့ဘၩဆၧလၧယရုစလံၫ့အဖၧၩ့ဂီၩ့",
			"28": "<sup>28</sup> တၭထဲၩ့ထဲၩ့ဝ့ၫလီၫ.- ဆၧၫ့နၩ့လၧလဲၪ့ဖၧၩ့နီၪ,ဖီမီၪ",
			"29": "<sup>29</sup> စအဲၫစ့ယၫအလံၬလီၫ.- ၥၭမုနီၪစံၭစဖံလံၭ, လ့ၩဆီး",
			"30": "<sup>30</sup> ချႃၭန့လဲၪ့နီၪဘီၪ.- စဖံလံၭလ့ၩစဲၪ့တလဲးထီၩ့ဝ့ၫ တၭနါဂၧၫ့လၧအဖီမီၪစအဲၫစ့ယၫအလံၬတၭ စံၭဝ့ၫ,",
			"31": "<sup>31</sup> ဆၧလၧနဖီဘၪနီၪ,မွဲနနၪၥ့ၪဆ့ဧၪ.- အဝ့ၫဒၪစံၭဝ့ၫ, ၦလဂၩဂၩအ့ၪလဒုၭနဲၪဘၪယၧၩနီၪ, ယနၪမိၥ့ၪဘဲၫ ၥ့ၪလဲၪးမွဲအအၪ့ကံၩ့စဖံလံၭ ဘဲၫၥိၭအမိထၪ့ဆၧၫ့",
			"32": "<sup>32</sup> နၩ့လၧအၥိၭလီၫ.- လံၬလစီၪ့လၧအဖီဘၪဝ့ၫနီၪမွဲ အယီၩ, ဘဲၫၥိၪဘၪဆၧမီၩ့ဝ့ၫ လၧဆၧမၩၥံၫအလးနီၪ, ဘဲၫၥိၪဖိၪအီၪလၩ့မါပံၭ လၧၦထံၬအဆီၪ့ အမ့ၬ ယၫအၥိၭနီၪ, အဝ့ၫဒၪလအၩ့ထၪ့ဘၪအနိၭ ဘဲၫနီၪအၥိၭလီၫ.",
			"33": "<sup>33</sup> လၧဆၧဆၪ့လၩ့အၥၭအဖၧၩ့နီၪ, ဆၧထုၭခွံၬအ ဆၧစ့ၩရၫ့, တၭမွဲပလၫမိဒုၭနဲၪ အဆၨၩအဆၬနီၪလဂၩလဲၪ, အဂဲးဘဲၫယီၩဆၧထုၭခွံၬအၥၭမၧၫ့လၧဂၪ့ခိၪချိၫ့ လီၫ.",
			"34": "<sup>34</sup> ၦဖၫဆွံၪလဂၩနီၪ ချဲၩ့ဆၧၫ့စဖံလံၭတၭစံၭဝ့ၫ,ယအၪ့ စၪ့နၧၩ, မွဲမီၪချဲၩ့ဆၧလၧပလၫအဂဲးလဲၪ,မွဲလၧအနၫ့",
			"35": "<sup>35</sup> ဆါဒၪဝ့ၫအဂဲး,လၧၦဂူၫဂၩအဂဲးလဲၪ.- စဖံလံၭအၩ့ ထၪ့အနိၭတၭ, မၩဆိၫလၧဆၧကွ့ၭအၥၭလစီၪ့နီၪတၭ, လီၩဘၪဝ့ၫလၧယ့ၫၡုၬအဆၧၥၭထိၬအပရၧၫ့လီၫ.",
			"36": "<sup>36</sup> အဝ့ၫၥံၪလ့ၩဆၧလၧဖၧၩ့ၥၭ အဘိၩ့ဘၭတၭ, ထီၩ့ လၧထံၫအီၪလစီၪ့နီၪ, ၦဖၫဆွံၪလဂၩစံၭဝ့ၫ,ယိခွါ, ထံၫအီၪ,ဘဲၫၥိၭယထီးဒိၭဘၭတံၫဇၫ့ ယၥၭလဂ့ၩတၭ,",
			"37": "<sup>37</sup> မွဲဆၧနီၪပဒၩ့ထၬယၧၩလမံၩ့လဲၪ.- စဖံလံၭစံၭဝ့ၫ, နအ့ၪနဲၩ့ထဲၩ့လၧနၥၭထၧၫ့ဖျိၪ့ယၫတၭ, ဂ့ၩဒိၭန့ နဝ့ၫလီၫ.အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, ယနဲၩ လၧယ့ၫၡုၬဎရံၬနီၪ မွဲယွၩအဖိၪခွၫလီၫ.",
			"38": "<sup>38</sup> တၭအဆၧမၪလူၬဝ့ၫဘဲၫၥိၭလဲၪ့ မိအီၪပထုၬလီၫ, စဖံလံၭဒဲၦဖၫဆွံၪလ့ၩလၩ့လၧ ထံၫကျၩနံၫဂၩလူၬနီၪ, အဆၧဘၭတံၫဇၫ့အဝ့ၫဒၪလဂၩလီၫ.",
			"39": "<sup>39</sup> ထီးအဝ့ၫၥံၪဂဲၫထဲၩ့ထၪ့လၧထံၫကျၩတၭ, ယွၩအ ၥၭမုနီၪထုၭထၪ့ခွံၬစဖံလံၭတၭ, ၦဖၫဆွံၪလဂၩနီၪ, ဒၪဘၪလၧၩ့အဝ့ၫအ့ၬ. အၥုၪ့ထိၬၥၭထိၬတၭထဲၩ့ထဲၩ့ ဝ့ၪဒၪလီၫ.",
			"40": "<sup>40</sup> အ့ၪမွဲစဖံလံၭနီၪဆၧဒၪန့ဝ့ၫလၧ အဇိတၧၭတၭ,လ့ၩ ခၫ့ဂၬဝ့ၫနီၪ, လီၩလၩ့လၬလၩ့ဆၧၥၭထိၬအပရၧၫ့လၧ ကိၭဒိၩ့ကိၭတဝၫ့ထီးအထီၩ့လၧစ့စရံအၫနီၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> အ့ၪမွဲစစီလူၫနီၪၥၪထၪ့ဆၧချဲၩ့မၩၥၭမဲၪဆၧ, ဒဲ မၩၥံၫကဆါအထံၩအဖျဲၥံၪတၭ, လ့ၩဝ့ၫလၧၦလုဆၧ",
			"2": "<sup>2</sup> အခိၪအအီၪတၭ,- အၪ့ကံၩ့န့လံၬလၧၥရိၬလဖၪအဂး လၧဒမၭစကၧၭအဖၧၩ့နီၪ, အ့ၪဒၪဘၪၦၡၩ ဘၪဆဲၫ့ လၧဖၧၩ့ၥၭယီၩ, ၦမုၪမွဲဂ့ၩ, ၦခွၫမွဲဂ့ၩ, ဘဲၫၥိၭအမိ စၧၩ့ထၬဒဲဂဲၫထဲၩ့မီၩ့ဝ့ၫလၧ ယရုစလံၫ့အဖၧၩ့နီၪလီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪလ့ၩဝ့ၫအဘိၩ့ဘၭနီၪဘူၭထၪ့လၧဒမၭစ ကၧၭတၭ, ဆၧဖၩ့လၧမူၭခိၪယုၩ့ယဲထၪ့ဝၬဖီၩ့ၡုၬအ",
			"4": "<sup>4</sup> ဝ့ၫလီၫ.- တၭလၩ့ထံၩဖါဝ့ၫလၧဂၪ့ခိၪအလီၩ့နီၪနါဂၧၫ့ ဆၧအလူၥီၫထၪ့စံၭဝ့ၫ, စစီလူၫဧ့,စစီလူၫဧ့,မွဲဘၪနီၫ",
			"5": "<sup>5</sup> လၧနမၩအၧၩ့ယၧၩလဲၪ.- အဝ့ၫဒၪစံၭဝ့ၫ,ကဆါဧ့, နမွဲပလၫလဂၩလဲၪ. ကဆါစံၭဝ့ၫ,ယမွဲၦလၧနမၩအၧၩ့ ဝ့ၫယ့ၫၡုၬလဂၩနီၪလီၫ. ဎနထၧၫ့ဘၪ နိၪစူၩကၪမၬ",
			"6": "<sup>6</sup> လီၫ.- အဝ့ၫဝၭထိၬဝၭတ့ၭ ဒဲထီၫမံၫထီၫမၪ တၭစံၭ ဝ့ၫ,ကဆါဧ့, ယဘၪမၩဆၧနီၪလမံၩ့လဲၪ, ကဆါစံၭ အဝ့ၫၭ ဂဲထုၪ့တၭလ့ၩနုၬလၧဒိၩ့ဖၧၩ့နီၪ, မွဲနမိဘၪမၩ ဆၧနီၫလဲၪနီၪ, ဆၧမိဒုၭနဲၪနၧၩလီၫ.",
			"7": "<sup>7</sup> ၦလၧအလ့ၩဖိၬအခဲၫ့လဖၪနါဂၧၫ့ လါနၫ့ဆၧၥီၫနီၪ လဒၪဘၪၦနးဂၩ, အီၪဆၧၫ့ထုၪ့ဝ့ၫလၩ့မါပံၭလီၫ.",
			"8": "<sup>8</sup> စစီလူၫဂဲထုၪ့ဝ့ၫလၧဂၪ့ခိၪအလီၩ့နီၪ, ထီးအစၪ့ထၪ့အ မ့ၬတၭ,ဒၪဘၪၦနးဂၩအ့ၬ. ၦလ့ၩမီၩ့အစူၪထီၩ့လၧ",
			"9": "<sup>9</sup> ဒိၩ့ဒမၭစကၧၭအဖၧၩ့လီၫ.- လဒၪဘၪဆၧနီၪ,အီၪဝ့ၫ ၥၧၫ့ၥၫ့ဒဲအၪ့ဆၧအီၩဆၧဆ့အ့ၬ.",
			"10": "<sup>10</sup> အထံၩအဖျဲကိၭဝ့ၫအမံၩ့လၧစအၫ့နနဲအၭအီၪဝ့ၫ လၧဒိၩ့ဒမၭစကၧၭအဖၧၩ့လဂၩတၭ, ကဆါလီၩဘၪ ဝ့ၫလၧအဒၪဆၧလၧယၫလခီၫအဖၧၩ့, စအၫ့နနဲအၭဧ့,",
			"11": "<sup>11</sup> တၭအဝ့ၫဒၪစံၭ, ယိခွါ,ကဆါဧ့,မွဲယၧၩလီၫ.- ကဆါ စံၭဝ့ၫ, ဂဲထုၪ့တၭလ့ၩလၧဖၧၩ့ၥၭ ကိၭဝ့ၫအမံၩ့လၧ ဆၧလီၩ့နီၪ, အၪ့ဎၬန့ၦတၫစၧၭဖိၪ စစီလူၫလၧစယုဒၭ အဂံၪ့ဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩ, ယိခွါ, အဝ့ၫဒၪဘၩဆိၪဖၪဆၧလီၫ.",
			"12": "<sup>12</sup> လၧအဒၪဘၪဆၧလၧယၫလခီၫနီၪ, ဒၪဘၪၦအမံၩ့ စအၫ့နနဲအၭလဂၩ ဂဲၫနုၬတၭအီၪက့ၪအ စူၪလၧအလီၩ့ ဘဲၫၥိၭအမိဒၪထၪ့ထဲၩ့ဆၧလီၫ.",
			"13": "<sup>13</sup> စအၫ့နနဲအၭချဲၩ့ဆၧၫ့ဝ့ၫ, ကဆါဧ့,အဝ့ၫဒၪလဂၩ အဂဲး,ထီးဒၪအမၩၡၪ့မၩနၭ နၡၩဆံၫ့ဎံၪ လဖၪလၧ ယရုစလံၫ့ဆံၭဒိၪလဲၪနီၪ, ယနါဂၧၫ့ယူၭလၧၦအၪ",
			"14": "<sup>14</sup> ဂၩယူၭ.- ထီးယီၩအီၪဝ့ၫလၧအစီၩ့အမၩ့လၧၦလုဆၧ အဒိၪၥံၪ,ဘဲၫၥိၭအမိစၧၩ့ထၬကယဲၦလၧအကိၭထၪ့",
			"15": "<sup>15</sup> နမံၩ့လီၫ.- ကဆါစံၭအဝ့ၫ,လ့ၩဘီၪ,အဂဲးဘဲၫ ယီၩအဝ့ၫနီၪမွဲဆၧရွံန့စူၪဝဲၩလၧ ယဂးဘဲၫၥိၭအမိ ဆိၬယမံၩ့လၧၦဆၨၩလဖၪ,ဒဲစဎွၩၥံၪ, ဒဲၦအံၫစရ့",
			"16": "<sup>16</sup> လၭဖိၪၥံၪအမ့ၬယၫလီၫ.- အဂဲးဘဲၫယီၩမွဲအမိဘၪထိး ဆၧလၧယမံၩ့အကၠီၩ့ဆံၭအၪဆံၭအၪလဲၪနီၪ, ယမိ",
			"17": "<sup>17</sup> ဒုၭနဲၪဝ့ၫလီၫ.- စအၫ့နနဲအၭစဲၪ့ထၪ့တၭ, လ့ၩနုၬဝ့ၫ လၧဂံၪ့ဖၧၩ့အီၪက့ၪအစူၪလၧအလီၩ့စံၭဝ့ၫ, ထၧၫ့ ဖုဝဲစစီလူၫဧ့, ကဆါလၧအအီၪဖျီၪထၪ့လၧနမ့ၬယၫ လၧနဂဲၫလၧဖၧၩ့ၥၭအဘိၩ့ဘၭယ့ၫၡုၬလဂၩနီၪ, အၪ့ မၧၫ့ယဂဲၫလၧနအီၪဘဲၫၥိၭနမိဒၪထၪ့ထဲၩ့ဆၧ, ဒဲလၧၫ့",
			"18": "<sup>18</sup> ထၪ့ဎွ့ၩထၪ့လၧၥၭမုဆံၫ့ဎံၪလီၫ.- ဆၧလၩ့ထ့ၬခွံၬ လၧအမ့ၬၥၪချဲၫ့မၬ ဘဲၫယၪအဘံၪ့အၥိၭနီၪ, မွဲအဒၪ ထၪ့ထဲၩ့ဆၧ, ဂဲထုၪ့တၭလ့ၩဒိၭဘၭတံၫဇၫ့အၥၭလီၫ.",
			"19": "<sup>19</sup> အဝ့ၫအၪ့ဆၧအီၩဆၧတၭ, အဂဲးအဘၭဆီၪ့ထၪ့ထဲၩ့ ဝ့ၫလီၫ. စစီလူၫအီၪအနံၩအၥၫ့လနၩ့နၩ့လၧအထံၩ",
			"20": "<sup>20</sup> အဖျဲၥံၪအၥိၭလၧဒိၩ့ဒမၭစကၧၭအဖၧၩ့လီၫ.- အဝ့ၫ ဒၪလီၩလၩ့လၬလၩ့ဆၧချဲၫ့မၬ လၧၥရိၬလဖၪအဖၧၩ့",
			"21": "<sup>21</sup> လၧဎရံၬနီၪမွဲယွၩအဖိၪခွၫလီၫ.- ကယဲၦလၧအနါဂၧၫ့ ဝ့ၫလဖၪနီၪထီၫမံၫထီၫမၪအၥၭ,စံၭဝ့ၫ,ၦလဂၩယီၩ မွဲၦလၧအမၩဂၭဂီၩ့ ၦၡၩလၧအကိၭထၪ့ ဆၧအမံၩ့ ယီၩလၧယရုစလံၫ့အဖၧၩ့,ဒဲဂဲၫထီးယီၩ ဘဲၫၥိၭအ မိစၧၩ့ထၬအဝ့ၫၥံၪ, ဒဲထဲၩ့မီၩ့ဝ့ၫလၧၦလုဆၧအဒိၪ လဖၪအအီၪနီၪ, မွဲအ့ၬဧၪ.",
			"22": "<sup>22</sup> စစီလူၫအဂဲးအဘၭဆီၪ့ထၪ့လခီၫတၭ,ချဲၩ့နၧၩ့ ၦယုဒၫဖိၪၥံၪအီၪ လၧဒိၩ့ဒမၭစကၧၭအဖၧၩ့,ဒဲဒုၭနဲၪ ဝ့ၫလၧအယီၩမွဲဎရံၬနီၪလီၫ.",
			"23": "<sup>23</sup> ထီးအၪနံၩအၪၥၫ့ဎွ့ၩထၪ့နီၪ, ၦယုဒၫဖိၪလဖၪဘဲၫ ၥိၭအမိမၩၥံၫအဝ့ၫဒၪလဂၩတၭ, ကိၪ့ထၪ့ဖၭလၩ့",
			"24": "<sup>24</sup> ဆၧလီၫ.- တၭအဝ့ၫၥံၪ အဆၧကိၪ့ထၪ့ဖၭလၩ့နီၪ စစီ လူၫၥ့ၪယၫဝ့ၫလီၫ. ဘဲၫအဝ့ၫၥံၪမိမၩၥံၫဝ့ၫအၥိၭနီၪ,",
			"25": "<sup>25</sup> ခိၭဆၧလၧတရၫ့ထံၭ ၥံၫ့ၥံၫ့နံၩၥၫ့ၥၫ့နၩလီၫ.- အ ထံၩအဖျဲၥံၪမၩန့ဝ့ၫလၧမုနၩလခီၫတၭ, အီၪက့ၪလၩ့ ဝ့ၫလၧဒၩ့ဖၧၩ့တၭ, ဆဲၩလၩ့ခွံၬဝ့ၫလၧဒိၩ့ခိၪဒၧၩ့ အဖိးနီၪလီၫ.",
			"26": "<sup>26</sup> ထီးစစီလူၫထဲၩ့ထီၩ့ထဲၩ့ယူၭလၧ ယရုစလံၫ့နီၪမိ နုၬဖံၭၥိၭလိၬဘၪအၥၭ လၧဆၧအထံၩအဖျဲၥံၪတၭ, အဝ့ၫၥံၪၥၭမဲၪဝ့ၫကိၭဂၩဒ့ၭတၭ, မွဲအကဲၪထၪ့ယူၭအ",
			"27": "<sup>27</sup> ထံၩအဖျဲနီၪနဲၩဝ့ၫအ့ၬ.- စဘၫနဘၭကိၭန့ၥိၫ့ဝ့ၫလၧ ၦဆၧအၪ့မၧၫ့ဖိၪၥံၪအအီၪတၭ, လီၩဘၪအဝ့ၫၥံၪလၧ အဝ့ၫလဂၩဒၪဘၪကဆါနီၪ လၧဖၧၩ့ၥၭအဂဲးအကၠီၪ့ ဒဲကဆါချဲၩ့ဒုၪ့ဝ့ၫ, ဒဲလၧအလီၩလၩ့လၬလၩ့ဆၧလၧ ယ့ၫၡုၬဎရံၬအမံၩ့အကၠီၩ့ လၧအၥၭဒူၩလၧဒမၭ စကၧၭအဖၧၩ့နီၪလီၫ.",
			"28": "<sup>28</sup> တၭအဝ့ၫဒၪအီၪလၧအဝ့ၫၥံၪအၥိၭ နုၬထၪ့စဲၪ့လၩ့",
			"29": "<sup>29</sup> လၧယရုစလံၫ့,- လီၩလၩ့လၬလၩ့ဆၧလၧအၥၭဒူၩ လၧကဆါယ့ၫၡုၬအမံၩ့တၭ, ဂဲးလိၬတ့ၭလိၬအၥၭလၧ ၦဂြံစၭၥံၪနီၪ, အဝ့ၫၥံၪကျ့ၭစၨၭမၩၥံၫအဝ့ၫဒၪလီၫ.",
			"30": "<sup>30</sup> အထၧၫ့ဖုဝဲၥံၪထီးအၥ့ၪယၫဝ့ၫတၭ, ၥိၫ့လၩ့ဝ့ၫလၧစ့ၭ စရံအၫတၭ, အၪ့မၧၫ့အလ့ၩဆၧလၧတၫစၧၭလီၫ.",
			"31": "<sup>31</sup> ထီးနီၪလဖၧၫ့ဆၧအီၪကီၪ့ၥံၪလၧခးယုဒၫ,ဒဲဂၫ လလံၫ, ဒဲစမ့ရအၫထၧၫ့ခးယၫနီၪအီၪၡုၪအီၪမုၬ, ဒဲထၪ့ဝ့ၫထီၫဝ့ၫတၭ, လ့ၩဝ့ၫလၧဆၧၥၭမဲၪယွၩအ ဖၧၩ့,ဒဲလၧဆၧမၩမုၬထၪ့ထဲၩ့ဝ့ၫ လၧၥၭမုဆံၫ့ဎံၪအ ဖၧၩ့တၭ,အၪထၪ့ဂီထၪ့ဝ့ၫလီၫ.",
			"32": "<sup>32</sup> တၭဆၧမၩအၥၭလၧစပံတၧၫလ့ၩစဲၪ့ဝံၩ့ဝၩ့ဎံၩ့ဎံၩ့ လ့ၬအဘိၩ့ဘၭနီၪ, လ့ၩလၩ့ဝ့ၫလၧၦဆံၫ့ဎံၪအီၪဝ့ၫလၧ",
			"33": "<sup>33</sup> လံၭဒၫအဖၧၩ့လဖၪအအီၪလီၫ.- ထီးနီၪဒၪဘၪၦလၧ အၥံၫလခီၫဖၩလၧ အအီၪယူၭလၧအလးမံၫခိၪဎိၭနံၪ့,",
			"34": "<sup>34</sup> အမံၩ့မွဲစအံၫနံအၭလဂၩ,- စပံတၧၫစံၭအဝ့ၫဒၪ စအံၫနံအၭဧ့, ယ့ၫၡုၬဎရံၬမၩဘျၪထဲၩ့နၧၩတၭ,ဂဲထုၪ့ ဒၩလၩ့နလးမံၫဘီၪ. အဝ့ၫဒၪဂဲထုၪ့ဝ့ၫ ချဲၩ့မၬလီၫ.",
			"35": "<sup>35</sup> ကယဲၦလၧအအီၪဝ့ၫလၧ လံၭဒၫဒဲစၫရၧၫ့အဖၧၩ့ လဖၪဒၪဘၪဝ့ၫတၭ, ကၠၪစိၩအၥၭလၧကဆါအအီၪ လီၫ.",
			"36": "<sup>36</sup> တၭအထံၩအဖျဲအမံၩ့ နးတၫဘၥၫအီၪဝ့ၫလၧယီၭ ပၫအဖၧၩ့လဂၩ, ၦစံၭဆၧလၧတၫဘၥၫနီၪ, ဘဲၫၦစံၭ ဆၧအၥိၭ, ဒီၫကၭ, ၦမုၪနီၪလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧဆၧ မၩအဂ့ၩ, ဒဲဆၧဖ့ၪလၫ့ယၫ့ၥၭ ဆၧလၧအမၩဝ့ၫ",
			"37": "<sup>37</sup> လီၫ.- လၧမုနံၩလဖၪနီၪ ဆၧမၩအၥၭလၧအဘၪစူၭ ဘၪဆၫတၭၥံၫဝ့ၫလီၫ.- ၦၡၩၥူၫဝၭခွံၬဝ့ၫတၭအီၪက့ၪ",
			"38": "<sup>38</sup> ထၪ့ဝ့ၫလၧဒူၭထၪ့ထီၫလဆၫ့အဖၧၩ့လီၫ.- လံၭဒၫအီၪ ဘူၭလၧယီၭပၫတၭ အထံၩအဖျဲၥံၪနါဂၧၫ့လၧစပံတၧၫ အီၪထီးနီၪ, အၪ့မၧၫ့ၦနံၫဂၩလ့ၩအၪ့ကံၩ့အၪ့ယၫအ ဝ့ၫဒၪဘဲၫၥိၭအမိဂဲၫလၧအအီၪ ထီးၥုၭနံၩၥုၭၥၫ့လဂ့ၩ.",
			"39": "<sup>39</sup> စပံတၧၫဂဲထုၪ့တၭ, လ့ၩဖိၬအဝ့ၫၥံၪအခဲၫ့လီၫ. ဂဲၫထီၩ့ဝ့ၫတၭ, ၦၥိၫ့နူၬဝ့ၫလၧဒူၭထၪ့ထီၫလဆၫ့အဖၧၩ့ နီၪ,ၦမုၪမဲၫၥံၪဒုၭနဲၪဆၧကီၩ့ဆၧၥိၭ လၧနးဒီၫကၭမၩ လၧအအီၪဒံၭအဘိၩ့ဘၭနီၪဂၪ့ထၪ့ဝ့ၫဒဲအီၪဆၧၫ့",
			"40": "<sup>40</sup> ထုၪ့လၧအနဲၩထံၭ ထီးအလူၬလီၫ.- စပံတၧၫဒုၭစဲၪ့ ထၪ့ခွံၬအဝ့ၫၥံၪ ထီးအလူၬလၧခီၫ့တၭ, ထွံၩလၩ့အ ခၪ့ဒဲဘၩဆိၪဖၪဆၧတၭ, ကၠၪစိၩအၥၭလၧအစွၪအ အီၪတၭ, စံၭဝ့ၫ,နးတၫဘၥၫဧ့,ဂဲထုၪ့ဆံၭ. အဝ့ၫ ဒၪစၪ့ထၪ့အမ့ၬၥၪတၭ, ဒၪဘၪစပံတၧၫနီၪဂဲထုၪ့ဆၧၫ့",
			"41": "<sup>41</sup> နၩ့ဝ့ၫလီၫ.- စပံတၧၫယူၬစိၩအစူၪဘိၭဂဲထုၪ့အဝ့ၫဒၪ တၭ,ကိၭထဲၩ့ၦဆံၫ့ဎံၪၥံၪဒဲၦမုၪမဲၫၥံၪတၭ, အဝ့ၫဒၪမၧၫ့ ထၪ့ထဲၩ့နီၪဖ့ၪလၫ့ထဲၩ့လၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ.",
			"42": "<sup>42</sup> ဆၧမၩအၥၭနီၪ ၦၥ့ၪယၫဝ့ၫ လၧယီၭပၫ အဒိၩ့ဖၧၩ့ ထၧၫ့ဒိၩ့ယၫတၭ, ၦနဲၩ့ထဲၩ့ကဆါနီၪအၪဂၩလီၫ.",
			"43": "<sup>43</sup> ဆၧမၩအၥၭလၧအအီၪလၧ ၦမၩဆၧဖံၭစစဲမၧၫ့လ ဂၩအၥိၭလၧ ယီၭပၫအဖၧၩ့အၪနံၩလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ၦၥုၭဖိၪလယၩအခိၪ, အမံၩ့မွဲစကနံလအၧၭလဂၩ ဘၪဆဲၫ့လၧၦၥုၭဖိၪလဒီၪ့ ကိၭဝ့ၫအမံၩ့ လၧအံတလံၫ",
			"2": "<sup>2</sup> အီၪဝ့ၫလၧစ့ၭစရံအၫအဖၧၩ့လီၫ.- အဝ့ၫနီၪဒဲအဂံၪ့ဖိၪ ထီးအလူၬမွဲၦလၧအယူၭယၪ့ဒဲၥၭမဲၪယွၩဖ့ၪလၫ့ယၫ့ ၥၭဆၧအၪမၬလၧၦခမျၧးဒဲအၪ့ကံၩ့အၪ့ယၫယွၩ ထံၪဎးလီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪနီၪဒၪဘၪဆၧလၧယၫလခီၫဖျီၪဝ့ၫ ဂ့ၩဘၪ စဲၪတၭ,လၧခွံၫနၩရံၩကၪယူၭနီၪ, ဒၪဘၪဝ့ၫလၧယွၩ အၥီၫ့လဂၩဂဲၫနုၬလၧအအီၪတၭ, စံၭအဝ့ၫ,စကနံ",
			"4": "<sup>4</sup> လအၧၭဧ့,- တၭယိအၥီၫ့လၩ့ထံးလၩ့ဆ့ၭ, ၥၭမဲၪၥၭ ဖျဲၩ့ဝ့ၫနီၪ, စံၭဝ့ၫ, ကဆါဧ့,မွဲဆၧနီၫလဲၪ. တၭအဝ့ၫဒၪ စံၭဝ့ၫ, နဆၧဘၩဆိၪဖၪဒဲနဆၧဖ့ၪလၫ့ယၫ့ၥၭဆၧနီၪ, ထၪ့ဘၭယူၭလၧယွၩအမ့ၬယၫ လၧဆၧနၪ့ထၪ့ထဲၩ့အ",
			"5": "<sup>5</sup> ဂဲးယူၭ,- ဘိၩ့နဲၪ့ယီၩ အၪ့မၧၫ့ၦလ့ၩလၧယီၭပၫအ ဖၧၩ့တၭ, ကိၭန့စစဲမၧၫ့ကိၭဝ့ၫအမံၩ့ အၥၫ့လၧစပံတၧၫ",
			"6": "<sup>6</sup> နီၪဆံၭ.- အဝ့ၫဒၪအီၪၦမွံၩလၧၦမၩဆၧဖံၭစစဲမၧၫ့ အဂံၪ့ဖၧၩ့, လၧအအီၪလၧမၫဆမံၭနဲၩ့လီၫ. ဎနဘၪ မၩဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ အဝ့ၫဒၪမိလီၩဘၪနၧၩ လီၫ.ၭ",
			"7": "<sup>7</sup> ထီးအၥီၫ့လၧအချဲၩ့လိၬအၥၭ လၧစကနံလအၧၭလ ဂၩနီၪစဲၪ့ထၪ့တၭ, အဝ့ၫဒၪကိၭန့ အၡၩဂံၪ့ဖိၪနံၫဂၩ ဒဲၥုၭဖိၪလၧအမၩအဆၧထံၪဎး လၧအယူၭယၪ့ ယွၩ",
			"8": "<sup>8</sup> လဂၩ,- လီၩဘၪအဝ့ၫၥံၪလၧဆၧထီးအလူၬနီၪ အဂဲး အကၠီၪ့တၭ, အၪ့မၧၫ့အလ့ၩလၧယီၭပၫအဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ကဲဂီၩလနံၩနီၪ, ထီးအဝ့ၫၥံၪလ့ၩဆၧလၩ့ဘူၭလၧဒိၩ့ နီၪ, လၧအဘူၭထၪ့ဎူၫနၩရံၩယူၭ, စပံတၧၫနီၪဘဲၫၥိၭအ မိဘၩဆိၪဖၪဆၧတၭ, လ့ၩထၪ့ဝ့ၫလၧဂံၪ့ခိၪလီၫ.",
			"10": "<sup>10</sup> ဆၧၥၭဝံအၥၭနီၪ ဆၧမိအၪ့ဘၪအၥၭဆ့လီၫ. ၦတဲၩ့ဝဲၩ ဆၧအဘိၩ့ဘၭနီၪ အဝ့ၫဒၪလၩ့ဘၪဝ့ၫလၧဆၧဒၪဆၧ",
			"11": "<sup>11</sup> လၧယၫလခီၫအဖၧၩ့,- ဒၪဘၪဝ့ၫလၧမူၭခိၪဝဲထၪ့အ ၥၭနီၪ,ဆၧဖၧၩ့မၩအၥၭဘဲၫ ဖၬဘဲၩ့ဖၭဒိၪအၥိၭစၧၩ့ ထၬအၥၭလၧအနိၪ့လံနိၪ့လဘံၪ့ ဆဲၩလၩ့အၥၭလၧ",
			"12": "<sup>12</sup> အအီၪထီၩ့လၩ့လၧဂၪ့ခိၪလီၫ.- ကယဲဆၧဖိၪဆၧဎါ အီၪလၧအခၪ့လံခီၫဒဲ ဆၧအစွၩၥ့ၪလၧဂၪ့ခိၪချိၫ့ယီၩ, ဒဲထိၪၥံၪလံၪၥံၪလၧ ဆၧဖိၭဖၫ့လဖၪနီၪ အီၪဝ့ၫလၧအ",
			"13": "<sup>13</sup> ဖၧၩ့လီၫ.- ဆၧအလူလီၩဘၪဝ့ၫစပံတၧၫဧ့, ဂဲထုၪ့,မၩ ၥံၫ,အၪ့ဘီၪ.",
			"14": "<sup>14</sup> စပံတၧၫစံၭဝ့ၫ, မွဲလၩလါအ့ၬ,ကဆါဧ့းအဂဲးဘဲၫ ယီၩယအၪ့ဆၧ လဆံၫ့ဘၪနီၪမွဲဂ့ၩ, ဒဲဆၧၥၭလိၪနီၪ",
			"15": "<sup>15</sup> မွဲဂ့ၩနးဆိၭအ့ၬ,- ဆၧအလူနီၪစံၭဒီၭအဝ့ၫနံၫဘျၩ့ လဘျၩ့ဆၧလၧယွၩမၩဆံၫ့ထၪ့နီၪ, ထီးအီၪက့ၪအဝ့ၫ",
			"16": "<sup>16</sup> လၧဆၧလဆံၫ့ဘၪနီၪလဂ့ၩ.- ဆၧမၩအၥၭဘဲၫနီၪ ၥၧၫ့ဖၧၫ့ဂီၩ့တၭ,ဆၧဖၧၩ့နီၪဘၪဆၧထုၭထၪ့ထဲၩ့ဝ့ၫ လၧမူၭခိၪလီၫ.",
			"17": "<sup>17</sup> ဆၧဒၪဆၧလၧယၫလခီၫ လၧအဒၪဘၪဝ့ၫမွဲအမၩ အၥၭဘဲၫၥ့ၪလဲၪနီၪ, စပံတၧၫအၥၭဂံၩ့ဂၩ့အဘိၩ့ဘၭ နီၪ,ယိခွါ, ၦၡၩလၧစကနံလအၧၭအၪ့မၧၫ့ဝ့ၫလဖၪအၪ့ ဎၬစစဲမၧၫ့အဂံၪ့တၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧတရၫ့ထံၭ,",
			"18": "<sup>18</sup> ကိၭထၪ့တၭ,အၪ့စၪ့ဝ့ၫ, စစဲမၧၫ့ကိၭဝ့ၫအမံၩ့အၥၫ့ လၧစပံတၧၫနီၪ, မွဲအအီၪၦမွံၩထီးယီၩဧၪ.",
			"19": "<sup>19</sup> ဆၧလၧအဒၪဘၪဝ့ၫလၧယၫလခီၫနီၪ, စပံတၧၫဆီၫ့ မီၪ့အဂဲးအကၠီၪ့ ထံၫထံၫဆၭဆၭ အဘိၩ့အဘၭနီၪ တၭ,ၥၭမုနီၪလီၩဘၪအဝ့ၫး ယိခွါ,ၦၡၩအၪ့ဎၬနၧၩ",
			"20": "<sup>20</sup> လီၫ.- အ့ၪမွဲဂဲထုၪ့စဲၪ့လၩ့ဘီၪး နၥၭထီးဂံၩ့ဂၩ့ လဂ့ၩးလ့ၩလၧအၥိၭဘီၪး အဂဲးဘဲၫယီၩယအၪ့မၧၫ့ အဝ့ၫၥံၪလီၫ.",
			"21": "<sup>21</sup> စပံတၧၫစဲၪ့လၩ့လၧၦၡၩလဖၪနီၪ အအီၪတၭ, စံၭ ဝ့ၫ,ယိခွါ, ၦလၧနၥံၪအၪ့ဎၬဝ့ၫလဂၩနီၪ, မွဲယၧၩလီၫ.",
			"22": "<sup>22</sup> မွဲနၥံၪဂဲၫလၧဆၧနီၪအဂဲးလဲၪ.- အဝ့ၫၥံၪစံၭဝ့ၫ, ၦအ တီၩလၧအၥၭမဲၪယွၩ, လၧၦယုဒၫဖိၪထိးအၥၭလၧအ ဂးထၧၫ့ဆၨၩယၫ, ၦၥုၭဖိၪလယၩအခိၪစကနံလအၧၭ လဂၩနီၪ, ယွၩအၥီၫ့ဆံၫ့ဎံၪလဂၩၥီၪ့ထဲၩ့အဝ့ၫဘဲၫ ၥိၭအမိကိၭနၧၩလၧအဂံၪ့, ဒဲနါဂၧၫ့ဆၧချဲၩ့လဖၪလၧ နၧၩလီၫ.",
			"23": "<sup>23</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫဒၪကိၭနုၬ ၦၡၩၥံၪနီၪ တၭ,ထိးဆၧၫ့ဝ့ၫဒၪလီၫ. ကဲဂီၩလနံၩနီၪစပံတၧၫ ထဲၩ့ ဎုၬလၧအဝ့ၫၥံၪအၥိၭတၭ, အထၧၫ့ဖုဝဲလၧယီၭပၫအ",
			"24": "<sup>24</sup> ဖၧၩ့လနၩ့နၩ့လ့ၩဖိၬဝ့ၫအခဲၫ့လီၫ.- ကဲဂီၩလနံၩဒီၭ နီၪ,လ့ၩနုၬဝ့ၫလၧစ့ၭစရံအၫ အဖၧၩ့တၭ, စကနံလ အၧၭကိၭကီၪ့ယူၭ အဘူၭအထံးဒဲအထံၩအၥိၭယူၭ",
			"25": "<sup>25</sup> တၭ,ယိလါၦၡၩၥံၪအဖၧၩ့ၥၭလီၫ.- ဆၧမၩအၥၭလၧ စပံတၧၫလ့ၩနုၬဝ့ၫ အဘိၩ့ဘၭနီၪ, စကနံလအၧၭဂဲၫ အၪ့ဂၬအဝ့ၫတၭ, ထွံၩလၩ့လၧအခၪ့ထံၭနီၪ ဘၩဆၧ",
			"26": "<sup>26</sup> လီၫ.- စပံတၧၫဘိၭဂဲထုၪ့အဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဆၧၫ့",
			"27": "<sup>27</sup> ထုၪ့ဘီၪးယဝ့ၫဒၪယီၩယမွဲၦၡၩဆ့လီၫ.- ချဲၩ့လိၬ အၥၭအဘိၩ့ဘၭနီၪ လ့ၩနုၬဝ့ၫတၭ, ဒၪဘၪၦၡၩအီၪ",
			"28": "<sup>28</sup> ကိၩ့အီၪကီၪ့ဝ့ၫအၪဂၩလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, နၥံၪ ၥ့ၪယၫလၧၦယုဒၫဖိၪ ဖံၭၥိၭလိၬအၥၭ လၧၦဆၨၩ ဂူၫဂၩမွဲဂ့ၩ, လ့ၩနုၬလၧအအီၪမွဲဂ့ၩ, မွဲလဂ့ၩလဘၪ ဘၪလီၫ. မွဲလါနၫ့ယွၩဒုၭနဲၪယၧၩလၧယကြၨၭကိၭ ၦၡၩလၧဆၧလဆံၫ့ဘၪမွဲဂ့ၩ, ဆၧၥၭလိၪမွဲဂ့ၩနီၪ, နး",
			"29": "<sup>29</sup> ဂၩအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, လၧနၥံၪကိၭယၧၩ နီၪယလၥုၭနံၩၥုၭၥၫ့ဘၪတၭ, ယဂဲၫလီၫ. မၩအၥၭ ဘဲၫနီၪတၭ, ယမိအၪ့စၪ့ဆၧလမံၩ့, လၧနၥံၪကိၭန့ ယၧၩယီၩမွဲလၧဆၧနီၪအဂဲးလမံၩ့လဲၪ.",
			"30": "<sup>30</sup> စကနံလအၧၭစံၭဝ့ၫ, လၧအဖီၩ့ခွံၬဝ့ၫလံၥၫ့နီၪ,ယ ဒုၪဆၧအၪ့ဆၧအီၩ ထီၩ့လၩ့လၧနၩရံၩယီၩး ဒဲလၧခွံၫနၩ ရံၩအဖၧၩ့နီၪ, ယဘၩဆိၪဖၪဆၧလၧယဂံၪ့ဖၧၩ့တၭ, ယိခွါ,ၦၡၩအီၪ လၧအကီၩ့အၥိၭ ယုၩ့ယဲအီၪဆၧၫ့",
			"31": "<sup>31</sup> ထုၪ့လၧယမ့ၬယၫလဂၩလီၫ.- တၭစံၭဝ့ၫ,စကနံလ အၧၭဧ့, နဘၩဆိၪဖၪဆၧနီၪဆၧနါဂၧၫ့ယူၭ,နဖ့ၪ လၫ့ယၫ့ၥၭဆၧနီၪ, ဆၧနၪ့ထၪ့ထဲၩ့ယူၭလၧယွၩအမ့ၬ",
			"32": "<sup>32</sup> ယၫယူၭ.- မၩအၥၭဘဲၫနီၪတၭ, အၪ့မၧၫ့ၦၡၩလ့ၩလၧ ယီၭပၫတၭ, ကိၭန့စစဲမၧၫ့ကိၭဝ့ၫအမံၩ့အၥၫ့လၧစပံ တၧၫနီၪဆံၭ. အဝ့ၫနီၪအီၪၦမွံၩ လၧၦမၩဆၧဖံၭစစဲ မၧၫ့အဂံၪ့ဖၧၩ့လၧမၫဆမံၭအနဲၩ့လီၫ. ထီးအဝ့ၪဒၪ",
			"33": "<sup>33</sup> အ့ၪဂဲၫထီၩ့နီၪမိလီၩဘၪဆၧလၧနၧၩလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ယအၪ့မၧၫ့ၦလ့ၩလၧနအီၪ ချဲၫ့ချံၭတၭ, နဂဲၫထီၩ့နဝ့ၫမွဲဆၧဂ့ၩမၬလီၫ. အခိးမွဲဘဲၫနီၪတၭ, ဘိၩ့ နဲၪ့ယီၩဘဲၫၥိၭပမိခိၭနၪကယဲဆၧ လၧယွၩမၪလူၬနၧၩ ထီးအလူၬနီၪ, ပအီၪဝဲၩယူၭပဝ့ၫလၧယွၩအမ့ၬယၫ ကိၭဂၩဒ့ၭလီၫ.",
			"34": "<sup>34</sup> စပံတၧၫအၩ့ထၪ့အနိၭတၭ,စံၭဝ့ၫ, ယဒၪဘၪယူၭ လၩ့ထံးလၩ့ဆ့ၭ လၧယွၩ ယိဒိၪဆံၭအၪၡၩၦမ့ၬ",
			"35": "<sup>35</sup> အ့ၬ,- မွဲအထိးဆၧၫ့ ၦလၧအၥၭမဲၪဝ့ၫ, ဒဲမၩဆၧတီၩ",
			"36": "<sup>36</sup> နီၪလၧၦကိၭဆၨၩဒ့ၭအကျၩလီၫ.- ဆၧလီၩလၩ့ လၬလၩ့ဆၧဘၪလိၬအိၭလိၬ လၧယ့ၫၡုၬဎရံၬနီၪ, (အဝ့ၫနီၪမွဲဆၧထီးအလူၬအကဆါ,) မွဲဆၧအလူ အထၫလၧအဖ့ၪယူ ၦအံၫစရ့လၭဖိၪနီၪ, နၥံၪၥ့ၪယၫ",
			"37": "<sup>37</sup> တၭ,- မွဲဆၧလၧစယီဟၫ့လီၩလၩ့ ဆၧဒိၭဘၭတံၫဇၫ့ နီၪအလးခဲၫ့တၭ, အလူနီၪဆၧလီၩလၩ့ဆိၫဝ့ၫလၧခးဂၫ",
			"38": "<sup>38</sup> လလံၫ ဖိးလၧခးယုဒၫထၧၫ့ခးယၫနီၪလီၫ.- ယွၩဂုၪၦ နၭဇရ့ၭဖိၪယ့ၫၡုၬလၧၥၭမုဆံၫ့ဎံၪဒဲဆၧစီၩ့ဆၧမၩ့ လီၫ.အဝ့ၫနီၪလ့ၩဝံၩ့ဝၩ့မၩဂ့ၩဆၧ,ဒဲမၩဘျၪထဲၩ့ ကယဲၦလၧမုၪခီၩလဲးမၩအၧၩ့မၩနၭဝ့ၫလဖၪတၭ,",
			"39": "<sup>39</sup> အဂဲးဘဲၫယီၩယွၩအီၪလၧအၥိၭလီၫ.- ကယဲအမၩ ဆၧလၧယရုစလံၫ့အဖၧၩ့, ဒဲလၧၦယုဒၫဖိၪၥံၪအခးဖၧၩ့ နီၪ,ပဝ့ၫဒၪယီၩပမွဲၦထိးအၥၭလီၫ. အဝ့ၫနီၪလဂၩ ၦၡၩစဲၩထၬဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့, မၩၥံၫဝ့ၫတၭ,",
			"40": "<sup>40</sup> ထီးအဘၪၥၧၫ့နံၩလနံၩနီၪ, ယွၩဒုၭဂဲထုၪ့ထဲၩ့ဝ့ၫ",
			"41": "<sup>41</sup> တၭ,ဒုၭနဲၪဖျီၪအဝ့ၫဒၪတၭ,- လမွဲဘၪလၧၦထီးအလူၬ အမ့ၬယၫ,မွဲလၧၦထိးအၥၭ, ၦလၧယွၩရွံန့အီၪက့ၪ ဝဲၩဝ့ၫ,ပဝ့ၫဒၪယီၩ ပအၪ့ဎုၬအီၩဎုၬ ဆၧလၧအၥိၭ",
			"42": "<sup>42</sup> လၧအဂဲထုၪ့ထဲၩ့ လၧဆၧၥံၫအလးခဲၫ့လီၫ.- တၭအ ဝ့ၫဒၪမၪလူၬပၧၩဘဲၫၥိၭပမိ လီၩလၩ့လၬလၩ့ဆၧလၧ ၦခမျၧးနီၪ, ဒဲထိးပၥၭလၧအဝ့ၫနီၪမွဲၦလၧယွၩအီၪ က့ၪလၩ့လၧအမိစ့ၩရၫ့ ၦအမၧၫ့,ဒဲၦၥံၫလဖၪနီၪ",
			"43": "<sup>43</sup> လီၫ.- မီၪၥံၪထီးအလူၬထိးအၥၭလၧ ၦလဂၩနီၪအဂဲး အကၠီၪ့လၧကယဲၦလၧအနဲၩထဲၩ့ဝ့ၫ လဖၪနီၪဆၧ ဒဲၩဘၭဖီၩ့ဖျ့ၭဝ့ၫလၧအမံၩ့အကၠီၩ့လီၫ.",
			"44": "<sup>44</sup> စပံတၧၫချဲၩ့ဆၧအဘိၩ့ဘၭနီၪ, ၥၭမုဆံၫ့ဎံၪဂဲၫလၩ့ လၧကယဲၦလၧအနါဂၧၫ့ ဆၧချဲၩ့နီၪအလီၩ့လီၫ.",
			"45": "<sup>45</sup> တၭၦကူၭတရံၭဖိၪလၧအနဲၩဆၧ ဂဲၫဖိၬစပံတၧၫအခဲၫ့ လဖၪထီၫမံၫထီၫမၪဝ့ၫလၧ ၥၭမုဆံၫ့ဎံၪဘၪဆၧလူၫ လၩ့ဂါလၩ့အၥၭလၧ ၦအဆၨၩလဖၪအလီၩ့နီၪအကၠီၩ့",
			"46": "<sup>46</sup> လီၫ.-အဂဲးဘဲၫယီၩ မွဲအနါဂၧၫ့ၦၡၩနီၪ ချဲၩ့ဆၧလၧ ၦဆၨၩလဖၪအလၨ, ဒဲစံၭထၪ့အၪ့အူၭယွၩလီၫ.",
			"47": "<sup>47</sup> ထီးနီၪလဖၧၫ့, စပံတၧၫချဲၩ့ဆၧၫ့ဆၧ, ၦလၧအဒိၭန့ ၥၭမုဆံၫ့ဎံၪလဖၪယီၩ, ဘဲၫပဝ့ၫဒၪအၥိၭ ဘဲၫၥိၭအ ထီးဒိၭဘၭတံၫဇၫ့ဘၪအၥၭလဂ့ၩနီၪ, ၦပဒၩ့ထၬထံၫ",
			"48": "<sup>48</sup> မိၥ့ၪလဂၩဂၩဆ့ဧၪ.- တၭမၪလူၬဝ့ၫဘဲၫၥိၭအဝ့ၫၥံၪ မိဒိၭဘၭတံၫဇၫ့အၥၭ လၧကဆါအမံၩ့လီၫ. ထီးနီၪ လဖၧၫ့,အဝ့ၫၥံၪအၪ့ကံၩ့အၪ့ယၫဝ့ၫ ဘဲၫၥိၭအမိအီၪ အနံၩအၥၫ့လနၩ့နၩ့လီၫ."
		},
		"11": {
			"1": "<sup>1</sup> တၭၦဆၧအၪ့မၧၫ့ဖိၪလဖၪ, ဒဲၦထၧၫ့ဖုဝဲၥံၪအီၪလၧ ခးယုဒၫအဖၧၩ့လဖၪနီၪ, နါဂၧၫ့ဝ့ၫလၧၦဆၨၩၥံၪဒိၭ",
			"2": "<sup>2</sup> န့ယွၩအလူအထၫလီၫ.- တၭထီးစပံတၧၫထဲၩ့ထၪ့ဝ့ၫ လၧယရုစလံၫ့နီၪ, ၦဒိၭဆၧကူၭတရံၭလဖၪဂဲးလိၬ",
			"3": "<sup>3</sup> တ့ၭလိၬအၥၭလၧအဝ့ၫဒၪ,- စံၭဝ့ၫး နဝ့ၫဒၪယီၩနလ့ၩ နုၬလၧၦလဒိၭဘၪဆၧကူၭတရံၭၥံၪ အအီၪနီၪ နအၪ့ ဎုၬမၬဆၧလၧအဝ့ၫၥံၪနီၪကၨ.",
			"4": "<sup>4</sup> အ့ၪမွဲစပံတၧၫလီၩဘၪ အဝ့ၫၥံၪလမံၩ့ဘၪလမံၩ့လ",
			"5": "<sup>5</sup> မံၩ့ဘၪလမံၩ့တၭ,စံၭဝ့ၫ,- ယဝ့ၫဒၪယီၩယအီၪလၧဒိၩ့ ယီၭပၫအဖၧၩ့နီၪယဘၩဆိၪဖၪဆၧတၭ,လၧယဒၪ ဆၧလၧယၫအဖၧၩ့နီၪ,ယဒၪဘၪဆၧမၩအၥၭဘဲၫဖၬ ဘဲၩ့ဖၭဒိၪအၥိၭ လၧအနိၪ့လံနိၪ့ဆဲၩလၩ့အၥၭလၧမူၭ",
			"6": "<sup>6</sup> ခိၪတၭ,ထီၩ့လၩ့လၧယအီၪလီၫ.- ယယိဆီၫ့မီၪ့ဆၧ လၩ့ထံးလၩ့ဆ့ၭတၭ, ယဒၪဆၧအီၪလၧအခၪ့လံခီၫ, လၧဂၪ့ခိၪချိၫ့ယီၩ, ဒဲဆၧမံၩ့လၬ,ဒဲဆၧအစွၩၥ့ၪ,ဒဲထိၪ",
			"7": "<sup>7</sup> ၥံၪလံၪၥံၪလၧ ဆၧဖိၭဖၫ့နီၪလီၫ.- ယနါဂၧၫ့ဆၧအလူ ၥီၫနီၪ,စံၭယၧၩ, စပံတၧၫဧ့, ဂဲထုၪ့,မၩၥံၫ, အၪ့ဘီၪ.",
			"8": "<sup>8</sup> တၭယစံၭ,မွဲလၩလါအ့ၬ, ကဆါဧ့,အဂဲးဘဲၫယီၩ ဆၧအီၪလဆံၫ့ဘၪမွဲဂ့ၩ,ဆၧၥၭလိၪမွဲဂ့ၩ, ဂဲၫနုၬလၧ",
			"9": "<sup>9</sup> ယနိၭဖၧၩ့နးဆိၭအ့ၬ.- တၭဆၧအလူချဲၩ့ဆၧၫ့ယၧၩ လၧမူၭခိၪနံၫဖၧၫ့လဖၧၫ့း ဆၧလၧယွၩမၩဆံၫ့ဝ့ၫနီၪ,",
			"10": "<sup>10</sup> ထီးအီၪက့ၪအဝ့ၫ လၧဆၧလဆံၫ့ဘၪနီၪလဂ့ၩ.- ဆၧ မၩအၥၭဘဲၫနီၪၥၧၫ့ဖၧၫ့တၭ, ဆၧထီးအလူၬဘၪဆၧ",
			"11": "<sup>11</sup> ထုၭထၪ့ထဲၩ့ဒီၭအၥၭလၧမူၭခိၪအဖၧၩ့လီၫ.- ယိခွါ, ၦၥၧၫ့ဂၩအီၪဆၧၫ့ထုၪ့ချဲၫ့မၬ လၧဂံၪ့လၧယအီၪလၧ အဖၧၩ့နီၪ, အနဲၩ့ထံၭတၭ, မွဲၦလၧဆၧအၪ့မၧၫ့လၩ့ခွံၬ",
			"12": "<sup>12</sup> ဝ့ၫလၧစ့ၭစရံအၫနီၪထီၩ့လၧယအီၪလီၫ.- ၥၭမုနီၪစံၭ ယၧၩ,နၥၭထီးဂံၩ့ဂၩ့လဂ့ၩ, လ့ၩဆၧလၧအဝ့ၫၥံၪအ ၥိၭဘီၪ.ထၧၫ့ဖုဝဲလဖၪယီၩလ့ၩလၧယၥိၭတၭ, ပနုၬ လၧၦလဂၩနီၪအဂံၪ့ဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> အဝ့ၫဒၪဒုၭနဲၪပၧၩ လၧအဒၪဘၪယွၩအၥီၫ့လဂၩ ဆၧၫ့ထုၪ့လၧအဂံၪ့ဖၧၩ့တၭ, လီၩဘၪအဝ့ၫ, အၪ့မၧၫ့ ၦလ့ၩကိၭန့စစဲမၧၫ့ကိၭထဲၩ့အမံၩ့အၥၫ့ လၧစပံတၧၫ",
			"14": "<sup>14</sup> လၧယီၭပၫအဖၧၩ့နီၪဘီၪ.- အဝ့ၫဒၪမိလီၩဘၪနၧၩ, လၧဆၧချဲၩ့လၧအမိထိးထဲၩ့တၩ့ထဲၩ့နၧၩ, ဒဲနဂံၪ့ဖိၪ ၥံၪထီးအလူၬလီၫ.",
			"15": "<sup>15</sup> ယလီၩလၩ့လၬလၩ့ဆိၫဆၧအဘိၩ့ဘၭတၭ, ၥၭမု ဆံၫ့ဎံၪနီၪလၩ့ဘၪလၧအဝ့ၫၥံၪအလီၩ့ဘဲၫလၧပလီၩ့",
			"16": "<sup>16</sup> လၧအၥၫ့အၥိၭနီၪလီၫ.-ထီးနီၪလဖၧၫ့ယနၪ့ထၪ့ထဲၩ့ ကဆါအဆၧချဲၩ့လၧအစံၭဝ့ၫ, စယီဟၫ့ဘၭတံၫဇၫ့ ဆၧလၧထံၫကျၩလီၫ. အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩနၥံၪမိဒိၭ ဘၭတံၫဇၫ့နၥံၪအၥၭလၧၥၭမုဆံၫ့ဎံၪအဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> မၩအၥၭဘဲၫနီၪတၭ, ယွၩအ့ၪဖ့ၪလၫ့အဝ့ၫၥံၪလၧဆၧ ဖ့ၪလၫ့ဘဲၫအဖ့ၪလၫ့ၦလၧအနဲၩထဲၩ့ကဆါယ့ၫၡုၬ ဎရံၬ,ပဝ့ၫဒၪယီၩအၥိၭတၭ, ယဝ့ၫဒၪယီၩယမွဲပလၫ လၧအပဒၩ့ထၬယွၩမိၥ့ၪလဂၩလဲၪ.",
			"18": "<sup>18</sup> ထီးအဝ့ၫၥံၪနါဂၧၫ့ဆၧနီၪလဖၪတၭ, အီၪလၩ့မါပံၭ စံၭထၪ့အၪ့အူၭယွၩ,စံၭဝ့ၫမွဲတၡါ ယွၩဒုၭနီၫ့ယါလၩ့ ထဲၩ့ၦဆၨၩလဖၪအၥၭလၧဆၧမၧၫ့အဂဲးဆ့လီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၩ့မုလၩ့ဖၭလၧဆၧမၩ အၧၩ့မၩၥၫ့လၧ အအီၪထၪ့ဝ့ၫ လၧစတံဝံၫ့အကၠီၩ့နီၪ ဂၭဝ့ၫဖိးလၧဖနံၡၫ, ဒဲစဲပၧၭ,ဒဲအၪ့တအီၭတၭ, လီၩ",
			"20": "<sup>20</sup> ဘၪဆၧအလူအထၫန့ၫလၧၦယုဒၫဖိၪလီၫ.- မွဲလါနၫ့ ၦလနၩ့နၩ့လၧအကျၩနီၪ မွဲၦစဲပၧၭဖိၪ,ဒဲၦစဲၫရံနံၫဖိၪ, လၧအလ့ၩဖိးလၧအၪ့တအီၭနီၪ လီၩလၩ့ကဆါယ့ၫ ၡုၬအဆၧၥၭထိၬအပရၧၫ့တၭ, လီၩဘၪၦဂြံစၭဖိၪ",
			"21": "<sup>21</sup> ၥံၪလီၫ.- ယွၩအစူၪအီၪလၧအဝ့ၫၥံၪအၥိၭတၭ, ၦ နဲၩထဲၩ့ဝ့ၫကၠၪစိၩအၥၭလၧယွၩအအီၪ အၪဂၩလီၫ.",
			"22": "<sup>22</sup> ဆၧပရၧၫ့လဖၪနီၪ, ဆၧအီၪကီၪ့လၧယရုစလံၫ့နါ ဂၧၫ့ဝ့ၫတၭ, အဝ့ၫၥံၪအၪ့မၧၫ့ စဘၫနဘၭလ့ၩလၧ",
			"23": "<sup>23</sup> အၪ့တအီၭလီၫ.- အဝ့ၫဒၪနီၪလ့ၩထီၩ့တၭ, ဒၪဘၪယွၩ အခိးအတၩနီၪအၥုၪ့ထိၬအၥၭထိၬတၭ, ၦဂၨၪထၪ့ ၦထီးအလူၬအခဲၫ့ဘဲၫၥိၭအမိပထဲဒိၭနဲၩ့အၥၭလၧ",
			"24": "<sup>24</sup> ယွၩလၧအၥုၪ့ခံအၥၭလဲၫလီၫ.- အဂဲးဘဲၫယီၩအ ဝ့ၫဒၪလဂၩနီၪ မွဲၦအဂ့ၩ,ဒဲလၧၫ့ဎွ့ၩဝ့ၫလၧၥၭမုဆံၫ့ ဎံၪ,ဒဲဆၧနဲၩလီၫ.ဆၧအီၪက့ၪအၪထၪ့ၦခမျၧးဖၭဒိၪ လၧကဆါနီၪအဖၧၩ့လီၫ.",
			"25": "<sup>25</sup> စဘၫနဘၭလ့ၩဝ့ၫလၧတၫစၧၭဘဲၫၥိၭအမိအၪ့",
			"26": "<sup>26</sup> ဎၬန့စစီလူၫတၭး- ထီးအဒၪန့ဝ့ၫနီၪ, ထဲၩ့ၥိၫ့ဝ့ၫလၧ အၪ့တအီၭလီၫ. အဝ့ၫၥံၪလ့ၩနုၬအီၪဝ့ၫလၧဆၧအီၪ ကီၪ့အၥိၭထၧၫ့နံၪ့ယၫတၭ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ၦခမျၧးအၪ ဂၩလီၫ. အထံၩအဖျဲၥံၪ ဘၪဆၧကိၭဆိၫဝ့ၫလၧဎရံၬ ဖိၪထီးအၪ့တအီၭအဖၧၩ့နီၪလီၫ.",
			"27": "<sup>27</sup> တၭလၧမုနံၩလဖၪနီၪမီၪၥံၪဂဲၫစဲၪ့ထၪ့ခွံၬလၧယ",
			"28": "<sup>28</sup> ရုစလံၫ့ထီၩ့လၧအၪ့တအီၭအဖၧၩ့လီၫ.- လၧအဝ့ၫၥံၪ အကျၩနီၪၦၡၩအမံၩ့စအၫဂဘၧၭလဂၩဂဲထုၪ့တၭ, ဒုၭနဲၪဝ့ၫလၧၥၭမုနီၪ လၧဆၧၥၭဝံလၩ့ဒိၩဖၭဒိၪ မိအီၪ ထၪ့ဝ့ၫလၧခးထၧၫ့ဘံၪ့ယၫလီၫ. ဆၧနီၪအီၪထၪ့ဝ့ၫ",
			"29": "<sup>29</sup> လၧစကျီဒအၧၭစံစၧၫအဆိၩလီၫ.- အထံၩအဖျဲလဂၩ ဒဲလဂၩ, လၥ့ၪကယဲအၥ့ၪနီၪ, အီၪက့ၪအၥၭလၧအမိ ဖ့ၪယူဆၧလၧအထၧၫ့ဖုဝဲၥံၪလၧအအီၪဝ့ၫလၧခးယု",
			"30": "<sup>30</sup> ဒၫအဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဖ့ၪယူဝ့ၫလၧ ၦၥုၪ့က့ၭၥၭၡါၥံၪအအီၪ လၧစဘၫနဘၭ, ဒဲလၧစစီလူၫ အစူၪဖၧၩ့လီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ထီးအထီနီၪစဎွၩဟ့ရၧၭ ယၩ့ထၪ့အစူၪဘဲၫၥိၭအမိ",
			"2": "<sup>2</sup> မၩအၧၩ့မၩနၭဆၧအီၪကီၪ့လနၩ့နၩ့လီၫ.- တၭမၩၥံၫ စယ့မံၭလၧအထၧၫ့ဖုဝဲ လၧစယီဟၫ့နီၪလၧနၭလီၫ.",
			"3": "<sup>3</sup> ထီးအဒၪဘၪဝ့ၫလၧဆၧနီၪလမံၩ့ ဘၪၦယုဒၫဖိၪၥံၪ အၥၭတၭ,မၩထၪ့ဒီၭဖီၪ့ထၬစပံတၧၫဆ့, (မုနံၩနီၪ",
			"4": "<sup>4</sup> မွဲဘိၪ့ကိၪလဘၪဘၪလၧမံၪအနံၩလဖၪ,) - ဖီၪ့ထၬ ဒုၭနုၬဝ့ၫလၧထီၫ့ဖၧၩ့တၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦၥုၭဖိၪလ ဆံၫဎူၫဂၩအစူၪဖၧၩ့, ဘဲၫၥိၭအမိအီၪခိၭဝ့ၫဒၪတၭ, ဘိၪ့လ့ၩဖၬအ့ၪဖီၩ့ခွံၬနီၪ, မိအၪ့မၩန့ထၪ့အဝ့ၫလဂၩ လၧၦခမျၧးအမ့ၬယၫလီၫ.",
			"5": "<sup>5</sup> စပံတၧၫဘၪဆၧအီၪခိၭဝ့ၫလၧထီၫ့ဖၧၩ့နီၪ, အ့ၪမွဲ ဆၧအီၪကီၪ့ဖိၪၥံၪ ဘၩဆိၪဖၪန့အဂးလၧယွၩဆီၪ့ဆီၪ့ လ့ၬလီၫ.",
			"6": "<sup>6</sup> ထီးစဟ့ရၧၭမိထုၭထၪ့အဝ့ၫဒၪအထီ ဘူၭထၪ့ယူၭ နီၪ,လၧမုလနၩနီၪ, စပံတၧၫဘၪဆၧစၧၩ့ထၬလၧၥွ့ၫ ထၭနံၫဘီၩ့တၭ, မံၫမၪဝ့ၫလၧၥုၭဖိၪနံၫဂၩအဘိၩ့ဆၧၩ့ တၭ,ၦအီၪခိၭဆၧလၧထီၫ့အတရၫ့ထံၭနီၪ အီၪခိၭဆၧ",
			"7": "<sup>7</sup> လီၫ.- ယိခွါ,ယွၩအၥီၫ့လဂၩအီၪထၪ့တၭ, ဆၧဖၩ့ ထၪ့လၧထီၫ့ဖၧၩ့နီၪ, အဝ့ၫဒၪဒိၪစပံတၧၫအဂုၬဖၩ တၭ,ဒုၭဂဲထုၪ့ဝ့ၫတၭ, စံၭဝ့ၫ, ဂဲထုၪ့ထၪ့ချဲၫ့ချဲၫ့ဘီၪ. ၥွ့ၫထၭနီၪလၩ့ကွဲၪခွံၬဝ့ၫလၧအစူၪလီၩ့လီၫ.",
			"8": "<sup>8</sup> အၥီၫ့နီၪလီၩဘၪအဝ့ၫ, ခဲးထူၬနယးဒံၩ့,ဒဲၥိၭထၪ့ထဲၩ့ နခၪ့ဖံၭဘီၪး အဆၧမၩဝ့ၫဘဲၫနီၪၥိၭလီၫ. အဝ့ၫနီၪ လီၩဘၪအဝ့ၫဒၪ, ခၭချံၭထၪ့နဖၬဘဲၩ့တၭ, ဖိၬထၪ့ယ",
			"9": "<sup>9</sup> ခဲၫ့ဆံၭ.- အဝ့ၫဒၪစဲၪ့ထၪ့ဖိၬအခဲၫ့နီၪ အၥီၫ့မၩဆၧနီၪ မွဲအလၥ့ၪယၫဘၪဝ့ၫလၧအမၩတၡါနီၪး ဆီၫ့မီၪ့လၧ",
			"10": "<sup>10</sup> အဒၪဆၧလၧယၫလခီၫလီၫ.- ထီးအဝ့ၫၥံၪလ့ၩဖီၩ့ခွံၬ ၦအီၪခိၭဆၧလဆၫ့ဒဲနံၫဆၫ့နီၪ, ဖိးလၧတရၫ့ထၭလၧ အၥိၫ့ထၪ့လၧဒိၩ့ဖၧၩ့နီၪ, အဆၧအီၪဝဲထၪ့ဒၪအၥၭ တၭ,အဝ့ၫၥံၪစဲၪ့ထၪ့ဝ့ၫနီၪ, လ့ၩဖိၬဖၧၩ့ၥၭလဘီၩ့တၭ, အၥီၫ့နီၪစဲၪ့ဖၭ လၧအဝ့ၫဒၪချဲၫ့မၬလီၫ.",
			"11": "<sup>11</sup> စပံတၧၫနၪ့ထၪ့ထဲၩ့အၥၭတၭ, စံၭဝ့ၫဘိၩ့နဲၪ့ယီၩ ယၥ့ၪယၫယူၭလၩ့ထံးလၩ့ဆ့ၭ လၧကဆါအၪ့မၧၫ့ လၩ့န့အၥီၫ့တၭ, မၩဖီၩ့မၩဖျ့ၭယၧၩလၧစဟ့ရၧၭ အစူၪဖၧၩ့,ဒဲလၧၦယုဒၫဖိၪၥံၪ အဆၧယိလါအဖၧၩ့",
			"12": "<sup>12</sup> ထီးအလူၬလီၫ.- ထီးအၥ့ၪယၫဆၧဂ့ၩဘၪစဲၪနီၪ,လ့ၩ ဝ့ၫထီၩ့လၧစယီဟၫ့ ကိၭထဲၩ့ဝ့ၫအမံၩ့အၥၫ့ လၧစမၫ ကၧၭအမိနးမၫရံၫအဂံၪ့လီၫ. ၦအီၪကိၩ့အီၪကီၪ့ဘၩ ဆိၪဖၪဆၧထီးနီၪအၪဂၩလီၫ.",
			"13": "<sup>13</sup> စပံတၧၫဒိၪထိၬတရၫ့အဆံၭတၭ, ၦမုၪနၩ့အမံၩ့",
			"14": "<sup>14</sup> နးရိဒၫလဂၩ ဂဲၫခိၭနၪဝ့ၫလီၫ.- မွဲအၥ့ၪယၫစပံတၧၫအ လူနီၪလၧအၥုၪ့ထိၬၥၭထိၬအကၠီၩ့တၭ, လဝဲထၪ့ဘၪ တရၫ့နီၪ, ထဲၩ့စဲၪ့တလဲးနုၬဝ့ၫတၭ, လီၩဘၪလၧစပံ",
			"15": "<sup>15</sup> တၧၫဆၧၫ့ထုၪ့လၧ တရၫ့အခၪ့ထံၭနီၪလီၫ.- ၦၡၩၥံၪ စံၭဝ့ၫ,နဖျႃထၪ့မၬကၨ, မွဲလါနၫ့အဝ့ၫဒၪစံၭလၧအၥၭ ဆီၪ့ဆီၪ့လ့ၬ လၧအမွဲဆၧဘဲၫနီၪလီၫ. အဝ့ၫၥံၪစံၭဝ့ၫ,",
			"16": "<sup>16</sup> မွဲအၥီၫ့လီၫ.- မွဲလါနၫ့ဘိၩ,စပံတၧၫဒိၪထိၬဒံၭဆၧ ဒံၭတၭ,ထီးအဝ့ၫၥံၪဝဲထၪ့နီၪ ဒၪဘၪဝ့ၫတၭ, ထီၫမံၫ ထီၫမၪဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ဘဲၫအဝ့ၫၥံၪ မိအီၪလၩ့မါပံၭအၥိၭတၭ,စပံတၧၫဝံၩ ဝါအစူၪတၭ,လီၩဘၪလၧကဆါနီၪထုၭထၪ့ခွံၬဝ့ၫ လၧထီၫ့ဖၧၩ့ ဘဲၫအံၩဘဲၫအိၩ အဂဲးအကၠီၪ့လီၫ. တၭစံၭဝ့ၫ,လ့ၩလီၩဘၪဆၧနီၪလဖၪ လၧစယ့မံၭ ဒဲ ထၧၫ့ဖုဝဲၥံၪဘီၪ. အဝ့ၫနီၪစဲၪ့ထၪ့ဝ့ၫတၭ, လ့ၩဝ့ၫလၧ အလးလစီၪ့ဒၪလီၫ.",
			"18": "<sup>18</sup> ထီးဆၧဖၩ့ထၪ့နီၪ, စပံတၧၫအီၪခီၫခီၫလဲၪအဂဲးနီၪ,",
			"19": "<sup>19</sup> ၦၥုၭဖိၪဘၪဆၧတုၩ့ထၪ့တုၩ့လၩ့ၡၩခိၬအ့ၬ.- တၭထီး စဟ့ရၧၭအၪ့ဎၬဝ့ၫနီၪ, လဒၪဘၪတၭ, အၪ့စိၭအၪ့စၪ့ ၦခိၭဆၧဖိၪၥံၪဂီၩ့တၭ, မၪလူၬလၧဆၧဘၪမၩၥံၫအဝ့ၫ ၥံၪလီၫ.အဝ့ၫဒၪလ့ၩလၩ့ခွံၬ လၧခးယုဒၫထီၩ့လၧစ့ၭစရံ အၫနီၪအီၪဝ့ၫထီးနီၪလီၫ.",
			"20": "<sup>20</sup> စဟ့ရၧၭအၥၭထၪ့ လၧၦတဲအၫဖိၪၥံၪ, ဒဲၦစဲဒၧၫ့ ဖိၪၥံၪအကၠီၩ့တၭ, အဝ့ၫၥံၪဂဲၫလၧအၥၭလဖျိၪ့ဎးလၧအ အီၪ,ဆၧမိအီၪဘၪလိၬအိၭလိၬအၥၭတၭ, အၪ့ကံၩ့ အၪ့ယၫၦယိစဎွၩအလးမံၫ စဘျၫစတၧၭလီၫ. အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪအထံၫအခးနီၪ, န့ဘၪဆၧအၪ့ဆၧ အီၩလၧစဎွၩအဝ့ၫဒၪယီၩလီၫ.",
			"21": "<sup>21</sup> မုနံၩလၧအဖၭဝ့ၫနီၪ, စဟ့ရၧၭကီၩ့ထၪ့ၥိၭထၪ့စဎွၩ အကီၩ့အၥိၭတၭး ဆၧၫ့နၩ့ဝ့ၫလၧလးဆီၩ့ဆီအဖၫ့ခိၪ",
			"22": "<sup>22</sup> တၭ,လီၩ့လၩ့လၬလၩ့ဆၧလီၫ.- ၦခမျၧးကိၭၡၭထၪ့ စံၭဝ့ၫ,မွဲယွၩအလူ မွဲၦၡၩအလူအ့ၬ. မွဲအလစံၭ",
			"23": "<sup>23</sup> ထၪ့အၪ့အူၭဘၪယွၩအကၠီၩ့နီၪ,- ကဆါအၥီၫ့လဂၩ ကျီၪ့အဝ့ၫချဲၫ့မၬတၭ, လိၪ့အၪ့ခွံၬဝ့ၫတၭ, အၥၭစဲၪ့ထၪ့ ခွံၬဝ့ၫဒၪလီၫ.",
			"24": "<sup>24</sup> မွဲလါနၫ့ယွၩအလူအထၫအၪထၪ့ဂီထၪ့တၭ, ဒိၪ",
			"25": "<sup>25</sup> ထၪ့လဲထၪ့ဝ့ၫဒၪလီၫ.- စဘၫနဘၭဒဲစစီလူၫ မၩဂီၩ့အ ဆၧမၩတၭ, အၪ့မၩန့စယီဟၫ့ ကိၭဝ့ၫအမံၩ့အၥၫ့လၧ စမၫကၧၭတၭ, ထဲၩ့ခွံၬဝ့ၫလၧယရုစလံၫ့လီၫ."
		},
		"13": {
			"1": "<sup>1</sup> တၭမီၪၥံၪဒဲဆရၫလနၩ့နၩ့ဘဲၫၦစံၭဆၧအၥိၭ စဘၫ နဘၭ,ဒဲစစံမအၧၫ့ လၧၦကိၭဝ့ၫလၧစနဲဂၧၫ, ၦစဲၫရံနံၫ ဖိၪစလုစအၧၭ, ဒဲၦလၧအဒိၪထၪ့ဎုၬလၧခးအၦဒိၪ စဟ့ရၧၭ,စမန့အၫ့ဒဲစစီလူၫၥံၪ အီၪဝ့ၫလၧဆၧအီၪကီၪ့ အကျၩလၧအၪ့တအီၭအဖၧၩ့နီၪလီၫ.",
			"2": "<sup>2</sup> ထီးအမၩကဆါအဆၧ ဒဲဒုၪဆၧအၪ့ဆၧအီၩအ ဘိၩ့ဘၭတၭ, ၥၭမုဆံၫ့ဎံၪနီၪ, စံၭဝ့ၫ, အၪ့နၩ့ဖၭန့ယၧၩ လၧစဘၫနဘၭဒဲစစီလူၫလၧဆၧမၩလၧယကိၭန့အ ဝ့ၫၥံၪအဂးဘီၪ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪဒုၪဆၧအၪ့ဆၧအီၩ ဒဲဘၩဆိၪ ဖၪဆၧတၭ, အီၪက့ၪအစူၪလၧအလီၩ့နီၪဂီၩ့,အၪ့မၧၫ့ အလ့ၩဆၧလီၫ.",
			"4": "<sup>4</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪဒိၭဆၧအၪ့မၧၫ့အ လ့ၩဆၧလၧၥၭမုဆံၫ့ဎံၪနီၪ လ့ၩလၩ့ထီၩ့ဝ့ၫလၧစံၫလူ ၡၫတၭ, စဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, ထူၬထၪ့ကဘၩ့ထီၩ့",
			"5": "<sup>5</sup> လၧစဲပြၧၭနီၪလီၫ.- တၭအဝ့ၫၥံၪထီၩ့လၧစၫလမံၭ အ ဖၧၩ့နီၪ,လီၩလၩ့လၬလၩ့ယွၩအလူအထၫ လၧၦယုဒၫ ဖိၪၥံၪအၥရိၬလဖၪအဖၧၩ့လီၫ. အီၪဝ့ၫလၧစယီဟၫ့ လၧအမၩဆၧအခ့ၫအၡၩအလးလီၫ.",
			"6": "<sup>6</sup> လ့ၩခၫ့ဂၬကျိၩ့ထၧၫ့ကျိၩ့ယၫ ထီၩ့လၧပၫဖီၭတၭ, ဒၪဘၪၦမၩကဒၩၦမ့ၬ, မီၪအဘျၪၦယုဒၫဖိၪအမံၩ့မွဲ",
			"7": "<sup>7</sup> စဘၫယံစၧၭလဂၩလီၫ.- အဝ့ၫနီၪအီၪလၧကျိၩ့အၦဒိၪ အၥိၭလၧအၥုၪ့ဆၭအၥၭဆၭ စစၧဇအၧၭဖီလၧၭလီၫ. အဝ့ၫနီၪမိခိၭနၪဘၪအၥၭ လၧယွၩအလူအထၫတၭ,",
			"8": "<sup>8</sup> ကိၭန့စဘၫနဘၭဒဲစစီလူၫလီၫ.- အ့ၪမွဲစအ့လမၭၦမၩ ကဒၩၦမ့ၬလဂၩနီၪ အၪ့ဎၬကၠၪခွံၬကျိၩ့အၦဒိၪအၥၭ လၧဆၧနဲၩအဖၧၩ့လီၫ. (ၦစံၭဆၧလၧအ့လမၭနီၪ,",
			"9": "<sup>9</sup> မွဲအစံၭဝ့ၫ,ၦမၩကဒၩၦမ့ၬလီၫ.)- စစီလူၫဘဲၫၦစံၭဆၧ အၥိၭ,စပီလူၫလဂၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့လၧၥၭမုဆံၫ့ဎံၪ",
			"10": "<sup>10</sup> နီၪယိထံၫယိဆၭအဝ့ၫလဂၩ,- စံၭဝ့ၫ, ၦလၧအလၧၫ့ ထၪ့ဎွ့ၩထၪ့ဝ့ၫ လၧဆၧအၪ့ဝံၩအၪ့လီၫ,ဒဲဆၧအၧၩ့ ဆၧၥၫ့ထီးအလူၬ, မုၪခီၩလဲးအဖိၪ, ဆၧတီၩဆၧလီၩ့ ထီးအလူၬအဒုၪအဒၩလဂၩဧ့, နကၠၪခွံၬကဆါအဖၧၩ့",
			"11": "<sup>11</sup> ၥၭတီၩဖၧၩ့ၥၭလီၩ့နီၪ,မွဲနအီၪထီအ့ၬဧၪ.- ယိခွါ, ဘိၩ့ နဲၪ့ယီၩ,ကဆါအစူၪအီၪလၧနလီၩ့တၭး နမ့ၬဘျီၪ နလဒၪလၧၩ့ဘၪမုၥံၪလၩၥံၪ ထီးအထီဘၪနီၪ လီၫ. ဆၧအုၪ့ဒဲဆၧခံၭလၩ့ဘၪ အဝ့ၫဒၪချဲၫ့မၬတၭ, စဲၪ့ဝံၩ့ ဝၩ့အၪ့ဎၬၦမီၩ့ဝ့ၫလၧအစူၪလီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့,ကျိၩ့အၦဒိၪ ဒၪဘၪဆၧမၩအၥၭနီၪ, ထီၫမံၫထီၫမၪဝ့ၫ လၧကဆါအဆၧၥီၪ့ဆၧၥၫ့အကၠီၩ့ တၭ,နဲၩထဲၩ့ဝ့ၫဒၪလီၫ.",
			"13": "<sup>13</sup> စပီလူၫဒဲၦအီၪလၧအၥိၭၥံၪ စဲၪ့ထၪ့ခွံၬလၧပၫဖီၭ တၭ,လ့ၩဝ့ၫထီၩ့လၧပၧဂၫ လၧအဘၪဆဲၫ့လၧပၫ့ဖံလ အၫနီၪစယီဟၫ့စဲၪ့ဖၭလၧအဝ့ၫၥံၪတၭ,ထဲၩ့ထဲၩ့ဝ့ၫ",
			"14": "<sup>14</sup> လၧယရုစလံၫ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫလၧပၧဂၫ နီၪ,လ့ၩဝ့ၫထီၩ့လၧအၪ့တအီၭ လၧအဘၪဆဲၫ့လၧ ပစံဒအၫတၭ, လၧမးၥံၫအနံၩနီၪ လ့ၩနုၬဆၧၫ့နၩ့ဝ့ၫ",
			"15": "<sup>15</sup> လၧၥရိၬဖၧၩ့လီၫ.- ဖီလံၬဆၧၥီၪ့ဆၧၥၫ့, ဒဲမီၪလဖၪ အလူအထၫဂီၩ့,ၦၥရိၬခိၪအၪ့မၧၫ့ၦလ့ၩစံၭအဝ့ၫၥံၪ, ၦၡၩၥံၪ,ဖုၥံၪဝဲၥံၪဧ့, ဆၧချဲၩ့ၦဂၨၪထၪ့ ၦၡၩၥံၪအခဲၫ့ အ့ၪအီၪလမံၩ့မံၩ့တၭလီၩထဲၩ့ဘီၪ.",
			"16": "<sup>16</sup> စပီလူၫဂဲထုၪ့တၭ, ဝံၩဝါအစူၪနီၪ,စံၭဝ့ၫ,ၦၡၩအံၫ စရ့လၭဖိၪၥံၪ ဒဲၦလၧအၥၭမဲၪယွၩၥံၪဧ့, ခိၭနၪဆံၭ.",
			"17": "<sup>17</sup> ၦအံၫစရ့လၭအဆၨၩယီၩ အယွၩရွံန့ပဖါၥံၪတၭ, မွဲအအီၪက့ၪထၪ့ထီၫ ၦဆၨၩလၧအအီၪၦမွံၩလၧခး အံဇံၭအဖၧၩ့နီၪ, ဆိၬထၪ့ခွံၬ အဝ့ၫၥံၪ လၧအစူၪ",
			"18": "<sup>18</sup> ယူၬထၪ့အၥၭလီၫ.- တၭလုအၪ့လုအီၩအဝ့ၪၥံၪလၧ",
			"19": "<sup>19</sup> မံၩ့လၬကျၩဖိၭဘိၭအနံၪ့လံဆံၫလီၫ.- နၫ့ထၪ့ခွံၬၦ နွ့ၫဆၨၩလၧခးကၫနအၫ့တၭ, ဖ့ၪလၫ့အၪ့နၩ့ဖၭအ",
			"20": "<sup>20</sup> ထံၫအခးလၧ အဝ့ၫၥံၪအဆၧန့ၥၫအဂးလီၫ.- လၧ ခဲၫ့နီၪဖ့ၪလၫ့အဝ့ၫၥံၪလၧၦစ့ၩရၫ့ဆၧလဖၪထီၩ့လၧ မီၪစစၫမုၫအ့လၭ ဖိၭဘိၭအနံၪ့လံယၩယဲဆံၫလီၫ.",
			"21": "<sup>21</sup> လၧခဲၫ့ထဲၩ့နီၪအဝ့ၫၥံၪအၪ့ကံၩ့စဎွၩတၭ, ယွၩဖ့ၪ လၫ့ဝ့ၫလၧၦဘံၪ့ယမံၫ့အဒီၪ့, စကံၭအဖိၪခွၫ စစီလူၫ",
			"22": "<sup>22</sup> အနံၪ့လံဆံၫလီၫ.- မွဲအနၫ့ထၪ့ခွံၬအဝ့ၫဒၪလဂၩနီၪ, အီၪက့ၪထၪ့စဒၫဝံၭလၧစဎွၩတၭ, ထိးအၥၭလၧအ ဂး, စံၭဝ့ၫ, ယဒၪန့ၦလၧအ ဘၪ ယ ၥၭ လဂၩလၧ အမိမၩ ထီးဒၪယၥၭ ထီးအလူၬ, စယ့စံၫအဖိၪခွၫ စဒၫဝံၭလီၫ.",
			"23": "<sup>23</sup> ဘဲၫအစံၭဝဲၩဝ့ၫအၥိၭနီၪ, ယွၩဒုၭအီၪထၪ့လၧၦ လဂၩနီၪအချံၫအၥၪ ၦထိးထဲၩ့တၩ့ထဲၩ့ဆၧယ့ၫၡုၬ",
			"24": "<sup>24</sup> လၧၦအံၫစရ့လၭဖိၪၥံၪအဂးလီၫ.- လၧအဝ့ၫဒၪလချႃၭ ဂဲၫဒံၭဘၪနီၪ,စယီဟၫ့လီၩလၩ့ ကယဲၦအံၫစရ့လၭဖိၪ ၥံၪထီးအလူၬလၧဆၧဘၭတံၫဇၫ့ ဘၪဆဲၫ့လၧဆၧ",
			"25": "<sup>25</sup> နၪ့ထၪ့နီၫ့ယါလၩ့ထဲၩ့ၥၭအဂဲးအကၠီၪ့လီၫ.- ထီးစယီ ဟၫ့အဆၧမၩဒၪဝ့ၫလၩ့ဘူၭမိလူၬနီၪ, စံၭဝ့ၫဒၪ, နၥံၪ ဆီၫ့မီၪ့လၧယမွဲပလၫလဂၩလဲၪ, ယမွဲအဝ့ၫနီၪအ့ၬ. မွဲလါနၫ့ဘိၩ့, ယိခွါ, ၦဂဲၫလၧယလးခဲၫ့လဂၩအခၪ့ ဖံၭနီၪ,ယကြၨၭကွဲၪလၩ့ယဝ့ၫအ့ၬ.",
			"26": "<sup>26</sup> စအၫဘြဟၫ့အဖိၪၥံၪ, ၦၡၩၥံၪ, ဖုၥံၪဝဲၥံၪဒဲၦၥၭမဲၪ ယွၩလၧနၥံၪအကျၩၥံၪဧ့, ဆၧထိးထဲၩ့တၩ့ထဲၩ့အလူ",
			"27": "<sup>27</sup> အထၫယီၩ ဆၧဖ့ၪယူနၥံၪလီၫ.- အဂဲးဘဲၫယီၩ ၦအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ ဒဲအၦဒိၪၦၡါၥံၪလၥ့ၪ ယၫဘၪအဝ့ၫဒၪ, ဒဲမီၪလဖၪအလူအထၫ လၧၦဖီဝ့ၫ ကိၭမးၥံၫအနံၩအဖၧၫ့ဒ့ၭတၭ, မၩလၧၫ့ထၪ့ဎွ့ၩထၪ့",
			"28": "<sup>28</sup> ဝ့ၫလၧအစ့ၩရၫ့စၪဝ့ၫအကၠီၩ့လီၫ.- ဂ့ၩဘၪၥံၫအ ဆၧမၪနီၪလဒၪန့ဘၪလါနၫ့ဘိၩ, အၪ့ကံၩ့အၪ့ယၫ စပဲလၭဘဲၫၥိၭ အမိမၩၥံၫအဝ့ၫဒၪလီၫ.",
			"29": "<sup>29</sup> ထီးအဝ့ၫၥံၪမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ ကယဲဆၧကွ့ၭအ ၥၭလၧအဂဲးအကၠီၪ့တၭ, ဆိၬလၩ့ထဲၩ့ဝ့ၫလၧထုၪ့စူၪ ယၫအလီၩ့နီၪ အီၪက့ၪနုၬဝ့ၫ လၧဆၧၥွၪခိၪအဖၧၩ့",
			"30": "<sup>30</sup> လီၫ.- မွဲလါနၫ့ဘိၩ့ ယွၩဒုၭဂဲထုၪ့ထဲၩ့ဝ့ၫလၧဆၧၥံၫအ",
			"31": "<sup>31</sup> ဖၧၩ့လီၫ.- အဝ့ၫဒၪဒုၭနဲၪအၥၭလၧ ၦဂဲၫဖိၬအခဲၫ့လၧ ဂၫလလံၫထီၩ့လၧယရုစလံၫ့ၥံၪ အမ့ၬယၫအၪနံၩအၪ ၥၫ့လီၫ. အဝ့ၫၥံၪမွဲၦထိးအၥၭ လၧၦခမျၧးအမ့ၬ ယၫဘိၩ့နဲၪ့ယီၩလီၫ.",
			"32": "<sup>32</sup> ပဝ့ၫဒၪယီၩပလီၩဘၪနၥံၪ လၧဆၧၥၭထိၬအပရၧၫ့ လၧဆၧစံၭဝဲၩအဂဲး အီၪဝ့ၫလၧပဖါၥံၪအအီၪလီၫ.",
			"33": "<sup>33</sup> ယွၩဒုၭဂဲထုၪ့ထဲၩ့ ယ့ၫၡုၬနီၪမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ဆၧ ယီၩလၧအဖိၪအလံၩ ပဝ့ၫဒၪယီၩအဂး, ဘဲၫဆၧကွ့ၭ အၥၭလၧလံၬစံၭထၪ့အၪ့အူၭ အမိၡါနံၫဒုၩလဒုၩအ ဖၧၩ့အၥိၭနီၪ, ယထၪ့ဖိၪယူၭနၧၩလၧမုဆၫလနံၩယီၩယူၭ, နဝ့ၫဒၪယီၩနမွဲယဖိၪခွၫလီၫ.",
			"34": "<sup>34</sup> တၭလၧနီၪအမ့ၬယၫ မွဲအဒုၭဂဲထုၪ့အဝ့ၫဒၪလၧဆၧ ၥံၫအဖၧၩ့ဘဲၫၥိၭ အထီးအုၪလၧၩ့လဂ့ၩလီၫ. စံၭဝ့ၫ ဘဲၫယီၩ, ယ မိ ဖ့ၪ လၫ့ န ၥံၪ ဆၧ စံၭ ဝဲၩ ဆံၫ့ ဎံၪ လ ဖၪ အ ဂုး အ ခၧၫ့ ဘၪ ဆဲၫ့ လၧ စ ဒၫ ဝံၭ လီၫ.",
			"35": "<sup>35</sup> အခိးမွဲဘဲၫနီၪတၭ, လၧလံၬစံၭထၪ့အၪ့အူၭလစီၪ့ ဒၪစံၭဝ့ၫ,န ဒုၭ ဒၪ ဘၪ န ခ့ၫ န ၡၩ ဆံၫ့ ဎံၪ လ",
			"36": "<sup>36</sup> ဂၩနီၪလၧဆၧအုၪအ့ၬ.- အဂဲးဘဲၫယီၩစဒၫဝံၭမၩအ ဆိၩဒၪဝ့ၫ အဆၧမၩဘဲၫယွၩအဆၧဒုၭကိၪ့အီၪဝ့ၫ အ ၥိၭနီၪမံၫဝ့ၫတၭ, ဆၧအီၪက့ၪကီၪ့ဝ့ၫဒၪ လၧအဖါ",
			"37": "<sup>37</sup> လဖၪလၧအဒၪဘၪဆၧအုၪနီၪလီၫ.- အ့ၪမွဲၦလၧယွၩ ဒုၭဂဲထုၪ့ထဲၩ့ဝ့ၫလဂၩယီၩဒၪဘၪဆၧအုၪအ့ၬ.",
			"38": "<sup>38</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦၡၩၥံၪ,ဖုၥံၪဝဲၥံၪဧ့, ၥ့ၪယၫ နၥံၪဝ့ၫလၧၦလီၩလၩ့လၬလၩ့နၥံၪလၧ ဆၧဖီၩ့ဖျ့ၭဆၧ",
			"39": "<sup>39</sup> ဒဲၩဘၭလၧၦလဂၩယီၩအကၠီၩ့ဆံၭ.- လၧအဝ့ၫနီၪ အကၠီၩ့ၦကိၭဂၩဒ့ၭ လၧအနဲၩထဲၩ့ဆၧလဖၪယၫနီၪ ဖီၩ့ဖျ့ၭလၧကယဲဆၧလၧစမိစ့ၭ အဆၧမၪလူၬမၩ ဖီၩ့မၩဖျ့ၭဝ့ၫလၥ့ၪဘၪနီၪလီၫ.",
			"40": "<sup>40</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧမီၪၥံၪချဲၩ့ဝ့ၫနီၪ, ဘဲၫ ၥိၭအထီးလၩ့ဘၪလၧ နၥံၪအလီၩ့လဂ့ၩတၭ, ထီးလၩ့ နၥံၪအၥၭဘီၪ.",
			"41": "<sup>41</sup> ၦလၧအမၩကြၩ့ထမးဆၧၥံၪဧ့, ယိခွါ, ဒဲထီၫမံၫ ထီၫမၪတၭ, ဘၪဆၧဂၭဂီၩ့ဆံၭ, အဂဲးဘဲၫယီၩ ယမၩဆၧမၩလၧနၥံၪအနံၩအၥၫ့, ဆၧမၩလၧၦအ့ၪလီၩဘၪနၥံၪလၩ့ထံးလၩ့ဆ့ၭ လါနၫ့ဘိၩ, နၥံၪမိနဲၩလၩလါအ့ၬ.",
			"42": "<sup>42</sup> ၦၡၩၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧၥရိၬဖၧၩ့ အဘိၩ့ဘၭနီၪ, ဘဲၫၥိၭအဝ့ၫမိလီၩလၩ့လၬလၩ့ဆၧ အလူအထၫနီၪ လၧမးၥံၫအနံၩခိၬတၭ, ဆၧအၪ့ကံၩ့အၪ့ယၫဝ့ၫလီၫ.",
			"43": "<sup>43</sup> ဆၧကွဲၪဖျါဆၧအီၪကိၩ့အီၪကီၪ့တၭ, ၦယုဒၫဖိၪၥံၪဒဲ ၦလၧအယူၭယၪ့ယွၩလၧအနုၬ လၧၦယုဒၫဖိၪၥံၪအ ထူၫအရူၫအၪဂၩ လီၩ့ဖိၬစပီလူၫ ဒဲစဘၫနဘၭ အခဲၫ့ တၭ,အဝ့ၫၥံၪချဲၩ့ပဂၨၪထၪ့ၦၡၩနီၪအခဲၫ့ ဘဲၫၥိၭအမိ အီၪဂုးခၧၫ့လၧယွၩအခိးအတၩအဖၧၩ့လီၫ.",
			"44": "<sup>44</sup> ထီးအဘၪမးၥံၫအနံၩ လၧခဲၫ့လဖၧၫ့နီၪ, ဘဲၫၥိၭအ မိခိၭနၪယွၩအလူတၭ, ၦအီၪကိၩ့အီၪကီၪ့ဝ့ၫဘူၭထၪ့",
			"45": "<sup>45</sup> အမိလူၬထၧၫ့ဒိၩ့ယၫလီၫ.- အ့ၪမွဲထီးၦယုဒၫဖိၪၥံၪ ဒၪဘၪၦၡၩခမျၧးလဖၪနီၪ, အၥၭထၪ့ဆီၪ့ဎွ့ၩထၪ့ဝ့ၫ တၭ,ဂဲးလိၬတ့ၭလိၬဆၧချဲၩ့လၧစပီလူၫ လီၩဘၪနီၪ,",
			"46": "<sup>46</sup> ဂဲးလိၬတ့ၭလိၬဝ့ၫတၭ, ဒုၪဒွ့ၪဝ့ၫဆ့လီၫ.- စပီလူၫ ဒဲစဘၫနဘၭအီၪက့ၪဒူၩအၥၭတၭ, စံၭဝ့ၫ, ၦလီၩလၩ့ လၬလၩ့ဆိၫနၥံၪလၧယွၩအလူအထၫအလးအီၪ ဝ့ၫလီၫ.အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ လၧနၥံၪအီၪက့ၪခွံၬဝ့ၫအ ကၠီၩ့တၭ,နၥံၪစ့ၩရၫ့လၩ့ဒၪနၥံၪအၥၭ လၧနၥံၪလကြၨၭ ဒိၭန့ဘၪဆၧမၧၫ့အဆိၩအကၠၪနီၪ, ယိခွါ, ၦကၠၪစိၩ ပၥၭလၧၦဆၨၩလဖၪအအီၪလီၫ.",
			"47": "<sup>47</sup> အဂဲးဘဲၫယီၩကဆါမၪလူၬပၧၩဘဲၫနီၪး ယအီၪက့ၪ နၧၩလၧၦဆၨၩလဖၪ အဆၧဖၩ့အဂး, ဘဲၫၥိၭနမိ ကဲၪထၪ့ဆၧထိးထဲၩ့တၩ့ထဲၩ့ ဆၧဖိးလၧဂၪ့ခိၪအထုၬ လီၫ.",
			"48": "<sup>48</sup> ဆၧနီၪလဖၪၦဆၨၩၥံၪနါဂၧၫ့နီၪ အၥၭထိၬဝ့ၫတၭ, စံၭထၪ့အၪ့အူၭကဆါအလူအထၫလီၫ. ထီးဒၪၦလၧ ဆၧစ့ၩရၫ့ဝဲၩဝ့ၫ လၧအမိန့ဘၪဆၧမၧၫ့အဆိၩအကၠၪ",
			"49": "<sup>49</sup> လဖၪနီၪနဲၩထဲၩ့ဝ့ၫဒၪလီၫ.- တၭကဆါအလူအထၫ ဂၧၫ့ထၪ့ၥၩလၩ့ထၧၫ့ခးယၫနီၪလီၫ.",
			"50": "<sup>50</sup> မွဲလါနၫ့ဘိၩ ၦယုဒၫဖိၪၥံၪပဂၨၪထၪ့ၦမုၪလဖၪ,လၧ အလၩအဖၩ့ အီၪလၧအယူၭယၪ့ယွၩ ဒဲဒိၩ့အၥုၪ့က့ၭ အၥၭၡါလဖၪအခဲၫ့တၭ, မၩအၧၩ့မၩၥၫ့စပီလူၫဒဲ စဘၫနဘၭနီၪ, နၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ လၧအခးဖၧၩ့",
			"51": "<sup>51</sup> လီၫ.- အဝ့ၫၥံၪတရူၩလၩ့ခွံၬ ဂၪ့ခိၪမုၬလၧအခၪ့ ယၫၥၭအလီၩ့တၭ,လ့ၩဝ့ၫထီၩ့လၧအဲၫကိနအၫ့လီၫ.",
			"52": "<sup>52</sup> အထံၩအဖျဲၥံၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧဆၧၥၭထိၬဒဲၥၭမု ဆံၫ့ဎံၪနီၪလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧအအီၪလၧအဲၫကိနအၫ့ အဖၧၩ့နီၪ, အဝ့ၫၥံၪလ့ၩနုၬ လၧၦယုဒၫဖိၪၥံၪအၥရိၬဖၧၩ့ နံၫဂၩ လူၬတၭ,လၧအလီၩလၩ့လၬလၩ့ ဆၧဘဲၫအံၩဘဲၫ အိၩအကၠီၩ့နီၪ, ၦယုဒၫဖိၪၥံၪဒဲၦဂြံစၭဖိၪၥံၪ ခမျၧးဖၭ ဒိၪနဲၩဝ့ၫဒၪဆ့လီၫ.",
			"2": "<sup>2</sup> အ့ၪမွဲၦယုဒၫဖိၪ လၧအလနဲၩဘၪ ဆၧလဖၪနီၪ, ပ ဂၨၪထၪ့ၦဆၨၩလဖၪအခဲၫ့ ဘဲၫၥိၭအမိထၫ့ဒုၪဒၩ ထၧၫ့",
			"3": "<sup>3</sup> ဖုဝဲၥံၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪအီၪထီးနီၪ ယံၬယံၬတၭ, လီၩလၩ့လၬလၩ့ဆၧလၧအၥၭဒူၩလၧ ကဆါအဖၧၩ့နီၪ, မွဲအဖ့ၪလၫ့အဝ့ၫၥံၪဆၧမၩနဲၪ့လၩ့ လၭတၭ,ဆၧလၩ့လိလၩ့လၭ မၩအၥၭလၧအဝ့ၫၥံၪအ စူၪနီၪ, ထိးအၥၭလၧအလူ အခိးအတၩအဂးလီၫ.",
			"4": "<sup>4</sup> မွဲလါနၫ့ဘိၩ, ၦခမျၧးလၧဒိၩ့ဖၧၩ့လၩ့မုလၩ့ဖၭလိၬ အၥၭတၭ, လနၩ့နၩ့အီၪဝ့ၫလၧၦယုဒၫဖိၪၥံၪအဖၧၩ့နီၪ, လနၩ့နၩ့အီၪဝ့ၬလၧၦဆၧအၪ့မၧၫ့ဖိၪလဖၪနီၪအဖၧၩ့လီၫ.",
			"5": "<sup>5</sup> ၦအဆၨၩလဖၪ, ဒဲၦယုဒၫဖိၪၥံၪ ဒဲအၦဒိၪၦၡါၥံၪ အီၪက့ၪဎုၬအၥၭ ဘဲၫၥိၭအမိမၩအၧၩ့အဝ့ၫၥံၪ, ဒဲခွံၬ",
			"6": "<sup>6</sup> ဝ့ၫလၧလိးတၭ,- အဝ့ၫၥံၪၥ့ၪယၫနီၪစဲၪ့ဖျိၭထီၩ့လၧ လဲၫကအိနအၫအဒိၩ့ၥံၪ, လံစတြၫ,ဒဲဒၧဘံၫ, ဒဲခးအီၪ",
			"7": "<sup>7</sup> ဝၬဖီၩ့ဝ့ၫလီၫ.- တၭလီၩလၩ့လၬလၩ့ ဆၧၥၭထိၬအ အပရၧၫ့ထီးနီၪလီၫ.",
			"8": "<sup>8</sup> ၦလဂၩလၧအခၪ့လအီၪဆီၪ့ဘၪ လၧအဂၭဂီၩ့ဝ့ၫ လၧအမိအဒၧၩ့လးဖၧၩ့လံၩလံၩ, ဒဲလစဲၪ့ဘၪဝ့ၫနး",
			"9": "<sup>9</sup> ဖၧၫ့လဂၩဆၧၫ့နၩ့ဝ့ၫလၧ လံစတြၫလီၫ.- အဝ့ၫဒၪခိၭ နၪစပီလူၫအလူတၭ, အဆၧယိဝ့ၫထံၫထံၫဆၭဆၭနီၪ,",
			"10": "<sup>10</sup> ၥ့ၪယၫလၧအနဲၩဆၧထီး အမိဘျၪထဲၩ့ဝ့ၫတၭ, ကိၭ ထၪ့ဝ့ၫလၧအလူဖၭဒိၪတၭး စံၭဝ့ၫ, ဂဲထုၪ့ဆၧၫ့ထုၪ့, ထုၪ့လုၪ့လၧနခၪ့ဘီၪ. အဝ့ၫဒၪဖုၫထၪ့တၭ,လ့ၩဆၧ လီၫ.",
			"11": "<sup>11</sup> စပီလူၫမၩဆၧနီၪၦခမျၧးဒၪဘၪဝ့ၫတၭ, ထုၭထၪ့အ လူ, ချဲၩ့ဆၧလၧၦလဲၫကအိနအၫအလၨလခီၫတၭ,စံၭ ဝ့ၫ,ကဆါၥံၪလၩ့ဂၬလၧၦၡၩဂဲၫလၩ့လၧပအီၪလီၫ.",
			"12": "<sup>12</sup> စဘၫနဘၭနီၪအဝ့ၫၥံၪကိၭဝ့ၫယုပတၧၫ, ဒဲစပီလူၫနီၪ ကိၭဝ့ၫမၧကရံၫလီၫ. အဂဲးဘဲၫယီၩမွဲလၧအချဲၩ့ဆၧ အၪအကၠီၩ့နီၪလီၫ.",
			"13": "<sup>13</sup> ယုပတၧၫအၡၩလုဆၧအီၪလၧဒိၩ့ အမ့ၬယၫနီၪ, ဆိၬထၪ့ချီၥံၪ ဒဲဖီၫၥံၪလၧတရၫ့အခၪ့ထံၭဘဲၫအမိလု",
			"14": "<sup>14</sup> ထၪ့ဆၧလၧၦခမျၧးအၥိၭနီၪလီၫ.- ၦဆၧအၪ့မၧၫ့ဖိၪ စဘၫနဘၭ, ဒဲစပီလူၫနါဂၧၫ့ဝ့ၫနီၪ, ၡၫ့ယၬခွံၬအကီၩ့ အၥိၭတၭ,စဲၪ့တလဲးဝ့ၫလၧၦခမျၧးအအီၪနီၪကိၭၡၭ",
			"15": "<sup>15</sup> ထၪ့ဆၧ,- စံၭဝ့ၫ, ၦၡၩၥံၪဧ့, ဆၧယီၩလဖၪနၥံၪမၩ မွဲဘၪလဲၪ, ပဝ့ၫဒၪယီၩ ပမွဲၦၡၩအီၪလၧအၥုၪ့အၥၭ ဘဲၫနၥံၪအၥိၭတၭ, ဘဲၫနၥံၪမိခွံၬၡိၭခွံၬဆၧပျီၩ ပျီၩယီၩဒဲကၠၪထဲၩ့နၥံၪအၥၭ လၧယွၩလၧအမၧၫ့ဝ့ၫလ ဂၩအအီၪၦလၧအမၩကဲၪထၪ့မူၭခိၪ, ဒဲဂၪ့ခိၪ, ဒဲမၫ ဆမံၭ,ဒဲကယဲဆၧအီၪလၧအဖၧၩ့ ထီးအလူၬနီၪ,",
			"16": "<sup>16</sup> ပလီၩဘၪနၥံၪ အဆၧၥၭထိၬအပရၧၫ့လီၫ.- အဝ့ၫဒၪ လၧအဆိၩ အကၠၪဖီၩ့ခွံၬနီၪ ဖ့ၪလၫ့ ၦကိၭဆၨၩဒ့ၭ",
			"17": "<sup>17</sup> လ့ၩလၧအဖၧၩ့ၥၭဒၪဝ့ၫလီၫ.- မွဲလါနၫ့ဘဲၫနီၪ တၭ,မွဲအမၩဂ့ၩဆၧ ဒဲမၩဆၧၩ့လၩ့ဆၧလၧမူၭခိၪ တၭ,ဖ့ၪလၫ့ၦလၧဆၧၥူၪဆၧၥၪအထီ, ဒဲမၩဎွ့ၩပၥုၪ့ ပၥၭလၧဆၧအၪ့ဆၧအီၩ, ဒဲဆၧၥုၪ့ထိၬၥၭထိၬတၭ, ဆၧထိးအၥၭလၧအနၫ့ဆါဒၪဝ့ၫအဂးနီၪ, မွဲအဖ့ၪလၫ့ လၩ့မါဝ့ၫအ့ၬ.",
			"18": "<sup>18</sup> ဆၧနီၪလဖၪအဝ့ၫၥံၪလီၩဘၪဝ့ၫတၭ,ဘဲၫၥိၭၦခမျၧး ထီးလုထၪ့ဝ့ၫလဂ့ၩနီၪပဒၩ့ဆၧကၪမၬလီၫ.",
			"19": "<sup>19</sup> ၦယုဒၫဖိၪၥံၪလၧအၪ့တအီၭ, ဒဲအဲၫကိနအၫ့နီၪ,ပ ဂၨၪထၪ့ၦခမျၧးလဖၪအခဲၫ့တၭ, ၦခွံၬစပီလူၫလၧလိး တၭ,ဆီၫ့မီၪ့ဝ့ၫလၧအၥံၫယူၭတၭ, မီၩ့ကၠူၭထၪ့ခွံၬ",
			"20": "<sup>20</sup> ဝ့ၫလၧဒိၩ့အချိၫ့လီၫ.- မွဲလါနၫ့အထံၩအဖျဲၥံၪအီၪဖီၩ့ ဝ့ၫအဘိၩ့ဘၭတၭ, ဂဲထုၪ့ထဲၩ့နုၬထဲၩ့ဝ့ၫလၧဒိၩ့ဖၧၩ့ လီၫ.တၭထီးကဲဂီၩလနံၩနီၪ စဲၪ့ထၪ့ဝ့ၫ ဒဲစဘၫနဘၭ လ့ၩဝ့ၫထီၩ့လၧဒၧဘံၫနီၪလီၫ.",
			"21": "<sup>21</sup> လီၩလၩ့လၬလၩ့ ဆၧၥၭထိၬအပရၧၫ့ လၧဒၧဘံၫအ ဖၧၩ့နီၪ. ဒဲဒုၭကဲၪထၪ့ၦအၪဂၩ လၧအထံၩအဖျဲၥံၪတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧလံစတြၫ ဒဲအဲၫကိနအၫ့,ဒဲအၪ့တအီၭ",
			"22": "<sup>22</sup> နီၪလီၫ.- မၩဂုးထၪ့အထံၩအဖျဲၥံၪအၥၭ အဂဲးအဘၭ နီၪ,ပဂၨၪထၪ့ဝ့ၫအခဲၫ့ ဘဲၫၥိၭအမိအီၪဂုးခၧၫ့ လၧဆၧ နဲၩအဖၧၩ့, ဒဲလၧပဘၪခၫ့ဂၬ ဆၧၡၪ့ဆၧနၭအၪ မံၩ့တၭ,ပလ့ၩနုၬဖိး လၧယွၩအဘၩ့အမုး အဖၧၩ့နီၪ လီၫ.",
			"23": "<sup>23</sup> ထီးအအီၪက့ၪထၪ့ဝ့ၫၦၥုၪ့က့ၭၥၭၡါလဖၪ လၧဆၧ အီၪကီၪ့အဂးလစီၪ့လါလါဂီၩ့နီၪ, ဘၩဆိၪဖၪဆၧ,ဒဲ ဒုၪဆၧအၪ့ဆၧအီၩ, ဒဲဖ့ၪလၫ့လၧကဆါလၧအဝ့ၫၥံၪ",
			"24": "<sup>24</sup> နဲၩဝ့ၫလဂၩ အစူၪဖၧၩ့လီၫ.- အဝ့ၫၥံၪ လ့ၩခၫ့ဂၬခွံၬ",
			"25": "<sup>25</sup> ပစံဒအၫတၭ, လ့ၩဝ့ၫထီၩ့လၧပၫ့ဖံလအၫလီၫ.- လီၩ လၩ့လၬလၩ့ဆၧအလူအထၫလၧပၧဂၫဂီၩ့တၭ, လ့ၩ",
			"26": "<sup>26</sup> လၩ့ဝ့ၫလၧအၭတလဲအၫလီၫ.- ထူၬထၪ့ကဘၩ့ထီးနီၪ တၭ, ထဲၩ့ထဲၩ့ဝ့ၫထီၩ့လၧအၪ့တအီၭ, လၧဆၧဖ့ၪ လၫ့ယူၭအဝ့ၫၥံၪလၧယွၩအခိးအတၩအဖၧၩ့, ဘဲၫ ၥိၭအမိမၩဆၧ လၧအမၩဂီၩ့ယူၭဝ့ၫနီၪလီၫ.",
			"27": "<sup>27</sup> ထီးအထီၩ့ဝ့ၫနီၪ, ဒုၭအီၪကီၪ့ ဆၧအီၪကီၪ့ ဖိၪၥံၪ တၭ,လီၩဘၪဝ့ၫ, ထီးဒၪဆၧလၧယွၩမၩလၧအစူၪ ဖၧၩ့လဖၪ ဒဲလၧအဝဲထၪ့ဆၧနဲၩ အတရၫ့လၧၦဆၨၩ လဖၪအဂးနီၪလီၫ.",
			"28": "<sup>28</sup> အီၪလၧအထံၩအဖျဲၥံၪအၥိၭ ထီးနီၪယံၬယံၬလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ၦၡၩဂဲၫလၩ့လၧခးယုဒၫလနၩ့နၩ့နီၪ, ၥီၪ့ထဲၩ့ၥၫ့ ထဲၩ့ထၧၫ့ဖုဝဲၥံၪတၭ, စံၭဝ့ၫဒၪ, နၥံၪအ့ၪလဒိၭန့ဘၪ ဆၧကူၭတရံၭဘဲၫစမိစ့ၭအထူၫအရူၫအၥိၭနီၪ, နၥံၪ",
			"2": "<sup>2</sup> ထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ၥ့ၪအ့ၬ.- လၧစပီလူၫ ဒဲစဘၫနဘၭၥံၪ တ့ၭလိၬအၥၭဆီၪ့ လၧၦလဖၪနီၪ အ ကၠီၩ့, ဆၧစ့ၩရၫ့ဝ့ၫလၧစပီလူၫ,ဒဲစဘၫနဘၭ, ဒဲၦအ ဂူၫဂၩလနၩ့နၩ့ လၧအကျၩနီၪ, ဘၪလ့ၩထၪ့လၧၦဆၧ အၪ့မၧၫ့ဖိၪလဖၪ, ဒဲၦၥုၪ့က့ၭၥၭၡါလဖၪ အအီၪလၧ ယရုစလံၫ့အဖၧၩ့ လၧဆၧအၪ့စၪ့ယီၩအဂဲးအကၠီၪ့လီၫ.",
			"3": "<sup>3</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအီၪကီၪ့ဖိၪၥံၪအၪ့မၧၫ့အ ဝ့ၫၥံၪတၭ,မွဲအလ့ၩခၫ့ဂၬဖနံၡၫ,ဒဲစမ့ရအၫတၭ,လီၩ လၩ့လၬလၩ့ဝ့ၫလၧၦဆၨၩလဖၪကၠၪလီၩ့ထဲၩ့အၥၭ အဂဲးအကၠီၪ့နီၪ, ဒုၭကဲၪထၪ့အထၧၫ့ဖုဝဲၥံၪ ထီးအၥုၪ့ ထိၬၥၭထိၬအၪမၬလီၫ.",
			"4": "<sup>4</sup> ထီးအထီၩ့လၧယရုစလံၫ့နီၪ, ဆၧအီၪကီၪ့ဖိၪၥံၪဒဲ ၦဆၧအၪ့မၧၫ့ဖိၪၥံၪ, ၦၥုၪ့က့ၭၥၭၡါၥံၪနီၪ ထိးဆၧၫ့မုၬ မုၬတၭ,အဝ့ၫၥံၪလီၩဘၪဝ့ၫ ထီးဒၪကယဲယွၩမၩဆၧ",
			"5": "<sup>5</sup> လၧအစူၪဖၧၩ့လီၫ.- ၦၡၩအစူၪလလၩ့ဎုၬဘၪၦဖၫရ စံၫလၧအနဲၩထဲၩ့ဝ့ၫလနၩ့နၩ့ ဂဲထုၪ့တၭ,စံၭဝ့ၫ, ၦလဖၪ နီၪဘၪဒိၭဆၧကူၭတရံၭတၭ, ဆၧဘၪမၪလူၬဘဲၫၥိၭ အမိထီးန့စမိစ့ၭ အဆၧၥီၪ့ဆၧၥၫ့လီၫ.",
			"6": "<sup>6</sup> ၦဆၧအၪ့မၧၫ့ဖိၪၥံၪ, ဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪနီၪ, အီၪ ကိၩ့အီၪကီၪ့ဘဲၫၥိၭ အမိယိဆီၫ့မီၪ့ဆၧလၧ ဆၧလမံၩ့",
			"7": "<sup>7</sup> နီၪအဂဲးလီၫ.- ဂဲးလိၬတ့ၭလိၬအၥၭလၧအအၪနီၪ, စပံတၧၫဂဲထုၪ့ဝ့ၫတၭ, စံၭဝ့ၫ, ၦၡၩၥံၪ, ဖုၥံၪဝဲၥံၪ ဧ့,နၥံၪၥ့ၪယၫနၥံၪဝ့ၫလၧယွၩရွံန့ ဆၧလၧပကျၩလၧ ဖျိၩ့လၧအၥၫ့ဘဲၫၥိၭၦဆၨၩလဖၪ မိနါဂၧၫ့ဆၧၥၭ",
			"8": "<sup>8</sup> ထိၬအပရၧၫ့လၧယနိၭ,ဒဲနဲၩထဲၩ့ဝ့ၫဒၪဆ့လီၫ.- ယွၩ လၧအၥ့ၪယၫၦၥုၪ့ၦၥၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪလၧၥၭမု ဆံၫ့ဎံၪ,ဘဲၫအဖ့ၪလၫ့ပၧၩအၥိၭတၭ, ထိးအၥၭလၧ",
			"9": "<sup>9</sup> အဂးလီၫ.- မၩဆံၫ့ဝ့ၫအၥုၪ့အၥၭ လၧဆၧနဲၩနီၪမၩ",
			"10": "<sup>10</sup> လၩ့မဲၩဝ့ၫလၧပၧၩအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,မွဲန ၥံၪအီၪက့ၪထၪ့နိၪယိၭဘီၩ့ လၧအထံၩအဖျဲၥံၪအခိၬ လီၩ့,လၧဖါၥံၪမွဲဂ့ၩ, ပဝ့ၫဒၪမွဲဂ့ၩ,ပယိၭလၥ့ၪဘၪ",
			"11": "<sup>11</sup> တၭ,မွဲဘၪနီၫလၧနၥံၪကျဲၩ့ဖစီၩ့ယွၩဘဲၫနီၪလဲၪ. မွဲလါ နၫ့ဘိၩပနဲၩလၧကဆါယ့ၫၡုၬဎရံၬအခိးအတၩအ ကၠီၩ့တၭ, ပဝ့ၫဒၪယီၩ ပမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ ထဲၩ့ပၧၩဘဲၫအဝ့ၫၥံၪအၥိၭဆ့လီၫ.",
			"12": "<sup>12</sup> ၦခမျၧးနီၪအီၪလၩ့မါပံၭတၭ, ခိၭနၪစဘၫနဘၭ,ဒဲ စပီလူၫလီၩလၩ့လၬလၩ့ ဆၧမၩနဲၪ့လၩ့လၭ, ဒဲဆၧ လၩ့လိလၩ့လၭလၧယွၩမၩဝ့ၫ လၧအဝ့ၫၥံၪအစူၪဖၧၩ့ လၧၦဆၨၩလဖၪအကျၩလီၫ.",
			"13": "<sup>13</sup> အဝ့ၫၥံၪအီၪလၩ့မါပံၭနီၪ, စယ့မံၭချဲၩ့ဆၧၫ့ဆၧတၭ,",
			"14": "<sup>14</sup> စံၭဝ့ၫ,ၦၡၩၥံၪ, ဖုၥံၪဝဲၥံၪဧ့,ခိၭနၪယလူဆံၭ.- ဘဲၫၥိၭ",
			"15": "<sup>15</sup> အမိမၩန့ဘၪၦလဆၨၩ လၧအမံၩ့အဂးတၭ,- ယွၩဂဲၫ အီၪၡီၩ့ၦဆၨၩလဖၪ လၧထံၭလၧအၥၫ့နီၪ စစံမအၧၫ့ လီၩဘၪယူၭဝ့ၫယူၭ. ဆၧနီၪလဖၪလၩ့ဂၬ မီၪၥံၪအ လူဘဲၫအစံၭဝ့ၫအၥိၭ,",
			"16": "<sup>16</sup> လၧဆၧယီၩအလးခဲၫ့နီၪ ယမိဂဲၫထဲၩ့တၭ, ယမိမၩထဲၩ့စဒၫဝံၭ အတဲၩလၧအလၩ့ဎီးနီၪ, အဆၧလၩ့ဎီးနီၪ ယမိမၩထၪ့ထဲၩ့ဝ့ၫတၭ, ယမိမၩကဲၪထၪ့ထဲၩ့ဝ့ၫ,",
			"17": "<sup>17</sup> ဘဲၫၥိၭၦၡၩလၧအအီၪလၩ့ထးဝ့ၫ, ဒဲကယဲၦဆၨၩလဖၪ လၧအကိၭထၪ့ယမံၩ့လၧ အလီၩ့လဖၪယၫနီၪ, မိအၪ့ဎၬကဆါလီၫ. ကဆါလၧအမၩ ဆၧယီၩလဖၪ ထီးအလူၬ, စံၭ ဝ့ၫဒၪ.",
			"18": "<sup>18</sup> လၧအၥၫ့လၧအခၪ့ထံၭလံၩလံၩနီၪ, ယွၩၥ့ၪယၫဝဲၩ",
			"19": "<sup>19</sup> အဆၧမၩ ထီးအလူၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦဆၨၩလဖၪလၧအကၠၪထဲၩ့အၥၭ လၧယွၩအအီၪ နီၪ,ယစ့ၩရၫ့ လၧပထီးမၩထံၬထၬ အဝ့ၫၥံၪလဂ့ၩ.",
			"20": "<sup>20</sup> မွဲလါနၫ့ဘိၩ ပမိကွ့ၭဖ့ၪယူအဝ့ၪၥံၪ လၧလံၬလၧအဘၪ ဂၭဎ့ၭဆၧဂၩ့အဆၧစံၪစၪ, ဒဲဆၧမၩဖိၬၥၭလဲးၥၭ ဘျၪအခဲၫ့,ဒဲဆၧလၧဆၧဘံၭၥံၫဝ့ၫဒဲဆၧၥွံၪလဖၪ ဆ့လီၫ.",
			"21": "<sup>21</sup> အဂဲးဘဲၫယီၩ ၦဖီစမိစ့ၭအလံၬ လၧၥရိၬဖၧၩ့ကိၭ မးၥံၫအနံၩဒ့ၭတၭ, လၧအဆိၩအကၠၪလၧဖျိၩ့လံၩ လံၩနီၪၦလီၩလၩ့လၬလၩ့ဝ့ၫ အီၪလၧကိၭဒိၩ့ဒ့ၭလီၫ.",
			"22": "<sup>22</sup> ထီးနီၪလဖၧၫ့ ဘၪၦဆၧအၪ့မၧၫ့ဖိၪၥံၪဒဲၦၥုၪ့က့ၭၥၭ ၡါၥံၪဒဲဆၧအီၪကီၪ့ ထီးအလူၬ အၥၭတၭ, ရွံန့ၦၡၩ လၧအကျၩၦအဒိၪအခိၪလၧအထၧၫ့ဖုဝဲအကျၩ, စယု ဒၭကိၭထဲၩ့ဝ့ၫအမံၩ့အၥၫ့ လၧစဘၫစဘၭ, ဒဲစစဲလၭ ဂီၩ့တၭ အီၪက့ၪအၥၭလၧအမိအၪ့မၧၫ့အဝ့ၫၥံၪလ့ၩ ဆၧလၧစပီလူၫ ဒဲစဘၫနဘၭအၥိၭထီၩ့လၧအၪ့တ အီၭလီၫ.",
			"23": "<sup>23</sup> အဝ့ၫၥံၪကွ့ၭဖ့ၪယူလံၬ လၧအစူၪဖၧၩ့ဘဲၫယီၩ, ၦ ထၧၫ့ဖုဝဲ လၧၦဆၨၩလဖၪအကျၩ အီၪလၧအၪ့တအီၭ, ဒဲစံရအၫ, ဒဲစလံၭၡၫလဖၪၥံၪဧ့, မွဲနၥံၪဘၪဆၧအရှူၪ အမုၬဆံၭ. ၦဆၧအၪ့မၧၫ့ဖိၪလဖၪ ဒဲၦၥုၪ့က့ၭၥၭၡါ",
			"24": "<sup>24</sup> ၥံၪဒဲၦထၧၫ့ဖုဝဲၥံၪယီၩ,- မွဲပနါဂၧၫ့ လၧၦစဲၪ့ထၪ့လၧ ပကျၩလနၩ့နၩ့,မၩခိမၩဝီၩနၥံၪအၥၭ လၧဆၧချဲၩ့, ဒဲမၩဂၭဂီၩ့နၥံၪအၥၭ. စံၭဝ့ၫ, နၥံၪဘၪဒိၭဆၧကူၭ တရံၭ,ဒဲနၥံၪဘၪထီး ဆၧအထူၫအရူၫနီၪ, အ့ၪမွဲပဝ့ၫ",
			"25": "<sup>25</sup> ဒၪယီၩပမၪလူၬပဝ့ၫအ့ၬ,- ပအီၪကိၩ့အီၪကီၪ့လၧ ပၥၭလဖျိၪ့ဎးအဘိၩ့ဘၭတၭ, ဘၪပၥၭလၧပအၪ့မၧၫ့",
			"26": "<sup>26</sup> ၦၡၩဘၪဆၧရွံန့ဝ့ၫလဖၪ,- ဒဲၦလၧအအီၪက့ၪလၩ့ခွံၬ အၥၭ,လၧပကဆါယ့ၫရှူၬဎရံၬ အမံၩ့အကၠီၩ့လဖၪ နီၪ,ပထၧၫ့ဖုဝဲၥၭဘီၩ့, စဘၫနဘၭ ဒဲစပီလူၫၥံၪ လ့ၩ",
			"27": "<sup>27</sup> လၧနၥံၪအအီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ပအၪ့မၧၫ့ လၩ့စယုဒၭ ဒဲစစဲလၭတၭ, အဝ့ၫၥံၪမိလီၩဘၪနၥံၪလၧ",
			"28": "<sup>28</sup> ဆၧယီၩလဖၪ လမံၩ့ဎးလၧအနိၭလီၫ.- အဂဲးဘဲၫယီၩ နၥံၪဂၭဎ့ၭ ဆၧလုဆၧဂၩ့ဒဲဆၧၥွံၪ, ဒဲဆၧလၧဆၧ ဘံၭၥံၫဝ့ၫ,ဒဲဆၧမၩဖိၬၥၭလဲးၥၭဘျၪအခဲၫ့နီၪ, ဘၪ",
			"29": "<sup>29</sup> ၥၭမုဆံၫ့ဎံၪအၥၭနီၪ,- ဒဲပၥၭယီၩဆ့ လၧဆၧနီၪလဖၪ အမ့ၬယၫ, ဆၧယိၭဆၧဎၧၫ့ ဒိၪနဲၪ့အနီၪဒံၭ, ပအီၪက့ၪ လၧနၥံၪအလီၩ့အ့ၬ. ဆၧနီၪလဖၪ အ့ၪလဂၭဎ့ၭဘၪ တၭ,နၥံၪအီၪဝ့ၫၥ့ၪအ့ၬ. နၥံၪအ့ၪဂၭဎ့ၭ မွဲနၥံၪမၩဂ့ၩ ဘၪစဲၪလီၫ. မွဲနၥံၪအီၪဆီၪ့အီၪချဲၫ့ဆံၭ.",
			"30": "<sup>30</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးဆၧကွဲၪဖျါအဝ့ၫၥံၪတၭ, လ့ၩထီၩ့လၧ အၪ့တအီၭနီၪ, ဒုၭအီၪကိၩ့အီၪကီၪ့ ၦ",
			"31": "<sup>31</sup> ခမျၧးတၭ,ဖ့ၪလၫ့ဝ့ၫ လၧလံၬလဘံၪ့နီၪလီၫ.- အဝ့ၫၥံၪ ဖီလံၬလဘံၪ့နီၪဂီၩ့တၭ, အၥုၪ့ထိၬ အၥၭထိၬဝ့ၫ လၧ ဆၧမၩမုၬထၪ့ထဲၩ့ အကၠီၩ့လီၫ.",
			"32": "<sup>32</sup> စယုဒၭဒဲစစဲလၭ အနၫ့ဆါဒၪဝ့ၫလဖၪ မွဲမီၪတၭ,ပ ဂၨၪထၪ့ထၧၫ့ဖုဝဲၥံၪ လၧဆၧချဲၩ့အၪထံၪဒဲဒုၭဆီၪ့ထၪ့",
			"33": "<sup>33</sup> ဝ့ၫအဂဲးအဘၭလီၫ.- အီၪဝ့ၫထီးနီၪယံၬယံၬတၭ, ဘဲၫၥိၭအမိထဲၩ့ထဲၩ့ လၧဆၧအၪ့မၧၫ့ဖိၪ လဖၪအအီၪ တၭ,ၦထၧၫ့ဖုဝဲနီၪ ဖျါခွံၬဝ့ၫ ရှူၪရှူၪမုၬမုၬလီၫ.",
			"34": "<sup>34</sup> ဎမွဲလါနၫ့ဘဲၫနီၪတၭ, ဘၪစစဲလၭအၥၭ လၧအမိအီၪ ဒံၭထီးနီၪလီၫ.ၭ",
			"35": "<sup>35</sup> စပီလူၫဒဲစဘၫနဘၭ, ဒဲၦဂူၫဂၩလဖၪအၪဂၩ အီၪဝ့ၫ လၧအၪ့တအီၭနီၪ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧတၭ, လီၩလၩ့ ဆၧၥၭထိၬအပရၧၫ့ ကဆါအလူအထၫလီၫ.",
			"36": "<sup>36</sup> မုနံၩလနၩ့နၩ့ဖီၩ့ခွံၬနီၪ, စပီလူၫစံၭစဘၫနဘၭ, ပ ထၧၫ့ဖုဝဲၥံၪ လၧကယဲဒိၩ့ ကယဲတဝၫ့လၧပလီၩလၩ့လၬ လၩ့ ကဆါအလူအထၫလၧအဖၧၩ့နီၪ, မွဲအအီၪဝ့ၫ ဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪ, မွဲပထဲၩ့ထဲၩ့ပဝ့ၫတၭ, လ့ၩ ၡီၩ့ယိထဲၩ့ခွါထဲၩ့ အဝ့ၫၥံၪဘီၪ.",
			"37": "<sup>37</sup> စဘၫနဘၭ အီၪက့ၪအၥၭလၧအမိကိၭန့စယီဟၫ့",
			"38": "<sup>38</sup> ကိၭဝ့ၫအမံၩ့ လၧစမၫကၧၭလီၫ.- မွဲလါနၫ့ဘိၩမွဲၦလ ဂၩနီၪ စဲၪ့ဖၭလၧအဝ့ၫၥံၪလၧပၫ့ပံလအၫတၭ, လမၩ လၧၩ့ဘၪ ဆၧလၧအဝ့ၫၥံၪအၥိၭ အကၠီၩ့နီၪ, စပီလူၫ",
			"39": "<sup>39</sup> ဆီၫ့မီၪ့ဝ့ၫလၧအဂ့ၩလ့ၩအ့ၬ.- တၭဆၧဂဲးလိၬတ့ၭ လိၬဆီၪ့ဆီၪ့လ့ၬ အီၪထၪ့ထီးအဝ့ၫၥံၪ လၩ့မုလၩ့ဖၭ လိၬအၥၭတၭ, စဘၫနဘၭကိၭန့ စမၫကၧၭတၭ, ထူၬ ထၪ့ကဘၩ့တၭ, လ့ၩဝ့ၫထီၩ့လၧ စဲပၧၭလီၫ.",
			"40": "<sup>40</sup> စပီလူၫရွံန့စစဲလၭလဂၩနီၪ ၦထၧၫ့ဖုဝဲၥံၪဖ့ၪလၫ့ဝ့ၫ လၧယွၩအခိးအတၩအဖၧၩ့တၭ, စဲၪ့ထၪ့ဝ့ၫဒၪလီၫ.",
			"41": "<sup>41</sup> အဝ့ၫဒၪလ့ၩခၫ့ဂၬခွံၬ ခးစံရအၫဒဲစလံၭၡၫတၭ, ဒုၭဂုး ထၪ့ဆၧအီၪကီၪ့ဖိၪၥံၪ အဂဲးအဘၭလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> တၭအဝ့ၫဒၪလ့ၩဝ့ၫထီၩ့လၧဒၧဘံၫ ဒဲလံစတြၫလီၫ. ယိခွါ,အထံၩအဖျဲအမံၩ့စထံမၥံၫ,ၦယုဒၫမုၪလၧအ နဲၩထဲၩ့ဆၧလဂၩအဖိၪခွၫ,အီၪဝ့ၫထီးနီၪလဂၩလီၫ.",
			"2": "<sup>2</sup> အ့ၪမွဲအဖါနီၪမွဲၦဂြံစၭဖိၪလီၫ.- ၦထၧၫ့ဖုဝဲၥံၪအီၪလၧ လံစတြၫဒဲအဲၫကိနအၫ့လဖၪ ထိးအၥၭလၧအဂးလီၫ.",
			"3": "<sup>3</sup> ဘၪစပီလူၫအၥၭ လၧအဝ့ၫဒၪ မိလ့ၩဆၧ လၧအ ၥိၭတၭ,အၪ့မၩန့ကူၭ တရံၭဝ့ၫလၧၦယုဒၫဖိၪၥံၪအီၪ ဝ့ၫထီးနီၪအကၠီၩ့တၭ, အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪထီးအ လူၬၥ့ၪယၫ လၧအဖါမွဲ ၦဂြံစၭဖိၪလီၫ.",
			"4": "<sup>4</sup> ထီးအဝ့ၫၥံၪ လ့ၩခၫ့ဂၬဒိၩ့ၥံၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧ ဆၧစ့ၩရၫ့လဖၪ ဘဲၫၥိၭအမိထီးန့ဖံၭထၬဘဲၫဆၧအၪ့ မၧၫ့ဖိၪၥံၪ ဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪ လၧယရုစလံၫ့အဖၧၩ့",
			"5": "<sup>5</sup> စ့ၩရၫ့ဝ့ၫဒၪ အၥိၭနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧအီၪကီၪ့လဖၪ ဂုးထၪ့ခၧၫ့ထၪ့ဝ့ၫ လၧဆၧနဲၩအ ဖၧၩ့,ဒဲအၪထၪ့ဂီထၪ့ဝ့ၫ ကိၭမုနံၩ ကိၭမုနၩဒ့ၭလီၫ.",
			"6": "<sup>6</sup> အဝ့ၫၥံၪလ့ၩခၫ့ဂၬခွံၬဖြံဇအၫ, ဒဲဂလ့ၡၫနီၪ,ဘဲၫ ၥိၭအထီး လီၩလၩ့လၬလၩ့ဆၧ လၧခးအ့ၡၫအဖၧၩ့",
			"7": "<sup>7</sup> လဂ့ၩတၭ, ၥၭမုဆံၫ့ဎံၪနီၪပဒၩ့ဝ့ၫလီၫ.- တၭအဝ့ၫ ၥံၪလ့ၩထီၩ့ဝ့ၫ လၧမံၭစအၫနီၪ, အီၪက့ၪအၥၭလၧ အမိလ့ၩလၧဘၥံနအၫ, လါနၫ့ဘိၩ, ၥၭမုနီၪဖ့ၪလၫ့",
			"8": "<sup>8</sup> အလ့ၩအ့ၬ.- လ့ၩဝ့ၫလၧ မံၭစအၫအနဲၩ့ထံၭတၭ, ထီၩ့ လၩ့ဝ့ၫလၧတြိအၭအဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> လၧမုနၩအထီနီၪ, စပီလူၫဒၪဆၧလၧယၫလခီၫတၭး ၦမၫစဒိနအၫဖိၪဆၧၫ့ထုၪ့အၪ့ကံၩ့အၪ့ယၫဆၧတၭ, စံၭဝ့ၫ,ဂဲၫခၫ့ဂၬ လၧမၫစဒိနအၫ အဖၧၩ့ယီၩ မၩဘိၭ",
			"10": "<sup>10</sup> မၩဆၧၩ့ပၧၩဘီၪ.- ထီးအဝ့ၫလဂၩ ဒၪဆၧလၧယၫ တၭ,မွဲပဆီၫ့မီၪ့ လၧပကဆါနီၪ ကိၭပၧၩ ဘဲၫၥိၭပမိ လီၩလၩ့လၬလၩ့ ဆၧၥၭထိၬအပရၧၫ့ ထီးနီၪတၭ, ပ အၪ့ဎၬကိၪ့ထၪ့ ဘဲၫၥိၭပမိဂၬထၪ့ ထီၩ့လၧမၫစဒိနအၫ အဖၧၩ့ချဲၫ့မၬလီၫ.",
			"11": "<sup>11</sup> မၩအၥၭဘဲၫနီၪတၭ, ပစဲၪ့ထၪ့ လၧတြိအၭတၭ, ပလ့ၩဆုးလီၩ့ထီၩ့ လၧစၫမိၫၥ့ၡၫတၭ ကဲဂီၩလနံၩ",
			"12": "<sup>12</sup> နီၪထီၩ့လၧ န့ၫအၭပလံၭလီၫ.- ပစဲၪ့ထၪ့ ထီးနီၪ ထီၩ့လၧဖလံဖံၫလၧအမွဲ မၫစဒိနအၫ အဒိၩ့ခိၪ လဆၫ့နီၪတၭ, ၦလဆၨၩဒၪဂဲၫအီၪဝ့ၫ လၧအဖၧၩ့လီၫ. ပအီၪလၧဒိၩ့အဖၧၩ့နီၪအနံၩအၥၫ့ လနၩ့နၩ့လီၫ.",
			"13": "<sup>13</sup> လၧမးၥံၫအနံၩနီၪ, ပလ့ၩထၪ့လၧဒိၩ့အချိၫ့ထီးၦ ဘၩဆိၪဖၪဆၧအလးလၧထံၫနဲၩ့နီၪပဆၧၫ့နၩ့တၭ, ပလီၩဘၪဆၧလၧၦမုၪ လၧအအီၪကိၩ့ အီၪကီၪ့လဖၪ",
			"14": "<sup>14</sup> လီၫ.- ၦလၧအအၪ့ဆၫဆၧလုၭဖုၭ, ဒိၩ့ၥဲၫအထဲရၫအ ဖိၪမုၪအမံၩ့နးလံဒအၫလဂၩ လၧအဘိၪ့ယွၩဘၩယွၩ, နါဂၧၫ့ဝ့ၫဒၪတၭး ကဆါဝဲထၪ့အၥုၪ့အၥၭဘဲၫၥိၭအ",
			"15": "<sup>15</sup> မိခိၭနၪဆၧလၧစပီလူၫလီၩဘၪဝ့ၫလီၫ.- ထီးအဝ့ၫနီၪ ဒဲအဂံၪ့ဖိၪလဖၪဒိၭဘၭတံၫဇၫ့ အၥၭဂီၩ့တၭ, မွဲအအၪ့ ကံၩ့အၪ့ယၫထဲၩ့ပၧၩတၭ,စံၭဝ့ၫ, ယဝ့ၫဒၪယီၩနၥံၪ အ့ၪအီၪက့ၪယၧၩ လၧၦနဲၩထဲၩ့ကဆါတၡါနီၪ, ဂဲၫ အီၪလၧယဂံၪ့ဖၧၩ့ဘီၪး တၭအၪ့ဂူၬအၪ့ကံၩ့ အၪ့ယၫ န့ပၧၩဆီၪ့ဆီၪ့လ့ၬလီၫ.",
			"16": "<sup>16</sup> တၭဆၧမၩအၥၭ လၧပလ့ၩဘၩဆိၪဖၪ ဆၧအဘိၩ့ ဘၭနီၪ, ၦဎီးမုၪ လၧဆၧနၪအၪ့ဖၩ့ဆၧအီၪလၧအလီၩ့ လဂၩဂဲၫဘၪခီၩ့ပၧၩလီၫ. အဝ့ၫဒၪချဲၩ့ဆၧ လၧဆၧနၪ အအၪ့ဖၩ့ဆၧအချိၬတၭ, အကဆါလဖၪနီၪန့ဘၪ",
			"17": "<sup>17</sup> ဆၧအၪမၬလီၫ.- အဝ့ၫနီၪလီၩ့ဖိၬစပီလူၫအခဲၫ့ဒဲပ ခဲၫ့တၭ.ကိၭထၪ့ဆၧ, စံၭဝ့ၫ, အဝ့ၫၥံၪယီၩ မွဲဆၧထီၫ ထုၬယွၩအဎီးအၡၩၥံၪ လၧအဒုၭနဲၪပၧၩလၧဆၧ ထိးထဲၩ့တၩ့ထဲၩ့ အဖၧၩ့ၥၭလီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪ မၩဝ့ၫဘဲၫနီၪ အၪနံၩအၪၥၫ့နီၪ, စပီလူၫအ ၥၭခိထၪ့တၭ, ကၠၪစိၩအၥၭတၭ,စံၭဆၧနၪနီၪ,ယ မၪလူၬနၧၩလၧ ယ့ၫရှူၬဎရံၬအမံၩ့ လၧနစဲၪ့ထၪ့ခွံၬ လၧ ၦယီၩအလီၩ့လီၫ. တၭအဆၧစဲၪ့ထၪ့ခွံၬဝ့ၫလၧနၩရံၩ နီၪလီၫ.",
			"19": "<sup>19</sup> ၦမုၪအကဆါလဖၪ ၥ့ၪယၫဝ့ၫလၧအယိလါန့ဘၪ ဆၧနီၪအလးစဲၪ့ထၪ့ခွံၬဝ့ၫတၭ, ဖီၪ့ထၬစပီလူၫ, ဒဲ စစဲလၭၥံၪ, လ့ၩမီၩ့ဝ့ၫလၧၦဒိၪလဖၪစ့ၩရၫ့ဆၧလၧ",
			"20": "<sup>20</sup> ဖၠၫဖၧၩ့အအီၪလီၫ.- ၥိၫ့ထၪ့ဝ့ၫလၧခးအၦဒိၪလဖၪအ အီၪတၭ, အဝ့ၫၥံၪစံၭဝ့ၫ, ၦလဖၪယီၩမွဲၦယုဒၫဖိၪ",
			"21": "<sup>21</sup> တၭ,မၩထံၬထၬၦဒိၩ့ဖိၪယီၩဒိၪမၬ,- ဒဲၥီၪ့လိၪဆၧ အထူၫအရူၫလၧၦရိမၫဖိၪပဝ့ၫဒၪယီၩ ပဒိၭန့ဒဲထီးန့ နီၪမွဲအတီၩအ့ၬ.",
			"22": "<sup>22</sup> ၦခမျၧးနီၪဂဲထုၪ့ထၫ့ဒုၪဒၩအဝ့ၫၥံၪ, ဒဲခးအၦဒိၪလ ဖၪၡၫ့လၩ့ခွံၬအကီၩ့အၥိၭတၭ, မၪလူၬဆၧလၧၦဘၪ",
			"23": "<sup>23</sup> ဒိၪအဝ့ၫၥံၪ လၧနိၪထးလဖၪလီၫ.- ဒိၪဝ့ၫအၪထံၪ ဂီၩ့,ဒူၭလၩ့ဝ့ၫ လၧထီၩ့ဖၧၩ့တၭ, မၪလူၬၦထီၫ့အခိၪ",
			"24": "<sup>24</sup> ဘဲၫၥိၭအမိ ခိၭထၬဝ့ၫခၧၫ့ခၧၫ့လီၫ.- အဝ့ၫဒၪဘၪဆၧ မၪလူၬဘဲၫနီၪတၭ, ဒုၭနုၬအဝ့ၫၥံၪ လၧထီၫ့ဖၧၩ့လၧ ယၫလဆၫ့နီၪ, ၥံၫ့ထၬဝ့ၫအခၪ့လၧၥံၫ့လီၫ.",
			"25": "<sup>25</sup> လၧဖိၭဖၫ့မုနီၪစပီလူၫဒဲစစဲလၭဘၩဆိၪဖၪဆၧဒဲ ၥံၫကျံၩစံၭထၪ့အၪ့အူၭယွၩတၭ, ၦထီၫ့ဖိၪၥံၪနါဂၧၫ့",
			"26": "<sup>26</sup> ဝ့ၫဒၪလီၫ.- ဂၪ့ခိၪဝၭရှုၭဝ့ၫဒိၪမၬ ထီးထီၫ့အခၪ့ထံၭ ဝၭဝ့ၫတၭ, ထီၫ့အတရၫ့ၥံၪဝဲထၪ့အၥၭချဲၫ့မၬထီး အလူၬတၭ, ၦထီးအလူၬ အၥွ့ၫထၭလၩ့ကွဲၪခွံၬဝ့ၫ",
			"27": "<sup>27</sup> ဒၪလီၫ.- ထီၫ့အခိၪနၪ့ထၪ့အၥၭနီၪ, ဒၪဘၪဝ့ၫလၧထီၫ့ အတရၫ့ၥံၪဝဲထၪ့အၥၭတၭ, ဆီၫ့မီၪ့ဝ့ၫလၧၦထီၫ့ဖိၪ ၥံၪစဲၪ့ထၪ့ခွံၬတၭ, ထုၭထၪ့အနၭဘဲၫၥိၭအမိမၩၥံၫ",
			"28": "<sup>28</sup> လၩ့အၥၭလီၫ.- စပီလူၫကိၭထၪ့ဆၧလၧအလူဖၭဒိၪ တၭ, စံၭဝ့ၫ,ထီးမၩအၧၩ့နၥၭနးမံၩ့လဂ့ၩ, အဂဲး",
			"29": "<sup>29</sup> ဘဲၫယီၩပအီၪထီးယီၩကိၭဂၩဒ့ၭလီၫ.- အဝ့ၫနီၪ အၪ့ကံၩ့ဆၧဖၩ့ၥံၪတၭ, စဲၪ့နုၬဝ့ၫလၧစပီလူၫဒဲစစဲလၭ အအီၪ, ဝၭထိၬဝၭတ့ၭနီၪထွံၩလၩ့လၧအမ့ၬယၫ",
			"30": "<sup>30</sup> လီၫ.- ၥိၫ့ထၪ့အဝ့ၫၥံၪလၧခီၫ့, စံၭဝ့ၫ,ကဆါၥံၪဧ့,ဘဲၫ ၥိၭယမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩတၭ, မွဲယ",
			"31": "<sup>31</sup> ဘၪမၩဆၧနီၪလမံၩ့လဲၪ.- အဝ့ၫၥံၪလီၩဘၪဝ့ၫ, နဲၩ ထဲၩ့ကဆါယ့ၫရှူၬဎရံၬဆံၭ, နမိထီၩ့လၧဆၧထိး",
			"32": "<sup>32</sup> ထဲၩ့တၩ့ထဲၩ့နၧၩ, ဒဲနဂံၪ့ဖိၪၥံၪလီၫ.- အဝ့ၫၥံၪလီၩဘၪ အဝ့ၫလၧကဆါအလူအထၫ, ဒဲၦအီၪလၧအဂံၪ့အဖၧၩ့ ထီးအလူၬလီၫ.",
			"33": "<sup>33</sup> လၧမုလနၩဎးနီၪ, အဝ့ၫဒၪမၩန့အဝ့ၫၥံၪတၭ,ၥူၫဝၭ ဆံၫ့ခွံၬအဖၧၩ့လးၥံၪနီၪ, အနၫ့ဆါဒၪဝ့ၫ,ဒဲအဂံၪ့ဖိၪ",
			"34": "<sup>34</sup> ထီးအလူၬလဖၪဒိၭဘၭတံၫဇၫ့အၥၭချဲၫ့မၬလီၫ.- ထီး အဝ့ၫဒၪၥိၫ့ထၪ့အဝ့ၫၥံၪ လၧအဂံၪ့ဖၧၩ့တၭ, အီၪက့ၪ ဆၧအၪ့ဆၧအီၩလၧအမ့ၬယၫတၭ, အနၫ့ဆါဒဲအ ဂံၪ့ဖိၪၥံၪၥုၪ့ထိၬၥၭထိၬနဲၩထဲၩ့ယွၩထီးအလူၬလီၫ.",
			"35": "<sup>35</sup> မုဆဲၪ့ထၪ့နီၪ ခးအၦဒိၪလဖၪအၪ့မၧၫ့ ပၠၩတၩၥံၪ",
			"36": "<sup>36</sup> လ့ၩလီၩဘၪဝ့ၫ, ၦၡၩၥံၪနီၪကွဲၪဖျါခွံၬဝ့ၫဘီၪ.- ဆၧချဲၩ့ လဖၪနီၪ,ၦထီၫ့ခိၪလီၩဘၪစပီလူၫလၧခးအၦဒိၪလဖၪ အၪ့မၧၫ့ၦဂဲၫကွဲၪဖျါခွံၬနၥံၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩစဲၪ့ထၪ့တၭ, လ့ၩဆၧမုၬမုၬဆံၭ.",
			"37": "<sup>37</sup> မွဲလါနၫ့ဘိၩစပီလူၫစံၭအဝ့ၫၥံၪ, ၦရိမၫဖိၪပဝ့ၫဒၪ ယီၩ, ၦလဘၪဆၧစ့ၩရၫ့စၪပၧၩတၭ, အဝ့ၫၥံၪဒိၪပၧၩ အီၪဖျီၪ,ဒဲဒုၭနုၬပၧၩလၧထီၫ့ဖၧၩ့တၭ, ဘိၩ့နဲၪ့ယီၩ မွဲအမိနၫ့ထၪ့ခွံၬၥူၪပၧၩဆ့ဧၪ, မွဲလၩလါအ့ၬ,မွဲအနၫ့ ဆါဒၪဝ့ၫ ဂဲၫမၩန့ထၪ့ပၧၩဆံၭ.",
			"38": "<sup>38</sup> ဆၧချဲၩ့လဖၪနီၪ ပၠၩတၩၥံၪလီၩဘၪ ခးအၦဒိၪလ ဖၪတၭ, အဝ့ၫၥံၪနါဂၧၫ့လၧၦလဖၪနီၪ မွဲၦရိမၫဖိၪ",
			"39": "<sup>39</sup> တၭ,ဘၪဆၧၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫလီၫ.- တၭဂဲၫအၪ့ကံၩ့ အၪ့ယၫထဲၩ့အဝ့ၫၥံၪ, အၪ့မၩန့ထဲၩ့ဝ့ၫတၭ, အၪ့ ယၫဝ့ၫဘဲၫၥိၭအမိစဲၪ့ထၪ့ခွံၬလၧဒိၩ့ဖၧၩ့လီၫ.",
			"40": "<sup>40</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧထီၫ့ဖၧၩ့နီၪ လ့ၩနုၬလၧ နးလံဒအၫအဂံၪ့ဖၧၩ့တၭ, ထီးအဒၪဘၪထဲၩ့အထၧၫ့ ဖုဝဲၥံၪဒဲဒုၭမုၬ ထၪ့ထဲၩ့ဝ့ၫအၥၭတၭ, စဲၪ့ထၪ့ခွံၬ ဝ့ၫဒၪလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> တၭထီးအဝ့ၫၥံၪလ့ၩခၫ့ဂၬခွံၬအၫ့ဖံပိၫလံၭ, ဒဲအၫ ပလိနအၫဂီၩ့နီၪ, လ့ၩဝ့ၫထီၩ့လၧၥ့ၭစလနဲကၫ,ထီးနီၪ",
			"2": "<sup>2</sup> ၦယုဒၫဖိၪၥံၪအၥရိၬအီၪဝ့ၫလဖျိၪ့လီၫ.- စပီလူၫဘဲၫ အထူၫအရူၫအီၪဝ့ၫအၥိၭနီၪ,လ့ၩနုၬလၧအဝ့ၫၥံၪအ အီၪလၧမးၥံၫအနံၩၥၧၫ့နံၩတၭ, ချဲၩ့လိၬအၥၭလၧအ",
			"3": "<sup>3</sup> ဝ့ၫၥံၪလၧဆၧကွ့ၭအၥၭအဂဲး,- ဝဲထၪ့ဝ့ၫတၭ,ဒုၭနဲၪ ဝ့ၫလၧဎရံၬဘၪထိးဆၧၡၪ့ဆၧနၭ,ဒဲဘၪဂဲထုၪ့ထဲၩ့ ဝ့ၫလၧဆၧၥံၫအဖၧၩ့တၭ, စံၭဝ့ၫ, ယ့ၫၡုၬလၧယလီၩ",
			"4": "<sup>4</sup> ဘၪနၥံၪအဂဲးအကၠီၪ့လဂၩယီၩ မွဲဎရံၬနီၪလီၫ.- ၦလၧ အကျၩလနၩ့နၩ့ ဒဲၦဂြံစၭဖိၪ လၧအဘိၪ့ထၪ့ဘၩထၪ့ ယွၩ,ခမျၧးဖၭဒိၪ, ဒဲၦမုၪအီၪလၧအလၩအဖၩ့တဘျႃၭ ဂၩနဲၩထဲၩ့ဝ့ၫတၭ, အီၪက့ၪဎုၬအၥၭ လၧစပီလူၫဒဲ စစဲလၭၥံၪအၥိၭလီၫ.",
			"5": "<sup>5</sup> အ့ၪမွဲၦယုဒၫဖိၪလဖၪနီၪ ၥၭခ့ၬဝ့ၫတၭ, အၪ့မၩန့ ၦအအၧၩ့လၧအအီၪဒၪ အဆၧလၧဖၠၫဖၧၩ့တၭ, ဒုၭအီၪ ကီၪ့ၦခမျၧးတၭ, ဒုၭတုၩ့ထၪ့တုၩ့လၩ့ ဒိၩ့ထၧၫ့ဖျိၪ့ ယၫလီၫ.အဝ့ၫၥံၪအီၪဖီၩ့ စယၫစၧၫ့အဂံၪ့ဒဲအၪ့ဎၬမီၩ့",
			"6": "<sup>6</sup> ထၪ့ၦလဖၪနီၪ,လၧၦခမျၧးအအီၪလီၫ.- လဒၪဘၪအ ဝ့ၫၥံၪတၭ,မီၩ့ကၠူၭထၪ့စယၫစၧၫ့ဒဲ ၦထၧၫ့ဖုဝဲလနၩ့နၩ့ လၧဒိၩ့အၦဒိၪလဖၪ အအီၪတၭ, ကိၭၡၭထၪ့ဆၧ, စံၭ ဝ့ၫ,ၦလဖၪလၧအချႃၬလၩ့ဂၪ့ခိၪ ဂဲၫထီၩ့ယူၭထီးယီၩ",
			"7": "<sup>7</sup> ယူၭ,- စယၫစၧၫ့ထိးဆၧၫ့အဝ့ၫၥံၪတၭ, ၦထီးအလူၬ လဖၪယီၩမၩဆၧထၫ့ဒုၪဒၩစံစၧၫအလူတၭ, စံၭဝ့ၫ, လၧစဎွၩအဂူၫဂၩ ယ့ၫၡုၬအီၪဝ့ၫလဂၩလီၫ.",
			"8": "<sup>8</sup> ထီးၦခမျၧးဒဲဒိၩ့အၦဒိၪၥံၪ နါဂၧၫ့ဆၧလဖၪနီၪ",
			"9": "<sup>9</sup> တၭ,အၥုၪ့ခိအၥၭဝီၩထၪ့လီၫ.- တၭထီးအအၪ့မၩန့ဆၧ ထိးအၥၭလၧစယၫစၧၫ့, ဒဲၦဂူၫဂၩအစူၪဖၧၩ့တၭ, ကွဲၪဖျါခွံၬအဝ့ၫၥံၪလီၫ.",
			"10": "<sup>10</sup> ၦထၧၫ့ဖုဝဲလဖၪအၪ့မၧၫ့ စပီလူၫဒဲစစဲလၭၥံၪစဲၪ့ ထၪ့ခွံၬလၧမုနၩလခီၫတၭ, လ့ၩထီၩ့ဝ့ၫလၧဘရံအၫချဲၫ့ မၬလီၫ. လ့ၩထီၩ့ဝ့ၫထီးနီၪ နုၬလၧၦယုဒၫဖိၪၥံၪအၥ",
			"11": "<sup>11</sup> ရိၬဖၧၩ့လီၫ.- ၦလဖၪနီၪအၥၭဂ့ၩနဲၪ့ၦၥ့ၭစလနဲကၫ ဖိၪဒံၭလီၫ. မွဲအဒိၭန့ဒၪဆၧအလူလၧအၥၭချဲၫ့ခိၬ တၭ,ဆၧနီၪလဖၪမွဲဆၧဘဲၫနီၪဧၪ, လမွဲဘၪလဲၪနီၪ အၪ့ဎၬယိခွါ, လံၬၥံၪလဲၥံၪထံၫထံၫဆၭဆၭၥံၫ့ၥံၫ့နံၩ",
			"12": "<sup>12</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦနဲၩထဲၩ့ဆၧလၧအကျၩ အၪဂၩတၭ, ၦဂြံစၭဖိၪအီၪလၧအလၩအဖၩ့, ၦမုၪဒဲ ၦခွၫနဲၩထဲၩ့ဆၧဆ့မွဲၡၩခိၬအ့ၬ.",
			"13": "<sup>13</sup> ၦယုဒၫဖိၪလၧၥ့ၭစလနဲကၫအဖၧၩ့လဖၪ ထီးအၥ့ၪ ယၫဝ့ၫလၧ စပီလူၫလီၩလၩ့လၬလၩ့ယွၩ အလူအထၫ လၧဘရံအၫအဖၧၩ့တၭ, လ့ၩဝ့ၫထီးနီၪဆ့,ပဂၨၪထၪ့",
			"14": "<sup>14</sup> ၦခမျၧးအခဲၫ့လီၫ.- ထီးနီၪလဖၧၫ့ၦထၧၫ့ဖုဝဲၥံၪအၪ့ မၧၫ့စပီလူၫလ့ၩထီၩ့ လၧမၫဆမံၭအနဲၩ့ထံၭနီၪချဲၫ့ မၬလီၫ.အ့ၪမွဲစစဲလၭဒဲစထံမၥံၫနီၪ အီၪဒံၭဝ့ၫထီးနီၪ",
			"15": "<sup>15</sup> လီၫ.- တၭၦလၧအၥိၫ့စပီလူၫလဖၪနီၪ ၥိၫ့ဝ့ၫထီၩ့လၧ အၭၥံၫ့အဖၧၩ့လီၫ. တၭမွဲအဒိၭန့ဆၧမၪလူၬလၧစစဲ လၭဒဲစထံမၥံၫအဂးဘဲၫၥိၭအဝ့ၫၥံၪမိဂဲၫလၧအ အီၪချဲၫ့ချဲၫ့ဂီၩ့တၭ, မွဲအစဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"16": "<sup>16</sup> စပီလူၫအီၪခိၭအဝ့ၫၥံၪ လၧအၭၥံၫ့အဖၧၩ့အဘိၩ့ ဘၭနီၪ, ဒၪဘၪလၧဒိၩ့ဎွ့ၩထၪ့ဝ့ၫလၧဆၧဂၩ့တၭ,",
			"17": "<sup>17</sup> အၥၭခိထၪ့ဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, လၧၥရိၬ ဖၧၩ့နီၪဂဲးလိၬတ့ၭလိၬအၥၭ လၧၦယုဒၫဖိၪၥံၪ, ဒဲၦ ယူၭယၪ့ယွၩဒဲၦလၧအဂဲၫဒၪခီၩ့ဝ့ၫ လၧဖၠၫဖၧၩ့လ ဖၪကိၭမုနံၩမုနၩဒ့ၭလီၫ.",
			"18": "<sup>18</sup> တၭၦလၧအကိၪ့ၥ့ၪအ့ၫပကုရအၫ့ဖိၪၥံၪ, ဒဲၦစတိ အၭဖိၪၥံၪလနၩ့နၩ့တ့ၭလိၬအၥၭ လၧစပီလူၫနီၪ,လနၩ့ နၩ့စံၭဝ့ၫ, ၦအၪ့ထုၫ့န့ဆၧချဲၩ့လဂၩယီၩ မွဲအမိလီၩ ဘၪဆၧနီၪလမံၩ့လဲၪ. ၦဂူၫဂၩစံၭဝ့ၫ, လၩ့ဂၬလၧအ မွဲၦလၧအလီၩလၩ့လၬလၩ့ ၦလခီၫဘၩ့မုးဖိၪအကဆါ လဖၪအဂဲးအကၠီၪ့လီၫ. အဂဲးဘဲၫယီၩ မွဲအလီၩဘၪ",
			"19": "<sup>19</sup> ဝ့ၫလၧယ့ၫၡုၬဒဲဆၧဂဲထုၪ့ထဲၩ့အဂဲးလီၫ.- အဝ့ၫၥံၪနီၪ အၪ့မၩန့ဝ့ၫတၭ,ၥိၫ့ဝ့ၫထီၩ့လၧအၫရအီၭပဂၧၭ, စံၭ ဝ့ၫ,ဆၧၥီၪ့ဆၧၥၫ့အၥၫ့ လၧနလီၩလၩ့လၬလၩ့နီၪမွဲပ",
			"20": "<sup>20</sup> ကြၨၭၥ့ၪယၫဆ့ဧၪ.- အဂဲးဘဲၫယီၩနဒုၭဂၧၫ့ထၪ့ဆၧ မၩထီၫမံၫထီၫမၪလနၩ့နၩ့လၧပနါဖၧၩ့လီၫ. မၩအ ၥၭဘဲၫနီၪတၭ, ဆၧနီၪလဖၪမွဲ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ နီၪ,မိၥ့ၪယၫဘၪပၥၭလီၫ.",
			"21": "<sup>21</sup> ၦအၭၥံၫ့ဖိၪကိၭဂၩဒ့ၭ, ဒဲၦမွံၩအီၪဝ့ၫထီးနီၪလဖၪ လမၩဘၪဆၧမၩအဂူၫဂၩ နးမံၩ့တၭ, မွဲအလီၩထဲၩ့ ဆၧ,ဒဲခိၭနၪဆၧအၥၫ့လဖၪနီၪလီၫ.",
			"22": "<sup>22</sup> စပီလူၫဆၧၫ့ထုၪ့လၧအၫရအီၭပဂၧၭ အကျၩတၭ, စံၭဝ့ၫ, ၦအၭၥံၫ့ဖိၪၥံၪဧ့, ယဒၪဘၪလၧနၥံၪ ယူၭယၪ့ နၥံၪအကဆါလဖၪ လၧဆၧကျ့ၭစၨၭဒိၪမၬလီၫ.",
			"23": "<sup>23</sup> အဂဲးဘဲၫယီၩယလ့ၩစဲၪ့တၭ, ယဒၪဘၪနၥံၪဘိၪ့ဆၧ ဘၩဆၧအလးနီၪ, ယဒၪဆၧလုအလးလစီၪ့အီၪလၧ ဆၧကွ့ၭအၥၭလၧအလီၩ့, ယွၩလၧၦလၥ့ၪယၫဘၪဝ့ၫ လဂၩအဂးနီၪလီၫ. ဆၧလၧနၥံၪလၥ့ၪယၫဘၪနီၪ, နၥံၪဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫ တၭ,ယမိလီၩဘၪနၥံၪ လၧအဝ့ၫ လဂၩနီၪအဂဲးလီၫ.",
			"24": "<sup>24</sup> ယွၩလၧအမၩကဲၪထၪ့ဂၪ့ခိၪမူၭခိၪ, ဒဲကယဲဆၧ အီၪလၧအဖၧၩ့,အဝ့ၫဒၪနီၪမွဲမူၭခိၪဒဲဂၪ့ခိၪအကဆါ တၭ,ဂံၪ့လၧၦၡၩမၩ လၧအစူၪနီၪ, လအီၪဘၪဝ့ၫလၧ",
			"25": "<sup>25</sup> အဖၧၩ့တၭ,- အဝ့ၫဒၪအနၫ့ဆါဒၪဝ့ၫနီၪ ဖ့ၪလၫ့ၦၡၩ ၥံၪထီးအလူၬလၧအၥၭမၧၫ့, ဒဲအၥၪ, ဒဲအဆၧကိၭအ မံၩ့ဒ့ၭတၭးဘဲၫအဂ့ၩန့ဘၪဆၧလမံၩ့မံၩ့အၥိၭနီၪ, ၦၡၩမၩလၧအစူၪ လၧအဝ့ၫဒၪအဂးအလးအီၪအ့ၬ.",
			"26": "<sup>26</sup> အဝ့ၫဒၪမၩကဲၪထၪ့ ၦကိၭဆၨၩဒ့ၭ လၧဆၧၥွံၪလ မံၩ့ဎး,ဘဲၫၥိၭအမိအီၪ လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫအလီၩ့ တၭ,အီၪက့ၪလၩ့ဝ့ၫလၧအဆၧၫ့အထီ,ဒဲအအီၪဝ့ၫ",
			"27": "<sup>27</sup> အလးလဖၪအဆၧၩ့,- ဘဲၫၥိၭအမိအၪ့ဎၬ ယွၩတၭ, ဘၪလဘၪမိလုးယိခွါဝ့ၫနီၪ, မိဒၪန့ၥံၪၥံၪလီၫ. မွဲလါနၫ့",
			"28": "<sup>28</sup> ဘဲၫနီၪတၭ,အီၪယဲၩ့လၧၦၡၩနးဂၩအ့ၬ.- အဂဲးဘဲၫ ယီၩပမၧၫ့, ဒဲပဂဲၩ,ဒဲပအီၪလၧအဖၧၩ့ဘဲၫၦၥ့ၪထၭ ခိၪလၧနၥံၪအကျၩလနၩ့နၩ့, စံၭဝ့ၫ,အၥိၭ, အဂဲးဘဲၫယီၩ, အဆၨၩအဆၬ, မွဲဆ့, ပဝ့ၫဒၪ.",
			"29": "<sup>29</sup> မၩအၥၭဘဲၫနီၪတၭ, ပမွဲယွၩအဆၨၩအဆၬတၭး ပဆီၫ့မီၪ့ လၧယွၩလၩ့ဂၬထီၫ့ၥံၪလွ့ၫၥံၪ, ကျိၪၥံၪစ့ၩၥံၪ, လိးၥံၪလဲၫ့ၥံၪ လၧၦၡၩစိၭဖျၩန့ဝ့ၫ, လၧအစူၪဒဲကိၪ့",
			"30": "<sup>30</sup> ထၪ့ဖၭလၩ့အဆၧဒၪဝ့ၫနီၪမွဲအကြၨၭအ့ၬ- ၦလၥ့ၪ ယၫဘၪဆၧအထီနီၪ,ယွၩအွံၪၥၭဆၧၩ့လါနၫ့ဘိၩ, ဘိၩ့နဲၪ့ယီၩမွဲအမၪလူၬၦအီၪလစီၪ့လါလါထီးအလူၬ,",
			"31": "<sup>31</sup> ဘဲၫၥိၭအမိနီၫ့ယါလၩ့ထဲၩ့အၥၭလီၫ.- အဂဲးဘဲၫ ယီၩဖၭနံၩဖၭၥၫ့ဝ့ၫ လၧအမိစ့ၩရၫ့ ၦဂၪ့ခိၪဖိၪၥံၪတီၩ တီၩလီၩ့လီၩ့လၧၦလၧ အအီၪက့ၪလၩ့ဝ့ၫ လဂၩ တၭ,မွဲအဒုၭဂဲထုၪ့ထဲၩ့ အဝ့ၫဒၪလဂၩ လၧဆၧၥံၫအ ဖၧၩ့အကၠီၩ့တၭ, ဖ့ၪလၫ့ဆၧထိးအၥၭ ဂုးဂုးခၧၫ့ခၧၫ့ လၧၦထီးအလူၬ အမ့ၬယၫနီၪလီၫ.",
			"32": "<sup>32</sup> ထီးအဝ့ၫၥံၪနါဂၧၫ့ ၦဂဲထုၪ့ထဲၩ့လၧဆၧၥံၫအဖၧၩ့ အဂဲးအကၠီၩ့နီၪ, ၦလနၩ့နၩ့ဒုၪဒွ့ၪဆၧတၭ, လနၩ့နၩ့, စံၭဝ့ၫ, ဆၧနီၪလဖၪအဂဲးနီၪပမိနါဂၧၫ့ဒီၭလၧနၧၩလီၫ.",
			"33": "<sup>33</sup> ဘဲၫနီၪအၥိၭ စပီလူၫစဲၪ့ထၪ့ခွံၬ လၧအကျၩလီၫ.",
			"34": "<sup>34</sup> မွဲလါနၫ့ဘိၩ, ၦလနၩ့နၩ့ အီၪက့ၪဎုၬအၥၭလၧအၥိၭ တၭ,နဲၩထဲၩ့ဝ့ၫဒၪလီၫ. ၦစ့ၩရၫ့ခွး စဒဲၫအနံၡၧၭအီၪ လၧအကျၩနီၪလဂၩ, ဒဲၦမုၪနးဒၫမရံၭလဂၩ, ဒဲၦဂူၫဂၩ လဖၪအီၪလၧအၥိၭလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ဆၧနီၪလဖၪအလးခဲၫ့တၭ, စပီလူၫစဲၪ့ထၪ့ခွံၬဝ့ၫလၧ",
			"2": "<sup>2</sup> အၭၥံၫ့နီၪ,ဂဲၫထီၩ့ဝ့ၫလၧကီရံၫ့လီၫ.- တၭစကျီဒအၧၭ အလူလၩ့လၧၦယုဒၫဖိၪၥံၪ ထီးအလူၬဘၪစဲၪ့ထၪ့ခွံၬ လၧရိမၫအဖၧၩ့နီၪ, စပီလူၫဒၪဘၪၦယုဒၫဖိၪအီၪဖျဲၪ လၧပီၪ့တၧၭ,အမံၩ့စအကွံလၫလဂၩဒဲအမၫ နးပြံၫ စံလၫနီၪစဲၪ့ထၪ့ခွံၬလၧအံတလံၫ ဂဲၫထီၩ့လၧအဝ့ၫဒၪ",
			"3": "<sup>3</sup> အအီၪလီၫ.- မွဲလၧအမၩဆၧၥ့ၪလမံၩ့ဎးအကၠီၩ့တၭ, အီၪဝ့ၫလၧအၥိၭမၩဆၧလီၫ.- အဂဲးဘဲၫယီၩအဆၧ",
			"4": "<sup>4</sup> မၩနီၪမွဲလၧအဆၭတဲၩၥံၪလီၫ.- မွဲအလီၩလၩ့ဆၧတ့ၭ လိၬဆၧလၧၥရိၬဖၧၩ့ကိၭမးၥံၫအနံၩအဘျၩ့ဒ့ၭ,ဒဲပ ဂၨၪထၪ့ၦယုဒၫဖိၪၥံၪ, ဒဲၦဂြံစၭဖိၪၥံၪအခဲၫ့လီၫ.",
			"5": "<sup>5</sup> ထီးစစဲလၭ, ဒဲစထံမၥံၫစဲၪ့ထၪ့ခွံၬဝ့ၫလၧမၫစဒိ နအၫနီၪ, ဂဲၫထီၩ့တၭ, စပီလူၫ ဘၪဆၧအလူအၪ့မၧၫ့ ဆီၪ့ဝ့ၫတၭ, ထိးအၥၭ လၧၦယုဒၫဖိၪၥံၪအမ့ၬယၫလၧ",
			"6": "<sup>6</sup> ယ့ၫရှူၬနီၪမွဲဎရံၬလီၫ.- ထီးအဝ့ၫၥံၪပဒၩ့ထၬဆၧ, ဒုၪ ဒွ့ၪဝ့ၫနီၪ,စပီလူၫတရူၩလၩ့အကီၩ့အၥိၭတၭ, လီၩ ဘၪအဝ့ၫၥံၪ မွဲနၥံၪအၥွံၪလၩ့ဘၪလၧနၥံၪ အခိၪဒၪန ၥံၪဝ့ၫအလီၩ့ဆံၭ, ယဝ့ၫဒၪယီၩမွဲယဆံၫ့ယဝ့ၫတၭး ထီးယီၩလၧယၫလခီၫနီၪ, ယမိလ့ၩလၧၦဆၨၩလဖၪ အအီၪလီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪတၭ, လ့ၩနုၬလၧၦလ ဂၩလၧအယူၭယၪ့ယွၩ, အမံၩ့မွဲစယၧၭစတၧၭအဂံၪ့",
			"8": "<sup>8</sup> ဖၧၩ့လီၫ. အဂံၪ့နီၪအီၪဘူၭဝ့ၫလၧၥရိၬလီၫ.- ၦၥရိၬ ခိၪစကြံစပၧၭနဲၩထဲၩ့ကဆါနီၪဒဲအဂံၪ့ဖိၪထီးအလူၬ ဆ့လီၫ. ၦကီရံၫ့ဖိၪၥံၪနါဂၧၫ့ဆၧနီၪ နဲၩထဲၩ့ဝ့ၫတၭ, ဒိၭဘၭတံၫဇၫ့အၥၭအၪဂၩလီၫ.",
			"9": "<sup>9</sup> ကဆါလီၩဘၪစပီလူၫ, လၧမုနၩလခီၫလၧအဒၪဆၧ လၧယၫအဖၧၩ့တၭးစံၭဝ့ၫဒၪ, ထီးၥၭမဲၪလဂ့ၩ, အီၪ",
			"10": "<sup>10</sup> လၩ့မါပံၭလဂ့ၩ, ချဲၩ့ဆၧဆံၭ.- အဂဲးဘဲၫယီၩယဝ့ၫ ဒၪယီၩယအီၪလၧနၥိၭလီၫ. ဘဲၫၥိၭအမိမၩအၧၩ့ ဘၪနၧၩနီၪ,ၦလမၩဘၪနၧၩ နးဂၩတၭ, အဂဲးဘဲၫယီၩ ယခ့ၫယၡၩအီၪဝ့ၫလၧဒိၩ့လဖျိၪ့ယီၩအဖၧၩ့အၪဂၩလီၫ.",
			"11": "<sup>11</sup> အဝ့ၫဒၪအီၪထီးနီၪလနံၪ့ ဒဲလၩဎူၫဘံၪ့တၭ,ၥီၪ့ထဲၩ့ ၥၫ့ထဲၩ့ယွၩအလူအထၫ လၧအကျၩလီၫ.",
			"12": "<sup>12</sup> လၧစဂၫလအိၫလဂၩကဲၪ ၦဒိၪဖၭဒိၪ လၧခးအခ့ ယၫနီၪ, ၦယုဒၫဖိၪၥံၪအီၪဝ့ၫ လၧအၥၭလဖျိၪ့ဎးဖီၪ့ ထၬစပီလူၫၥိၫ့နုၬဝ့ၫ လၧဆၧစ့ၩရၫ့ခွးအလးဆၧၫ့နၩ့",
			"13": "<sup>13</sup> အမ့ၬယၫ,- စံၭဝ့ၫ,ဘဲၫၥိၭၦၡၩမိဘိၪ့ထၪ့ဘၩထၪ့ယွၩ နီၪ,လမွဲဘၪဘဲၫဆၧၥီၪ့ဆၧၥၫ့အၥိၭတၭ, အဝ့ၫလဂၩ ယီၩပဂၨၪထၪ့ၦၡၩအခဲၫ့လီၫ.",
			"14": "<sup>14</sup> စပီလူၫအၥၭအီၪ လၧအမိအၩ့ထၪ့အနိၭအဘိၩ့ဘၭ တၭ,စဂၫလအိၫလီၩဘၪၦယုဒၫဖိၪလဖၪနီၪ, ၦယုဒၫ ဖိၪၥံၪဧ့, ဆၧလတီၩလလီၩ့ဘၪ,ဆၧအၧၩ့ဆၧၥၫ့",
			"15": "<sup>15</sup> အ့ၪအီၪနီၪယမိ အွံၪၥၭဆၧၩ့နၥံၪလီၫ.- အ့ၪမွဲဆၧအၪ့ စၪ့လၧဆၧချဲၩ့အဂဲး,ဒဲအမံၩ့အၥၪအဂဲး,ဒဲနၥံၪအဆၧ ၥီၪ့ဆၧၥၫ့အဂဲးအကၠီၪ့နီၪ, ယိဒၪနၥံၪဝ့ၫဆံၭး အ",
			"16": "<sup>16</sup> ဂဲးဘဲၫယီၩဆၧဘဲၫနီၪၥိၭ ယစ့ၩရၫ့ယဝ့ၫအ့ၬ.- အဝ့ၫ ဒၪနၫ့ထၪ့ခွံၬ အဝ့ၫၥံၪလၧဆၧစ့ၩရၫ့ခွး အလးဆၧၫ့ နၩ့အမ့ၬယၫလီၫ.",
			"17": "<sup>17</sup> အ့ၪမွဲၦထီးအလူၬလဖၪဖီၪ့ထၬၥရိၬခိၪ, စစီၥနံၫ နီၪတၭ,ထးဝ့ၫလၧဆၧစ့ၩရၫ့ခွးအလးအမ့ၬယၫလီၫ. တၭဆၧနီၪလဖၪစဂၫလအိၫ အီၪက့ၪဝ့ၫလၧဆၧနးမံၩ့ အ့ၬ.",
			"18": "<sup>18</sup> စပီလူၫအီၪဒံၭဝ့ၫ အၪနံၩအၪၥၫ့တၭ, စဲၪ့ဖၭလၧ ၦထၧၫ့ဖုဝဲၥံၪတၭ, ဆိၪလၩ့ယူၭအၥၭနီၪ, လိၩ့အ ခိၪလၧစံၪ့ခြံအၫအဖၧၩ့တၭ, လ့ၩထူၬကဘၩ့ထီၩ့ ဝ့ၫလၧစံရအၫတၭ, နးပြံၫစံလၫဒဲစအကွံလၫ အီၪလၧ",
			"19": "<sup>19</sup> အၥိၭလီၫ.- အဝ့ၫၥံၪလ့ၩထီၩ့ဝ့ၫလၧအ့ဖစၧၭတၭ, အ ဝ့ၫဒၪအီၪက့ၪလၩ့ထးအဝ့ၫၥံၪ ထီးနီၪလီၫ. အ့ၪမွဲအနၫ့ ဆါဒၪဝ့ၫနီၪ,လ့ၩနုၬဝ့ၫလၧၥရိၬဖၧၩ့တၭ,ဂဲးလိၬတ့ၭ",
			"20": "<sup>20</sup> လိၬဆၧလၧၦယုဒၫဖိၪၥံၪလီၫ.- အဝ့ၫၥံၪ အၪ့ကံၩ့ အၪ့ယၫဝ့ၫလၧအမိအီၪ လၧအဝ့ၫၥံၪ အၥိၭယံၬနဲၪ့အ",
			"21": "<sup>21</sup> နီၪဒံၭတၭ,အဝ့ၫဒၪအုၩ့လၩ့ဝ့ၫအ့ၬ.- ချဲၩ့ဒုၪ့အဝ့ၫၥံၪ ဂီၩ့တၭ,စံၭဝ့ၫ, ဎဘိၪ့လၧအမိဘၪဝ့ၫနီၪ ယဘၪလ့ၩ မၩလၧယရုစလံၫ့အဖၧၩ့တၡါလီၫ. မွဲလါနၫ့ၭ အ့ၪ ဘၪယွၩအၥၭနီၪ,ယမိဂဲၫအီၪၡီၩ့ဒံၭနၥံၪနးဘျၩ့ဒံၭ လီၫ. အဝ့ၫဒၪထူၬထၪ့ကဘၩ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫလၧ အ့ဖစၧၭအဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> တၭစိၭထၪ့ဝ့ၫ လၧစ့ၭစရံအၫနီၪ, အဝ့ၫဒၪလ့ၩထၪ့ ချဲၩ့ဒုၪ့လိၬအၥၭ လၧဆၧအီၪကီၪ့ဖိၪၥံၪတၭ, လ့ၩလၩ့",
			"23": "<sup>23</sup> ဝ့ၫလၧအၪ့တအီၭလီၫ.- လဆိလလးဖီၩ့ခွံၬဝ့ၫနီၪ,စဲၪ့ ထၪ့ဝ့ၫတၭ, ဘဲၫၥိၭအမိဒုၭဂုးထၪ့အထံၩအဖျဲၥံၪထီး အလူၬအဂဲးအဘၭတၭ, လ့ၩခၫ့ဂၬဂလ့ၡၫ, ဒဲဖြံဇ အၫနီၪလီၫ.",
			"24": "<sup>24</sup> တၭၦလဂၩလၧအချဲၩ့ဆၧၥ့ၪ, လၧအၥ့ၪဆၧကွ့ၭ အၥၭလဖၪ, ၦယုဒၫဖိၪလၧအအီၪဖျဲၪဝ့ၫလၧအလ့ၭစၫ့ ဒအၫအဖၧၩ့, အမံၩ့မွဲစအၫပီလၧၭလဂၩ ဂဲၫထီၩ့",
			"25": "<sup>25</sup> ဝ့ၫလၧအ့စဖၧၭလီၫ.- အဝ့ၫဒၪနီၪမၩလိၪယူၭကဆါနီၪ အဖၧၩ့ၥၭတၭ, အၥၭအၪ့ဂူၬမၩဆၧ, လီၩလၩ့လၬ လၩ့ဒဲၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧလၧကဆါနီၪ အဂဲးအကၠီၪ့ လၩ့ထံးလၩ့ဆ့ၭလီၫ. ၥ့ၪယၫဝ့ၫန့ၫ စယီဟၫ့အဆၧ",
			"26": "<sup>26</sup> ဘၭတံၫဇၫ့လီၫ.- အဝ့ၫဒၪနီၪချဲၩ့ဆၧလၧအၥၭဒူၩ လၧၥရိၬဖၧၩ့တၭ, ထီးစအကွံလၫ, ဒဲနးပြံၫစံလၫနါ ဂၧၫ့အဝ့ၫတၭ, အၪ့မၩန့ဒုၭနဲၪဝ့ၫယွၩအဖၧၩ့ၥၭလၧ အမ့ၬယၫလၩ့ထံးလၩ့ဆ့ၭ အၪနဲၪ့အလးဒံၭလီၫ.",
			"27": "<sup>27</sup> ထီးအၥၭအီၪလၧအမိလ့ၩလၧအခ့ယၫတၭ, ၦထၧၫ့ ဖုဝဲၥံၪကွ့ၭဆၧ, ဒဲပဂၨၪထၪ့အထံၩအဖျဲၥံၪအခဲၫ့ဘဲၫ အမိထိးဆၧၫ့ဝ့ၫအၥိၭလီၫ. အဝ့ၫနီၪလ့ၩထီၩ့ဝ့ၫတၭ, ၦလဖၪလၧအနဲၩထဲၩ့ဝ့ၫလၧဆၧအခိးအတၩအကၠီၩ့ နီၪ, အဝ့ၫလဂၩမၩဘိၭမၩဆၧၩ့အဝ့ၫၥံၪအၪအၪ",
			"28": "<sup>28</sup> လ့ၬဆ့လီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪ လၧအဆၧချဲၩ့ ဆီၪ့နီၪမၩနၧၩ့မၩစၪ ၦယုဒၫဖိၪၥံၪအဆၧဂဲးလိၬတ့ၭ လိၬလၧၦခမျၧးၥံၪအမ့ၬယၫတၭ, ဒုၭနဲၪလၧဆၧကွ့ၭ အၥၭလဖၪအဖၧၩ့နီၪလၧယ့ၫရှူၬမွဲဎရံၬနီၪလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭ လၧစအၫပီလၧၭအီၪလၧကီရံၫ့အဖၧၩ့ အဘိၩ့ဘၭနီၪ, စပီလူၫလ့ၩခၫ့ဂၬခွံၬခးလၧထၭတၭ, လ့ၩထီၩ့ဝ့ၫလၧအ့ဖစၧၭနီၪ ဒၪန့ဝ့ၫအထံၩအဖျဲလနၩ့",
			"2": "<sup>2</sup> နၩ့တၭ,- စံၭအဝ့ၫၥံၪ,လၧနၥံၪနဲၩထဲၩ့ဆၧနီၪ, မွဲနၥံၪ ဒိၭန့ၥၭမုဆံၫ့ဎံၪဆ့ဧၪး အဝ့ၫၥံၪစံၭအဝ့ၫလဒိၭန့ဘၪ နီၪလကၭလၧၩ့, န့ၫၥၭမုဆံၫ့ဎံၪအီၪဝ့ၫနီၪပနါဂၧၫ့ဘၪ",
			"3": "<sup>3</sup> အ့ၬ.- အဝ့ၫဒၪစံၭဝ့ၫ,အ့ၪမွဲဘဲၫနီၪတၭ, မွဲနၥံၪဒိၭဘၭ တံၫဇၫ့နၥံၪအၥၭလၧဆၧနီၪလမံၩ့လဲၪ, အဝ့ၫၥံၪစံၭဝ့ၫ,",
			"4": "<sup>4</sup> လၧစယီဟၫ့အဆၧဘၭတံၫဇၫ့လီၫ.- ထီးနီၪလဖၧၫ့စ ပီလူၫစံၭဝ့ၫ မွဲမၬ,စယီဟၫ့ဘၭတံၫဇၫ့ဆၧလၧဆၧဘၭ တံၫဇၫ့ဘၪဆဲၫ့လၧဆၧနီၫ့ယါလၩ့ထဲၩ့ၥၭနီၪ, လီၩ ဘၪၦခမျၧးလၧအဘၪနဲၩထဲၩ့ ၦမိဂဲၫလၧအလးခဲၫ့လ",
			"5": "<sup>5</sup> ဂၩ,ဘဲၫပစံၭဆၧအၥိၭ,ယ့ၫရှူၬနီၪလီၫ.- ထီးအဝ့ၫၥံၪနါ ဂၧၫ့ဆၧနီၪဒိၭဘၭတံၫဇၫ့အၥၭ လၧကဆါယ့ၫရှူၬအ",
			"6": "<sup>6</sup> မံၩ့လီၫ.- စပီလူၫအီၪက့ၪအစူၪလၧအလီၩ့တၭ,ၥၭ မုဆံၫ့ဎံၪနီၪဂဲၫလၩ့လၧအလီၩ့တၭ, အဝ့ၫၥံၪချဲၩ့ဆၧ လၧၦဆၨၩၥံၪအလၨ, ဒဲချဲၩ့ဆၧလၧမီၪအချိၬလီၫ.",
			"7": "<sup>7</sup> ၦထီးအလူၬနီၪမွဲလဆံၫနံၫဂၩကၪယူၭလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫဒၪလ့ၩနုၬဝ့ၫ လၧၥရိၬဖၧၩ့တၭ, ဂဲးလိၬတ့ၭ လိၬဆၧတၭ, ပဂၨၪထၪ့ၦအခဲၫ့လၧယွၩအဘၩ့အ မုးအဂဲးအကၠီၪ့တၭ, ချဲၩ့ဆၧလၧအၥၭဒူၩလၩၥၧၫ့ဘံၪ့",
			"9": "<sup>9</sup> ယၫလီၫ.- ထီးၦလနၩ့နၩ့အၥၭနီၩ့တၭ,လနဲၩဘၪ ဆၧစံၭအၧၩ့ဖၧၩ့ၥၭနီၪ လၧၦခမျၧးအမ့ၬယၫတၭ, အဝ့ၫဒၪစဲၪ့ဖၭလၧအဝ့ၫၥံၪတၭ, အၪ့မၩန့ထၪ့ထဲၩ့ အထံၩအဖျဲၥံၪ လၧအကျၩတၭ, ဂဲးလိၬတ့ၭ လိၬဆၧ လၧစတရၫ့နၧၭ အဆၧမၩလိၪလံၬအလး ၥံၫ့ၥံၫ့နံၩနီၪ",
			"10": "<sup>10</sup> လီၫ.- မၩဝ့ၫဘဲၫနီၪနံၫနံၪ့ယၫတၭ, ၦအီၪလၧခးအ့ ၡၫအဖၧၩ့,ၦယုဒၪဖိၪမွဲဂ့ၩ,ၦဂြံစၭဖိၪမွဲဂ့ၩ, နါဂၧၫ့ ကဆါယ့ၫရှူၬ အလူအထၫထီးအလူၬလီၫ.",
			"11": "<sup>11</sup> ယွၩမၩဆၧလၩ့လၭလၩ့မဲၩဒၪအဆၧလဖၪ လၧစပီ",
			"12": "<sup>12</sup> လူၫအစူၪဖၧၩ့,- ထီးပဝၫမွဲဂ့ၩ,ခၧၩ့ယးမွဲဂ့ၩ,အီၪ လၧအလီၩ့နီၪ. ၦလ့ၩဆိၬထီၩ့လၧၦဘၪစူၭဘၪဆၫ အအီၪနီၪ, အဆၧဆၫဘျၪထဲၩ့ဝ့ၫတၭ, ဆၧနၪစဲၪ့ထၪ့ ခွံၬလၧအဝ့ၫၥံၪအလီၩ့လီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့ ၦယုဒၫဖိၪၥံၪ လၧအလ့ၩလိၬဝၭၡၫဒဲ မၩကဒၩၦမ့ၬဒုၭဆိၪဆၧလနၩ့နၩ့တၭ ကိၭယိခွါ,က ဆါယ့ၫရှူၬအမံၩ့လၧၦဆၧနၪအီၪလၧအလီၩ့အဖၫ့ ခိၪတၭ,စံၭဝ့ၫ, ပဒုၭဆိၪလၩ့နၥံၪအၥၭလၧၦလၧစပီ လူၫလီၩဘၪဝ့ၫ, ယ့ၫရှူၬလဂၩအမ့ၬယၫနီၪလီၫ.",
			"14": "<sup>14</sup> ၦလုဆၧအဒိၪ ၦယုဒၫဖိၪစစံဝါလဂၩအဖိၪခွၫနွ့ၫဂၩ",
			"15": "<sup>15</sup> မၩဝ့ၫဘဲၫနီၪလီၫ.- ဆၧနၪချဲၩ့ဆၧၫ့ဆၧ,စံၭဝ့ၫ,ယ့ၫရှူၬ ယၥ့ၪယၫဒဲစပီလူၫယၥ့ၪယၫဂ့ၩဘၪစဲၪဆ့,အ့ၪမွဲနၥံၪ",
			"16": "<sup>16</sup> ဝ့ၫဒၪယီၩ နၥံၪမွဲပလၫလဖၪလဲၪ.- တၭၦလၧဆၧနၪ အီၪလၧအလီၩ့ ဖုၫထၪ့လၧအဝ့ၫၥံၪ အလီၩ့တၭ, မၩ နၧၩ့မၩစၪဝ့ၫ,ထီးအဝ့ၫၥံၪစဲၪ့ထၪ့ဘိၪ့ခွံၬဝ့ၫလၧဂံၪ့ ဖၧၩ့နီၪအီၪလၧအဖၧၩ့လးလီၫ.",
			"17": "<sup>17</sup> တၭဆၧမၩအၥၭနီၪၦယုဒၫဖိၪမွဲဂ့ၩ ၦဂြံစၭဖိၪမွဲဂ့ၩ, အီၪလၧအ့ဖစၧၭအဖၧၩ့လဖၪ ၥ့ၪယၫဝ့ၫထီးအလူၬနီၪ, ဆၧၥၭမဲၪၥၭဖျဲၩ့ဘၪအဝ့ၫၥံၪတၭ, အီၪက့ၪဒိၪအီၪ က့ၪထီၫကဆါယ့ၫရှူၬအမံၩ့လီၫ.",
			"18": "<sup>18</sup> ၦလၧအနဲၩဆၧလဖၪ ဂဲၫနဲၪဖျီၪအဆၧဒဲၩဘၭတၭ,",
			"19": "<sup>19</sup> လီၩလၩ့အဆၧမၩအၪဂၩလီၫ.- ၦလၧအၥ့ၪဆၧ အူၪဆၧပီၩအၪဂၩ ဂဲၫဆိၬအီၪက့ၪကီၪ့အလံၬၥံၪလဲၥံၪ တၭ,ဆူၭထၪ့ခွံၬဝ့ၫ လၧၦထီးအလူၬ အမ့ၬယၫလီၫ. တၭဆၧဝံထၪ့နၬထၪ့အဎွ့ၩနီၪ မွဲအကြၨၭစ့ၩယဲလၬ လီၫ.",
			"20": "<sup>20</sup> ဘဲၫနီၪအၥိၭယွၩအလူအထၫ ဒိၪထၪ့ဝ့ၫအၪအၪ လ့ၬတၭ, ဆီၪ့ထၪ့ဝ့ၫဒၪဆ့လီၫ.",
			"21": "<sup>21</sup> ဆၧနီၪလဖၪမၩအၥၭဂီၩ့တၭ, စပီလူၫအီၪက့ၪ အၥၭလၧအမိလ့ၩခၫ့ဂၬ မၫစဒိနအၫ ဒဲအခ့ယၫနီၪ,မိ လ့ၩလၧယရုစလံၫ့တၭ,စံၭဝ့ၫ,လၧယလ့ၩထီၩ့ထီးနီၪ",
			"22": "<sup>22</sup> အလးခဲၫ့တၭ, ယမိဘၪထီၩ့လၧရိမၫဆ့လီၫ.- တၭ အၪ့မၧၫ့ၦလၧအမၩအဆၧစထံမၥံၫ, ဒဲစအံၫရၭစတၧၭ နံၫဂၩလ့ၩလၧမၫစဒိနအၫတၭ, အနၫ့ဆါဒၪဝ့ၫအီၪ လၧခးအ့ၡၫအဖၧၩ့ လဆိလလးလီၫ.",
			"23": "<sup>23</sup> လၧအဆၧၫ့အထီနီၪ ဆၧတုၩ့ထၪ့တုၩ့လၩ့လၧဖၧၩ့",
			"24": "<sup>24</sup> ၥၭအကၠီၩ့အီၪထၪ့လဆံၭလခ့နီၪမွဲအ့ၬ.- အဂဲးဘဲၫ ယီၩၦနဲၫ့စ့ၩစဒမံတြအၧၭ လၧအမၩဆၧလုအဂံၪ့ဖိၪ လၧစ့ၩလၧနးအၫတမံၭအဂးနီၪ ဒုၭအီၪထၪ့ၦမၩဆၧ",
			"25": "<sup>25</sup> လဖၪအစူၪလးအခၪ့ခိၪၡၩခိၬအ့ၬ.- အဝ့ၫဒၪနီၪ ကိၭကီၪ့ၦမၩဆၧဘဲၫနီၪၥိၭလဖၪတၭ, စံၭဝ့ၫ,ၦၡၩ ၥံၪဧ့,မွဲလၧဆၧမၩယီၩအကၠီၩ့တၭ, ပန့ဘၪပစူၪလး",
			"26": "<sup>26</sup> ပခၪ့ခိၪနီၪ နၥံၪၥ့ၪယၫနၥံၪဝ့ၫလီၫ.- တၭနၥံၪဒၪဘၪ ဒဲနၥံၪနါဂၧၫ့လၧစပီလူၫလဂၩယီၩ ပဂၨၪထၪ့ၦၡၩၥံၪ အခဲၫ့,ဒဲကၠၪခွံၬၦအၪဂၩ, ဒဲကယဲလၧအ့ဖစၧၭအဖၧၩ့ နီၪလကၭလၧၩ့, မွဲလၧအ့ၡၫဆ့, ဘူၭလၧအမိဎွ့ၩထၧၫ့ ခးယၫတၭ စံၭဝ့ၫ, ဆၧလၧၦမၩကဲၪထၪ့လၧအစူၪလ",
			"27": "<sup>27</sup> ဖၪနီၪမွဲယွၩအ့ၬ.- တၭကယဲပမၩဆၧယီၩမိဘၪဆၧ ဒုၪဒွ့ၪနီၪလကၭလၧၩ့, ပကဆါဖၭဒိၪနးအၫတမံၭအ ဆၧလုအဂံၪ့လၧၦအ့ၡၫဖိၪၥံၪ, ဒဲၦဂၪ့ခိၪဖိၪၥံၪထီးအ လူၬဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫနီၪ, မွဲဆၧအီၪက့ၪလၧအလန့ ကၩဘၪဆၧနးမံၩ့တၭ, မိမၩဂၭဂီၩ့ အလၩအဖၩ့ လီၫ.",
			"28": "<sup>28</sup> ထီးအဝ့ၫၥံၪနါဂၧၫ့ဆၧနီၪ, ဎွ့ၩထၪ့ဝ့ၫလၧဆၧၥၭ ထၪ့တၭ, ကိၭၡၭထၪ့ဆၧ, စံၭဝ့ၫ ၦအ့ဖစၧၭဖိၪအနး",
			"29": "<sup>29</sup> အၫတမံၭယီၩ မွဲအဒိၪမၬလီၫ.- ဒိၩ့နီၪဎွ့ၩဝ့ၫလၧဆၧ တုၩ့ထၪ့တုၩ့လၩ့ ထၧၫ့ဒိၩ့ယၫတၭ, ၦလဖၪဖီၪ့ထၬၦ လၧအလ့ၩလၧစပီလူၫအၥိၭလဖၪ, ၦမၫစဒိနအၫဖိၪ, စဂ့အၧၭဒဲစအရံစတၫခၧၭတၭ. စဲၪ့တလဲးနုၬဝ့ၫချဲၫ့",
			"30": "<sup>30</sup> မၬလၧယိဖၧၩ့ဆၧအလးနီၪလီၫ.- ထီးစပီလူၫမိလ့ၩ နုၬဘၪအၥၭ လၧၦခမျၧးအကျၩနီၪ, အထံၩအဖျဲၥံၪ",
			"31": "<sup>31</sup> ဖ့ၪလၫ့အလ့ၩနုၬအ့ၬ.- အထံၩအၥိၭၥံၪ ခးအ့ၡၫအ ခိၪလနၩ့နၩ့ မၪလူၬဆၧတၭ, အၪ့ကံၩ့အၪ့ယၫဝ့ၫ ဘဲၫ ၥိၭအထီးလ့ၩနုၬ လၧယိဖၧၩ့ဆၧအလးနီၪလဂ့ၩ လီၫ.",
			"32": "<sup>32</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလနၩ့နၩ့ကိၭထၪ့ဆၧလမံၩ့, အလနၩ့နၩ့ဆၧလမံၩ့ဒၪလီၫ အဂဲးဘဲၫယီၩၦအီၪ ကီၪ့လဖၪ တုၩ့ထၪ့တုၩ့လၩ့ဆၧတၭ, ၦအီၪကိၩ့အီၪ ကီၪ့လၧဆၧနီၪအဂဲးလဲၪနီၪ, ၦလၥ့ၪယၫဘၪဝ့ၫအၪဒၪ",
			"33": "<sup>33</sup> အဆၧလီၫ.- အဝ့ၫၥံၪထုၭထၪ့စအလ့ၭစၪ့ဒၧၫ လၧၦ ခမျၧးအကျၩတၭ, ၦယုဒၫဖိၪၥံၪဆၪ့ထၪ့ဝ့ၫ လၧယၫ တၭ,စအလ့ၭစၪ့ဒၧၫမိချဲၩ့ဖီၩ့ဖျ့ၭလၩ့ဘၪအၥၭနီၪ, ဝံၩ",
			"34": "<sup>34</sup> ဝါအစူၪလီၫ.- ထီးအဝ့ၫၥံၪၥ့ၪယၫဝ့ၫလၧအမွဲၦယု ဒၫဖိၪတၭ, အဝ့ၫၥံၪထီးအလူၬကိၭၡၭထၪ့ဝ့ၫလၧအလူ ၥီၫလမံၩ့ဎး, နံၫနၩရံၩကၪယူၭတၭ, စံၭဝ့ၫ,ၦအ့ဖစၧၭ ဖိၪအနးအၫတမံၭယီၩ မွဲအဖၭဒိၪလီၫ.",
			"35": "<sup>35</sup> ဒိၩ့အၡၩကွ့ၭလံၬလဂၩ အၪ့မၧၫ့ၦခမျၧးအီၪလၩ့မါ ပံၭတၭ,စံၭဝ့ၫ, ၦအ့ဖစၧၭဖိၪၥံၪဧ့,ၦလၥ့ၪယၫဘၪ လၧဒိၩ့အ့ဖစၧၭ ယိထဲၩ့ဆၧဒိၪနးအၫတမံၭ အဆၧလု အဂံၪ့, ဒဲဆၧဂၩ့ဂဲၫလၩ့ထ့ၬ လၧကဆါယုပတၧၫအအီၪ",
			"36": "<sup>36</sup> နီၪ, မွဲပလၫလဂၩလဲၪ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧနီၪ လဖၪဆၧဂဲးလိၬ တ့ၭလိၬအၥၭ အလးလအီၪဘၪအ ကၠီၩ့,ကြၨၭအီၪနၥံၪဝ့ၫလၩ့မါပံၭဘီၪ. မၩကြၩ့ဆၧ",
			"37": "<sup>37</sup> နးမံၩ့လဂ့ၩ.- အဂဲးဘဲၫယီၩၦလၧအလအၪ့ဂူၪဘၪ ကဆါလဖၪအဂံၪ့အဆၧ, ဒဲလဒုၪဒွ့ၪဘၪနၥံၪအက ဆါမုၪလဖၪယၫနီၪ နၥံၪမီၩ့န့ထီးယီၩလီၫ.",
			"38": "<sup>38</sup> မၩအၥၭဘဲၫနီၪတၭ, စဒမံတြအၧၭ, ဒဲၦမၩဆၧၥံၪ အီၪလၧအၥိၭလဖၪနီၪ, အ့ၪမိအီၪက့ၪဘၪအၥၭ ဆၧ မၪလၧၦလဂၩဂၩအလီၩ့နီၪ, ချဲၩ့ခွးအမုနံၩလဖၪအီၪ ဒဲခးအၦဒိၪၥံၪအီၪဝ့ၫလီၫ. မွဲအချဲၩ့လိၬဒၪအၥၭ လၧ ခွးဘီၪ.",
			"39": "<sup>39</sup> တၭနၥံၪအ့ၪအၪ့ကံၩ့ဆၧ လၧအဂူၫဂၩဒိၪဒံၭလမံၩ့ နီၪ, မိဘၪဆၧစ့ၩရၫ့ဝ့ၫ လၧၦအီၪကိၩ့အီၪကီၪ့တီၩတီၩ",
			"40": "<sup>40</sup> အဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ ဆၧတုၩ့ထၪ့တုၩ့လၩ့အ ယီၩလနံၩအဂဲး, ဘၪလဘၪ ပမိဘၪဆၧအၪ့စၪ့လၧ ဆၧအီၪကီၪ့ယီၩ အဂဲးအကၠီၪ့တၭ, ပစံၭဆၧၫ့ဆၧၥ့ၪ",
			"41": "<sup>41</sup> အ့ၬ.- စံၭဆၧဘဲၫနီၪဂီၩ့တၭ, အဝ့ၫဒၪကွဲၪဖျါခွံၬ ၦၡၩခမျၧး လၧအအီၪကီၪ့လဖၪနီၪလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ဆၧတုၩ့ထၪ့တုၩ့လၩ့ အီၪလၩ့မါပံၭ အလးခဲၫ့နီၪ, စပီလူၫကိၭန့အထံၩအဖျဲၥံၪ ချဲၩ့ဒုၪ့အဝ့ၫၥံၪဂီၩ့နီၪ, စဲၪ့ထၪ့ခွံၬဝ့ၫ ဘဲၫၥိၭအမိလ့ၩနုၬ လၧမၫစဒိနအၫအ",
			"2": "<sup>2</sup> ဖၧၩ့နီၪလီၫ.- ဆၧအလးလဖၪနီၪအဝ့ၫဒၪလ့ၩခၫ့ဂၬ ခွံၬဝ့ၫတၭ, ပဂၨၪထၪ့အဝ့ၫၥံၪအခဲၫ့ လၧဆၧချဲၩ့အၪ",
			"3": "<sup>3</sup> ထံၪဂီၩ့တၭ, ဂဲၫထၪ့ဝ့ၫလၧခးဂြံစၭအဖၧၩ့လီၫ.- အီၪ ထီးနီၪလၩၥၧၫ့ဘံၪ့ယၫတၭ, မိထူၬထၪ့ကဘၩ့လ့ၩ လၧစံရအၫနီၪ, မွဲၦယုဒၫဖိၪၥံၪကိၪ့ဆၧထၫ့ဒုၪဒၩဝ့ၫ အကၠီၩ့တၭ, အီၪက့ၪအၥၭလၧအမိထဲၩ့ခၫ့ဂၬမၫစဒိ နအၫနီၪလီၫ.",
			"4": "<sup>4</sup> ၦစဖ့ၫရၧၭအဖိၪခွၫ ၦဘရံအၫဖိၪစစီပတၧၫဒဲၦၥ့ၭစ လနဲကၫဖိၪစအရံစတၫခၧၭ,ဒဲစ့ကၧၫ့ဒၧၭ,ဒဲၦဒၧဘံၫ ဖိၪစဂ့ယၧၭဒဲစထံမၥံၫ,ဒဲၦအ့ၡၫဖိၪစတံခကၧၭဒဲစတြီ",
			"5": "<sup>5</sup> ဖမၧၭၥံၪလ့ၩဖိၬအခဲၫ့ထီၩ့လၧခးအ့ၡၫနီၪလီၫ.- အ ဝ့ၫၥံၪလ့ၩဝဲၩဝ့ၫတၭ, အီၪခိၭပၧၩ လၧတြိအၭ အဖၧၩ့ လီၫ.",
			"6": "<sup>6</sup> ဘိၪ့ကိၪလဘၪဘၪ လၧမံၪအနံၩအၥၫ့ဖီၩ့ခွံၬနီၪ, ပထူၬထၪ့ကဘၩ့တၭ, ပစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧဖလံဖံၫအ ဖၧၩ့နီၪ, ပလ့ၩထီၩ့လၧအအီၪ ထီးတြိအၭအဖၧၩ့ လၧယဲနံၩအထးဖၧၩ့တၭ, ပအီၪထီးနီၪနွ့ၫနံၩလီၫ.",
			"7": "<sup>7</sup> နွ့ၫနံၩအကျၩမုခၪ့ထံၭအနံၩနီၪ,ပအီၪကိၩ့အီၪ ကီၪ့ဘဲၫၥိၭပမိကံၪ့ဘျ့ၭကိၪတၭ, စပီလူၫမိစဲၪ့ထၪ့ ခွံၬကဲဂီၩလနံၩလီၩလၩ့လၬလၩ့ဆၧ ထီးအထီၩ့လၧဖိၭ",
			"8": "<sup>8</sup> ဖၫ့မုလီၫ.- မ့ၪဒိၩ့အီၪအၪဖျိၪ့ လၧပအီၪကိၩ့အီၪကီၪ့",
			"9": "<sup>9</sup> အဒူၭလၧဆၧထၪ့ထီၫလဆၫ့အဖၧၩ့နီၪလီၫ.- ၦဖိၪ ၥၪခွၫစယုတခၧၭလဂၩ ဆၧၫ့နၩ့ဝ့ၫ လၧတရၫ့လံၩအ ဖၧၩ့တၭ, မံၫမၪဝ့ၫယိၬနီၪ, စပီလူၫလီၩလၩ့လၬလၩ့ ဆၧယံၬယံၬတၭ, မွဲအမံၫမၪဝ့ၫအကၠီၩ့နီၪ,လၩ့ထ့ၬဝ့ၫ လၧဂံၪ့ၥၧၫ့ဆၫ့လဆၫ့နီၪၥံၫဝ့ၫတၭ, ၦမၩန့ထၪ့ထဲၩ့ဝ့ၫ",
			"10": "<sup>10</sup> လီၫ.- စပီလူၫစဲၪ့လၩ့မံၫနၩ့ဝ့ၫလၧအလီၩ့, ဒဲဖိၭဂိၫ့ ဝ့ၫတၭ,စံၭဝ့ၫ, ဂၪ့ဆၧယၧၩ့ဆၧလဂ့ၩ,မွဲအၥၭမၧၫ့",
			"11": "<sup>11</sup> အီၪဝ့ၫလၧအဖၧၩ့လီၫ.- ထဲၩ့ထၪ့ထဲၩ့ ကံၪ့ဘျ့ၭကိၪ, ဒဲအၪ့ဆၧ, ဒဲချဲၩ့ဆၧယံၬယံၬထီးဆၧဖၩ့ထၪ့တၭ, စဲၪ့",
			"12": "<sup>12</sup> ထၪ့ခွံၬဝ့ၫဘဲၫနီၪလီၫ.- ၦဂဲၫဆိၬထၪ့ၦဖိၪၥၪခွၫလၧ အမၧၫ့ဝ့ၫနီၪတၭ, အီၪရှူၪအီၪမုၬမွဲလဆံၭလခ့အ့ၬ.",
			"13": "<sup>13</sup> ပဝ့ၫဒၪယီၩ ပလ့ၩထူၬထၪ့ကဘၩ့တၭ, ပလ့ၩထီၩ့ လၧအၭစီၭတၭ, ပဆီၫ့မီၪ့လၧပမိအၪ့မၩန့ စပီလူၫထီး နီၪလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမိလ့ၩလၧအခၪ့ထီးနီၪ,",
			"14": "<sup>14</sup> မၪလူၬဝ့ၫဘဲၫနီၪလီၫ.- ထီးပဒၪလိၬပၥၭလၧအဝ့ၫဒၪ လၧအၭစီၭနီၪတၭ, ပမၩန့ထဲၩ့ဝ့ၫတၭ, ပလ့ၩထီၩ့လၧ မံတလံနံၫနီၪလီၫ.",
			"15": "<sup>15</sup> ပစဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, ကဲဂီၩလနံၩပလ့ၩဖိးဆဲၫဎၩ့ လၧခဲအီၭလီၫ. ကဲဂီၩလနံၩဒီၭနီၪ ပလ့ၩဖိးလၧစ့မီၭ တၭ,ပအီၪလၧတြိၫဇံလအၫ့အဖၧၩ့တၭ, ကဲဂီၩလနံၩ",
			"16": "<sup>16</sup> ဒီၭနီၪ, ပလ့ၩထီၩ့လၧမလံတၧၭလီၫ.- အဂဲးဘဲၫယီၩ, စပီလူၫအီၪက့ၪအၥၭလၧအမိလ့ၩဖီၩ့ခွံၬအ့ဖစၧၭဘဲၫ ၥိၭအထီးအီၪလၧခးအ့ၡၫအဖၧၩ့ယံၬယံၬလဂ့ၩး အဂဲး ဘဲၫယီၩအၪ့ဂူၬလ့ၩဝ့ၫ ဘဲၫၥိၭအ့ၪၥ့ၪမိထီၩ့ဘၪအၥၭ လၧယရုစလံၫ့ထီးမုယဲဆံၫအနံၩလနံၩနီၪလီၫ.",
			"17": "<sup>17</sup> လၧမလံတၧၭအဖၧၩ့နီၪ, အဝ့ၫဒၪအၪ့မၧၫ့ၦလ့ၩ လၧအ့ဖစၧၭတၭ, ကိၭန့ဆၧအီၪကီၪ့ အၥုၪ့က့ၭၥၭၡါၥံၪ",
			"18": "<sup>18</sup> လီၫ.- ထီးအဝ့ၫၥံၪဂဲၫထီၩ့လၧအအီၪနီၪ, မွဲအစံၭအ ဝ့ၫၥံၪး လၧယဂဲၫထီၩ့ဝ့ၫလၧခးအ့ၡၫခီၫလၧမုအခၪ့ ထံၭလံၩလံၩ ယမၩယုၩယါ လၧနၥံၪအကျၩ ဘဲၫၥ့ၪ",
			"19": "<sup>19</sup> လဲၪဘဲၫၥ့ၪလဲၪနီၪ, နၥံၪၥ့ၪယၫနၥံၪဝ့ၫလီၫ.- ယမၩ ကဆါအဆၧလၧဆၧဆၪ့လၩ့ယၥၭထီးအလူၬဒဲ လၧယမ့ၬထံၫၥံၪလၩ့ဝ့ၫ, ဒဲဆၧမၩခိမၩဝီၩလၧ အဘၪယၧၩ လၧၦယုဒၫဖိၪၥံၪအဆၧကိၪ့ထၫ့ဒုၪဒၩ",
			"20": "<sup>20</sup> ယၧၩအကၠီၩ့လီၫ.- ဆၧလၧအကြၨၭလၧနၥံၪအဂး လမံၩ့လါလါနီၪယအီၪက့ၪၥူၪခွံၬဝ့ၫနးမံၩ့အ့ၬ. အ့ၪ မွဲလၧၦခမျၧးအကျၩဒဲလၧလဂံၪ့ဘၪလဂံၪ့ လဂံၪ့ဘၪ လဂံၪ့ယဒုၭနဲၪနၥံၪအဆၧ, ဒဲယၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့နၥံၪ",
			"21": "<sup>21</sup> လီၫ.- ဒဲဆၧနီၫ့ယါလၩ့ထဲၩ့လၧယွၩအမ့ၬယၫ,ဒဲနဲၩ ထဲၩ့ပကဆါယ့ၫရှူၬဎရံၬနီၪ, ယထိးယၥၭလၧၦယုဒၫ ဖိၪၥံၪဒဲၦဂြံစၭဖိၪၥံၪ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ နၥံၪၥ့ၪ ယၫလီၫ.",
			"22": "<sup>22</sup> ဘိၩ့နဲၪ့ယီၩ, ယိခွါ,ယမိလ့ၩထီၩ့လၧယရုစလံၫ့နီၪ ဘၪလၧၥၭမု အၪ့မၧၫ့ဆီၪ့ယၧၩတၭ, ထီးနီၪဆၧမိ ဘၪယၧၩဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ယၥ့ၪယၫအ့ၬ.",
			"23": "<sup>23</sup> မွဲလါနၫ့ဘဲၫနီၪတၭ, ၥၭမုဆံၫ့ဎံၪနီၪ ထိးအၥၭလၩ့ထံး လၩ့ဆ့ၭလၧဆၧစၧၩ့ထၬ, ဒဲဆၧၡၪ့ဆၧနၭအီၪခိၭယၧၩ",
			"24": "<sup>24</sup> လၧကိၭဒိၩ့ဒ့ၭအဖၧၩ့လီၫ.- မွဲလါနၫ့ယအီၪက့ၪ ဆၧနီၪလဖၪ လၧဆၧနးမံၩ့အ့ၬ. ယအီၪက့ၪယၥၭ မၧၫ့ယီၩလၧဆၧလူဒိၪဎွ့ၩဒိၪလၧယဂးဒၪယဝ့ၫ မွဲဆ့ အ့ၬ,မွဲဘဲၫၥိၭယမိမၩဂီၩ့ယလ့ၩဆၧ လၧဆၧၥၭထိၬ ဒဲဆၧအခ့ၫအၡၩအဆၧမၩလၧယဒိၭန့လၧကဆါ ယ့ၫရှူၬ, လၧယမိထိးယၥၭလၩ့ထံးလၩ့ဆ့ၭ, ဒဲလၧ ယွၩအခိးအတၩ အဆၧၥၭထိၬ အပရၧၫ့အဂဲးလီၫ.",
			"25": "<sup>25</sup> ဘိၩ့နဲၪ့ယီၩ,ယိခွါ, နၥံၪဝ့ၫဒၪထီးအလူၬလၧယလ့ၩ ဝံၩ့ဝၩ့ဒဲယလီၩလၩ့လၬလၩ့ ယွၩအဘၩ့အမုးအဂဲးလၧ နၥံၪအကျၩနီၪ, ယၥ့ၪယၫလၧနၥံၪမိဒၪဘၪလၧၩ့ယမ့ၬ",
			"26": "<sup>26</sup> အ့ၬ.- အခိးမွဲဘဲၫနီၪတၭ, မုလနံၩယီၩ ယထိးယၥၭ လၧနၥံၪအမ့ၬယၫလၧယဆံၫ့ခွံၬလၧၦၡၩအၥွံၪကိၭ",
			"27": "<sup>27</sup> အဂၩဒ့ၭလီၫ.- အဂဲးဘဲၫယီၩ ယလီၩဘၪနၥံၪ လၧ ယွၩအၥၭထီးအလူၬနီၪတၭ, ယဂၭဎ့ၭခွံၬအ့ၬ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးလၩ့နၥံၪအၥၭ, ဒဲယိၥိၪ လဒီၪ့ထၧၫ့ဒီၪ့ယၫ, လၧၥၭမုဆံၫ့ဎံၪအီၪက့ၪနၥံၪလၧ ၦယိဝ့ၫဘဲၫၥိၭနၥံၪမိယိထဲၩ့ခွါထဲၩ့ ယွၩအဆၧအီၪ ကီၪ့လၧအဎွ့ၩန့ထဲၩ့ဝ့ၫလၧအၥွံၪဒၪဝ့ၫနီၪဆံၭ.",
			"29": "<sup>29</sup> အဂဲးဘဲၫယီၩယၥ့ၪယၫဆၧယီၩ, ထီးယအ့ၪလ့ၩဆၧ အလးခဲၫ့နီၪ, ထွံၪမံၩ့အဒူၩၥံၪလၧအလလီၫ့ကီၩ့",
			"30": "<sup>30</sup> ဘၪၥိၪလဒီၪ့နီၪမိဂဲၫနုၬလၧနၥံၪအကျၩလီၫ.- လၧနီၪ အမ့ၬယၫၦၡၩမိဂဲထုၪ့လၧနၥံၪအကျၩလဖၪမိလီၩ လၩ့ဆၧလၧအကဲၪ့ကီၪ့လဖၪဘဲၫၥိၭအထံၩအဖျဲၥံၪမိ",
			"31": "<sup>31</sup> လီၩ့ဖိၬအခဲၫ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,အီၪခိၭဆံၭး လၧယလအီၪထီခွံၬဘၪတၭ, လၧၥၧၫ့နံၪ့ယၫနီၪ, လၧမုဆၫဆၫ ဒဲမုနၩနၩတၭ, ယၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ နၥံၪ ကိၭဂၩဒ့ၭ လၧယမ့ၬထံၫလၩ့နီၪ, နၪ့ထၪ့ထဲၩ့နၥံၪ ဝ့ၫဆံၭ.",
			"32": "<sup>32</sup> ဘိၩ့နဲၪ့ယီၩ,ဖုၥံၪဝဲၥံၪဧ့, ယအီၪက့ၪနၥံၪလၧယွၩ အဖၧၩ့,ဒဲလၧအလူအခိးအတၩအဖၧၩ့, လၧအမၩဂုး မၩခၧၫ့နၥံၪၥ့ၪ, ဒဲဖ့ၪၥၫနၥံၪအဆၧလၧကယဲၦဆံၫ့ဎံၪ",
			"33": "<sup>33</sup> အကျၩၥ့ၪလီၫ.- ၦလဂၩဂၩအစ့ၩမွဲဂ့ၩ,အထီၫ့ မွဲဂ့ၩ,အကီၩ့အၥိၭမွဲဂ့ၩ, ယလီၫ့ကီၩ့ယဝ့ၫနးမံၩ့အ့ၬ.",
			"34": "<sup>34</sup> နၥံၪၥ့ၪယၫဒၪနၥံၪဝ့ၫလၧယစူၪမၩန့ယဆၧ,ဒဲၦအီၪ",
			"35": "<sup>35</sup> လၧယၥိၭအဆၧလီၫ.- ဘဲၫနီၪအၥိၭလၧဖၧၩ့ၥၭကိၭ အဘီၩ့ဒ့ၭနီၪယဒုၭနဲၪလၧနၥံၪဂ့ၩမၩဆၧ, ဒဲမၩဘိၭ မၩဆၧၩ့ၦအဂဲးဆါအဘၭဆါ, ဒဲနၪ့ထၪ့ထဲၩ့ကဆါ ယ့ၫရှူၬအလူအထၫ, လၧအဝ့ၫဒၪအနၫ့ဆါဒၪဝ့ၫစံၭ, ဖ့ၪလၫ့ဆၧနီၪ မွဲအဘၪဆၧဆိၪဂ့ၩအၪနဲၪ့ဒိၭန့ဆၧ ဒံၭလီၫ.",
			"36": "<sup>36</sup> အဝ့ၫစံၭဆၧဘဲၫနီၪဂီၩ့, ချံၭလၩ့အခၪ့တၭ,ဘၩဆိၪ",
			"37": "<sup>37</sup> ဖၪဆၧလၧၦထီးအလူၬအၥိၭလီၫ.- အဝ့ၫၥံၪဂၪ့ထၪ့ ဝ့ၫအၪအၪလ့ၬတၭ, ဖိၭဂိၫ့စပီလူၫအခိၬတၭ,အဲၪဂါ ဝ့ၫဒၪလီၫ.",
			"38": "<sup>38</sup> လၧဆၧချဲၩ့လၧအစံၭဝ့ၫ, အမ့ၬနီၪအဝ့ၫၥံၪ လဒၪလၧၩ့ဘၪဝ့ၫအကၠီၩ့ မွဲအၥၭအုၭဒိၪဒၪအဆၧ ဒံၭလီၫ.အဝ့ၫၥံၪလ့ၩၥိၫ့အဝ့ၫဒၪ ထီၩ့လၧကဘၩ့နီၪ လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> ပစဲၪ့ဖၭလၧၦလဖၪနီၪဂီၩ့တၭ, ပထူၬထၪ့ကဘၩ့နီၪ, ပလ့ၩဆုးလီၩ့ထီၩ့လၧကိအီၭနီၪ, ကဲဂီၩလနံၩ ထီၩ့ လၧရိၭတၭ, ပစဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, ပထီၩ့လၧပါ တရၫလီၫ.",
			"2": "<sup>2</sup> ပဒၪန့ကဘၩ့လဖျိၪ့လၧအမိလ့ၩခၫ့ဂၬ ဆၧလၧဖနံ ၡၫတၭ, ပလ့ၩထၪ့လၧအဖၧၩ့, ပစဲၪ့ထၪ့ခွံၬ ထီးနီၪ",
			"3": "<sup>3</sup> လီၫ.- ထီးစဲပၧၭအီၪဖျီၪထၪ့တၭ, ပလ့ၩဖီၩ့ခွံၬဝ့ၫလၧ စူၪထွ့ၪလခီၫနီၪ, ပလ့ၩထီၩ့လၧစံရအၫနီၪတၭ, ပစိၭ ထၪ့လၧတဲအၫလီၫ. အဂဲးဘဲၫယီၩဆၧပဒၨၭ လၧက ဘၩ့ဖၧၩ့ပဘၪဆိၬလၩ့ခွံၬထီးနီၪလီၫ.",
			"4": "<sup>4</sup> ပအၪ့ဎၬဒၪန့အထံၩအဖျဲလဖၪနီၪတၭ, ပအီၪထီး နီၪနွ့ၫၥၫ့လီၫ. မွဲလၧၥၭမုအဖၧၩ့နီၪအဝ့ၫၥံၪစံၭစပီလူၫ,",
			"5": "<sup>5</sup> မွဲနထီးလ့ၩထၪ့လၧယရုစလံၫ့နီၪလဂ့ၩ.- ထီးအ နံၩအၥၫ့လဖၪနီၪဎွ့ၩထၪ့, ပစဲၪ့ထၪ့ခွံၬတၭ, အဝ့ၫၥံၪ ထီးအလူၬ, အဖိၪအမၫဒဲအဖိၪအလံၩၥံၪလ့ၩၥိၫ့ပၧၩ လၧဒိၩ့အချိၫ့နီၪ, ပချံၭလၩ့ပခၪ့လၧထံၫနဲၩ့တၭ,",
			"6": "<sup>6</sup> ပဘၩဆိၪဖၪဆၧလီၫ.- ပဖိၭဂိၫ့လိၬပၥၭဂီၩ့တၭ,ပဝ့ၫ ဒၪပလ့ၩထၪ့လၧကဘၩ့ဖၧၩ့နီၪ, အဝ့ၫၥံၪထဲၩ့ထဲၩ့ဝ့ၫ လၧအဂံၪ့လဖၪလီၫ.",
			"7": "<sup>7</sup> ပထူၬထၪ့ကဘၩ့ဂီၩ့တၭ, ပစဲၪ့လၩ့ခွံၬလၧတဲအၫ ဖိးလၧတီလမဲၫတၭ, ပဖိၭဂိၫ့လိၬပၥၭလၧပထၧၫ့ဖုဝဲ ၥံၪထီးနီၪတၭ, ပအီၪလၧအၥိၭမုလနံၩနီၪလီၫ.",
			"8": "<sup>8</sup> ကဲဂီၩလနံၩနီၪး ပစဲၪ့ထၪ့ခွံၬတၭ, လ့ၩထီၩ့လၧစ့ၭ စရံအၫလီၫ. ပလ့ၩနုၬလၧၦလီၩလၩ့လၬလၩ့ဆၧၥၭ ထိၬအပရၧၫ့စဖံလံၭ, လၧအအီၪလၧၦနွ့ၫဂၩနီၪအ ကျၩအဂံၪ့တၭ, ပအီၪလၧအၥိၭလီၫ.",
			"9": "<sup>9</sup> အဝ့ၫလဂၩနီၪအဖိၪမုၪနၩ့လၧ အချဲၩ့ဆၧလၧမီၪအ ချိၬအီၪလံဂၩလီၫ.-",
			"10": "<sup>10</sup> ပအီၪထီးနီၪအၪနံၩအၪၥၫ့တၭ, မီၪလဂၩအမံၩ့မွဲ စအၫဂဘၧၭဂဲၫလၩ့ဝ့ၫလၧခးယုဒၫ",
			"11": "<sup>11</sup> လီၫ.- အဝ့ၫနီၪဂဲၫလၧပအီၪတၭ. အၪ့မၩန့စပီလူၫအ ခၧၩ့ယးနီၪ, စၧၩ့ထၬအစူၪအခၪ့ဒၪဝ့ၫတၭ, စံၭဝ့ၫ,ၥၭ မုဆံၫ့ဎံၪစံၭဝ့ၫဘဲၫယီၩ, ၦယုဒၫဖိၪၥံၪအီၪလၧယရု စလံၫ့မိစၧၩ့ထၬခၧၩ့ယးယီၩ အကဆါဘဲၫယီၩအၥိၭ တၭ,မိဖ့ၪလၫ့ခွံၬဝ့ၫလၧ ၦဆၨၩလဖၪအစူၪဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> ဆၧနီၪလဖၪထီးပနါဂၧၫ့တၭ, ပဝ့ၫဒၪဒဲၦၡၩအီၪ ထီးနီၪအၪ့ကံၩ့အၪ့ယၫဝ့ၫ, ဘဲၫၥိၭအထီးလ့ၩထၪ့လၧ",
			"13": "<sup>13</sup> ယရုစလံၫ့လဂ့ၩလီၫ.- ထီးနီၪလဖၧၫ့စပီလူၫချဲၩ့ဆၧၫ့ ဝ့ၫ,မွဲဘၪနီၫလၧနၥံၪဂၪ့တၭ, မၩခါမၩလၩ့ယၥၭဘဲၫ နီၪလဲၪ.အဂဲးဘဲၫယီၩ ယအီၪတဲၩ့ဝဲၩယၥၭ ဘဲၫၥိၭ ယမိဘၪဆၧစၧၩ့ထၬလၧယရုစလံၫ့အဖၧၩ့ လကၭ လၧၩ့,မွဲဘဲၫၥိၭယမိဘၪၥံၫ လၧပကဆါယ့ၫၡုၬအမံၩ့ အကၠီၩ့နီၪဆ့လီၫ.",
			"14": "<sup>14</sup> ပဝ့ၫဒၪ ပပဂၨၪထၪ့အခဲၫ့လန့ဘၪနီၪ, ပအီၪထီခွံၬ တၭ, ပစံၭ, မွဲဆၧမၩအၥၭထီးဒၪကဆါအၥၭဆံၭ.",
			"15": "<sup>15</sup> အနံၩအၥၫ့လဖၪနီၪဖီၩ့ခွံၬတၭ, ပတဲၩ့ဝဲၩပဆၧဖိၪ",
			"16": "<sup>16</sup> ဆၧလံၩဂီၩ့နီၪ, ပလ့ၩထၪ့လၧယရုစလံၫ့လီၫ.- ၦစ့ၭ စရံအၫဖိၪအထံၩအဖျဲ လနၩ့နၩ့ လ့ၩလၧပၥိၭဆ့တၭ, ၥိၫ့ပၧၩထီၩ့လၧၦစဲပၧၭဖိၪ, မွဲအထံၩအဖျဲအၥၭၡါစန့ စၧၫ့လဂၩအအီၪနီၪ, ဘဲၫၥိၭပမိအီၪၦမွံၩလၧအၥိၭ လီၫ.",
			"17": "<sup>17</sup> ထီးပထီၩ့လၧယရုစလံၫ့နီၪ, ၦထၧၫ့ဖုဝဲၥံၪထိး",
			"18": "<sup>18</sup> ဆၧၫ့ပၧၩလၧအၥုၪ့ထိၬၥၭထိၬဝ့ၫလီၫ.- ကဲဂီၩလနံၩနီၪ စပီလူၫလ့ၩလၧပၥိၭ ထီၩ့လၧစယ့မံၭအအီၪနီၪ,",
			"19": "<sup>19</sup> ၦၥုၪ့က့ၭၥၭၡါၥံၪ ထီးအလူၬအီၪဝ့ၫလီၫ.- တၭဖိၭဂိၫ့ အဝ့ၫၥံၪဂီၩ့, စပီလူၫလီၩ့လၩ့လၬလၩ့ ဆၧလမံၩ့ဘၪ လမံၩ့, လမံၩ့ဘၪလမံၩ့,လၧယွၩမၩလၧအစူၪဖၧၩ့ လၧၦဆၨၩလဖၪအကျၩလီၫ.",
			"20": "<sup>20</sup> အဝ့ၫၥံၪနါဂၧၫ့ဆၧနီၪ, စံၭထၪ့အၪ့အူၭယွၩတၭ,စံၭ အဝ့ၫဒၪ,ထၧၫ့ဖုဝဲဧ့, ၦယုဒၫဖိၪလၧအနဲၩဆၧလဖၪ, မွဲၦဎွ့လၬဎွ့လၬလဲၪနီၪ,နၥ့ၪယၫလီၫ. အဝ့ၫၥံၪထီးအ",
			"21": "<sup>21</sup> လူၬဂဲၩလိၬဝ့ၫလၧဆၧမၪလူၬအဂးလီၫ.- အဝ့ၫၥံၪ နါဂၧၫ့ဝ့ၫလၧနဂဲးလၧနၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ၦယုဒၫဖိၪအီၪ လၧၦဆၨၩဂူၫဂၩၥံၪအကျၩ ဘဲၫၥိၭအမိခွံၬၡိၭခွံၬစမိ စ့ၭနီၪ,လၧနစံၭ, ထီးကူၭတရံၭနၥံၪအဖိၪလဂ့ၩ,",
			"22": "<sup>22</sup> လ့ၩဘဲၫအထူၫအရူၫအၥိၭနီၪလဂ့ၩလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ပမိမၩဘဲၫၥ့ၪလဲၪ. ၦခမျၧး လအီၪကိၩ့ အီၪကီၪ့ဘၪတၭ, အီၪၥ့ၪအ့ၬ.အဂဲးဘဲၫယီၩအဝ့ၫ",
			"23": "<sup>23</sup> ၥံၪမိနါဂၧၫ့လၧနဂဲၫထီၩ့နဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,မၩဘဲၫပစံၭနၧၩအၥိၭဆံၭ. ၦလၧအဆိၪလၩ့",
			"24": "<sup>24</sup> ယူၭအၥၭအီၪလၧပကျၩလံဂၩယူၭလီၫ.- အဝ့ၫၥံၪနီၪ မွဲနမၩန့လၧနနၫ့ဆါဒၪနဝ့ၫအၥိၭ, ဒဲမၩဆံၫ့ထၪ့နၥၭ လၧအၥိၭ, လိၭစ့ၩလၧအဂး ဘဲၫၥိၭအမိလိၩ့အခိၪ ဘီၪၦထီးအလူၬမိၥ့ၪယၫဆၧ လၧအနါဂၧၫ့ဝ့ၫလၧနဂဲး လဖၪနီၪလမွဲဘၪဆၧတၭ, မွဲနလ့ၩဆၧနနၫ့ဆါဒၪနဝ့ၫ",
			"25": "<sup>25</sup> ဂ့ၩဘၪစဲၪ, ဒဲနထီးန့ဆၧမၪလူၬဆ့လီၫ.- အ့ၪမွဲၦဆၨၩ ဂူၫဂၩလၧအနဲၩထဲၩ့ဆၧလဖၪနီၪ ပစ့ၩရၫ့ဒဲပကွ့ၭယူၭ ဆၧလၧအဝ့ၫၥံၪကြၨၭထီးန့ဖံၭထၬ ဆၧနီၪလဖၪနး မံၩ့လဂ့ၩ, မွဲန့ၫအဘၪဂၭဎ့ၭဆၧလုဆၧဂၩ့, ဒဲဆၧၥွံၪ, ဒဲဆၧလၧဆၧဘံၭၥံၫဝ့ၫ, ဒဲဆၧလ့ၩဖိၬ ၥၭလဲးၥၭဘျၪ အခဲၫ့လီၫ.",
			"26": "<sup>26</sup> ထီးနီၪလဖၧၫ့, စပီလူၫမၩန့ၦလဖၪနီၪတၭ,ကဲဂီၩ လနံၩမၩဆံၫ့ယူၭအၥၭလၧအဝ့ၫၥံၪအၥိၭနီၪ, လ့ၩ နုၬဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, လီၩဘၪဆၧမၩဆံၫ့ အနံၩအၥၫ့မိဎွ့ၩဝ့ၫ ထီးဆၧမိဂဲၫဆိၬဆၧမၩဘိၪ့လၧ လဂၩအဂးလဂၩအဂး ဆုၬဆုၬလီၫ.",
			"27": "<sup>27</sup> ထီးနွ့ၫၥၫ့နီၪမိဎွ့ၩထၪ့ယူၭတၭ, ၦယုဒၫဖိၪၥံၪဂဲၫ လၧအ့ၡၫဒၪဘၪဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, ပဂၨၪ ထၪ့ၦခမျၧး,အီၪက့ၪအစူၪလၧစပီလူၫအလီၩ့တၭ,",
			"28": "<sup>28</sup> ကိၭၡၭထၪ့ဝ့ၫ, ၦအံၫစရ့လၭဖိၪၥံၪဧ့,ဂဲၫမၩဆၧၩ့ဘီၪ. ၦလၧအၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ၦထီးအလူၬလစီၪ့လါလါ လၧအဒုၭထၫ့ဒုၪဒၩ ၦလဆၨၩယီၩ, ဒဲဆၧၥီၪ့ဆၧၥၫ့, ဒဲဆၧအလးယီၩလဂၩနီၪ,မွဲၦယီၩလီၫ. လၧနီၪအမ့ၬ ယၫ,မွဲအဂဲၫၥိၫ့ၦဂြံစၭဖိၪ လၧဆၧလုအဂံၪ့ဖၧၩ့ယီၩ မၩစံၪစၪဆၧအလးဆံၫ့ဎံၪလီၫ.",
			"29": "<sup>29</sup> အဂဲးဘဲၫယီၩအဝ့ၫၥံၪဒၪဘၪယူၭ ၦအ့ဖစၧၭဖိၪစ တြီဖမၧၭအီၪလၧအၥိၭလၧဒိၩ့ဖၧၩ့တၭ, ဆီၫ့မီၪ့ဝ့ၫလၧ စပီလူၫဂဲၫကိၭန့လၧ ဆၧလုအဂံၪ့ဖၧၩ့လီၫ.",
			"30": "<sup>30</sup> ၦဒိၩ့ဖိၪၥံၪ တုၩ့ထၪ့တုၩ့လၩ့ ထၧၫ့ဒိၩ့ယၫတၭ, ၦ ခမျၧးစဲၪ့တလဲးအီၪကီၪ့တၭ, ဖီၪ့ထၬစပီလူၫနီၪ, ကၠူၭ ထၪ့ခွံၬဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့လၧခီၫ့တၭ, ကၭဘံၭ တရၫ့ချဲၫ့မၬလီၫ.",
			"31": "<sup>31</sup> အဝ့ၫၥံၪအၪ့ဎၬမၩၥံၫဝ့ၫအဘိၩ့ဘၭတၭ, ၦၥုၭ ဖိၪလထီၫ့အခိၪလဂၩ, နါဂၧၫ့ဆၧပရၧၫ့လၧယရုစလံၫ့",
			"32": "<sup>32</sup> တုၩ့ထၪ့တုၩ့လၩ့ထၧၫ့ဒိၩ့ယၫလီၫ.- မွဲအကိၭန့ၦ ၥုၭဖိၪလဖၪဒဲ ၦၥုၭဖိၪလယၩအခိၪၥံၪချဲၫ့မၬတၭ, စဲၪ့တလဲးဝ့ၫလၧအအီၪလီၫ. ထီးအဝ့ၫၥံၪဒၪဘၪၦၥုၭ ဖိၪလထီၫ့အခိၪ, ဒဲၦၥုၭဖိၪလဖၪနီၪ ထးလၧၩ့စပီလူၫ နီၪအ့ၬ.",
			"33": "<sup>33</sup> ထီးနီၪလဖၧၫ့ ၦၥုၭခိၪလထီၫ့အခိၪဂဲၫဘူၭတၭ, ဖီၪ့ ထၬအဝ့ၫဒၪ, မၪလူၬဆၧဘဲၫၥိၭ ၦမိစၧၩ့ထၬဝ့ၫလၧ ၥွ့ၫထၭနံၫဘီၩ့လီၫ. မွဲပလၫလဂၩလဲၪနီၪ,မွဲအမၩဆၧ",
			"34": "<sup>34</sup> နီၫလဲၪနီၫလဲၪနီၪ,အၪ့စၪ့ဝ့ၫဒၪလီၫ.- ၦအီၪလၧၦခမျၧး အကျၩလနၩ့နၩ့ကိၭထၪ့ဆၧလမံၩ့တၭ, လနၩ့နၩ့လ မံၩ့ဒၪလီၫ. တၭၥီၫထၪ့နၭနၭလ့ၬနီၪ, ၥ့ၪယၫဝ့ၫဆၧ လၩ့ထံးလၩ့ဆ့ၭလၥ့ၪဘၪတၭ, မၪလူၬဝ့ၫဘဲၫၥိၭၦမိ မီၩ့ထၪ့အဝ့ၫဒၪ လၧၦၥုၭဖိၪအဂံၪ့ဖၧၩ့နီၪလီၫ.",
			"35": "<sup>35</sup> ၦခမျၧးၥံၪအၥၭဆီၪ့နၭနၭလ့ၬနီၪ, ထီးအလ့ၩထၪ့ ဝ့ၫထီၩ့လၧဎၫ့အလီၩ့နီၪ, ၦၥုၭဖိၪဆိၬထၪ့ဝ့ၫဒၪ",
			"36": "<sup>36</sup> လီၫ.- အဂဲးဘဲၫယီၩၦခမျၧးဖိၬထၪ့အခဲၫ့တၭ, ကိၭၡၭ ထၪ့ဆၧ,စံၭဝ့ၫ, ဆိၬထၪ့ခွံၬအဝ့ၫဒၪဘီၪ.",
			"37": "<sup>37</sup> စပီလူၫဘၪဆၧမီၩ့ထၪ့ဝ့ၫလၧ ၦၥုၭဖိၪအဂံၪ့ဖၧၩ့အ ဘိၩ့ဘၭနီၪ, စံၭၦၥုၭဖိၪလထီၫ့အခိၪ, ယချဲၩ့ဆၧလၧ နၧၩမွဲအဂ့ၩဆ့ဧၪ. အဝ့ၫဒၪစံၭ, မွဲနချဲၩ့ၦဂြံစၭဖိၪအ",
			"38": "<sup>38</sup> ဆၧချဲၩ့ၥ့ၪဆ့ဧၪ.- နမွဲၦအံဇံၭဖိၪလဂၩလၧ အမၩတုၩ့ ထၪ့တုၩ့လၩ့ဆၧလၧအခီၫ ဒဲနၥိၫ့ထၪ့ၦထမျၬလံထီၫ့ လၧၡါမုနၧၫ့ဖၫမွဲအ့ၬဧၪ.",
			"39": "<sup>39</sup> စပီလူၫစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩ,ယမွဲၦယုဒၫဖိၪဘၪ ဆဲၫ့လၧတၫစၧၭလမွဲဘၪ ဒိၩ့ဆံၭခိၬလၧခးစလံၡၫနီၪ အၡၩဒိၩ့ဖိၪလဂၩတၭ, ယအၪ့ယၫနၧၩ လၧနဒုၭ ချဲၩ့ဒုၪ့ယၧၩလၧ ၦခမျၧးနးထံၪဘီၪ.",
			"40": "<sup>40</sup> ထီးအဝ့ၫနီၪဖ့ၪလၫ့အချဲၩ့တၭ, စပီလူၫဆၧၫ့ထုၪ့ လၧဎၫ့အလီၩ့နီၪ, ဝံၩဝါအစူၪလၧၦခမျၧးအအီၪ တၭ,အဝ့ၫၥံၪအီၪလၩ့မါပံၭနီၪ, အဝ့ၫဒၪချဲၩ့ဆၧလၧ အဝ့ၫၥံၪလၧ ၦဟံဘြူၫအလၨလခီၫတၭ, စံၭဝ့ၫ,"
		},
		"22": {
			"1": "<sup>1</sup> ဖုၥံၪဝဲၥံၪ, ဒဲဖါၥံၪဧ့,ယဆၧချဲၩ့ဖီၩ့ဖျ့ၭယီၩ,ခိၭနၪ",
			"2": "<sup>2</sup> ဆံၭ.- ထီးအဝ့ၫၥံၪနါဂၧၫ့လၧအချဲၩ့ဆၧလၧၦဟံဘြူၫ အလၨနီၪအီၪဝ့ၫလၩ့မါပံၭအၪနဲၪ့အနီၪဒံၭတၭ, အဝ့ၫ",
			"3": "<sup>3</sup> ဒၪစံၭဝ့ၫ,- ယဝ့ၫဒၪယီၩ,ယမွဲၦယုဒၫဖိၪအီၪဖျဲၪလၧ တၫစၧၭလၧစလံၡၫအဖၧၩ့, အ့ၪမွဲယမၩလိၪလံၬလၧ ဒိၩ့ဖၧၩ့ယီၩ, လၧစဂမၫလအ့လၭအခၪ့ထံၭတၭ, ယ ဘၪဆၧၥီၪ့ဆၧၥၫ့လၧဖါၥံၪ အထူၫအရူၫလၩ့ထံးလၩ့ ဆ့ၭတၭ,ယဂဲၩလိၬလၧယွၩအဖၧၩ့, ဘဲၫနၥံၪထီး",
			"4": "<sup>4</sup> အလူၬမၩဝ့ၫလနံၩယီၩအၥိၭနီၪလီၫ.- ယစၧၩ့ထၬၦ မုၪၥံၪ,ဒဲၦခွၫၥံၪ, ယဒုၭနုၬအဝ့ၫၥံၪ လၧထီၫ့ဖၧၩ့တၭ,",
			"5": "<sup>5</sup> ယမၩအၧၩ့ဖၧၩ့ၥၭယီၩထီးဆၧၥံၫလီၫ.- ဘဲၫၦလုဆၧ အခိၪ,ဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪ ထီးအလူၬထိးအၥၭလၧယ ဂးအၥိၭလီၫ. ယထိးန့လံၬလၧအဝ့ၫၥံၪအစူၪဖၧၩ့ဘဲၫ ၥိၭယမိဖ့ၪလၫ့ လၧၦထၧၫ့ဖုဝဲၥံၪအအီၪတၭ, ယလ့ၩ စိၩဒမၭစကၧၭဘဲၫၥိၭၦလၧအအီၪ ထီးနီၪလဖၪ, ယမိဂဲၫထဲၩ့ၥိၫ့ဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ လၧအဘၪဆၧ စၧၩ့ထၬနီၪ, ဘဲၫၥိၭအမိဘၪဆၧနၭဆၧၡၪ့အဂဲးလီၫ.",
			"6": "<sup>6</sup> ဆၧမၩအၥၭလၧအလ့ၩဆၧအဘိၩ့ဘၭနီၪ, ဘူၭထၪ့ လၧဒမၭစကၧၭတၭ, လၧမုထုၪ့ကၪယူၭနီၪ, ဆၧဖၩ့ဖၭ",
			"7": "<sup>7</sup> ဒိၪလၧမူၭခိၪဖၩ့ထၪ့ရှူၭဝၬဖီၩ့ယၧၩလီၫ.- တၭယလၩ့ ထံၩဖါလၧဂၪ့ခိၪနီၪ, ယနါဂၧၫ့ဆၧအလူၥီၫ,စံၭယၧၩ, စစီလူၫဧ့, စစီလူၫဧ့, မွဲဘၪနီၫလၧနမၩအၧၩ့ မၩၥၫ့",
			"8": "<sup>8</sup> ယၧၩလဲၪ.- တၭယချဲၩ့ဆၧၫ့ဆၧ, ကဆါဧ့, နမွဲပလၫ",
			"9": "<sup>9</sup> လဂၩလဲၪ.- တၭအဝ့ၫဒၪစံၭယၧၩ, ယမွဲၦလၧနမၩ အၧၩ့မၩၥၫ့ဝ့ၫၦနၭဇရ့ၭဖိၪယ့ၫၡုၬလဂၩ နီၪလီၫ. ၦ အီၪလၧယၥိၭလဖၪ ဒၪဆၧဖၩ့နီၪၥၭမဲၪဆၧလီၫ. အ့ၪမွဲၦချဲၩ့ဆၧလၧယၧၩအလူနီၪ နါဂၧၫ့ဘၪဝ့ၫအ့ၬ.",
			"10": "<sup>10</sup> ယစံၭ,ကဆါဧ့, မွဲယမိဘၪမၩဆၧနီၪလဲၪ,ကဆါ နီၪစံၭယၧၩ, ဂဲထုၪ့တၭလ့ၩလၧဒမၭစကၧၭနီၪ, ဆၧမၩ လၧဆၧအီၪက့ၪဝဲၩလၧနကြၨၭမၩနီၪ ဆၧမိလီၩဘၪ",
			"11": "<sup>11</sup> နၧၩအဂဲးအကၠီၪ့ထီးအလူၬထီးနီၪလီၫ.- ထီးယဒၪဆၧ လၥ့ၪဘၪလၧဆၧဖၩ့ ယုၩ့ယဲအကၠီၩ့နီၪ, ၦအီၪလၧယ ၥိၭလဖၪလ့ၩမီၩ့ယၧၩ လၧအစူၪထီၩ့လၧဒမၭစကၧၭ အဖၧၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> စအၫနနဲအၭလဂၩလၧအဘိၪ့ထၪ့ဘၩထၪ့ဆၧ ဘဲၫဆၧမၪလူၬအၥိၭနီၪ ဘၪဆၧလၩဆၧဖၩ့လၧၦယုဒၫ",
			"13": "<sup>13</sup> ဖိၪၥံၪကိၭဂၩဒ့ၭအီၪထီးနီၪတၭ,- အဝ့ၫဒၪဂဲၫလၧ ယအီၪဆၧၫ့ထုၪ့တၭ, လီၩဘၪယၧၩ,ထၧၫ့ဖုဝဲစပီလူၫ ဧ့,ဒၪထၪ့ထဲၩ့ဆၧဆံၭ. ယယိထၪ့အဝ့ၫဒၪလၧနၩရံၩ",
			"14": "<sup>14</sup> နီၪလီၫ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ,ပဖါၥံၪအယွၩရွံန့နၧၩ ဘဲၫၥိၭနမိၥ့ၪယၫအၥၭ ဒဲမိဒၪဘၪၦတီၩၦလီၩ့လဂၩ",
			"15": "<sup>15</sup> နီၪ,ဒဲမိနါဂၧၫ့ဘၪအလူလၧအနိၭလီၫ.- အဂဲးဘဲၫ ယီၩနမိကဲၪထၪ့ အၡၩထိးအၥၭလၧဆၧလၧနဒၪ ဘၪဒဲနနါဂၧၫ့ဘၪနီၪ လၧၦထီးအလူၬအမ့ၬယၫလီၫ.",
			"16": "<sup>16</sup> တၭဘိၩ့နဲၪ့ယီၩ, နအီၪခိၭဆၧမွဲဘၪလဲၪ. ဂဲထုၪ့ကိၭ ထၪ့ကဆါအမံၩ့တၭ, ဒိၭဘၭတံၫဇၫ့နၥၭဒဲၥူၫဝၭ ခွံၬနဆၧဒဲၩဘၭဆံၭ.",
			"17": "<sup>17</sup> ဆၧမၩအၥၭလၧယဂဲၫထဲၩ့ထီၩ့ လၧယရုစလံၫ့ တၭ,ယဘၩဆိၪဖၪဆၧလၧ ဆၧလုအဂံၪ့ဖၧၩ့အဘိၩ့ဘၭ",
			"18": "<sup>18</sup> နီၪ, ယဒၪဆၧလၧယၫလခီၫ,- ယဒၪဆၧလၧအစံၭ ယၧၩ,စဲၪ့ထၪ့ခွံၬလၧ ယရုစလံၫ့အဖၧၩ့ ချဲၫ့ချဲၫ့ဆံၭ. အဂဲးဘဲၫယီၩနထိးနၥၭလၧယဂဲးနီၪ, ၦၡၩလဖၪဒိၭန့",
			"19": "<sup>19</sup> ဝ့ၫအ့ၬ.- ယစံၭ,ကဆါဧ့, အဝ့ၫၥံၪၥ့ၪယၫလၧယဒုၭနုၬ ၦလၧထီၫ့ဖၧၩ့, ဒဲထးၦလၧအနဲၩထဲၩ့နၧၩလဖၪလၧ",
			"20": "<sup>20</sup> ကယဲၥရိၬကိၭဖျိၪ့ဒ့ၭအဖၧၩ့လီၫ.- လၧၦထိးအၥၭလၧ နဂးစတံဝံၫ့အၥွံၪဘၪဆၧလူၫလၩ့ဝ့ၫနီၪ, ယဆၧၫ့ထုၪ့ လၧအနဲၩ့ထံၭတၭ, ဆၧမၩၥံၫဝ့ၫအဘိၩ့ဘၭနီၪ, ယ အုၩ့လၩ့ယဝ့ၫ, ယခိၭၦမၩၥံၫဆၧအကီၩ့အၥိၭဆ့",
			"21": "<sup>21</sup> လီၫ.- အဝ့ၫဒၪစံၭယၧၩလ့ၩကဒၪဘီၪ.ယမိအၪ့မၧၫ့",
			"22": "<sup>22</sup> နလ့ၩလၧအယဲၩ့ လၧၦဆၨၩလဖၪအအီၪလီၫ.- အဝ့ၫ ၥံၪခိၭနၪဆၧချဲၩ့လဖၪနီၪဂီၩ့တၭ, ထုၭထၪ့အလူစံၭဝ့ၫ, ၦဘဲၫယီၩအၥိၭလဂၩ ဆိၬထၪ့ခွံၬလၧဂၪ့ခိၪချိၫ့ယီၩ",
			"23": "<sup>23</sup> ဘီၪ.အဂဲးဘဲၫယီၩမွဲအကြၨၭမၧၫ့လၧၩ့အ့ၬ.- အဝ့ၫ ၥံၪကိၭၡၭထၪ့ဆၧ, ဘဲၪ့လၩ့ခွံၬအကီၩ့အၥိၭ, ခွံၬထၪ့ ဝ့ၫဒဲဎွံၪထၪ့ဂၪ့ခိၪအမုၬ လၧမူၭဖိၭဖၫ့အဘိၩ့ဘၭနီၪ,",
			"24": "<sup>24</sup> ၦၥုၭဖိၪလထီၫ့အခိၪလဂၩ မၪလူၬဝ့ၫဘဲၫၥိၭ ၦမိမီၩ့စပီ လူၫလၧၦၥုၭဖိၪ အဂံၪ့ဖၧၩ့တၭ, အၪ့စိၭအၪ့စၪ့ဝ့ၫလၧ ဆၧထးဝ့ၫနီၪဘဲၫၥိၭ အမိၥ့ၪယၫလၩ့ထံးလၩ့ဆ့ၭလၧ ၦကိၭထၪ့ဆၧထၫ့ဒုၪဒၩဝ့ၫ ဘဲၫနီၪအဂဲးအကၠီၪ့လီၫ.",
			"25": "<sup>25</sup> တၭလၧၦစၧၩ့ထၬအဝ့ၫ လၧဖျံၩဆၧဖံၭအဘိၩ့ဘၭ နီၪ,စပီလူၫစံၭၦၥုၭဖိၪလယၩအခိၪ လၧအဆၧၫ့ထုၪ့ လၧအနဲၩ့ထံၭနီၪ, ၦရိမၫဖိၪလၧအလဘၪဒိၭဘၪဆၧ",
			"26": "<sup>26</sup> စ့ၩရၫ့နီၪ, နၥံၪထးဝ့ၫနီၪဘၪမိတီၩဆ့ဧၪ.- ထီးၦၥုၭ ဖိၪလယၩအခိၪနါဂၧၫ့ဆၧနီၪတၭ, လ့ၩလီၩဘၪၦၥုၭ ဖိၪလထီၫ့အခိၪ, စံၭဝ့ၫ, နမိမၩဆၧနီၪလမံၩ့လဲၪးအဂဲး ဘဲၫယီၩၦလဂၩယီၩမွဲၦရိမၫဖိၪလီၫ.",
			"27": "<sup>27</sup> ၦၥုၭဖိၪလထီၫ့အခိၪဂဲၫစိၩအၪ့စၪ့ဝ့ၫ, နမွဲၦရိမၫဖိၪ ဆ့ဧၪ, လီၩဘၪယၧၩဘီၪ, တၭအဝ့ၫဒၪစံၭ, မွဲယူၭ,",
			"28": "<sup>28</sup> ၦၥုၭဖိၪလထီၫ့အခိၪနီၪ ချဲၩ့ဆၧၫ့ဝ့ၫတၭ,ယဝ့ၫဒၪယဖ့ၪ လၫ့စ့ၩအၪအကၠီၩ့တၭ, ယထၪ့ဘၭလၧခးဖိၪနီၪအ လးလီၫ.တၭစပီလူၫစံၭဝ့ၫ, အ့ၪမွဲယဝ့ၫဒၪယီၩယအီၪ ဖျဲၪတၭ, ယမွဲၦခးဖိၪနီၪလီၫ.",
			"29": "<sup>29</sup> ၦလၧအမိအၪ့စၪ့ဝ့ၫလဖၪ, စဲၪ့ထၪ့ခွံၬလၧအအီၪချဲၫ့ မၬတၭ, ထီးအၥ့ၪယၫဝ့ၫလၩ့ထံးလၩ့ဆ့ၭ လၧအမွဲၦရိ မၫဖိၪတၭ, ၦၥုၭဖိၪလထီၫ့အခိၪနီၪ ၥၭမဲၪဆၧလၧအ စၧၩ့ထၬဝ့ၫအကၠီၩ့လီၫ.",
			"30": "<sup>30</sup> ကဲဂီၩလနံၩနီၪ, မွဲၦယုဒၫဖိၪၥံၪအီၪက့ၪဆၧမၪလၧ အလီၩ့ဘဲၫအံၩဘဲၫအိၩနီၪ ၦၥုၭဖိၪလထီၫ့ အခိၪမိၥ့ၪ ယၫဘၪအၥၭ လၩ့ထံးလၩ့ဆ့ၭတၭ,ကွဲၪလၩ့ခွံၬ အဖျံၩနီၪ,မၪလူၬၦလုဆၧအဒိၪၥံၪ, ဒဲၦၥၭၡါအဆၧ အီၪကီၪ့ဖိၪၥံၪထီးအလူၬ ဘဲၫၥိၭအမိဂဲၫအီၪကီၪ့တၭ, အဝ့ၫနီၪမီၩ့ထၪ့အီၪက့ၪလၩ့ စပီလူၫလၧအဝ့ၫၥံၪအ မ့ၬယၫလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> စပီလူၫ, ယိၦၥၭၡါၥံၪ အဆၧအီၪကီၪ့နီၪ ထံၫထံၫ ဆၭဆၭတၭ, စံၭဝ့ၫ, ၦၡၩၥံၪ, ဖုၥံၪဝဲၥံၪဧ့, ယအီၪ လၧကၪ့ၡၧၫ့လၧအဂ့ၩ လၧယွၩအမ့ၬယၫထီးမုလနံၩ ယီၩလီၫ.",
			"2": "<sup>2</sup> ၦလုဆၧအခိၪ စအၫ့နနဲအၭမၪလူၬ ၦဆၧၫ့ထုၪ့လၧ အနဲၩ့ထံၭၥံၪ ဘဲၫၥိၭအမိဒဲၩဘၪ စပီလူၫအနိၭလီၫ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့, စပီလူၫလီၩဘၪအဝ့ၫ, ဆၧဒီၪ့ဂုၪဘွၩ အၥၭဧ့, ယွၩမိဒိၪနၧၩလီၫ. နဆၧၫ့နၩ့စ့ၩရၫ့ယၧၩဘဲၫ ဆၧမၪလူၬအီၪဝ့ၫအၥိၭတၭ, မွဲနမၪလူၬဆၧဒိၪယၧၩ",
			"4": "<sup>4</sup> ထၫ့ဒုၪဒၩဆၧမၪလူၬနီၪဆ့ဧၪ.- တၭၦဆၧၫ့ထုၪ့လၧ အနဲၩ့ထံၭၥံၪစံၭဝ့ၫ, မွဲနဒုၪဒွ့ၪယွၩအၡၩလုဆၧအခိၪ ဧၪ.",
			"5": "<sup>5</sup> စပီလူၫစံၭဝ့ၫ,ဖုၥံၪဝဲၥံၪဧ့း အဝ့ၫနီၪမွဲၦလုဆၧအခိၪ ယလၥ့ၪယၫဘၪနီၪ အဂဲးဘဲၫယီၩ ဆၧကွ့ၭအၥၭ, န ၥံၪ အ ၦ ဒိၪ ၦ ၡါ နီၪ, မွဲ န ထီး စံၭ အၧၩ့ အ ဝ့ၫ ဒၪ လ ဂ့ၩ.",
			"6": "<sup>6</sup> စပီလူၫၥ့ၪယၫလၧၦလနၩ့နၩ့မွဲၦစၭဒုၫစံၫ,လနၩ့နၩ့ မွဲၦဖၫရစံၫတၭ, ကိၭၡၭထၪ့ဆၧလၧၦၥၭၡါအီၪကီၪ့အ ကျၩ,ၦၡၩၥံၪ, ဖုၥံၪဝဲၥံၪဧ့,ယဝ့ၫဒၪယီၩယမွဲၦဖၫရစံၫ ဒဲၦဖၫရစံၫအဖိၪခွၫလီၫ. လၧဆၧယိလါၦၥံၫမိဂဲထုၪ့ ထဲၩ့အကၠီၩ့နီၪယဘၪဆၧစ့ၩရၫ့ဘိၩ့နဲၪ့ယီၩလီၫ.",
			"7": "<sup>7</sup> ထီးအစံၭဆၧနီၪၦဖၫရစံၫၥံၪ ဒဲၦစၭဒုၫစံၫၥံၪဂဲးလိၬ တ့ၭလိၬ အၥၭတၭ, ၦခမျၧးလၩ့ဖၭလိၬအၥၭလီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩၦစၭဒုၫစံၫလဖၪစံၭလၧၦၥံၫဂဲထုၪ့ထဲၩ့ နီၪ,ၦမူၭခိၪဖိၪမွဲဂ့ၩ, ၥၭမွဲဂ့ၩ, အီၪအ့ၬ. အ့ၪမွဲၦဖၫ ရစံၫလဖၪနီၪစံၭဝ့ၫ, လၧအအီၪနံၫမံၩ့လူၬလီၫ.",
			"9": "<sup>9</sup> ၦကိၭၡၭထၪ့ဆၧဖၭဒိၪတၭ, ၦကွ့ၭလံၬလၧၦဖၫရ စံၫအကျၩလဖၪဂဲထုၪ့တၭ, တ့ၭလိၬအၥၭ, စံၭဝ့ၫ, ၦလဂၩယီၩ, ပလဒၪဘၪဆၧအမၪလၧအလီၩ့နးမံၩ့ တၭ,အ့ၪမွဲၥၭနီၪမွဲဂ့ၩ, ၦမူၭခိၪဖိၪမွဲဂ့ၩ,အ့ၪလီၩဘၪ",
			"10": "<sup>10</sup> အဝ့ၫဒၪအဆၧလမံၩ့မံၩ့တၭၬ- ဆၧဂဲးလိၬတ့ၭလိၬနၭ နၭလ့ၬအီၪထၪ့ဝ့ၫတၭ, ၦၥုၭဖိၪလထီၫ့အခိၪနီၪ အၪ့ ယိၪဝ့ၫလၧအဝ့ၫၥံၪမိထုၭထ့ၬဘၪစပီလူၫတၭ, မၪလူၬ ၦၥုၭဖိၪလဖၪ, ဘဲၫၥိၭအမိလ့ၩမၩန့ဆီၪ့ဝ့ၫလၧအဝ့ၫ ၥံၪအကျၩနီၪ, ဂဲၫမီၩ့ထၪ့ဝ့ၫ လၧၦၥုၭဖိၪ အဂံၪ့ဖၧၩ့",
			"11": "<sup>11</sup> လီၫ.- လၧခဲၫ့လနၩနီၪ ကဆါဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭ တၭ,စံၭဝ့ၫ, အီၪက့ၪဒူၩ နၥၭဆံၭ. အဂဲးဘဲၫယီၩ ဘဲၫနထိးနၥၭ လၧယဂဲးလၧယရုစလံၫ့အဖၧၩ့လၩ့ထံး လၩ့ဆ့ၭအၥိၭနီၪ မွဲနမိဘၪထိးနၥၭလၧရိမၫအဖၧၩ့ ဘဲၫနီၪအၥိၭဆ့လီၫ.",
			"12": "<sup>12</sup> မုဆဲၪ့ထၪ့နီၪ, ၦယုဒၫဖိၪၥံၪလနၩ့နၩ့ အုၩ့လၩ့လိၬ အၥၭတၭ,ဆိၪလၩ့အၥၭ, စံၭဝ့ၫ, ပလချႃၭမၩၥံၫဒံၭ",
			"13": "<sup>13</sup> ဘၪစပီလူၫလဂၩနီၪ, ပအၪ့ဆၧအီၩဆၧအ့ၬ.- ၦအုၩ့",
			"14": "<sup>14</sup> လၩ့လိၬအၥၭလဖၪနီၪ,အီၪဝ့ၫလံဆံၫဘျဲၪလီၫ.- အဝ့ၫ ၥံၪလ့ၩဝ့ၫ လၧၦလုဆၧအဒိၪၥံၪး ဒဲၦၥုၪ့က့ၭၥၭၡါ ၥံၪအအီၪတၭ, စံၭဝ့ၫ, ပဆိၪလၩ့ပၥၭ လၧဆၧဆိၪ အၧၩ့ဖၭဒိၪ လၧပလချႃၭမၩၥံၫဒံၭဘၪ စပီလူၫနီၪ ပမိ",
			"15": "<sup>15</sup> အၪ့ဘၪဆၧနးမံၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၩ့ ဂၬလၧနၥံၪမိၥ့ၪယၫ အဂဲးအကၠီၪ့လၩ့ထံးလၩ့ဆ့ၭဒံၭ တၭ,ဘိၩ့နဲၪ့ယီၩ မွဲနၥံၪဝ့ၫဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪအၪ့ယၫ ၦၥုၭဖိၪလထီၫ့အခိၪ ဘဲၫၥိၭအမိၥိၫ့လၩ့ဝ့ၫ လၧနၥံၪ အအီၪဘီၪ. တၭလၧအဂဲၫဝ့ၫဘိၩ့အလချႃၭလၩ့ဘူၭ ဒံၭဘၪနီၪ, ပအီၪတဲၩ့ဝဲၩပၥၭ ဘဲၫၥိၭပမိမၩၥံၫဝ့ၫ လီၫ.",
			"16": "<sup>16</sup> စပီလူၫအထၧၫ့ဖုဝဲမုၪအဖိၪခွၫ နါဂၧၫ့လၧအဝ့ၫၥံၪ အီၪခိၭၥူၪဆၧနီၪ, လ့ၩနုၬဝ့ၫလၧၦၥုၭဖိၪအဂံၪ့တၭ,",
			"17": "<sup>17</sup> လီၩဘၪစပီလူၫလီၫ.- ထီးနီၪလဖၧၫ့, စပီလူၫကိၭန့ ၦၥုၭဖိၪလယၩအခိၪလဂၩတၭ, စံၭဝ့ၫ,ၥိၫ့ၦဖိၪၥၪ ခွၫလဂၩယီၩ လၧၦၥုၭဖိၪလထီၫ့အခိၪအအီၪနီၪဘီၪ, အဂဲးဘဲၫယီၩ မွဲအလီၩဘၪဆၧလမံၩ့မံၩ့အလးအီၪဝ့ၫ",
			"18": "<sup>18</sup> ဒၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫဒၪမၩန့ဝ့ၫတၭ, ၥိၫ့ဝ့ၫထီၩ့လၧၦၥုၭဖိၪလထီၫ့အခိၪအအီၪတၭ, စံၭဝ့ၫ, ၦဘၪဆၧစၧၩ့ထၬဝ့ၫ, စပီလူၫလဂၩနီၪကိၭန့ယၧၩ တၭ,အၪ့ယၫယၧၩ ဘဲၫၥိၭယမိၥိၫ့ ၦဖိၪၥၪခွၫလဂၩ ယီၩလၧနအီၪတၭ, မွဲအလီၩဘၪနဆၧလမံၩ့မံၩ့နီၪအ လးအီၪဝ့ၫဒၪလီၫ.",
			"19": "<sup>19</sup> ၦၥုၭဖိၪလထီၫ့အခိၪနီၪ ဖီၪ့အစူၪၥိၫ့ဝ့ၫ လၧအလး အီၪၥူၪဝ့ၫနီၪတၭ, အၪ့စၪ့ဝ့ၫ, ဆၧလၧနမိလီၩဘၪယၧၩ",
			"20": "<sup>20</sup> နီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ.- တၭအဝ့ၫဒၪစံၭ, ၦယုဒၫဖိၪ လဖၪအုၩ့လၩ့ဝ့ၫ လၧအမိအၪ့ကံၩ့နၧၩဘဲၫၥိၭကဲ ဂီၩလနံၩနီၪ နမိၥိၫ့စပီလူၫ လၧၦၥၭၡါအီၪကီၪ့အလး လၩ့ဂၬလၧအမိအၪ့စိၭအၪ့စၪ့ဝ့ၫ လၩ့ထံးလၩ့ဆ့ၭ",
			"21": "<sup>21</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ထီးဒုၭမၩထီးဒၪအဝ့ၫၥံၪ အၥၭလဂ့ၩးအဂဲးဘဲၫယီၩ ၦဆိၪလၩ့အၥၭလၧအ လချႃၭမၩၥံၫဒံၭဘၪအဝ့ၫဒၪတၭ, လအၪ့ဘၪဆၧလ အီၩဘၪဆၧနီၪ,ၦလံဆံၫဘျဲၪအီၪဝ့ၫလီၫ. ဘိၩ့နဲၪ့ယီၩ ဒၪလ့ၬအဝ့ၫၥံၪအီၪတဲၩ့ဝဲၩယူၭအၥၭ, ခိၭယိလါနလူ",
			"22": "<sup>22</sup> လၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ၦၥုၭဖိၪလထီၫ့အခိၪ မၪလူၬဝ့ၫ, ဆၧလၧနလီၩဘၪယၧၩယီၩ ထီးလီၩဘၪ ၦၡၩၥံၪနးဂၩလဂ့ၩတၭ, ဖျါခွံၬၦဖိၪၥၪခွၫ လဂၩနီၪ လီၫ.",
			"23": "<sup>23</sup> တၭကိၭန့ၦၥုၭဖိၪ လယၩအခိၪနံၫဂၩတၭ, စံၭဝ့ၫ, ကဲမုနၩခိၬၥၧၫ့နၩရံၩနီၪ ဘဲၫၥိၭအမိလ့ၩလၧစ့ၭစရံအၫ တၭ,တဲၩ့ဝဲၩၦၥုၭဖိၪနံၫယၩ, ဒဲကၥ့ၪၥုၭဖိၪနွ့ၫဆံၫ,",
			"24": "<sup>24</sup> ဒဲဖၩ့ၥုၭဖိၪနံၫယၩ,- တၭမၩန့ဆၧဖိၪဆၧဎါတၭ, ဒုၭ ထူၬစပီလူၫဂီၩ့, ၥိၫ့အဝ့ၫဂ့ၩဘၪစဲၪ ထီၩ့လၧၦဒိၪ စဖံ လံၭအအီၪနီၪလီၫ. အဝ့ၫဒၪကွ့ၭဖ့ၪယူလံၬဘဲၫယီၩ,",
			"25": "<sup>25</sup> ယၧၩ, စကျီၪ ဒအၧၭလံစအၭချဲၩ့ဒုၪ့နၧၩတၭ, ဆၧဒိၪကဆါၦဒိၪဖၭ",
			"27": "<sup>27</sup> ဒိၪ,စဖံလံၭဧ့, မွဲနအီၪရှူၪအီၪမုၬဘီၪ.- ၦလဂၩယီၩ ၦယုဒၫဖိၪၥံၪဖီၪ့ထၬဝ့ၫ, လၩ့ဘူၭလၧအမိမၩၥံၫဝ့ၫ တၭ,ယနါဂၧၫ့လၧအမွဲ ၦရိမၫဖိၪနီၪ, ယကိၭန့ၦၥုၭဖိၪ",
			"28": "<sup>28</sup> လဖၪတၭ, ယလ့ၩထုၭထၪ့ခွံၬ အဝ့ၫဒၪလီၫ.- တၭမွဲ အဝ့ၫၥံၪအီၪက့ၪဆၧမၪ လၧအလီၩ့အဂဲးနီၪ, ဆၧမိၥ့ၪ ယၫဘၪယၥၭတၭ, ယလ့ၩဆိၬဝ့ၫလၧၦၥၭၡါအီၪ",
			"29": "<sup>29</sup> ကီၪ့အအီၪလီၫ.- ဆၧမၩအၥၭလၧအဂ့ၩဘၪၥံၫမွဲဂ့ၩ, လၧအဂ့ၩဘၪစၧၩ့ထၬမွဲဂ့ၩနီၪ, ယလဒၪန့ဘၪ, မွဲလၧ ဆၧအမၪလၧအဝ့ၫၥံၪ အထူၫအရူၫအကၠီၩ့လီၫ.",
			"30": "<sup>30</sup> ယနါဂၧၫ့လၧၦခိၭယိဆၧ ထၫ့ဒုၪဒၩအဝ့ၫနီၪ, ယအၪ့ မၧၫ့အလ့ၩလၧနအီၪချဲၫ့မၬတၭ, ယမၪလူၬၦအီၪက့ၪ ဆၧအမၪလၧအလီၩ့လဖၪ ဘဲၫၥိၭအမိလီၩဘၪနၧၩ လၧဆၧဘၪဆဲၫ့လၧအဝ့ၫဒၪလီၫ. မွဲနအီၪဆီၪ့အီၪ ချဲၫ့ဆံၭ.",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦၥုၭဖိၪလဖၪဘဲၫဆၧမၪလူၬ ဝ့ၫအၥိၭနီၪ, မၩန့စပီလူၫလၧမုနၩလခီၫတၭ, လ့ၩၥိၫ့",
			"32": "<sup>32</sup> ဝ့ၫလၧအၫ့တံပတြံၭလီၫ.- ထီးကဲဂီၩလနံၩနီၪအဝ့ၫၥံၪ ထဲၩ့ထဲၩ့ဝ့ၫ လၧၦၥုၭဖိၪအဂံၪ့ဖၧၩ့တၭ, အီၪက့ၪလၩ့",
			"33": "<sup>33</sup> ထးကၥ့ၪၥုၭဖိၪဘဲၫၥိၭ အမိလ့ၩၥိၫ့အဝ့ၫဒၪလီၫ.- အ ဝ့ၫၥံၪလ့ၩထီၩ့ လၧစ့ၭစရံအၫဖ့ၪလၫ့လံၬ လၧၦဒိၪဖၭ",
			"34": "<sup>34</sup> ဒိၪတၭ,အီၪက့ၪစပီလူၫလၧအမ့ၬယၫလီၫ.- အဝ့ၫ ဒၪဖီဘၪလံၬနီၪဂီၩ့တၭ, အၪ့စၪ့ဝ့ၫ,မွဲအဘၪဆဲၫ့လၧခး ဘံၪ့ဘံၪ့လဲၪ. ထီးအၥ့ၪယၫ လၧအဘၪဆဲၫ့လၧစ",
			"35": "<sup>35</sup> လံၡၫနီၪ,- စံၭဝ့ၫထီးၦအီၪက့ၪဆၧမၪလၧနလီၩ့အ့ၪဂဲၫ ထီၩ့ခိၬတၭယမိခိၭနၪနလူ ထီးအလူၬလီၫ မွဲအမၪ လူၬဝ့ၫလၧၦဘၪအီၪခိၭဝ့ၫ လၧစဟ့ရၧၭအနီးဖၧၩ့ လီၫ."
		},
		"24": {
			"1": "<sup>1</sup> ယဲနံၩဖီၩ့ခွံၬတၭ,ၦလုဆၧအခိၪစအၫ့နနဲအၭလ ဂၩ,ဒဲၦၥုၪ့က့ၭၥၭၡါလဖၪ, ဒဲၦၥ့ၪဆၧချဲၩ့စတၧၫထၧ လၧၭလဂၩ, လ့ၩလၧၦဒိၪဖၭဒိၪအအီၪနီၪ, လီၩဘၪဝ့ၫ",
			"2": "<sup>2</sup> လၧဆၧထၫ့ဒုၪဒၩစပီလူၫလီၫ.- ဆၧကိၭထၪ့ဝ့ၫတၭ, စတၧၫထၧလၧၭအီၪက့ၪဆၧမၪ လၧအလီၩ့တၭ, စံၭဝ့ၫ, ၦဒိၪစဖံလံၭဧ့, ဆၧမၩအၥၭလၧၦဘၪဆၧမုၬလၧနၧၩ အၪမၬ,နယိထဲၩ့ခွါထဲၩ့ဆၧတၭ, ၦလဆၨၩယီၩဘၪ",
			"3": "<sup>3</sup> ဆၧဘီၪဆၧယီၫဂ့ၩမၬ,- နခိးနတၩပၥ့ၪယၫပဒိၭန့လ စီၪ့လါလါလီၫ.",
			"4": "<sup>4</sup> တၭဘဲၫၥိၭပထီးမၩထံၬထၬနၧၩ ယံၬယံၬလဂ့ၩနီၪ ယအၪ့ယၫနၧၩ လၧနမိအွံၪၥၭဆၧၩ့ ဒဲခိၭနၪပဆၧချဲၩ့",
			"5": "<sup>5</sup> ၡၩခိၬထံၪလီၫ.- အဂဲးဘဲၫယီၩၦယီၩပဒၪန့လၧအမွဲ ၦအၧၩ့ၦၥၫ့, ၦလၧအစူၪလလၩ့ဎုၬဘၪ, နၭဇရ့ၭဖိၪ အခိၪလဂၩ, တၭမၩတုၩ့ထၪ့တုၩ့လၩ့ ကယဲၦယုဒၫ",
			"6": "<sup>6</sup> ဖိၪအီၪလၧလစီၪ့လါလါ,- ဒဲဘဲၫၥိၭအမိမၩစံၪစၪဘၪ ဆၧလုအဂံၪ့နီၪမၩခွါဝ့ၫတၭး ပဖီၪ့ထၬပဝ့ၫ, ဎပၥၭ အီၪလၧပမိစ့ၩရၫ့ဝ့ၫ ဘဲၫပထူၫပရူၫ အီၪဝ့ၫအၥိၭနီၪ",
			"7": "<sup>7</sup> လီၫ.- အ့ၪမွဲၦၥုၭဖိၪလထီၫ့အခိၪစလုစအၭလဂၩနီၪ ဂဲၫမၩန့ဝ့ၫတၭ, အၪ့ဂူၬန့ဆီၪ့မၬဝ့ၫလၧပစူၪဖၧၩ့နီၪ,",
			"8": "<sup>8</sup> ဒဲမၪလူၬ ၦလၧအအီၪက့ၪဆၧမၪလၧအလီၩ့ ဂဲၫလၧန အီၪတၭ,ၭ နအၪ့စိၭအၪ့စၪ့အဝ့ၫအ့ၪဂီၩ့နီၪ, နမိၥ့ၪ ယၫဆၧမၪလၧပအီၪက့ၪ လၧအလီၩ့ထီးအလူၬအဂဲး",
			"9": "<sup>9</sup> အကၠီၪ့လီၫ.- ၦယုဒၫဖိၪၥံၪအုၩ့လၩ့ဝ့ၫတၭ, စံၭဝ့ၫ, ဆၧနီၪလဖၪမွဲဘဲၫနီၪလီၫ.",
			"10": "<sup>10</sup> ၦဒိၪဖၭဒိၪဖျၭလၩ့စိၩလၧ စပီလူၫအအီၪဘဲၫၥိၭ အမိချဲၩ့ဆၧတၭ, အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဝ့ၫးယၥ့ၪယၫလၧ နစ့ၩရၫ့ၦလဆၨၩယီၩအၪနံၪ့တၭ, ယချဲၩ့ဖီၩ့ဖျ့ၭဆၧ လၧယဂးဒၪယဝ့ၫယီၩယၥၭထိၬလီၫ.",
			"11": "<sup>11</sup> ယဝ့ၫဒၪယီၩ, လၧယလ့ၩဘၩဆၧလၧယရုစလံၫ့ အဖၧၩ့နီၪ, ထီၩ့လၩ့ခီးဘိၩ့နဲၪ့ယီၩ, လဖီၩ့ခွံၬဒံၭဘၪ",
			"12": "<sup>12</sup> လဆံၫနံၫၥၫ့နီၪနၥ့ၪယၫနဝ့ၫၥ့ၪလီၫ.- တၭယတ့ၭလိၬ ယၥၭလၧၦလဂၩဂၩလၧ ဆၧလုအဂံၪ့ဖၧၩ့မွဲဂ့ၩ ယမၩ တုၩ့ထၪ့တုၩ့လၩ့ၦခမျၧး လၧၥရိၬဖၧၩ့မွဲဂ့ၩ, လၧဒိၩ့",
			"13": "<sup>13</sup> ဖၧၩ့မွဲဂ့ၩနီၪ,အဝ့ၫၥံၪဒၪန့ယၧၩအ့ၬ.- လၧနီၪအ မ့ၬယၫ,ဆၧမၪလၧအအီၪက့ၪဝ့ၫ လၧယလီၩ့ဘိၩ့နဲၪ့ ယီၩမွဲအနဲၪဖျီၪထၪ့ဝ့ၫၥ့ၪဆ့အ့ၬ.",
			"14": "<sup>14</sup> မွဲလါနၫ့ဘဲၫနီၪတၭ, ယအုၩ့လၩ့လၧနမ့ၬယၫလၧ ယနဲၩထဲၩ့ဆၧမၪလူၬ, ဒဲမီၪလဖၪအလူအထၫလၧလံၬ ဖၧၩ့ထီးအလူၬတၭ, ဘဲၫၦလဖၪလၧအကိၭဝ့ၫလၧအ စူၪလလၩ့ဎုၬဘၪအၥိၭနီၪ, ယဘၩပဖါၥံၪ အယွၩ",
			"15": "<sup>15</sup> လီၫ.- ယအီၪလၧဆၧယိလါဘၪဆဲၫ့လၧယွၩ လၧအ ဝ့ၫၥံၪအနၫ့ဆါဒၪဝ့ၫအုၩ့လၩ့ဆ့, လၧဆၧအီၪက့ၪ ဝ့ၫလၧၦၡၩအၥံၫနီၪ, ၦအတီၩမွဲဂ့ၩ, ၦလတီၩဘၪမွဲ",
			"16": "<sup>16</sup> ဂ့ၩ,မိဂဲထုၪ့မၧၫ့ထၪ့ထဲၩ့ဝ့ၫဒၪလီၫ.- မၩအၥၭဘဲၫ နီၪတၭ,လၧယွၩအမ့ၬယၫမွဲဂ့ၩ, လၧၦၡၩအမ့ၬယၫမွဲ ဂ့ၩ,ဘဲၫၥိၭယကၪ့ၡၧၫ့ ထီးဒုၭနဲၪယၧၩ လၧယမၩမၪ ဆၧလဂ့ၩတၭ, ယဝ့ၫဒၪယနၫ့ဆါဒၪယဝ့ၫ ယအၪ့ ဂူၬမၩလထံၪဎးလီၫ.",
			"17": "<sup>17</sup> အၪနံၪ့အၪလၩဖီၩ့ခွံၬနီၪ, ယဂဲၫဆိၬဆၧဖ့ၪလၫ့ယၫ့ ၥၭလၧယဆၨၩဒၪယဝ့ၫအအီၪယီၩ ယမၩဘိၪ့ဆၧ",
			"18": "<sup>18</sup> လီၫ.- မၩဆၧနီၪအဘိၩ့ဘၭတၭ, ယလအီၪဘၪလၧၦ ခမျၧးမွဲဂ့ၩ ယလမၩတုၩ့ထၪ့တုၩ့လၩ့ဘၪ ဆၧမွဲဂ့ၩ, အဝ့ၫၥံၪဒၪန့ယၧၩ လၧယမၩဆံၫ့ယၥၭလၧဆၧလု အဂံၪ့ဖၧၩ့လီၫ. အ့ၪမွဲၦယုဒၫဖိၪၥံၪလၧအ့ၡၫလနၩ့နၩ့",
			"19": "<sup>19</sup> ဎမၩတုၩ့ထၪ့တုၩ့လၩ့ဆၧလီၫ.ၭ- အီၪက့ၪဆၧမၪလၧ ယလီၩ့အလးအ့ၪအီၪတၭ, အဝ့ၫၥံၪကြၨၭအီၪထီး",
			"20": "<sup>20</sup> ယီၩ,ဘဲၫၥိၭအမိအီၪက့ၪဆၧမၪလၧယလီၩ့လီၫ.- အ့ၪ လမွဲဘၪဘဲၫနီၪတၭ, လၧယအီၪလၧၦၥၭၡါအီၪကီၪ့ အမ့ၬယၫနီၪၦလဖၪယီၩ ဒၪဆၧမၪလၧယလီၩ့ဘဲၫၥ့ၪ",
			"21": "<sup>21</sup> လဲၪဘဲၫၥ့ၪလဲၪနီၪ, မွဲအစံၭဒၪဝ့ၫဘီၪ.- ဆၧမၪအ့ၪအီၪ တၭ,မွဲန့ၫလမံၩ့လၧယအီၪဆၧၫ့ထုၪ့ လၧအကျၩနီၪ, ယကိၭၡၭထၪ့ဆၧလထံၪ, လၧၦၥံၫမိဂဲထုၪ့ထဲၩ့အဂဲး နီၪ,ယဘၪဆၧစ့ၩရၫ့လၧနၥံၪအမ့ၬယၫ လၧမုလနံၩ",
			"22": "<sup>22</sup> ယီၩလီၫ.- စဖံလံၭ,ၥ့ၪယၫလၧဆၧဘၪဆဲၫ့လၧဖၧၩ့ၥၭ နီၪလၩ့ထံးလၩ့ဆ့ၭတၭ,ၥုၭနံၩၥုၭၥၫ့စံၭဝ့ၫ, ထီးၦၥုၭ ဖိၪလထီၫ့အခိၪစလံစအၭအ့ၪဂဲၫထီၩ့ခိၬနီၪ, ယမိ",
			"23": "<sup>23</sup> ၥ့ၪယၫနၥံၪ အဆၧလၩ့ထံးလၩ့ဆ့ၭလီၫ.- တၭအဝ့ၫဒၪ မၪလူၬၦၥုၭဖိၪလယၩအခိၪလဂၩ ဘဲၫၥိၭ ဆၧမိအီၪ ခိၭအဝ့ၫဒၪ, ဒဲဖ့ၪလၫ့အစဲၪ့ဝံၩ့ဝၩ့တၭ, အဘူၭအထံး အ့ၪမိလုအၪ့လုအီၩဝ့ၫနီၪ, ဘဲၫၥိၭအထီးပဒၩ့ဆၧ လဂ့ၩလီၫ.",
			"24": "<sup>24</sup> အနံၩအၥၫ့ လနၩ့နၩ့ဖီၩ့ခွံၬတၭ, စဖံလံၭဂဲၫဝ့ၫ ဒဲ အမၫၦယုဒၫမုၪနးဒြူၫစံလၫနီၪတၭ, ကိၭန့စပီလူၫ,",
			"25": "<sup>25</sup> ခိၭနၪဝ့ၫအလူလၧ ဆၧနဲၩထဲၩ့ဎရံၬအဂဲးလီၫ.- တၭထီး အဝ့ၫဒၪ လီၩလၩ့လၬလၩ့ဆၧတီၩဆၧလီၩ့အဂဲး, ဒဲဆၧထုၭအၥၭအဂဲး,ဒဲဆၧစ့ၩရၫ့မုနံၩခိၬအဂဲး နီၪ,စဖံလံၭဝၭထိၬဝၭတ့ၭဝ့ၫတၭ, ချဲၩ့ဆၧၫ့ဝ့ၫ,ဘိၩ့ နဲၪ့ယီၩထဲၩ့ဒၪခလူၬဘီၪ. အထီလၧအဂ့ၩအဘၪခိၬ နီၪယမိကိၭထဲၩ့နၧၩလီၫ.",
			"26": "<sup>26</sup> တၭယိလါဝ့ၫလၧစပီလူၫဖ့ၪလၫ့စ့ၩတၭ, ကိၭ",
			"27": "<sup>27</sup> န့ဝ့ၫအၪဘျၩ့, ချဲၩ့ဒုၪ့အဝ့ၫဒၪလီၫ.- မွဲလါနၫ့နံၫနံၪ့ဎွ့ၩ ထၪ့ဝ့ၪတၭ, စပီၫၡၧၭဖ့စတၧၭဂဲၫထီၩ့ လၧစဖံလံၭအ လးနီၪ,စဖံလံၭမိန့ဘၪအၥၭ ဆၧအခိးအတၩလၧ ၦယုဒၫဖိၪၥံၪအမ့ၬယၫ လၧအဂးဒၪဝ့ၫနီၪ, အီၪက့ၪ လၩ့ထးစပီလူၫလၧ အဘၪဆၧစၧၩ့ထၬအဖၧၩ့နီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, စဖ့စတၧၭဂဲၫထီၩ့လၧခးဖၧၩ့ နီၪ,ၥၧၫ့ၥၫ့ဖီၩ့ခွံၬတၭ, စဲၪ့ထၪ့ခွံၬလၧစ့ၭစရံအၫ နီၪလ့ၩ ထၪ့ထီၩ့လၧယရုစလံၫ့လီၫ.",
			"2": "<sup>2</sup> တၭၦလုဆၧအခိၪ, ဒဲၦယုဒၫဖိၪၥံၪအခိၪလဖၪလီၩ",
			"3": "<sup>3</sup> လၩ့လၬလၩ့ဆၧထၫ့ဒုၪဒၩ စပီလူၫနီၪအၪ့ယၫဝ့ၫ,-အၪ့ ကံၩ့ဆၧအခိးအတၩ လၧအနၫ့ဆါၥံၪအဂးဒၪဝ့ၫ ဘဲၫ ၥိၭအမိထၫ့ဒုၪဒၩ အဝ့ၫလဂၩ အၪ့မၧၫ့အဂဲၫလၧယရု စလံၫ့နီၪ, ဘဲၫၥိၭအဝ့ၫၥံၪမိအီၪခိၭၥူၪဆၧတၭ, မၩၥံၫ ဝ့ၫလၧဖၧၩ့ၥၭနီၪလီၫ.",
			"4": "<sup>4</sup> မၩအၥၭဘဲၫနီၪတၭ, စဖ့စတၧၭချဲၩ့ဆၧၫ့ဝ့ၫ,ဆၧမိ ဘၪအီၪခိၭစပီလူၫလၧစ့ၭစရံအၫနီၪ, အနၫ့ဆါဒၪဝ့ၫမိ",
			"5": "<sup>5</sup> လ့ၩလၧနီၪလၧအဆိၫအချဲၫ့လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,စံၭဝ့ၫ, ၦဒိၪၦၡါလဖၪ လၧနၥံၪအကျၩ ကြၨၭ လ့ၩဖိၬယခဲၫ့တၭ, ၦလဂၩနီၪအဆၧမၪအ့ၪအီၪတၭ, မွဲအဝ့ၫၥံၪအီၪက့ၪဆၧမၪ လၧအလီၩ့ဆံၭ.",
			"6": "<sup>6</sup> တၭအီၪလၧအဝ့ၫၥံၪအကျၩ ဎိၭၥၫ့ဆံၫၥၫ့ လချႃၭ ဖီၩ့ခွံၬဒံၭဘၪနီၪ, ထဲၩ့လၩ့ဝ့ၫလၧစ့ၭစရံအၫတၭ, ကဲ ဂီၩလနံၩနီၪ ဆၧၫ့နၩ့ဝ့ၫလၧစ့ၩရၫ့ခွးအလး ဆီၩ့ဆီအ",
			"7": "<sup>7</sup> ဖၫ့ခိၪတၭ, အၪ့မၧၫ့ဆၧကိၭန့စပီလူၫလီၫ.- အဝ့ၫနီၪ ဂဲၫထီၩ့တၭ, ၦယုဒၫဖိၪၥံၪ လၧအဂဲၫလၧယရုစလံၫ့ ဆၧၫ့ထုၪ့ဝၬဖီၩ့ဝ့ၫနီၪ, ဆၧအမၪလၧအအၪ့မၧၫ့ၦထိး အၥၭလန့ဘၪနီၪ, အီၪက့ၪဝ့ၫလၧစပီလူၫအလီၩ့အၪ မၬဎၧၫ့မၬလီၫ.",
			"8": "<sup>8</sup> စပီလူၫချဲၩ့ဖီၩ့ဖျ့ၭဆၧလၧအဂးဒၪဝ့ၫတၭ, စံၭဝ့ၫ, လၧၦယုဒၫဖိၪၥံၪအထူၫအရူၫမွဲဂ့ၩ, လၧဆၧလုအဂံၪ့ မွဲဂ့ၩ,လၧစံစၧၫမွဲဂ့ၩ, ယမၩမၪဘၪနးမံၩ့အ့ၬ.",
			"9": "<sup>9</sup> မွဲလါနၫ့ဘဲၫနီၪတၭ, စဖ့စတၧၭမိန့ဘၪအၥၭ လၧၦ ယုဒၫဖိၪၥံၪအခိးအတၩနီၪ, ချဲၩ့ဆၧၫ့စပီလူၫတၭ, စံၭ ဝ့ၫမွဲနမိလ့ၩထၪ့လၧယရုစလံၫ့နီၪ, ဘၪဆၧစ့ၩရၫ့လၧ ဆၧယီၩလဖၪအဂဲး လၧယမ့ၬယၫဆ့ဧၪ.",
			"10": "<sup>10</sup> စပီလူၫစံၭဝ့ၫ, ယဆၧၫ့ထုၪ့လၧစံစၧၫ စ့ၩရၫ့ဆၧအ လးအမ့ၬယၫ လၧယကြၨၭဘၪဆၧစ့ၩရၫ့ ယဝ့ၫလီၫ. ဘဲၫနၥ့ၪယၫဂ့ၩဘၪစဲၪအၥိၭနီၪ, ယမၩမၪဘၪၦယုဒၫ",
			"11": "<sup>11</sup> ဖိၪၥံၪနးမံၩ့အ့ၬ.- အဂဲးဘဲၫယီၩ ယအ့ၪမၩမၪ ဆၧ တၭ,ယဂ့ၩၥံၫအဆၧမၪအ့ၪအီၪ လၧယလီၩ့ယီၩ, ဘဲၫ ၥိၭယထီးဘၪၥံၫလဂ့ၩနီၪ, ယအၪ့ကံၩ့ အၪ့ယၫဆၧ အ့ၬ.အ့ၪမွဲဆၧမၪ လၧအဝ့ၫၥံၪ အီၪက့ၪလၧယလီၩ့ အ့ၪလအီၪဘၪနီၪ, ၦဖ့ၪလၫ့ဘၪယၧၩ လၧအစူၪဖၧၩ့နး ဂၩအ့ၬ. ယကိၭထၪ့ဆၧလၧစံစၧၫလဂၩနီၪလီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့ စဖ့စတၧၭချဲၩ့လိၬအၥၭလၧၦကိၪ့လိၬ ဆၧလဖၪဂီၩ့နီၪ, ချဲၩ့ဆၧၫ့ဝ့ၫ, နကိၭထၪ့စံစၧၫနီၪတၭ, နဘၪလ့ၩလၧစံစၧၫအအီၪလီၫ.",
			"13": "<sup>13</sup> အနံၩအၥၫ့လနၩ့နၩ့ဖီၩ့ခွံၬတၭ, စဎွၩအဂံပၫ, ဒဲနး ဘၧၫနဲစံၫဂဲၫအီၪၡီၩ့စဖ့စတၧၭ လၧစ့ၭစရံအၫအဖၧၩ့ လီၫ.",
			"14": "<sup>14</sup> အဝ့ၫၥံၪအီၪဝ့ၫထီးနီၪ တဘျႃၭနံၩတၭ, စဖ့စတၧၭ လီၩဘၪစဎွၩလၧစပီလူၫအဂဲး, စံၭဝ့ၫ, ၦဘၪစၧၩ့ထၬ လၧစဖံလံၭ အီၪက့ၪလၩ့ထးဝ့ၫနီၪ, အီၪလဂၩလီၫ.",
			"15": "<sup>15</sup> လၧယအီၪလၧယရုစလံၫ့အဖၧၩ့, ၦလုဆၧအခိၪဒဲၦယု ဒၫဖိၪၥံၪအၥုၪ့က့ၭအၥၭၡါလဖၪ လီၩဘၪယၧၩလၧအ ဂဲးအကၠီၪ့တၭ,အၪ့ကံၩ့အၪ့ယၫဝ့ၫ လၧအဂးဒၪဝ့ၫ",
			"16": "<sup>16</sup> လၧယမိစ့ၩရၫ့စၪအဝ့ၫဒၪလီၫ.- တၭယစံၭဆၧၫ့အဝ့ၫ ၥံၪ,ၦလဂၩဂၩ လၧဆၧအီၪက့ၪဆၧမၪ လၧအလီၩ့လ ချႃၭဒၪလိၬဒံၭဘၪအၥၭ လၧၦအီၪက့ၪဆၧမၪ လၧအ လီၩ့လဖၪနီၪ, ဆၧလဒုၭချဲၩ့ဖီၩ့ချဲၩ့ဖျ့ၭဘၪလၧအဆၧ မၪအကၠီၩ့တၭ, ၦရိမၫဖိၪၥံၪဖ့ၪလၫ့ခွံၬဝ့ၫနီၪ, အထူၫ အရူၫအီၪအ့ၬ.",
			"17": "<sup>17</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးအဝ့ၫၥံၪဂဲၫထီၩ့လၧယီၩ လၥုၭနံၩၥုၭၥၫ့ဘၪတၭ, လၧကဲဂီၩလနံၩနီၪ,ယဆၧၫ့ နၩ့လၧစ့ၩရၫ့ ဆၧအလးဆီၩ့ဆီအဖၫ့ခိၪ, ယအၪ့မၧၫ့",
			"18": "<sup>18</sup> ၦၥိၫ့ထၪ့ၦလဂၩနီၪလီၫ.- ၦအီၪက့ၪဆၧမၪလၧအလီၩ့ လဖၪဂဲထုၪ့ဝ့ၫတၭ, ဆၧမၪလၧယဆီၫ့မီၪ့ဝ့ၫနီၪ အီၪ",
			"19": "<sup>19</sup> က့ၪဝ့ၫလၧအလီၩ့နးမံၩ့အ့ၬ.- တၭအီၪက့ၪဆၧမၪလၧ အၥၫထနၫဒၪဝ့ၫအဂဲးနီၪ, မွဲၦလဂၩယ့ၫရှူၬလၧအ",
			"20": "<sup>20</sup> ၥံၫယူၭတၭ,စပီလူၫစံၭဝ့ၫ, မွဲအမၧၫ့ဒံၭနီၪလီၫ.- လၧ ယၥၭဂံၩ့ဂၩ့ လၧဆၧလဖၪနီၪအဂဲး, ယအၪ့စၪ့ယဝ့ၫ, မွဲနမိလ့ၩထၪ့လၧယရုစလံၫ့, ဘၪဆၧစ့ၩရၫ့ထီးနီၪလၧ",
			"21": "<sup>21</sup> ဆၧယီၩလဖၪအဂဲးဆ့ဧၪ.- တၭစပီလူၫအၪ့ကံၩ့ၦခိၭ ဝ့ၫ,ထီးအဘၪအီၫဂၧၭစတၧၭအဆၧစ့ၩရၫ့တၭ, ယမၪ လူၬလၧဆၧဘၪခိၭဝ့ၫ ထီးယအၪ့မၧၫ့အလ့ၩထၪ့လၧ စံစၧၫအအီၪနီၪလီၫ.",
			"22": "<sup>22</sup> စအဂြံပၫစံၭစဖ့စတၧၭ, ယဝ့ၫဒၪယီၩဆၧမိနါဂၧၫ့ဘၪ ယၥၭလၧၦလဂၩနီၪလၧယနၫ့ဆါဒၪယဝ့ၫလီၫ. အဝ့ၫ ဒၪစံၭဆၧၫ့ဝ့ၫး ကဲဂီၩခိၬလနံၩတၭ, နမိနါဂၧၫ့ဘၪအ ဝ့ၫဒၪလီၫ.",
			"23": "<sup>23</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဲဂီၩလနံၩစအဂြံပၫဒဲနးဘၧၫ နဲစံၫဂဲၫနုၬလၧအနါဂၧၫ့ဆၧအလးဒဲအကယးကဖး လၧအအၪ, ဒဲၦၥုၭဖိၪလထီၫ့အခိၪလဖၪ,ဒဲၦဒိၩ့ဖိၪအ ခိၪၥံၪတၭ, စဖ့စတၧၭမၪလူၬလၧၦဂဲၫၥိၫ့ထၪ့စပီလူၫ လီၫ.",
			"24": "<sup>24</sup> တၭစဖ့စတၧၭစံၭဝ့ၫး စဎွၩအဂြံပၫ, ဒဲၦအီၪကိၩ့အီၪ ကီၪ့ထီးယီၩထီးအလူၬၥံၪဧ့, နၥံၪဒၪဘၪၦလဂၩယီၩ, လၧၦယုဒၫဖိၪၥံၪအခမျၧးလၧယရုစလံၫ့ဒဲအလးထီး ယီၩထီးအလူၬ အၪ့ကံၩ့အၪ့ယၫယၧၩလၧအဂဲး, ဒဲ",
			"25": "<sup>25</sup> ကိၭၡၭထၪ့လၧအဂ့ၩမၧၫ့လၧၩ့အ့ၬ.-ဆၧမၪထီး အကြၨၭၥံၫနီၪ, ယလဒၪဘၪလၧအလီၩ့တၭ, မွဲအ ကိၭထၪ့ဝ့ၫလၧအီၫဂၧၭစတၧၭတၭ, ယအီၪက့ၪယ ၥၭလၧယမိအၪ့မၧၫ့အလ့ၩလီၫ.",
			"26": "<sup>26</sup> တၭအဂဲးအကၠီၪ့လၧယမိကွ့ၭဖ့ၪယူ ဆၧလၧယ ကဆါလၩ့ထံးလၩ့ဆ့ၭလအီၪဘၪနီၪ, ဘဲၫၥိၭအထီး ဘၪဆၧအၪ့စိၭအၪ့စၪ့ဝ့ၫဂီၩ့တၭ, ယမိအီၪလၧကွ့ၭ ဆၧအလးလမံၩ့မံၩ့, ယၥိၫ့ထၪ့အဝ့ၫလၧနၥံၪအအီၪ,",
			"27": "<sup>27</sup> လၩ့မဲၩဒၪဆၧလၧနအီၪနဝ့ၫ, စဎွၩအဂြံပၫဧ့,- အဂဲး ဘဲၫယီၩယဆီၫ့မီၪ့ လၧယလဒုၭနဲၪဘၪအဆၧမၪတၭ, အၪ့မၧၫ့ၦဘၪစၧၩ့ထၬလဂၩလ့ၩဝ့ၫနီၪကြၨၭအ့ၬ."
		},
		"26": {
			"1": "<sup>1</sup> စအဂြံပၫစံၭစပီလူၫ, ဆၧဒုၭချဲၩ့နၧၩလၧနဂးဒၪနဝ့ၫ လီၫ. ထီးနီၪလဖၧၫ့စပီလူၫယူၬထၪ့အစူၪတၭ, ချဲၩ့ဖီၩ့",
			"2": "<sup>2</sup> ဖျ့ၭလၩ့အၥၭ,- စဎွၩအဂြံပၫဧ့, ဆၧအမၪလၧၦယုဒၫ ဖိၪၥံၪအီၪက့ၪလၧယလီၩ့အဂဲးအကၠီၪ့နီၪ, ယချဲၩ့ဖီၩ့ ဖျ့ၭလၩ့ယၥၭလၧနမ့ၬယၫ, မုဆၫလနံၩယီၩတၭ, ယ",
			"3": "<sup>3</sup> ၥၭမုၬမၬလီၫ.- အဂဲးဘဲၫယီၩဆၧအထူၫအရူၫ, ဒဲက ယဲဆၧအၪ့စၪ့ဆၧလဖၪအဂဲးအကၠီၪ့ လၧၦယုဒၫဖိၪၥံၪ အကျၩနီၪ, နၥ့ၪယၫထီးအလူၬအၪဒၪအဆၧဒံၭလီၫ. အခိးမွဲဘဲၫနီၪတၭ, အွံၪၥၭဆၧၩ့, ခိၭနၪလါယလူ ဆံၭ.",
			"4": "<sup>4</sup> တၭယအီၪလၧယရုစလံၫ့အဖၧၩ့ အဂဲးအကၠီၪ့လၧ ယဆၨၩဒၪယဝ့ၫအကျၩ,ခီၫလၧယဖိၪၥၪခွၫထၪ့နီၪ,",
			"5": "<sup>5</sup> ၦယုဒၫဖိၪၥံၪၥ့ၪယၫဝ့ၫထီးအလူၬလီၫ.- အဝ့ၫၥံၪအ့ၪမိ ထိးဘၪအၥၭတၭ, ၥ့ၪယၫဝဲၩဝ့ၫဘဲၫပဆၧဘိၪ့ဆၧဘၩ အထူၫအရူၫအီၪဝ့ၫ အၥိၭယမၩယဝ့ၫ လၩ့ထံးလၩ့ ဆ့ၭနီၪ, ယမွဲၦအစူၪလလၩ့ဎုၬဘၪၦဖၫရစံၫလီၫ.",
			"6": "<sup>6</sup> ဘိၩ့နဲၪ့ယီၩယယိလါယွၩအလူလၧအဖ့ၪလၫ့ဝဲၩဝ့ၫ လၧပဖါၥံၪအကၠီၩ့တၭ, ယဆၧၫ့ထုၪ့ဘၪဆၧစ့ၩရၫ့",
			"7": "<sup>7</sup> လီၫ.- ပဝ့ၫဒၪ ပလဆံၫနံၫဒီၪ့ယီၩ မၩယွၩအဆၧမၩ ကိၭမုနံၩမုနၩဒ့ၭ လၩ့ထံးလၩ့ဆ့ၭတၭ,ယိလါလၧ အမိထီၩ့ လၧဆၧချဲၩ့ဝဲၩဝ့ၫအအီၪနီၪလီၫ. စဎွၩဧ့, ၦ ယုဒၫဖိၪၥံၪ အီၪက့ၪဆၧအမၪ လၧယလီၩ့ လၧဆၧယိ လါနီၪအကၠီၩ့လီၫ.",
			"8": "<sup>8</sup> ယွၩဒုၭဂဲထုၪ့ထဲၩ့ၦၥံၫနီၪ, နၥံၪဆီၫ့မီၪ့လၧၦနဲၩလ ၥ့ၪဘၪနီၪမွဲဘၪလဲၪ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဆီၫ့မီၪ့ယူၭလၧယကြၨၭ မၩဆၧထၫ့ဒုၪဒၩ ၦနၭဇရ့ၭဖိၪယ့ၫရှူၬ အမံၩ့အၥၪ",
			"10": "<sup>10</sup> အၪမံၩ့လီၫ.- ဆၧနီၪလဖၪယမၩ လၧယရုစလံၫ့အဖၧၩ့ တၭ,ယထိးန့ၦလုဆၧအဒိၪၥံၪအလူ, ယကၭဘံၭ ထၬၦဆံၫ့ဎံၪအၪဂၩလၧထီၫ့ဖၧၩ့တၭ, ထီးအဘၪၥံၫ",
			"11": "<sup>11</sup> ဝ့ၫနီၪ,ယအုၩ့လၩ့ယဝ့ၫလီၫ.- ယဒုၭဘၪအဝ့ၫၥံၪလၧ ဆၧနၭဆၧၡၪ့လၧၥရိၬထီးအလူၬအဖၧၩ့အၪဘျၩ့ တၭ,ယမၩဆီၪ့အဝ့ၫၥံၪ ဘဲၫၥိၭအမိဒုၪဒွ့ၪဆၧလီၫ. ယၥၭထၪ့ဆီၪ့ဖျႃထၪ့ထၫ့ဒုၪဒၩ အဝ့ၫၥံၪတၭ, ယမၩ အၧၩ့ဝ့ၫဖိး လၧၦဆၨၩဂူၫဂၩအဒိၩ့ၥံၪလီၫ.",
			"12": "<sup>12</sup> လၧယမၩဆၧနီၪတၭ, ယလ့ၩလၧၦလုဆၧအဒိၪၥံၪ အလူဒဲအစီၩ့အမၩ့ လၧဒမၭစကၧၭအဖၧၩ့ၥၭ အဘိၩ့",
			"13": "<sup>13</sup> ဘၭနီၪ,- လၧမုထုၪ့အခၫ, စဎွၩဧ့,လၧဖၧၩ့ၥၭနီၪယ ဒၪဆၧဖၩ့လၧမူၭခိၪအၪနဲၪ့မုအဖၩ့နီၪတၭ, ဖၩ့ထၪ့ဝၬ",
			"14": "<sup>14</sup> ဖီၩ့ယၧၩ ဒဲၦဖိၬယခဲၫ့လဖၪနီၪဆ့လီၫ.- ပလၩ့ထံၩဖါ လၧဂၪ့ခိၪလီၩ့ထီးအလူၬဂီၩ့တၭ, ယနါဂၧၫ့ဆၧအလူ ချဲၩ့ဒုၪ့ယၧၩ, စံၭဝ့ၫ, လၧၦဟံဘြူၫဖိၪ အလၨလခီၫ, စစီလူၫဧ့,စစီလူၫဧ့,နမၩအၧၩ့ယၧၩမွဲဘၪလဲၪ. နထၧၫ့",
			"15": "<sup>15</sup> ဘၪနိၪစူၩကၪမၬလီၫ.- တၭယစံၭ,ကဆါဧ့, နမွဲပလၫ လဂၩလဲၪ. အဝ့ၫဒၪစံၭယၧၩ, ယမွဲၦလၧနမၩအၧၩ့ဝ့ၫ",
			"16": "<sup>16</sup> ယ့ၫရှူၬလဂၩနီၪလီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ဂဲထုၪ့တၭ ဆၧၫ့ထုၪ့ဆံၭ. အဂဲးဘဲၫယီၩ ယနဲၪဖျီၪထၪ့ယၥၭလၧ နၧၩလၧဆၧယီၩအဂဲး, ဘဲၫၥိၭယမိအီၪက့ၪလၩ့နၧၩ လၧၦထိးအၥၭလၧဆၧလၧနဒၪဘၪ, ဒဲဆၧလၧယ",
			"17": "<sup>17</sup> မိမၩဖျီၪထၪ့လၧနၧၩအဂးဆ့လီၫ.- ယမၩဖီၩ့ဖျ့ၭနၧၩ လၧၦခမျၧးဒဲၦဆၨၩလဖၪအစူၪဖၧၩ့တၭ, ယအၪ့မၧၫ့",
			"18": "<sup>18</sup> နလ့ၩလၧအအီၪ,- ဘဲၫၥိၭနမိဒုၭဒၪထၪ့အမ့ၬ, န မိဘိၭကၠၪခွံၬအဝ့ၫၥံၪ လၧဆၧခံၭဖိးလၧဆၧဖၩ့, ဒဲ လၧမုၪခီၩလဲး အစီၩ့အမၩ့ အဖၧၩ့ဖိးလၧယွၩအ ဖၧၩ့, ဘဲၫၥိၭအဝ့ၫၥံၪ မိဒိၭန့ဆၧမၩဖီၩ့ဖျ့ၭဆၧဒဲၩ ဘၭ, ဒဲဆၧန့ၥၫဆၧလၧၦဆံၫ့ဎံၪလဖၪအကျၩ လၧဆၧနဲၩယၧၩအကၠီၩ့လီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, စဎွၩအဂြံပၫဧ့,ဆၧဒၪဆၧလၧ",
			"20": "<sup>20</sup> ယၫလခီၫလၧမူၭခိၪနီၪ, ယလခိၭနၪဘၪမွဲအ့ၬ.- အ့ၪ မွဲယလီၩလၩ့လၬလၩ့ဆိၫ ဆၧလၧဒမၭစကၧၭဒဲလၧ ယရုစလံၫ့ဒဲလၧခးယုဒၫထၧၫ့ခးယၫ, ဒဲလၧၦဆၨၩလ ဖၪအအီၪ ဘဲၫၥိၭအမိနီၫ့ယါလၩ့ထဲၩ့အၥၭ, ဒဲမိကၠၪ ထဲၩ့အၥၭ လၧယွၩအအီၪတၭ, မိမၩဆၧဂ့ၩဘၪဆဲၫ့ လၧဆၧနီၫ့ယါလၩ့ထဲၩ့ၥၭလီၫ.",
			"21": "<sup>21</sup> ၦယုဒၫဖိၪၥံၪဖီၪ့ထၬယၧၩ လၧဆၧလုအဂံၪ့ဖၧၩ့လၧ ဆၧနီၪလဖၪအကၠီၩ့တၭ, အၪ့ဎၬမၩၥံၫယၧၩလီၫ.",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ, ယွၩမၩဆၧၩ့ယၧၩယီၩ ယအီၪ ဒံၭထီးမုလနံၩယီၩတၭ, ယထိးယၥၭလၧၦဒိၪမွဲဂ့ၩ, ၦဆံၭမွဲဂ့ၩအမ့ၬယၫ, ယလီၩလၩ့လၬလၩ့ ကယဲဆၧ လၧမီၪလဖၪ ဒဲစမိစ့ၭစံၭဝဲၩလၧအမိအီၪထၪ့လီၫ.",
			"23": "<sup>23</sup> အဝ့ၫၥံၪစံၭလၧဎရံၬနီၪ မိဘၪထိးဆၧတၭ, မိကဲၪထၪ့ ၦဂဲထုၪ့ဆိၫလၧၦၥံၫလဖၪအကျၩတၭ, မိဒုၭနဲၪဆၧ ဖၩ့လၧၦခမျၧး, ဒဲလၧၦဆၨၩလဖၪလီၫ.",
			"24": "<sup>24</sup> စပီလူၫချဲၩ့ဖီၩ့ဖျ့ၭဆၧဘဲၫနီၪအဘိၩ့ဘၭတၭ, စဖ့ စတၧၭစံၭဝ့ၫလၧအလူဖၭဒိၪ,စပီလူၫဧ့,နဖျႃထၪ့လီၫ. မွဲနမၩလိၪလံၬအၪအၪလ့ၬတၭ, နဖျႃထၪ့ယူၭလီၫ.",
			"25": "<sup>25</sup> တၭအဝ့ၫဒၪစံၭဝ့ၫ,စဒိၪစဖ့စတၧၭဧ့, ယဝ့ၫဒၪယီၩ ယဖျႃထၪ့မွဲအ့ၬး ယလီၩဘၪဆၧမွဲဆၧတီၩလၧယၥၭ",
			"26": "<sup>26</sup> ထံၫလီၫ.- အဂဲးဘဲၫယီၩဆၧနီၪလဖၪစဎွၩၥ့ၪယၫလၩ့ ထံးလၩ့ဆ့ၭတၭ, ယချဲၩ့ဆၧလၧအမ့ၬယၫလၧယၥၭ ဒူၩလီၫ. အဂဲးဘဲၫယီၩယဆီၫ့မီၪ့လၧဆၧနီၪလဖၪအီၪ ၥူၪလၧအမ့ၬယၫနးမံၩ့အ့ၬး အဂဲးဘဲၫယီၩ ဆၧနီၪလ ဖၪမၩဘၪအၥၭ လၧဆၧနိၪ့ကဲၪ့အဖၧၩ့အ့ၬ.",
			"27": "<sup>27</sup> စဎွၩအဂြံပၫဧ့, မီၪလဖၪအလူအထၫနီၪ,မွဲနနဲၩဆ့ ဧၪ. ယၥ့ၪယၫလၧနနဲၩလီၫ.",
			"28": "<sup>28</sup> စအဂြံပၫစံၭစပီလူၫ, လၧဆၧကျ့ၭစၨၭ လဆံၭဖိၪ အကၠီၩ့နီၪ, နအၪ့လွ့ၫယၧၩဘဲၫၥိၭ ယမိကဲၪထၪ့ဎရံၬ ဖိၪလီၫ.",
			"29": "<sup>29</sup> တၭစပီလူၫစံၭဝ့ၫ, အ့ၪလမွဲဘၪၥွ့ၫထၭလမံၩ့ယီၩ, လၧဆၧလဆံၭဖိၪအကၠီၩ့မွဲဂ့ၩ, လၧဆၧအၪအကၠီၩ့မွဲ ဂ့ၩ,ယဘၩဆိၪဖၪန့ယွၩလၧနဂးဒၪနဝ့ၫ,ဒဲကယဲၦ လၧအနါဂၧၫ့ယလူလၧမုဆၫလနံၩယီၩ ထီးအလူၬအ ဂးဆ့, ဘဲၫၥိၭနၥံၪမိကဲၪထဲၩ့ၦဘဲၫယၧၩအၥိၭလီၫ.",
			"30": "<sup>30</sup> အဝ့ၫဒၪချဲၩ့ဆၧဘဲၫနီၪဂီၩ့တၭ, စဎွၩ, ဒဲနးဘၧၫနဲ စံၫ,ဒဲၦဒိၪဖၭဒိၪၥံၪ ဒဲၦဆၧၫ့နၩ့လၧအၥိၭလဖၪ ဂဲထုၪ့",
			"31": "<sup>31</sup> ထၪ့,- လ့ၩလၧဆၧအီၪၥူၪအလးတၭ, ချဲၩ့လိၬအၥၭ စံၭဝ့ၫ,ဆၧမၪလၧအကြၨၭဘၪၥံၫမွဲဂ့ၩ, ကြၨၭဘၪစၧၩ့",
			"32": "<sup>32</sup> ထၬမွဲဂ့ၩ, ၦလဂၩယီၩမၩဘၪအ့ၬ.- တၭစအဂြံပၫစံၭ စဖ့စတၧၭ, ၦလဂၩယီၩ အ့ၪလကိၭထၪ့ဘၪစံစၧၫနီၪ ဆၧကွဲၪဖျါခွံၬဝ့ၫၥ့ၪလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> ထီးဆၧစ့ၩရၫ့ဝ့ၫလၧပဘၪထူၬထၪ့ကဘၩ့လ့ၩလၧ အံတလံၫနီၪ, ဆၧဖ့ၪလၫ့စပီလူၫ,ဒဲၦဘၪဆၧစၧၩ့ထၬ အဂူၫဂၩလနၩ့နၩ့ လၧၥုၭဖိၪလယၩအခိၪအမံၩ့ စယု လအၧၭ လၧအဘၪဆဲၫ့ လၧအီၫဂၧၭစတၧၭ အၥုၭဖိၪ လဒီၪ့အစူၪဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> ၦၥ့ၭစလနဲကၫဖိၪ လၧအဘၪဆဲၫ့ လၧမၫစဒိနအၫ စအရံစတၫခၧၭအီၪလၧပၥိၭတၭ, ပလ့ၩနုၬထၪ့လၧ ၦအၫဒမံတအၫ့ဖိၪအကဘၩ့ဖၧၩ့နီၪ, ပဆီၫ့မီၪ့လၧပမိ",
			"3": "<sup>3</sup> လ့ၩလၧအ့ၡၫအနဲၩ့ထံၭတၭပစဲၪ့ထၪ့လီၫ.- မုနံၫနံၩ နီၪပစိၭထၪ့လၧစဲဒၧၫ့တၭ, စယုလအၧၭယိစပီလူၫဂ့ၩ ဘၪစဲၪတၭ, ဘဲၫၥိၭအထံၩအၥိၭမိလုအၪ့လုအီၩဝ့ၫ တၭ,ဒုၭလ့ၩအဝ့ၫဒၪ လၧအဝ့ၫၥံၪအအီၪလီၫ.",
			"4": "<sup>4</sup> ပစဲၪ့ထၪ့ခွံၬထီးနီၪ, မွဲလံၩလလီၩ့ဘၪဝ့ၫတၭ,ပလ့ၩ",
			"5": "<sup>5</sup> လၧစဲပၧၭလံၩကဒုၩလခီၫနီၪလီၫ.- ပလ့ၩခၫ့ဂၬမၫ ဆမံၭလၧအဘၪဆဲၫ့ခးစလံၡၫဒဲပၫ့ဖံလအၪနီၪ, ပလ့ၩ ဖိးလၧမဲရၫလၧအဘၪဆဲၫ့ လၧလံစအၫလီၫ.",
			"6": "<sup>6</sup> ထီးနီၪၦၥုၭဖိၪလယၩအခိၪ ဒၪန့ၦအလ့ၭစၫ့ဒအၫ အကဘၩ့လၧအမိလ့ၩဝ့ၫ လၧအံတလံၫလဖျိၪ့တၭဒုၭ",
			"7": "<sup>7</sup> နုၬပၧၩလၧအဖၧၩ့လီၫ.- ပလ့ၩၡီၩၡီၪၡီၩၡီၪအၪနံၩ အၪၥၫ့တၭ,ပဖိးလၧဆၧဆဲၫဎၩ့ လၧနဲဒၧၫကၪမၬတၭ, လံၩလတီၩဘၪန့ၫနီၪ, ပလ့ၩလၧကြံတံၫလၧလံၩက",
			"8": "<sup>8</sup> ဒုၩလခီၫနီၪအီၪဆဲၫဎၩ့လၧစၫလမိနံၫလီၫ.- ပလ့ၩဖီၩ့ ခွံၬထီးနီၪကၪမၬတၭ, ပလ့ၩဖိးလၧအလး ကိၭဝ့ၫအ မံၩ့လၧဆၧနိၪ့ဖၧၩ့အဂ့ၩ, အီၪဘူၭလၧဒိၩ့လၫ စံအၫ လီၫ.",
			"9": "<sup>9</sup> အီၪယံၬယံၬတၭ, ဒုၪဆၧအၪ့ဆၧအီၩအမုလနံၩနီၪ ဖီၩ့ခွံၬယူၭတၭ, လ့ၩဆၧလၧမၫဆမံၭနီၪဘိၩ့နဲၪ့ယီၩ",
			"10": "<sup>10</sup> ကၪမၬတၭ, စပီလူၫၥီၪ့ထဲၩ့ဆၧ,- စံၭအဝ့ၫၥံၪ, ၦၡၩ ၥံၪဧ့, ပၥ့ၪယၫလၧပလ့ၩဆၧလၧမၫဆမံၭယီၩ,မိအီၪ လၧဆၧဂၭဂီၩ့ဂၭစၪ ဒဲဆၧလၩ့မိၩ့လၩ့မါအၪအၪလ့ၬ, မိဘၪန့ၫကဘၩ့, ဒဲဆၧဖိၪဆၧလံၩလဖၪနီၪလကၭလၧၩ့,",
			"11": "<sup>11</sup> မွဲအမိဘၪပၥၭမၧၫ့ဆ့လီၫ.- မွဲလါနၫ့ဘိၩၦၥုၭဖိၪလ ယၩအခိၪနဲၩကဘၩ့အခိၪ, ဒဲကဘၩ့အကဆါအၪနဲၪ့",
			"12": "<sup>12</sup> ဆၧလၧစပီလူၫလီၩဘၪဝ့ၫနီၪဒံၭလီၫ.- မွဲလၧဆၧနိၪ့ ဖၧၩ့လမုၬဘၪ လၧအမိပထုၬဝ့ၫ လၧဆၧဂီးခၫနီၪအ ကၠီၩ့,ၦကိၪ့ထၪ့ဖၭလၩ့ဝ့ၫအၪဂၩ လၧအမိဂၭထၪ့ခွံၬ ထီးနီၪလ့ၩဆၧအ့ၪၥ့ၪ, ထီၩ့လၧဖံနံၭ ဘဲၫၥိၭအမိအီၪ ဝ့ၫထီးနီၪလၧဆၧဂီးခၫလီၫ. ဆၧအနိၪ့ဖၧၩ့နီၪဘၪဆဲၫ့ လၧကြံတံၫလၧမုနုၬမုခံၫ့လခီၫ, ဒဲမုနုၬမုဖၩလခီၫဆ့ လီၫ.",
			"13": "<sup>13</sup> ထီးလံၩဂဲၫလၧမုခံၫ့လခီၫရှူၪရှူၪတၭ, အဝ့ၫၥံၪဆီၫ့ မီၪ့လၧအမိလ့ၩဘဲၫအကိၪ့ဆၧအၥိၭနီၪၥ့ၪတၭ, ထုၭ ထၪ့ထဲၩ့လိးဆူၪခဲၩ့တၭ, လ့ၩဘူၭလၧကြံတံၫအနဲၩ့ ထံၭနီၪလီၫ.",
			"14": "<sup>14</sup> မွဲလါနၫ့ဘိၩ လယံၬလမီဘၪနီၪ လံၩမုၥဝံၭကိၭဝ့ၫ",
			"15": "<sup>15</sup> လၧယုၫရီၭလဒၧၫ့ဂဲၫထၪ့ဘၪဝ့ၫလီၫ.- ထီးအဘၪက ဘၩ့တၭ, စၩလံၩလၥ့ၪဘၪနီၪ, ပလ့ၩဖိၬလံၩအခဲၫ့",
			"16": "<sup>16</sup> လီၫ.- တၭပလ့ၩလၧကျိၩ့လဖျိၪ့ကိၭဝ့ၫလၧကျီဒၫလံၩ ကဒုၩလခီၫအဘိၩ့ဘၭနီၪ ပမၩန့ချံၫဖိၪကၪမၬတၭ,",
			"17": "<sup>17</sup> ထီးပထုၭထၪ့န့ဝ့ၫနီၪ,- ဘဲၫၥိၭကဘၩ့မိအီၪဂုးခၧၫ့ဝ့ၫ တၭ,အဝ့ၫၥံၪမၩန့ဖျံၩလဖၪတၭ, ဘဲၩ့ထၬကဘၩ့နီၪ လီၫ.မွဲအၥၭမဲၪလၧအမိဂၭဂီၩ့ လၧမ့ၭလၩ့လၧၩ့အ ဖၧၩ့နီၪထုၭလၩ့ခွံၬယါလၪတၭ လံၩအူၪဝ့ၫဘဲၫနီၪ လီၫ.",
			"18": "<sup>18</sup> ကဘၩ့လဲၩလီနၭနၭလ့ၬတၭ, ကဲဂီၩလနံၩပခွံၬ",
			"19": "<sup>19</sup> လၩ့ခွံၬဆၧဖိၪဆၧလံၩလီၫ.- ဆၧဎွ့ၩထၪ့ၥၧၫ့နံၩလနံၩ",
			"20": "<sup>20</sup> ပခွံၬၡိၭခွံၬကဘၩ့အဆၧလၧပစူၪဒၪပဝ့ၫလီၫ.- အၪ နံၩအၪၥၫ့အထးဖၧၩ့နီၪမုၥံၪလၩၥံၪမွဲဂ့ၩ, ၡၪၥံၪမွဲဂ့ၩ, လအီၪဖျီၪထၪ့ဘၪတၭ, လံၩမုလဆံၭလၡၩဘၪနီၪ ဘၪပၧၩတၭ, မွဲပမိထီၩ့လၧဆၧဖီၩ့ဖျ့ၭနီၪ ပယိလါအ",
			"21": "<sup>21</sup> လးလအီၪလၧၩ့ဘၪနးဆံၭလီၫ.- ၦလအၪ့လအီၩ ဘၪဆၧယံၬယံၬတၭ, စပီလူၫဆၧၫ့ထုၪ့လၧၦလဖၪနီၪ အကျၩ,စံၭဝ့ၫ, ၦၡၩၥံၪဧ့, ကြၨၭလၧနၥံၪခိၭနၪယလူ တၭ,လစဲၪ့ထၪ့ဘၪလၧကြံတံၫနီၪ, နၥံၪဘၪဆၧ",
			"22": "<sup>22</sup> ဂၭဂီၩ့ဒဲဆၧလၩ့မါယီၩအ့ၬ.- ဘိၩ့နဲၪ့ယီၩ ယပဂၨၪ ထၪ့နၥံၪအခဲၫ့ ဘဲၫၥိၭနၥံၪမိအီၪက့ၪနၥံၪအၥၭမုၬမုၬ ဆံၭ.အဂဲးဘဲၫယီၩ နၥံၪအၥၭမၧၫ့လမိလၩ့မါဘၪနး",
			"23": "<sup>23</sup> ဂၩတၭ,ဆၧမိဂၭဂီၩ့န့ၫ ကဘၩ့လီၫ.- အဂဲးဘဲၫယီၩ ယွၩလၧယမွဲအဆၧ,ဒဲယမၩအဆၧနီၪအၥီၫ့",
			"24": "<sup>24</sup> လဂၩဆၧၫ့ထုၪ့လၧယနဲၩ့ထံၭ လၧမုနၩယီၩ,- စံၭဝ့ၫ, စပီလူၫဧ့, ထီးၥၭမဲၪဆၧလဂ့ၩး နမိဘၪဆၧၫ့ထုၪ့လၧ စံစၧၫအမ့ၬယၫလီၫ. ယိခွါ, ယွၩဖ့ၪလၫ့နၧၩလၧၦလ့ၩ",
			"25": "<sup>25</sup> ဆၧလၧမၫဆမံၭလၧနၥိၭထီးအလူၬလီၫ.- မွဲဘဲၫနီၪ တၭ,ၦၡၩၥံၪဧ့, အီၪက့ၪနၥံၪအၥၭမုၬမုၬဘီၪ. အဂဲး ဘဲၫယီၩယနဲၩယွၩလၧ ဆၧမိမၩအၥၭဘဲၫအလီၩဝဲၩ",
			"26": "<sup>26</sup> ယၧၩအၥိၭနီၪလီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ပမိဘၪဆၧ ဂၭဂီၩ့လၧကျိၩ့နးဖျိၪ့အဖၫ့ခိၪဆ့လီၫ.",
			"27": "<sup>27</sup> ထီးအဘၪလဆံၫလံၥၫ့အမုလနၩနီၪ, ဆၧမၩဝံၩ့ဝၩ့ ပၧၩလၧမၫဆမံၭ အ့ဒအၫတံၭအဖၧၩ့ အဘိၩ့ဘၭတၭ, လၩ့ဘူၭလၧဖိၭဖၫ့မုနီၪ, ၦကဘၩ့ဖိၪၥံၪဆီၫ့မီၪ့ဝ့ၫလၧ",
			"28": "<sup>28</sup> အလ့ၩထီၩ့ဘူၭထၪ့လၧခးလဘံၪ့ဘံၪ့လီၫ.- ဆဲၩလၩ့ ယိခွါထံၫတၭ, ထံၫအီၪဝ့ၫအချဲၫ့နံၫဆံၫနီၪ, လၧယၫ လဆံၭဖိၪတၭ,ဆဲၩလၩ့ယိခွါဒီၭထံၫတၭ, ထံၫအီၪဝ့ၫ",
			"29": "<sup>29</sup> လဆံၫယဲချဲၫ့လီၫ.- ထီးနီၪလဖၧၫ့ၥၭမဲၪလၧအမိလၩ့ ဘၪဘၪခိၬ လၧလိးကျၩတၭ, ခွံၬလၩ့လိးဆူၪခဲၩ့လၧ ကဘၩ့အခဲၫ့လံခီၫတၭ ဆိၫ့လၧမုဆဲၫ့ထၪ့လီၫ.",
			"30": "<sup>30</sup> ၦကဘၩ့ဖိၪအၪ့ဎၬဝ့ၫ လၧအမိစဲၪ့ဒၪခွံၬကဘၩ့တၭ, ဆဲၩလၩ့ချံၫဖိၪ လၧမၫဆမံၭဖၧၩ့လၩ့ဂၬ လၧအမိခွံၬ",
			"31": "<sup>31</sup> လၩ့လိးဆူၪခဲၩ့လၧကဘၩ့အခိၪနီၪ,- စပီလူၫလီၩဘၪ ၦၥုၭဖိၪလယၩအခိၪ, ဒဲၦၥုၭဖိၪလဖၪ, ၦလဖၪယီၩ အ့ၪလအီၪဘၪလၧကဘၩ့ဖၧၩ့ယီၩ, နၥံၪထီၩ့လၧဆၧ",
			"32": "<sup>32</sup> ဖီၩ့ဖျ့ၭဝ့ၫၥ့ၪအ့ၬ.- ထီးနီၪလဖၧၫ့ၦၥုၭဖိၪလဖၪဖ့ၬထ့ၬ ချံၫဖိၪအဖျံၩတၭ, ဒုၭလၩ့ထ့ၬခွံၬဝ့ၫဒၪလီၫ.",
			"33": "<sup>33</sup> လၩ့ဘူၭဆၧဖၩ့ထၪ့နီၪ, စပီလူၫအၪ့ယၫၦထီးအလူၬ ဘဲၫၥိၭအမိအၪ့ဆၧတၭ, စံၭဝ့ၫ,နၥံၪယိလါဆၧဒဲဒုၪ ဒံၭဆၧအၪ့ဆၧအီၩတၭ, လဒိၭန့ဘၪဆၧနးမံၩ့နီၪ မု",
			"34": "<sup>34</sup> လနံၩယီၩမွဲလဆံၫလံနံၩလနံၩလီၫ.- မွဲဘဲၫနီၪတၭ, ယအၪ့ယၫနၥံၪဘဲၫၥိၭနၥံၪမိအၪ့ဆၧဘီၪ, အဂဲးဘဲၫ ယီၩဆၧယီၩ မွဲလၧနၥံၪအဆၧဖီၩ့ဖျ့ၭအဂးလီၫ. အ ဂဲးဘဲၫယီၩနၥံၪအခိၪၥူၫလဘီၩ့နီၪ မိလၩ့ထ့ၬခွံၬဝ့ၫလၧ နၥံၪအခိၪနးဘီၩ့အ့ၬ.",
			"35": "<sup>35</sup> အဝ့ၫဒၪချဲၩ့ဆၧဘဲၫနီၪတၭ, မၩန့ကိၪစံၭထၪ့အၪ့ အူၭယွၩအခိးအတၩလၧၦထီးအလူၬအမ့ၬယၫနီၪ,",
			"36": "<sup>36</sup> ကံၪ့ဘျ့ၭဝ့ၫတၭအၪ့ဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့ ၦထီးအ လူၬအၥၭဎွံၫထၪ့တၭအၪ့ဆၧဆ့လီၫ.",
			"37": "<sup>37</sup> ၦအီၪလၧကဘၩ့ဖၧၩ့ထီးအလူၬနီၪ, မွဲနံၫယၩနွ့ၫ",
			"38": "<sup>38</sup> ဆံၫဎူၫဂၩလီၫ.- ထီးအအၪ့ဘျဲၩအၪ့ဂီၩ့နီၪမၩဎွံၫထၪ့ ကဘၩ့, ခွံၬလၩ့ခွံၬဘုၪၥံၪဂူၫၥံၪလၧ မၫဆမံၭဖၧၩ့လီၫ.",
			"39": "<sup>39</sup> ထီးမုဆဲၫ့ထၪ့တၭ, ခီၫ့နီၪလၥ့ၪယၫဘၪဝ့ၫတၭ, အ့ၪမွဲဒၪဘၪထံၫချိၬဘၪအီၪလၧခီၫ့ၥူၪခိၪတၭ, မၩအ့ၪၥ့ၪ",
			"40": "<sup>40</sup> နီၪမိဒုၭနုၬ ကဘၩ့ထီးနီၪလီၫ.- မၩလၩ့ထ့ၬခွံၬလိးဆူၪ ခဲၩ့လၧမၫဆမံၭဖၧၩ့, ဒဲကွဲၪလၩ့ခွံၬၥန့ၫလၪ အဖျံၩလ ဖၪတၭ, ထုၭပၠၪထၪ့ယါလၪ လၧလံၩတၭ, လ့ၩစိၩဝ့ၫ",
			"41": "<sup>41</sup> လၧခီၫ့လီၫ.- တၭလ့ၩဝ့ၫလၧထံၫနံၫကၠီၪ့ဆ့ၭဆၧၫ့လိၬ အၥၭအလးနီၪ, ကဘၩ့ဘုၭလၩ့ဂၪ့ခိၪနီၪ, အခိၪလခီၫ လဝၭဘၪတၭ, အီၪဂုးခၧၫ့ဝ့ၫလီၫ. အ့ၪမွဲအခဲၫ့နီၪလၩ့ ဎီးဝ့ၫလၧ လပီၩလဖၪဘၪဝ့ၫဆီၪ့အကၠီၩ့လီၫ.",
			"42": "<sup>42</sup> ၦၥုၭဖိၪလဖၪအၪ့ယိၪဝ့ၫလၧ ၦထီၫ့ဖိၪၥံၪလနၩ့နၩ့မိ ယါထံၫတၭ,မိဖီၩ့မိဖျ့ၭဘၪခိၬတၭ, မိမၩၥံၫဘၪအ",
			"43": "<sup>43</sup> ၥၭလီၫ.- အ့ၪမွဲၦၥုၭဖိၪလယၩအခိၪနီၪ, ဆၧမိမၩဖီၩ့ မၩဖျ့ၭဘၪအၥၭလၧစပီလူၫနီၪ, ပဒၩ့ဝ့ၫ, မၫလူၬၦ လၧအယါထံၫၥ့ၪလဖၪဖုၫလၩ့ဆိၫတၭ, ထီၩ့စိၩလၧ",
			"44": "<sup>44</sup> ခီၫ့,- တၭၦအီၪလၩ့ထးလနၩ့နၩ့ လၧၥံၪ့ပၪအဖၫ့ခိၪ နီၪ,လနၩ့နၩ့လၧဆၧဘၪဆဲၫ့လၧ ကဘၩ့လဖၪအဖၫ့ခိၪလီၫ. မၩဝ့ၫဘဲၫနီၪတၭ, ၦဖီၩ့ဖျ့ၭဝ့ၫထီၩ့လၧခီၫ့ကိၭဂၩဒ့ၭလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> တၭထီးအဝ့ၫၥံၪဖီၩ့ဖျ့ၭဝ့ၫနီၪ, ၥ့ၪယၫဝ့ၫလၧကျိၩ့",
			"2": "<sup>2</sup> လဖျိၪ့နီၪၦကိၭမလံတၫလီၫ.- မွဲဆၧဂဲၫဆၧၩ့ဒဲဆၧဂီး တၭ,ၦၡၩမံၩ့လဖၪမၩဂ့ၩပၧၩလၡၩခိၬဘၪနီၪ, အဂဲး ဘဲၫယီၩဆူၭခဲၩထၪ့မ့ၪတၭ, ထိးဆၧၫ့ပၧၩထီးအလူၬ လီၫ.",
			"3": "<sup>3</sup> စပီလူၫအၪ့ထုၫ့န့ၥံၪ့မုထဲၩ့နီၪ, ဖျႃၭလၩ့ဝ့ၫလၧမ့ၪ ဖၧၩ့တၭ, ဂူအၧၩ့လဘီၩ့ဂဲၫထၪ့လၧဆၧခိကျၩနီၪ,အဲၪ့",
			"4": "<sup>4</sup> ထၬအစူၪလီၫ.- ထီးၦၡၩမံၩ့လဖၪဒၪဆၧဖိၪဆၧဎါ နီၪလၩ့ဆဲၩလၧအစူၪလီၩ့တၭ, စံၭလိၬအၥၭ,ၦလဂၩ ယီၩမွဲၦမၩၥံၫၦၡၩလီၫ. မွဲအဖီၩ့ဖျ့ၭ မၫဆမံၭလါ",
			"5": "<sup>5</sup> နၫ့,ဆၧတီၩနီၪလဒုၭမၧၫ့လၧၩ့ဘၪဝ့ၫလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, အဝ့ၫဒၪတဆ့ၪလၩ့ခွံၬဆၧဖိၪဆၧဎါနီၪ",
			"6": "<sup>6</sup> လၧမ့ၪဖၧၩ့တၭ, ဘၪဆၧနးမံၩ့အ့ၬ.- တၭအဝ့ၫၥံၪဆီၫ့ မီၪ့လၧအမိယိၭထၪ့မွဲဂ့ၩ, မိလၩ့ထံၩဖါၥံၫမွဲဂ့ၩချဲၫ့မၬ လီၫ.မွဲလါနၫ့ဘိၩ ယိဆီၫ့မီၪ့ဝ့ၫယံၬယံၬတၭ, ဒၪဘၪ လၧအဘၪဆၧနးမံၩ့နီၪ, အၥၭမၩထဲၩ့အၥၭ လမံၩ့ ဒၪတၭ,စံၭဝ့ၫ, ၦယီၩမွဲကဆါလဂၩလီၫ.",
			"7": "<sup>7</sup> အီၪဘူၭလၧအလးထီးနီၪမွဲခးအၦဒိၪ စပၧဘျံၫ အၧၭအဂၪ့ခိၪတၭ, အဝ့ၫဒၪထိးဆၧၫ့ပၧၩတၭ, ဒုၭအၪ့",
			"8": "<sup>8</sup> ဒုၭအီၩပၧၩၥၧၫ့နံၩယၫဂ့ၩဘၪစဲၪလီၫ.- ဆၧမၩအၥၭ လၧစပၧဘျံၫအၧၭအဖါအီၪမံၫနၩ့ ဘၪဆၧဆူၪဂိၬ, ဒဲဆၧ ဆၫလီၫ့လၩ့လၧအၥွံၪတၭ, စပီလူၫလ့ၩနုၬလၧအအီၪ နီၪ,ဘၩဆိၪဖၪဆၧတၭ, အီၪက့ၪအစူၪလၧအလီၩ့ နီၪမၩဘျၪထဲၩ့ဝ့ၫဒၪလီၫ.",
			"9": "<sup>9</sup> ဆၧမၩအၥၭဘဲၫနီၪလမံၩ့တၭ, ၦဂူၫဂၩဘၪစူၭဘၪ ဆၫအီၪလၧကျိၩ့ဖၧၩ့လဖၪဂဲၫဝ့ၫတၭ, ဘၪဆၧမၩဘျၪ",
			"10": "<sup>10</sup> ထဲၩ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪမၩလၩဖၩ့ပၧၩလၧဆၧအၪမံၩ့ တၭ,ထီးပစဲၪ့ထၪ့ခွံၬနီၪ, ဖ့ၪလၫ့ပၧၩလၧဆၧလၧပမၩ ဝ့ၫအလးအီၪလဖၪလီၫ.",
			"11": "<sup>11</sup> လၩၥၧၫ့ဘံၪ့ဖီၩ့ခွံၬနီၪ, ပစဲၪ့ထၪ့လၧအလ့ၭစၫ့ဒအၫ အကဘၩ့လၧအအီၪလၧကျိၩ့နီၪ လၧဆၧဂီးခၫတၭ, အဆၧမၩနဲၪ့ မွဲကၫစတၧၫဒဲဖီၫလၧၭအဂၩ့ လီၫ.",
			"12": "<sup>12</sup> ပစိၭထၪ့လၧစံရကူၫနီၪတၭ, ပအီၪထီးနီၪၥၧၫ့နံၩ လီၫ.",
			"13": "<sup>13</sup> ပစဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, ပလ့ၩဎဲၪ့ဖိးလၧရံဇ အၫ့နီၪ,လၥၫ့ဖီၩ့ခွံၬတၭ, လံၩဂဲၫလၧမုခံၫ့လခီၫတၭ, မုနံၫနံၩလနံၩနီၪ ပလ့ၩဖိးလၧဖုၫတံအလံၫလီၫ.",
			"14": "<sup>14</sup> ထီးနီၪပဒၪန့ထၧၫ့ဖုဝဲၥံၪ လၧအအၪ့ယၫပၧၩဘဲၫၥိၭ ပမိအီၪလၧအၥိၭနွ့ၫနံၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ပ လ့ၩထၪ့စိၩလၧရိမၫလီၫ",
			"15": "<sup>15</sup> ထီးနီၪထၧၫ့ဖုဝဲၥံၪနါဂၧၫ့ပဂဲးတၭ, ဂဲၫထၪ့အၪ့ဂၬ ပၧၩလၧအၭပဖိရၧၫ့ ဒဲၦမွံၩအလးၥၧၫ့စီၪ့လီၫ. စပီ လူၫဒၪဘၪအဝ့ၫၥံၪတၭ, စံၭထၪ့အၪ့အူၭယွၩအခိးအ တၩတၭ, အၥၭအီၪမုၬမၬလီၫ.",
			"16": "<sup>16</sup> ထီးပလ့ၩထီၩ့လၧရိမၫနီၪ, ၦၥုၭဖိၪလယၩအခိၪဖ့ၪ လၫ့ၦဘၪစၧၩ့ထၬလဖၪ လၧၦၥုၭဖိၪခိၭဆၧအလးအ ခိၪလဂၩနီၪလီၫ. အ့ၪမွဲဆၧဒုၭအီၪစပီလူၫလၧၦၥုၭဖိၪ လဂၩလၧအပၧၩ့ဝ့ၫနီၪအၥိၭ, လၧအလးဒၪဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ဆၧမၩအၥၭလၧၥၧၫ့နံၩဖီၩ့ခွံၬတၭ, စပီလူၫကိၭကီၪ့ ၦယုဒၫဖိၪအၥုၪ့က့ၭၥၭၡါၥံၪလီၫ. ထီးအအီၪကိၩ့အီၪ ကီၪ့တၭ, လီၩဘၪဝ့ၫ, ၦၡၩၥံၪ, ဖုၥံၪဝဲၥံၪဧ့, ၦခမျၧးမွဲ ဂ့ၩ, ပဖါၥံၪအထူၫအရူၫမွဲဂ့ၩ, ယမၩမၪဘၪအ့ၬ. မွဲလါနၫ့ဘိၩ, ဆၧဖ့ၪလၫ့ယဘၪဆၧစၧၩ့ထၬလၧယရု စလံၫ့အဖၧၩ့ လၧၦရိမၫဖိၪၥံၪအစူၪဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> အဝ့ၫၥံၪအၪ့စိၭအၪ့စၪ့ယၧၩဂီၩ့တၭ, ဆၧမၪလၧ ယလီၩ့ထီးယကြၨၭၥံၫနီၪလဒၪဘၪဝ့ၫတၭ, အၥၭအီၪ လၧအမိဖျါခွံၬယၧၩလီၫ.",
			"19": "<sup>19</sup> အ့ၪမွဲၦယုဒၫဖိၪၥံၪပဒၩ့ဆၧတၭ, ယလကိၭထၪ့ဘၪ စံစၧၫနီၪတၭ,ယအီၪလၥ့ၪဘၪတၭး မွဲလၧယမိအီၪ",
			"20": "<sup>20</sup> က့ၪဆၧမၪလၧၦယဆၨၩဒၪယဝ့ၫအလီၩ့မွဲအ့ၬ.- မၩ အၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭယမိဒၪလိၬဘၪယၥၭ လၧ နၥံၪယီၩယကိၭကီၪ့ယူၭနၥံၪယူၭ. အဂဲးဘဲၫယီၩလၧ ၦအံၫစရ့လၭဖိၪ အဆၧယိလါအကၠီၩ့နီၪ ယဘၪဆၧ စၧၩ့ထၬလၧၥွ့ၫထၭယီၩလီၫ.",
			"21": "<sup>21</sup> အဝ့ၫၥံၪစံၭဝ့ၫ, လံၬကွ့ၭဆၧဂဲၫလၧခးယုဒၫအီၪလၧ နဂဲးနကၠီၪ့ပလန့ဘၪတၭ, ဒဲထၧၫ့ဖုဝဲလဖၪဂဲၫဝ့ၫအီၪ",
			"22": "<sup>22</sup> က့ၪဘၪဆၧမၪလၧနလီၩ့နးဂၩဆ့အ့ၬ.- မွဲလါနၫ့ဘိၩ, နဆီၫ့မီၪ့ဆၧဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ကြၨၭလၧပနါ ဂၧၫ့ဘၪလၧနၧၩလီၫ. အဂဲးဘဲၫယီၩ ၦစူၪလလၩ့ဎုၬ ဘၪယီၩ,ပၥ့ၪယၫလၧၦဒုၪဒွ့ၪဝ့ၫလၧအလးလစီၪ့ လါလါကိၭစီၪ့ဒ့ၭလီၫ.",
			"23": "<sup>23</sup> အဝ့ၫၥံၪဖၭဝ့ၫအနံၩအၥၫ့ဂီၩ့တၭ, ၦခမျၧးဂဲၫလၧ အအီၪလီၫ. အဝ့ၫဒၪဒုၭနဲၪဝ့ၫ ဒဲထိးအၥၭလၧယွၩအ ဘၩ့အမုးအဂဲးအကၠီၪ့နီၪ ပထဲဒိၭနဲၩ့အၥၭလၧ စမိစ့ၭအဆၧၥီၪ့ဆၧၥၫ့, ဒဲမီၪနီၪအလူအထၫတၭ, ပဂၨၪထၪ့အခဲၫ့လၧယ့ၫၡုၬ အဂဲးလၧမုဂီၩထီၩ့လၧမု",
			"24": "<sup>24</sup> ဂၪလၩ့လီၫ.- ဆၧလၧအစံၭဝ့ၫလဖၪနီၪ, လနၩ့နၩ့နဲၩ ထဲၩ့ဝ့ၫတၭ, လနၩ့နၩ့လနဲၩဘၪဝ့ၫလီၫ.",
			"25": "<sup>25</sup> လဘၪလိၬဘၪအၥၭနီၪ,အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬတၭ, စ ပီလူၫချဲၩ့ထၪ့ယူၭ, ဆၧချဲၩ့လထံၪ, ၥၭမုဆံၫ့ဎံၪလီၩဘၪ",
			"26": "<sup>26</sup> ပဖါၥံၪလၧမီၪစအဲၫစ့ယၫဂ့ၩဘၪစဲၪ,-စံၭဝ့ၫ, လ့ၩလၧၦဆၨၩယီၩအအီၪတၭ, စံၭ, နါဂၧၫ့ဆၧနီၪနၥံၪမိနါဂၧၫ့တၭ, နၪဝ့ၫလၥ့ၪဘၪ, ယိဆၧနီၪနၥံၪမိယိဆၧတၭ,",
			"27": "<sup>27</sup> နၥံၪလဒၪဘၪဆၧ, အဂဲးဘဲၫယီၩၦလဆၨၩယီၩ, ဘဲၫၥိၭအထီးဒၪဘၪဆၧလၧအမ့ၬ, ဘဲၫၥိၭအထီးနါဂၧၫ့ဆၧလၧအနါ, ဘဲၫၥိၭအထီးၥ့ၪယၫဆၧလၧအၥၭ, ဘဲၫၥိၭအထီးကၠၪထဲၩ့အၥၭ, ဒဲယထီးမၩဘျၪထဲၩ့လဂ့ၩနီၪ, အၥုၪ့အၥၭဘီၪ့ဝ့ၫၥိၪဝ့ၫ, ဒဲအနိၩ့ဎၧၫ့အနါဎၧၫ့တၭ,ဘံၪ့ဒၪအမ့ၬလီၫ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, ယွၩအဆၧထိးထဲၩ့တၩ့ထဲၩ့ နီၪ,ဆၧအၪ့မၧၫ့လၩ့ဝ့ၫ လၧၦဆၨၩလဖၪအအီၪတၭ, အဝ့ၫၥံၪခိၭနၪဝ့ၫနီၪ, ၥ့ၪယၫနၥံၪဝ့ၫဆံၭ.",
			"29": "<sup>29</sup> ဎထီးအစံၭဝ့ၫဘဲၫနီၪတၭ, ၦယုဒၫဖိၪၥံၪစဲၪ့ထၪ့ဝ့ၫ နီၪ,တ့ၭလိၬအၥၭနၭမၬလီၫ.ၭ",
			"30": "<sup>30</sup> စပီလူၫအီၪဝ့ၫလၧအဂံၪ့ လၧအအၪ့လံၩ့ဒၪဝ့ၫအဖၧၩ့ နံၫနံၪ့ယၫတၭ, ထိးဆၧၫ့ကယဲၦလၧအဂဲၫလၧအအီၪ ထီးအလူၬလီၫ.",
			"31": "<sup>31</sup> လီၩလၩ့လၬလၩ့ယွၩအဘၩ့အမုး ဒဲၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ဆၧဘၪဆဲၫ့လၧကဆါယ့ၫၡုၬဎရံၬ အဂဲးအကၠီၪ့လဖၪ လၧအၥၭဒူၩထၧၫ့ဖျိၪ့ယၫတၭ, ၦပဒၩ့ဝ့ၫနးဂၩအ့ၬ."
		}
	}
};
module.exports = book;